var book = {
	"name": "Dagiti Salmo",
	"numChapters": 150,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> Nagasat ti tao a saan a magna iti patigmaan dagiti nadangkes, ken saan nga agtalinaed iti dalan dagiti managbasol, ken saan nga agtugaw iti tugaw dagiti managsabsabrac:",
			"2": "<sup>2</sup> Ngem ti pacaragsacanna adda iti linteg ni Jehova; ket iti lintegna imutectecanna iti aldaw ken rabii.",
			"3": "<sup>3</sup> Ket isu caslanto iti maysa a cayo a naimula iti sibay dagiti ayayus ti danum, nga ipaltuadna ti bungana iti carbenganna, a ti bulongna met saan a malaylay; ket isu-amin nga aramidna rumang-ayto.",
			"4": "<sup>4</sup> Dagiti nadangkes saanda a casta, ngem isuda cas ti taep nga ipalais ti angin.",
			"5": "<sup>5</sup> Ket iti casta dagiti nadangkes saandanto nga agtacder iti pannacaocom, uray dagiti managbasol iti gimong dagiti nalinteg.",
			"6": "<sup>6</sup> Ta ni Jehova ammona ti dalan dagiti nalinteg; ngem ti dalan dagiti nadangkes mapucawto."
		},
		"2": {
			"1": "<sup>1</sup> Apay a dagiti nasnacion agriribucda, ket dagiti tattao agpanpanunotda iti maysa a banag nga ubbaw?",
			"2": "<sup>2</sup> Dagiti ar-ari ditoy daga pabilgenda dagiti bagida met laeng, ken dagiti turayen agpipinnatigmaanda, a maibusor ken Jehova ken maibusor met iti pinulotanna, a cuncunada,",
			"3": "<sup>3</sup> Pugsatentayo coma dagiti pangbaludna, ket ibellengtayo iti adayo cadatayo dagiti talida.",
			"4": "<sup>4</sup> Daydiay a situtugaw cadagiti langlangit agcatawanto: ti Apo uyawennanto ida.",
			"5": "<sup>5</sup> Ket iti casta casaonanto ida iti ungetna, ket ranggasanna ida iti napalaus a lucsawna:",
			"6": "<sup>6</sup> Nupay no casta insaadco ti aric, iti rabaw ti nasantoan a turodco a Sion.",
			"7": "<sup>7</sup> Siac ibagacto ti maipapan iti bilin: ni Jehova kinunana caniac, Sica ti anacco; daytoy nga aldaw siac pinutotca.",
			"8": "<sup>8</sup> Agkiddawca caniac, ket siac itedconto   kenca dagiti nasnacion a maipaay a tawidmo, ken dagiti caungtoan a paset ti daga a cucuam.",
			"9": "<sup>9</sup> Rumekemto ida iti pang-or a landoc; burakemto ida a casla banga ti agdamdamili.",
			"10": "<sup>10</sup> Ita ngarud agmasiribcayo, O dacayo ar-ari: masursuroancayo, dacayo oc-ocom ditoy daga.",
			"11": "<sup>11</sup> Agservicayo a sibubuteng ken Jehova, ket agragsaccayo a sikikintayeg.",
			"12": "<sup>12</sup> Agepenyo ti anac, tapno di-agpungtot, ket mapucawcayo iti dalan, ta ti pungtotna nganngani a sumged. Nagasat amin dagidiay a cumamang kencuana."
		},
		"3": {
			"1": "<sup>1</sup> Jehova, amangan ti yaadu dagiti cabusorco! Adu dagiti umalsa a bumusor caniac.",
			"2": "<sup>2</sup> Adu dagiti agcuna iti cararwac, awan ti tulong ti Dios kencuana. (Selah)",
			"3": "<sup>3</sup> Ngem sica, O Jehova, ti maysa a calasag a manglawlaw caniac; ti dayagco, ken mamatan-oc iti uloc.",
			"4": "<sup>4</sup> Awagac ni Jehova iti timecco, ket sungbatannac manipud iti turodna a nasantoan. (Selah)",
			"5": "<sup>5</sup> Nagiddaac ket nacaturogac; nagriingac; ta ni Jehova saranayennac.",
			"6": "<sup>6</sup> Diacto agbuteng cadagiti linaclacsa a tattao, a nailicmut a bumusor caniac.",
			"7": "<sup>7</sup> Tumacderca, O Jehova, isalacannac, O Diosco: ta sica sinugatmo amin dagiti cabusorco iti sangida; rinumecmo dagiti ngipen dagiti nadangkes.",
			"8": "<sup>8</sup> Ti pannacaisalacan maipabiang ken Jehova: ti bendicionmo maisaad coma iti ilim. (Selah)"
		},
		"4": {
			"1": "<sup>1</sup> Sungbatannac no umawagac, O Dios ti kinalintegco; sica binang-arannac idi nagrigrigatac: caasiannac, ken denggem toy cararagco.",
			"2": "<sup>2</sup> O dacayo, nga annac dagiti tattao, casano ti cabayagto ti dayagco nga agbalin a pacaibabainan? casano ti cabayagto ti panagayatyo iti kinaubbaw, ken panangsapulyo iti kinaulbod? (Selah)",
			"3": "<sup>3</sup> Ngem ammoenyo nga ni Jehova inlasinna ti nadiosan nga agpaay kencuana met laeng: ni Jehova dumngegto no umawagac kencuana.",
			"4": "<sup>4</sup> Siaamesca, ket saanca nga agbasol: maki-umanca a sipapasnec ita pusom met laeng iti pagiddaam, ket agulimecca. (Selah)",
			"5": "<sup>5</sup> Idatonmo dagiti datdaton ti kinalinteg, ket agtalecca ken Jehova.",
			"6": "<sup>6</sup> Adda adu nga agcuna: Asino ti mangiparangto cadatayo iti uray ania nga imbag? Jehova, ibangonmo ta raniag ta rupam cadacami.",
			"7": "<sup>7</sup> Sica insaadmo ti adadu a kinaragsac itoy pusoc, ngem ti adda cadagidiay no dagiti anienda ken ti baro nga aracda immaduda.",
			"8": "<sup>8</sup> Sitatalnaac nga agpadpada iti panagiddacto ken iti pannaturogco: ta sica, Jehova, sicsica laeng ti mangisaad caniac iti kinatalged."
		},
		"5": {
			"1": "<sup>1</sup> Imdengam coma dagiti saoc, O Jehova, imutectecam coma ti panpanunotec.",
			"2": "<sup>2</sup> Denggem cadi ti timec ti asugco, Aric, ken Diosco; ta kenca agcararagac.",
			"3": "<sup>3</sup> O Jehova, iti bigat denggemto ti timecco; iti bigat ornosecto ti cararagco kenca, ket agsiputacto.",
			"4": "<sup>4</sup> Ta sica saanca a maysa a Dios nga adda ayatna iti kinadakes: ti dakes saanto a makitaeng kenca.",
			"5": "<sup>5</sup> Dagiti napalangguad saandanto a macatacder iti sangoanam: sica guraem dagiti amin a managaramid iti kinakillo.",
			"6": "<sup>6</sup> Racrakemto dagidiay nga agsao iti tinitiri: ni Jehova guraenna dagiti mawawan iti dara ken naulbod a tattao.",
			"7": "<sup>7</sup> Ngem no caniac, iti caadu ti kinamanangngaasim umayacto iti balaymo: iti panagbuteng kenca agrucbabacto a situturong iti nasantoan a templom.",
			"8": "<sup>8</sup> Idalannac, O Jehova, iti kinalintegmo gapu cadagiti cabusorco; palanasem iti sangoanac ta dalanmo.",
			"9": "<sup>9</sup> Ta awan ti kinatalec iti ngiwatda; ti unegda napalalo a kinadakes: ti carabucobda isu ti maysa a tanem a silulucat, pumasablugda iti dilada.",
			"10": "<sup>10</sup> Ibilangmo ida a nacabasol, O Dios; mapasagda coma a gapu cadagiti pammagbagada met laeng: pagtalawem coma ida babaen iti caadu dagiti isusukirda; ta isuda bimmusorda kenca.",
			"11": "<sup>11</sup> Ngem agragsac coma amin dagidiay nga agcamang kenca, umawawagda coma nga agnanayon gapu iti rag-o, ta icanawam ida: dagidiay met agayat ita naganmo agragsacda coma kenca.",
			"12": "<sup>12</sup> Ta sica bendicionamto ti nalinteg; O Jehova, sica bacudemto iti parabur cas iti maysa a calasag."
		},
		"6": {
			"1": "<sup>1</sup> O Jehova, saannac a babalawen iti panagungetmo, saannac met a dusaen ita sibabara a panaglucsawmo.",
			"2": "<sup>2</sup> Caasiannac, O Jehova; ta siac nalaylayacon: O Jehova, pasalun-atennac; ta dagiti tultulangco agbibinegda.",
			"3": "<sup>3</sup> Toy cararwac casta met mariribuc unay: ket sica, O Jehova, casano ti cabayagmo?",
			"4": "<sup>4</sup> Agsublica, O Jehova, luc-atam toy cararwac: isalacannac gapu iti kinamanangngaasim.",
			"5": "<sup>5</sup> Ta ken patay awan panglagipan kenca: iti Tanem asino ti agyamanto kenca?",
			"6": "<sup>6</sup> Siac nabannogac gapu iti panagsasaibbecco; amin a rabii paglangoyac ti iddac; sibogac ti catrec cadagiti luluac.",
			"7": "<sup>7</sup> Ti matac macullaapan gapu iti ladingit; lumacay maipuon cadagiti amin a cabusorco.",
			"8": "<sup>8</sup> Umadayocayo caniac, dacayo amin a managaramid iti kinadakes; ta ni Jehova dinengngegna ti timec ti sangsangitco.",
			"9": "<sup>9</sup> Ni Jehova dinengngegna ti dawatco, ni Jehova awatennanto ti cararagco.",
			"10": "<sup>10</sup> Amin dagiti cabusorco mabainandanto ket mariribucdanto unay: agsanuddanto, ket mabainandanto a madagdagus."
		},
		"7": {
			"1": "<sup>1</sup> O Jehova, Diosco, kenca agcamangac: isalacannac cadagiti isu-amin a cumamatcamat caniac, ket ispalennac,",
			"2": "<sup>2</sup> Tapno saanda nga agawen toy cararwac, cas iti maysa a leon lasanglasangenna, no awan ti mangisalacan.",
			"3": "<sup>3</sup> O Jehova, Diosco, no inaramidco daytoy; no adda ti kinadakes cadagitoy imac;",
			"4": "<sup>4</sup> No sinupapacac ti dakes iti sicacappia caniac. (Pudno, insalacanco ti bumusor caniac nga awan ti gapuna);",
			"5": "<sup>5</sup> Ti cabusor camatenna coma toy cararwac, ket magam-udanna; wen, ket ipayatpayatna coma toy biagco iti daga, ket toy dayawco icabilna coma iti tapuc. (Selah)",
			"6": "<sup>6</sup> Tumacderca, O Jehova, ita ungetmo; bumangonca cadi a bumusor iti pungtot dagiti sumuppiat caniac, ket agriingca coma gapu caniac; sica imbilinmon ti panangocom.",
			"7": "<sup>7</sup> Ket ti gimong dagiti il-ili lawlawendaca coma; ket iti rabawda sica agsublica a natan-oc.",
			"8": "<sup>8</sup> Ni Jehova ocomenna dagiti il-ili: ocomennac, O Jehova, a mayannurot iti kinalintegco, ken iti kinasingpetco nga adda caniac.",
			"9": "<sup>9</sup> O ti kinadakes dagiti nadangkes aggibus cadi, ngem pabilgem coma dagiti nalinteg: ta ti nalinteg a Dios suutenna dagiti isisip ken puspuso.",
			"10": "<sup>10</sup> Ti calasagco adda iti Dios, a mangisalacan cadagiti nalinteg ti pusoda.",
			"11": "<sup>11</sup> Ti Dios isu ti maysa nga ocom a nalinteg, wen, maysa a Dios a mapaunget iti inaldaw.",
			"12": "<sup>12</sup> No ti maysa a tao saanto nga agbabawi, isu asaennanto ti campilanna; binaccugna ti ba-i ti panana, ket silalayat;",
			"13": "<sup>13</sup> Ket sinaganana kencuana dagiti aruaten ti pammapatay; aramidenna dagiti panana a daga tx a nasilap.",
			"14": "<sup>14</sup> Adtoy, sumical iti kinadakes; wen, nagsicug iti ranggas, ket nagpasngay iti tiri.",
			"15": "<sup>15</sup> Inaramidna ti maysa a palab-ug, ket kinalianna, ket natnag iti abut nga inaramidna.",
			"16": "<sup>16</sup> Ti ranggasna agsublinto iti ulona met laeng, ket ti kinadawelna bumabanto iti coppocoppona met laeng.",
			"17": "<sup>17</sup> Agyamanacto ken Jehova a mayannatup iti kinalintegna, ket icancantacto ti pagdayaw iti nagan ni Jehova a Cangatoan Unay."
		},
		"8": {
			"1": "<sup>1</sup> O Jehova, Apomi, amangan a nagtan-oc ta naganmo iti amin a daga, a nangisaad iti dayagmo iti rabaw dagiti langlangit!",
			"2": "<sup>2</sup> Manipud iti ngiwat dagiti maladaga ken agsusu binangonmo ti pigsa, maipanggep cadagiti sumuppiat kenca, tapno pagulimekem coma ti cabusor ken ti manangibales.",
			"3": "<sup>3</sup> No imutectecac dagiti langlangitmo, ti aramid dagita ramaymo, ti bulan ken dagiti bitbituen, isuda nga insaadmo;",
			"4": "<sup>4</sup> Ania ti tao, tapno sipapanunutca kencuana? Ket ti anac ti tao, tapno sumarungcarca kencuana?",
			"5": "<sup>5</sup> Ta isu ti inaramidmo a nababbaba bassit ngem iti Dios, ket balangatam iti dayag ken dayaw.",
			"6": "<sup>6</sup> Inaramidmo nga adda turayna cadagiti ar-aramid dagita im-imam; Insaadmo amin a banbanag iti babaen dagiti sacsacana:",
			"7": "<sup>7</sup> Amin a carcarnero ken vacvaca, wen, ken dagiti an-animal ti away,",
			"8": "<sup>8</sup> Dagiti tumatayab cadagiti tangatang, ken dagiti ican iti taaw, uray ania man nga aglasat iti liplippit dagiti taaw.",
			"9": "<sup>9</sup> O Jehova, Apomi, amangan a nagtan-oc ta naganmo iti amin a daga!"
		},
		"9": {
			"1": "<sup>1</sup> Agyamanacto ken Jehova iti amin toy pusoc; iparangconto amin dagiti nacascasdaaw nga ar-aramidmo.",
			"2": "<sup>2</sup> Maragsacanacto ken rumagrag-oacto kenca; icancantacto ti panangidayaw ita naganmo, O Sica a Cangatoan.",
			"3": "<sup>3</sup> No dagiti cabusorco tumallicudda, maitibcol ken madadaeldan iti sangoanam.",
			"4": "<sup>4</sup> Ta sica sinaranaymo ti calintegac ken ringgorco; situtugawca iti trono a mangocom a sililinteg.",
			"5": "<sup>5</sup> Binabalawmo dagiti nacion, dinadaelmo dagiti nadangkes; pinucawmo ti naganda iti agnanayon awan inggana.",
			"6": "<sup>6</sup> Dagiti cabusorco nacagtengda iti panaggibus, narebbecda iti agnanayon; ket dagiti il-ili a dinupracmo, uray ti pacalaglagipan cadacuada napucawen.",
			"7": "<sup>7</sup> Ngem ni Jehova agtutugaw nga ari iti agnanayon; insaganana ti tronona iti panangocom;",
			"8": "<sup>8</sup> Ket ocomennanto a sililinteg ti lubong, aramidennanto ti panangocom a nainget cadagiti il-ili.",
			"9": "<sup>9</sup> Ni Jehova isunto met ti nangato a baluarte cadagiti mailuplupit, maysa a nangato a pagcamangan cadagiti tiempo ti riribuc;",
			"10": "<sup>10</sup> Ket dagiti macaammo iti naganmo agcammatalecdanto kenca, ta sica, Jehova, saanmo a binaybay-an dagiti agbiroc kenca.",
			"11": "<sup>11</sup> Cantaenyo dagiti pagdaydayaw ken Jehova, nga agnaed iti Sion; iwarnacyo cadagiti inilin-ili dagiti ar-aramidna.",
			"12": "<sup>12</sup> Ta isu nga agmalutmut gapu iti dara malagipna ida; saanna a malipatan ti asug dagiti napanglaw.",
			"13": "<sup>13</sup> Mangngaasica coma caniac, O Jehova; Matmatam coma ti leddaangco a sagabaec cadagidiay gumurgura caniac, sica a mangaon caniac iti ruangan ni patay;",
			"14": "<sup>14</sup> Tapno maiparangarangco coma amin ti dayawmo. Cadagiti ruruangan ti anac a babai ti Sion. Agragragsacacto iti panangisalacanmo.",
			"15": "<sup>15</sup> Dagiti nasnacion maipisocda iti palab-ug nga inaramidda: iti bateng nga insanebda pacasimbaludan ti sacada met laeng.",
			"16": "<sup>16</sup> Ni Jehova nagpacaammon, inaramidnan ti panangocom; ti nadangkes masiloanen iti aramid dagiti im-imana met laeng. (Higgaion. Selah)",
			"17": "<sup>17</sup> Dagiti nadangkes mapasublidanto ken Tanem, uray pay dagiti amin a nacion a manglipat iti Dios.",
			"18": "<sup>18</sup> Ta ti macasapul saandanto a cancanayon a malipatan, ket ti inanama dagiti napanglaw saanto met a maawan nga agnanayon.",
			"19": "<sup>19</sup> Tumacderca, O Jehova; saan coma a macapagballigi ti tao; dagiti nasnacion maocomda coma dita saclangmo.",
			"20": "<sup>20</sup> Pagbutngem coma ida, O Jehova: dagiti nasnacion maammoanda coma nga isuda taoda laeng. (Selah)"
		},
		"10": {
			"1": "<sup>1</sup> Apayapay agintecca iti adayo unay, O Jehova? Apayapay aglemmengca cadagiti tiempo ti riribuc?",
			"2": "<sup>2</sup> Iti kinatangsit dagiti nadangkes macamatcamat a sibabara ti napanglaw; matiliwda coma cadagiti sicap nga inar-arapaapda.",
			"3": "<sup>3</sup> Ta ti nadangkes pagpasindayawna ti calicagum ti pusona, ket ti naagum paglicudanna, wen, ket, umsienna ni Jehova.",
			"4": "<sup>4</sup> Ti nadangkes, iti kinatangsit ti langana, cunana, Saannanto nga isingir. Dagup ti panagpanunutna, Awan ti Dios.",
			"5": "<sup>5</sup> Dagiti cababalinna nairutda a cancanayon; dagiti panangocommo nangatngato ngem ti makitana: maipapan cadagiti amin a cabusorna, pugpugsitanna ida.",
			"6": "<sup>6</sup> Cunana iti pusona, Saanacto a maanano; cadagiti amin a capcaputotan saanacto a maidadanes.",
			"7": "<sup>7</sup> Ti ngiwatna napno iti panangilunod ken panangiculbo ken panangilupit: iti babaen ti dilana adda ti kinaranggas ken kinakillo.",
			"8": "<sup>8</sup> Agtugaw cadagiti disso a pagsaneban cadagiti purpuroc; cadagiti nalimed a disso papatayenna ti awanan basol; dagiti matana agsisiim iti saan a macaannong.",
			"9": "<sup>9</sup> Agsibsibloc a nalimed a cas maysa a leon iti aponna; adda nga agdadaan a mangtiliw iti napanglaw: tiliwenna ti napanglaw, no maawidna iti batengna.",
			"10": "<sup>10</sup> Sumcad, agrucub, ket ti saan a macaannong mapadso gapu cadagiti napigsa a buyotna.",
			"11": "<sup>11</sup> Kunana iti pusona, Ti Dios nalipatanna; ilingedna ti rupana; dinanto makita uray caanoman.",
			"12": "<sup>12</sup> Bumangonca coma, O Jehova; O Dios, ilayatmo coma ta imam: dica cadi lipatan ti napanglaw.",
			"13": "<sup>13</sup> Apayapay ti nadangkes umsienna ti Dios, ket cunana iti pusona, Saancanto nga agisingir?",
			"14": "<sup>14</sup> Nakitamon; ta buybuyaem ti ranggas ken ti dakes a nakem, tapno balsem babaen iti imam: ti di-macaannong agtalec kenca; sica ti nangsaranay cadagiti ululila.",
			"15": "<sup>15</sup> Rumekem ti tackiag ti nadangkes; ket maipapan iti dakes a tao, sukisukem ti kinadangkesna inggana iti masaracam.",
			"16": "<sup>16</sup> Ni Jehova isu ti Ari nga agnanayon nga awan ti inggana: dagiti nasnacion mapucawdan iti dagana.",
			"17": "<sup>17</sup> Jehova, nangngegmo ti calicagum dagiti naemma: saganaemto dagiti pusoda, iyemdengmonto ta lapayagmo a dumngeg;",
			"18": "<sup>18</sup> Tapno mangipato cadagiti ululila ken mailuplupit, tapno ti tao a taga-lubong saan coman a mamagames."
		},
		"11": {
			"1": "<sup>1</sup> Ken Jehova agcamangac: casano cunayo itoy cararwac, tumayabca a cas billit iti bantaymo;",
			"2": "<sup>2</sup> Ta, ni, dagiti nadangkes biatenda ti bai, sigoda ti pana iti partengna, tapno iturongda iti casipngetan iti nalinteg ti pusona;",
			"3": "<sup>3</sup> No madadael dagiti pamuon, ania ti mabalin nga aramiden ti nalinteg?",
			"4": "<sup>4</sup> Ni Jehova adda iti nasantoan a templona; ni Jehova, ti tronona adda sadi langit; dagiti matana cumitada, dagiti calub ti matana suutenda, dagiti annac dagiti tao.",
			"5": "<sup>5</sup> Ni Jehova suutenna ti nalinteg; ngem ti nadangkes ken ti agayat iti kinauyong guraen ti cararwana.",
			"6": "<sup>6</sup> Cadagiti nadangkes isu tudonanto dagiti silsilo; apuy ken azufre ken nabara nga angin isudanto ti pannacabagi ti copada.",
			"7": "<sup>7</sup> Ta ni Jehova nalinteg, ayatenna ti kinalinteg: ti nalinteg buyaennanto ti rupana."
		},
		"12": {
			"1": "<sup>1</sup> Bumadangca cadi, Jehova; ta ti nadiosan a tao mapucawen; ta dagiti matalec mapucawda iti tengnga dagiti annac dagiti tao.",
			"2": "<sup>2</sup> Agiinnulbodda tunggal maysa iti caarrubana: iti naaliog a bibig, ken iti nagsiping a puso, agsaoda.",
			"3": "<sup>3</sup> Ni Jehova putdennanto amin a bibbibig a naaliog, ti dila nga agsao cadagiti nasursuroc;",
			"4": "<sup>4</sup> A kinunada, Iti dilami mangparucmacamto; dagiti bibigmi cucuami a bucod: siasino ti mangituray cadacami?",
			"5": "<sup>5</sup> Gapu iti pannacailuplupit ti napanglaw, gapu iti sasainnec ti macasapul, ita bumangonacto, cuna ni Jehova; isu isaadconto iti kinatalged a tontontonenna a sigagagar.",
			"6": "<sup>6</sup> Dagiti sao ni Jehova nadalusda a sao; cas pirac a nalunag iti pagtunawan iti daga, naminpito a nadalusan.",
			"7": "<sup>7</sup> Salimetmetamto ida, O Jehova, salacnibamto ida manipud iti daytoy a caputotan nga agnanayon.",
			"8": "<sup>8</sup> Dagiti nadangkes magnada iti tunggal sikig, no ti kinacas-ang maitanoc iti tengnga dagiti annac a lallaki dagiti tao."
		},
		"13": {
			"1": "<sup>1</sup> Casano ti capaut, O Jehova? lipatannac ngata nga agnanayon? Casano ti capaut ti panangilingedmo caniac ita rupam?",
			"2": "<sup>2</sup> Casano ti capaut ti panangawatconto iti bagbaga itoy cararwac, idinto nga adda nga agmalmalem ni tarumpingay ditoy pusoc? Casano ti capaut ti panangsaliwan caniac ti cabusorco.",
			"3": "<sup>3</sup> Imutectecam cadi ket sungbatannac, O Jehova a Diosco: silawam dagitoy matac, tapno diac coma mailibay iti turog ni patay;",
			"4": "<sup>4</sup> Tapno ti cabacalco saanna a cuna, siac nagballigiacon kencuana; tapno dagiti cabusorco dida maragsacan no mapacsiatac.",
			"5": "<sup>5</sup> Ngem siac nangnamnamaac ita kinamanagayatmo; toy pusoc agragrag-onto iti panangisalacanmo,",
			"6": "<sup>6</sup> Cancantaacto ni Jehova, gapu ta nangtaconaynay a sibubuslon caniac."
		},
		"14": {
			"1": "<sup>1</sup> Ti maag kinunana iti pusona, Awan ti Dios. Isuda agrupsada, nagaramiddan iti nacarurrurod a gapuanan; awan siasino-man nga agaramid iti naimbag.",
			"2": "<sup>2</sup> Ni Jehova minatmatanna manipud sadi langit dagiti annac dagiti tattao, tapno kitaenna no adda cadacuada siasino-man a nacaawat, a nagbiroc iti Dios.",
			"3": "<sup>3</sup> Isuda amin nagbawingda; isuda amin nagbalinda a nadugiot; awan siasino-man nga agaramid iti naimbag, awan, uray maysa.",
			"4": "<sup>4</sup> Awan ammoda dagiti agar-aramid iti kinakillo, a lamutenda dagiti tattaoc a cas panaglamutda iti tinapay, ket saanda nga awagan ni Jehova?",
			"5": "<sup>5</sup> Idiay addaandan iti dackel a buteng; ta ti Dios adda iti caputotan dagiti nalinteg.",
			"6": "<sup>6</sup> Ibabainyo ti patigmaan ti napanglaw, gaputta ni Jehova ti camangna.",
			"7": "<sup>7</sup> Sapay coma ta ti pannacaisalacan ti Israel immayen manipud Sion! Intono ni Jehova lapsutenna iti pannacacayaw ti ilina, isunto ti panagragsac ni Jacob, ket agrag-onto ni Israel."
		},
		"15": {
			"1": "<sup>1</sup> Jehova, asino ti agtaengto ita tabernaculom? Asino ti agnaedto ita nasantoan a turodmo?",
			"2": "<sup>2</sup> Dayta a magmagna a nalinteg, ken agaramid iti kinalinteg, ket agsao iti pudno manipud iti pusona;",
			"3": "<sup>3</sup> Dayta a saan a mamadpadakes gapu iti dilana, ket saan a mangranggas iti gayyemna, ket saan a mangumsi a maibusor iti caarrubana;",
			"4": "<sup>4</sup> A cadagiti matana ti macarimon malais, ngem idaydayawna dagiti agbuteng ken Jehova; dayta a sapataana iti pannacaranggasna met laeng, ket di-agbaliw;",
			"5": "<sup>5</sup> Dayta a saan nga agpaanac iti piracna, ket saanna nga awaten ti panucsoc a maibusor cadagiti nanengneng. Daydiay nga agaramid cadagitoy a banbanag saanto a maanano."
		},
		"16": {
			"1": "<sup>1</sup> Icaluyanac, O Dios; ta kenca agcamangac.",
			"2": "<sup>2</sup> O cararwac, kinunam ken Jehova, Sica ti Apoc: awan ti naimimbag caniac ngem iti sica.",
			"3": "<sup>3</sup> Maipapan cadagiti sasantos nga adda iti rabaw ti daga, isuda dagiti natan-oc a pagay-ayatac.",
			"4": "<sup>4</sup> Maipaadunto dagiti ladladingit dagiti mangipaay cadagiti sagsagut iti sabali a dios: dagiti datonda nga inumen a dara saanconto nga idaton, saanco met nga aramaten ti nagnaganda cadagiti bibigco.",
			"5": "<sup>5</sup> Ni Jehova isu ti pannacabagi a tawidco ken copac: Pasingkedam ti gasatco.",
			"6": "<sup>6</sup> Dagiti beddeng cadagiti nacaayayo a disso naibatangda caniac; wen, addaanac iti nasayaat a tawid.",
			"7": "<sup>7</sup> Benditoecto ni Jehova, a nangted caniac iti patigmaan: wen, ti pusoc isursuronac iti bayat ti rinabii.",
			"8": "<sup>8</sup> Insaadco ni Jehova a cancanayon iti sangoanac: gapu ta adda iti macanawanco, saanacto a maanano.",
			"9": "<sup>9</sup> Gapuna ti pusoc sirarag-o, ket ti dayagco agragragsac: ti lasagco met agtalinaedto a sitatalged.",
			"10": "<sup>10</sup> Ta saanmonto a baybay-an toy cararwac iti Tanem; saanmonto met nga ipalubos a ti santom makitana ti panagrupsa.",
			"11": "<sup>11</sup> Ipakitamto caniac ti dana ti biag: ita sangoanam adda ti naananay a rag-o; ita macanawanmo adda dagiti pacaayaywan nga agnanayon."
		},
		"17": {
			"1": "<sup>1</sup> Denggem coma ti calintegan, O Jehova, imdengannac itoy asugco; dumngegca coma itoy cararagco, a saan nga agtaud cadagiti bibig nga aginiisu.",
			"2": "<sup>2</sup> Rumuar coma ti maikeddeng caniac manipud dita saclangmo; dagiti matam imatanganda coma ti kinalinteg.",
			"3": "<sup>3</sup> Pinadasmon toy pusoc; sinarungcarannac iti rabii; sinuutnac, ket awan nasaracam; pinanggepco a toy ngiwatco dinto macalibtaw.",
			"4": "<sup>4</sup> Maipapan cadagiti ar-aramid dagiti tattao, gapu iti balicas dagiti bibigmo. Siac nagannadac cadagiti daldalan dagiti naranggas.",
			"5": "<sup>5</sup> Dagiti addangco nagtaengda cadagiti dalanmo, dagiti sacac saanda a naicaglis.",
			"6": "<sup>6</sup> Inawaganca, ta sungbatannacto, O Dios: yallingagmo coma ta lapayagmo caniac, ket denggem ti saoec.",
			"7": "<sup>7</sup> Iparangmo coma ta nacascasdaaw a kinamanagayatmo, O sica a gapu ita imam a macanawan isalacanmo dagiti agcamang kenca cadagiti tumacder a bumusor cadacuada.",
			"8": "<sup>8</sup> Iyalluadnac cadi a cas iti taotao ta matam; ilemmengnac iti baba ti salinung dagiti payacmo,",
			"9": "<sup>9</sup> Cadagiti nadangkes a mangirurumen caniac, dagiti macapatay a cabusorco, a mangalicubcub caniac.",
			"10": "<sup>10</sup> Naibungonda iti tabada met laeng: gapu iti ngiwatda agsaoda a sipapalangguad.",
			"11": "<sup>11</sup> Isuda inalicubcubdacami ita cadagiti ad-addangmi; itaengdan dagiti matmatada a mangitublac cadacami iti daga.",
			"12": "<sup>12</sup> Isu cas maysa a leon a naagawa iti matiliwna, ket cas iti maysa nga agtutubo a leon nga agsibsibluc cadagiti nalimed a yan.",
			"13": "<sup>13</sup> Tumacderca coma, O Jehova, pagparangem coma, rebbaem: isalacanmo toy cararwac cadagiti nadangkes gapu ita campilanmo;",
			"14": "<sup>14</sup> Ken cadagiti tao gapu ita imam, O Jehova, cadagiti tao a nailubongan, a ti apagda adda iti daytoy a panagbiag, ket ti tianda punnoem iti gamengmo: isuda napnecda cadagiti ububbing, ket ibatida ti tidda dagiti cucuada cadagiti maladagada.",
			"15": "<sup>15</sup> Ngem no caniac, imatangacto ta rupam iti naincalintegan; mapnecacto, no agriingac, nga agbuybuya ita langam."
		},
		"18": {
			"1": "<sup>1</sup> Siac ayatenca, O Jehova, a pigsac.",
			"2": "<sup>2</sup> Ni Jehova isu ti batoc, ken sarikedkedco, ken mangispal caniac; Diosco, batoc, isu a pagcamangacto; calasagco, ken sara ti pannacaisalacanco, nangato a baluarte.",
			"3": "<sup>3</sup> Siac awagacto ni Jehova, isu a maicari a maidaydayaw: iti casta maisalacanacto cadagiti cabusorco.",
			"4": "<sup>4</sup> Dagiti singdan ni patay alicubcubendac, ket dagiti layus ti kinadakes pinabutengdac.",
			"5": "<sup>5</sup> Dagiti singdan ni Tanem licmutendac; dagiti silo ni patay immadanida caniac.",
			"6": "<sup>6</sup> Iti panagleddaangco inawagac ni Jehova, ket imkisac iti Diosco; nangngegna ti timecco nanipud iti templona. Ket ti ickisco iti sangoananna nacadanon cadagiti lapayagna.",
			"7": "<sup>7</sup> Iti casta ti daga nagarigengen ken nagpigerger; dagiti pamuon met dagiti banbantay nagginginedda, ket nagarigengenda, a gapu ta isu nagpungtot.",
			"8": "<sup>8</sup> Ngimmato ti maysa nga asuc a rimmuar cadagiti pagangsanna, ket ti apuy a rimmuar iti ngiwatna nagalun-un: dagiti beggang, dimmarangda gapu kencuana.",
			"9": "<sup>9</sup> Isu pinagluyocanna met dagiti langlangit, ket bimmaba; ket napuscol a sipnget adda idi iti baba dagiti sacana.",
			"10": "<sup>10</sup> Ket nagsacay iti maysa a querubin, ket timmayab; wen, nagpangato cadagiti paypayac ti angin.",
			"11": "<sup>11</sup> Pinagbalinna ti sipnget a paglemmenganna, ti bengbengna nga aglicmut kencuana, kinasipnget dagiti dandanum, napuscol nga ul-ulep dagiti tangatang.",
			"12": "<sup>12</sup> Iti kinasilnag iti sangoananna dagiti napuscol nga ul-ulep naglasatda. Nagbukel nga uraro ken beggang ti apuy.",
			"13": "<sup>13</sup> Ni met Jehova naggurrood cadagiti langlangit, ket ti Cangangatoan Unay nagtimec. Nagbukel nga uraro ken beggang ti apuy.",
			"14": "<sup>14</sup> Ket imbiatna dagiti panpanana, ken winarawarana ida; wen, dagiti kimkimat nagaduda unay, ken riniribucna ida.",
			"15": "<sup>15</sup> Idin dagiti pagayusan ti danum nagparangda, ket dagiti pamuon ti lubong nawacnitanda, Iti panangbabalawmo, O Jehova, iti pegges ti angin ti ipul-oy dagiti pagangsam.",
			"16": "<sup>16</sup> Nangibaon nanipud iti ngato, innalanac; inalawnac cadagiti adu a dandanum.",
			"17": "<sup>17</sup> Insalacannac iti napigsa a cabusorco, ken cadagiti gimmura caniac; ta napigsada unay caniac.",
			"18": "<sup>18</sup> Immayda caniac iti aldaw ti kinadacsangasatco; ngem ni Jehova isu ti taclinco.",
			"19": "<sup>19</sup> Innalanac met nga ipan iti maysa a nalawa a yan; insalacannac agsipud ta caay-ayonac.",
			"20": "<sup>20</sup> Ni Jehova ginungunaannac iti catutopan ti kinalintegco; mayanatop iti kinadalus dagiti im-imac sinupapacannac.",
			"21": "<sup>21</sup> Ta siac sinalimetmetac dagiti dalan ni Jehova, ket saanac a pimmanaw a sidadangkes iti Diosco.",
			"22": "<sup>22</sup> Ta isu-amin dagiti imbilbilinna addada idi iti sangoanac, ket diac inyadayo dagiti linlintegna caniac.",
			"23": "<sup>23</sup> Siac met awan idi ti curangco kencuana, ket ingagac ti bagic iti panangdangkesco.",
			"24": "<sup>24</sup> Anansata ni Jehova sinupapacannac iti catutopan ti kinalintegco, iti catutopan ti kinadalus dagiti im-imac iti sidongna.",
			"25": "<sup>25</sup> Cadagiti naasi sica agparangcanto a sicacaasi; cadagiti naananay a tao agparangcanto a cas naananay;",
			"26": "<sup>26</sup> Cadagiti nadalus agparangcanto a sidadalus; ket cadagiti nadangcoc agparangcanto a sibubusor.",
			"27": "<sup>27</sup> Ta isalacanmonto dagiti mairurumen a tattao; ngem dagiti sipapalangguad a matmata pagbabaemto.",
			"28": "<sup>28</sup> Ta gangatamto ti pagsilawac: Ni Jehova a Diosco parangrangennanto ti kinasipngetco.",
			"29": "<sup>29</sup> Ta gapu kenca duclusec ti sangabuyotan; ket gapu iti Diosco lagtuec ti maysa a bacud.",
			"30": "<sup>30</sup> Maipanggep iti Dios, ti dalanna awan pagcuranganna: ti sao ni Jehova naipadasen; isu ti maysa a calasag cadagiti amin nga agcamang kencuana.",
			"31": "<sup>31</sup> Ta siasino ti Dios, no saan laeng a ni Jehova? Ket siasino ti maysa a bato, no saan laeng a ti Diostayo,",
			"32": "<sup>32</sup> Ti Dios a mangbarikes caniac iti pigsa, ket pagbalinenna ti dalanco nga awan pagcurangan?",
			"33": "<sup>33</sup> Pagbalinenna dagitoy sacsacac a cas sacsaca ti ugsa: ket idissonac cadagiti nangato a dissoc.",
			"34": "<sup>34</sup> Isurona dagitoy im-imac iti pannakigubat; iti casta dagitoy tactackiagco biatenda ti maysa a bai a bronce.",
			"35": "<sup>35</sup> Sica intedmo met caniac ti calasag ti panangispalmo; ket ti macanawan nga imam tinengtengngelnac, ket ta tacnengmo pinatan-ocnac.",
			"36": "<sup>36</sup> Pinadackelmo dagiti addangco iti babaec, ket dagiti sacac saanda a naicaglis.",
			"37": "<sup>37</sup> Camatcamatecto dagiti cabusorco, ket gam-udecto ida; diacto met agsubli inggana iti manungpalda.",
			"38": "<sup>38</sup> Salputecto ida iti nacas-ang, inggana iti dida mabalin ti bumangon: matuangdanto iti baba dagiti sacac.",
			"39": "<sup>39</sup> Gapu ta binaricsannac iti pigsa a maipaay iti gubat: pinarucmam iti babaec dagiti bimmusor caniac.",
			"40": "<sup>40</sup> Pinagbalinmo met a dagiti cabusorco tinallicudandac, tapno pucawecto coma dagiti gumura caniac.",
			"41": "<sup>41</sup> Nagpuccawda, ngem awan nangicanawa; uray pay ken Jehova, ngem dina ida impangag.",
			"42": "<sup>42</sup> Idi casta ngarud rinumecrumecco ida a cas iti tapuc a mayangangin; impuruacco ida a cas iti pitac ti dalan.",
			"43": "<sup>43</sup> Inispalnac cadagiti panagriribuc ti umili; pinagbalinnac a panguloen dagiti nacion maysa nga umili nga diac naammoan pagserviannacto.",
			"44": "<sup>44</sup> Apaman a madamagdac agtulnogda caniac; dagiti gangannaet agpacumbabadanto caniac.",
			"45": "<sup>45</sup> Dagiti gangannaet cumpesdanto, ket umaydanto a sititigerger manipud cadagiti pagsalindeganda.",
			"46": "<sup>46</sup> Ni Jehova sibibiag; ket madaydayaw coma ti batoc; ket maitanoc coma ti Dios ti salacanco,",
			"47": "<sup>47</sup> Isu met laeng ti Dios a mangaramid iti pammales gapu caniac, ken mangparucma iti babaec cadagiti tattao.",
			"48": "<sup>48</sup> Alawennac cadagiti cabusorco; wen, sica intagaynac iti ngatoen dagiti bumusor caniac; ispalennac cadagiti narungsot a tao.",
			"49": "<sup>49</sup> Iti casta ngarud agyamanacto kenca, O Jehova, iti tengnga dagiti nasnacion, ket icancantacto dagiti panangidayaw iti naganmo.",
			"50": "<sup>50</sup> Dackel a pannacaispal ipaayna iti arina, ket ipakitana ti kinamanagayat iti pinulotanna, ken David ken iti putotna, iti agnanayon."
		},
		"19": {
			"1": "<sup>1</sup> Dagiti langlangit ipalawagda ti dayag ti Dios; ket ti law-ang ipakitana ti aramid ti imana.",
			"2": "<sup>2</sup> Iti inaldaw yesngaoda ti sao, ket iti rinabi-i iparangda ti pannacaammo.",
			"3": "<sup>3</sup> Awan panagsao wenno pagsasaoda: ti timecda saan a mangngeg.",
			"4": "<sup>4</sup> Ti ugisda sumacnapan iti dagup ti daga, ket ti balicasda aginggadan iti ungto ti lubong. Cadacuada insaadna ti calapaw a maipaay iti init.",
			"5": "<sup>5</sup> Isu a cas apagasasawa a rumuar iti pagturturoganna, ket agragragsac a cas nabileg a lalaki a mangtaray iti dalanna.",
			"6": "<sup>6</sup> Manipud iti pungto dagiti langlangit ti pagruaranna, ket ti pagricusanna agingga cadagiti pungtona; ket awan ti mailemmeng iti pudotna.",
			"7": "<sup>7</sup> Ti linteg ni Jehova awan pagcuranganna, pabaroenna ti cararwa: ti pammanecnec ni Jehova manamnama, pagsiribenna ti nanengneng.",
			"8": "<sup>8</sup> Dagiti alalagaden ni Jehova nalintegda, paragsakenda ti puso: ti bilin ni Jehova nasin-aw, lawaganna dagiti matmata.",
			"9": "<sup>9</sup> Ti buteng ken Jehova nadalus, agtalinaed nga agnanayon: dagiti linlinteg ni Jehova pudnoda, nalintegda amin a padapada.",
			"10": "<sup>10</sup> Adaddada a matarigagayan ngem ti balitoc, uray pay, ngem ti adu a naguguran a balitoc; nasamsam-itda met ngem diro ken cadagiti tedted ti calaba.",
			"11": "<sup>11</sup> Maysa pay, cadacuada mabagbagaan ti adipenmo: iti panangsalimetmet cadacuada adda dackel a gunguna.",
			"12": "<sup>12</sup> Siasino ti macailasin cadagiti bucudna nga  allilaw? Dalusannac cadagiti nalmeng a libtaw.",
			"13": "<sup>13</sup> Igawidmo met ti adipenmo cadagiti kinucuspag a basol;  dica ipalubos ti panangiturayda caniac: iti casta nalintegacto, ket mailisiacto iti dackel a labsing.",
			"14": "<sup>14</sup> Dagiti sasao toy ngiwatco ken ti pampanunot toy pusoc, maawatda cadi ita saclangmo, O Jehova, batoc, ken manubbot caniac."
		},
		"20": {
			"1": "<sup>1</sup> Ni Jehova sungbatannaca coma iti aldaw ti ducot; ti nagan ti Dios ni Jacob itan-ocnaca coma;",
			"2": "<sup>2</sup> Ibaonannaca coma iti badang manipud iti santuario, ket pabilgennaca coma manipud Sion;",
			"3": "<sup>3</sup> Lagipenna coma amin dagiti datdatonmo, ket acoenna coma ti pinuuran a sacrificiom; (Selah)",
			"4": "<sup>4</sup> Itdenna coma kenca ti tarigagay ta pusom, ket tungpalenna coma amin a bagbagam.",
			"5": "<sup>5</sup> Agballigicamto iti panangisalacanmo, ket iti nagan ti Diostayo ibayogtayto dagiti wagaywaytayo: Ni Jehova tungpalenna coma amin dagiti dawatmo.",
			"6": "<sup>6</sup> Ita ammocon a ni Jehova salacnibanna ti pinulotanna; sungbatannanto manipud iti nasantoan a langitna babaen iti mangisalacan a pigsa ti macanawan nga imana.",
			"7": "<sup>7</sup> Dadduma agcammatalecda cadagiti luglugan, ket dadduma cadagiti cabcabayo; ngem datayo dacawatentayo ti nagan ni Jehova a Diostayo.",
			"8": "<sup>8</sup> Isuda macusbo ket mapadsoda; ngem datayo nabangontayo, ket agtacdertayo a sililinteg.",
			"9": "<sup>9</sup> Mangisalacanca, Jehova: ti Ari sungbatannacami coma no umawagcami."
		},
		"21": {
			"1": "<sup>1</sup> Ti ari pagragsacannanto ta bilegmo, O Jehova; ket iti panangisalacanmo amangan a panagragsacnanto!",
			"2": "<sup>2</sup> Intedmo kencuana ti tarigagay ti pusona, ket dica impaidam ti dawat dagiti bibigna. (Selah)",
			"3": "<sup>3</sup> Ta sica isabatam cadagiti parabur ti kinaimbag: isaadmo ti maysa a balangat a balitoc a naguguran iti ulona.",
			"4": "<sup>4</sup> Dimmawat kenca iti biag, ket iniccam, ti met laeng caatiddug dagiti aldaw iti kinaagnanayon.",
			"5": "<sup>5</sup> Dackel ti dayagna iti panangisalacanmo: dayaw ken daeg isaadmo kencuana.",
			"6": "<sup>6</sup> Ta pagbalinem nga isu ti maparaburan a nangrona iti agnanayon; pagragsakem iti rag-o iti saclangmo.",
			"7": "<sup>7</sup> Ta ti ari agcammatalec ken Jehova; ket babaen ti kinamanagayat ti Catanocan isu saanto a maanano.",
			"8": "<sup>8</sup> Ti imam masucalannanto amin dagiti cabcabusormo; ta canawan nga imam masucalannanto dagitoy a gumura kenca.",
			"9": "<sup>9</sup> Pagbalinemto ida a cas sumsumged a paggebbaan inton panagungetmo: ni Jehova alun-unennanto ida iti pungtotna, ket ti apuy runawennanto ida.",
			"10": "<sup>10</sup> Ti bungada pucawemto ditoy daga, ken ti bin-ida cadagiti annac dagiti tattao.",
			"11": "<sup>11</sup> Ta nagpanagemda iti dakes a maibusor kenca; binalabalada ti maysa a sicap a dida nabalin nga aramiden.",
			"12": "<sup>12</sup> Ta pagtallicudemto ida; bisaremto ti parteng ti panam nga ipaturong iti rupada.",
			"13": "<sup>13</sup> Maitan-occa coma, O Jehova, ita bilegmo; iti casta icanta ken idayawminto ta pannacabalinmo."
		},
		"22": {
			"1": "<sup>1</sup> Diosco, Diosco, apayapay a binaybayannac? Apay adayoca man unay iti panangarayatmo caniac, Ken cadagiti sasao ti panagungorco?",
			"2": "<sup>2</sup> O Diosco, umawagac iti aldaw, ngem sica dinac sungbatan; ken iti rabii, ken saanac nga agulimec.",
			"3": "<sup>3</sup> Ngem sica santoca, O sica nga agtalinaed cadagiti panangidaydayaw ti Israel.",
			"4": "<sup>4</sup> Dagiti dadackelmi nagtalecda kenca: nagtalecda, ket sica inispalmo ida.",
			"5": "<sup>5</sup> Immickisda kenca, ket naispalda; Nagtalecda kenca, ket dida naibabain.",
			"6": "<sup>6</sup> Ngem maysaac laeng nga igges, ket saanac a tao; maysa a nacababain cadagiti tattao ken carurod dagiti umili.",
			"7": "<sup>7</sup> Amin a macakita caniac catawaandac a pagangangawan: aglibbida, ingilangilda ti uloda, ket cuncunada,",
			"8": "<sup>8</sup> Agcammatalec ken Jehova; bay-anyo ta ispalenna, bay-anyo ta aonenna, idinto nga isu ti pagayayatanna.",
			"9": "<sup>9</sup> Ngem sica ti nangaon caniac iti tian; pinagcammatalecnac idi addaac iti barucong ni inac.",
			"10": "<sup>10</sup> Sica ti nacaipurruacac manipud iti tian; sica ti Diosco nanipud idi inyanacnac ni ina.",
			"11": "<sup>11</sup> Dica coma adayu caniac; ta ti pagel asideg; ta awan ti umarayat.",
			"12": "<sup>12</sup> Adu dagiti toro a nanglicmut caniac; dagiti napigsa a tortoro ti Bashan sinalimpucocdac.",
			"13": "<sup>13</sup> Ingangada caniac ti ngiwatda, a cas umalun-un ken aguga a leon.",
			"14": "<sup>14</sup> Naibucbucac a cas danum, ket amin dagiti tulangco nangalangalda: toy pusoc cas allid; malunag ditoy unegco.",
			"15": "<sup>15</sup> Ti pigsac namagmagan a cas maysa a ribac; ket ti dilac cumpet iti ngadasco; ket sica impisocnac iti tapuc ni patay.",
			"16": "<sup>16</sup> Ta dagiti as-aso linacubdac: sangabuyotan a managdacdakes linacubdac; sinalputda dagiti im-imac ken sacsacac.",
			"17": "<sup>17</sup> Mabilbilangco amin a tultulangco; matmatan ken mulmulenglengandac.",
			"18": "<sup>18</sup> Pagbibinglayanda dagiti pagananayco ket paggiginnasatanda ti cawesco.",
			"19": "<sup>19</sup> Ngem dica coma adayu, O Jehova: O sica saranayco, agdarasca a mangarayat caniac.",
			"20": "<sup>20</sup> Salacnibam toy cararwac iti campilan, toy ayayatec iti pannacabalin ti aso.",
			"21": "<sup>21</sup> Isalacannac iti ngiwat ti leon; wen, cadagiti sarsara dagiti vacvaca nga atap sinungbatannac.",
			"22": "<sup>22</sup> Iparangarangconto ta naganmo cadagiti cacabsatco. Iti tengnga ti tallaong idaydayawcanto.",
			"23": "<sup>23</sup> Dacayo nga agbuteng ken Jehova, idaydayawyo; dacayo amin a bin-i ni Jacob, padayaganyo; ket agtacdercayo a siaamac kencuana, dacayo amin a bin-i ni Israel.",
			"24": "<sup>24</sup> Ta isu saanna nga inumsi ken kinauma ti leddaang ti mapaldaangan; saanna met nga inlinged kencuana ti rupana; ngem dinengngegna ketdi, idi immawag kencuana.",
			"25": "<sup>25</sup> Sica ti paggapuan ti panagdayawco iti dackel a gimong: bayadacto dagiti carcaric iti saclang dagiti agbuteng kencuana.",
			"26": "<sup>26</sup> Dagiti naemma mangandanto ket mapnecdanto, idaydayawdanto ni Jehova dagiti agsapsapul kencuana: ti pusoyo agbiag coma nga agnanayon.",
			"27": "<sup>27</sup> Amin dagiti pungpungto ti daga lumagip ken agpulangdanto ken Jehova; ket amin nga agcacabagian cadagiti nasnacion agdaydayawdanto iti saclangmo.",
			"28": "<sup>28</sup> Ta ti pagarian cucua ni Jehova; ket isu ti mangituray cadagiti nasnacion.",
			"29": "<sup>29</sup> Amin dagiti nanamay ditoy daga mangan ken agdaydayawdanto: amin dagiti agpababa iti tapuc agrunoydanto iti saclangna, uray pay ti saan a macabalin a mangtaginayon a sibibiag ti cararwana.",
			"30": "<sup>30</sup> Sangcaputotan agservinto kencuana; masarsaritanto a biang ti Apo iti umay a caputotan.",
			"31": "<sup>31</sup> Umaydanto ket ibunannagdanto ti kinalintegna iti umili a mayanacto, nga isu ti nangaramid."
		},
		"23": {
			"1": "<sup>1</sup> Ni Jehova isu ti pastorco; awanto ti pagcurangac.",
			"2": "<sup>2</sup> Ipaiddanac cadagiti nalasbang a pagaraban; idalannac iti sibay dagiti dandanum a natalna.",
			"3": "<sup>3</sup> Pabaroenna toy cararwac: iturongnac cadagiti dandana ti kinalinteg a gapu iti naganna.",
			"4": "<sup>4</sup> Wen, uray magnaac iti ginget ti sipnget ni patay, diacto agbuteng iti dakes; ta sicucuyogca caniac: ti barasmo ken sarucodmo, mamakiredda caniac.",
			"5": "<sup>5</sup> Isaganam ti panganan iti sangoc iti imatang dagiti cabusorco: pinulotam ti uloc iti lana; ti malucongco agliplipias.",
			"6": "<sup>6</sup> Kinaagpaysona da kinaimbag ken kinamanagayat sumurotdanto caniac dagup dagiti al-aldaw ti panagbiagco; ket iti balay ni Jehova agtaengacto nga agnanayon."
		},
		"24": {
			"1": "<sup>1</sup> Ti daga cucua ni Jehova, ken amin nga adda kencuana; ti lubong, ken dagiti agnaed kencuana.",
			"2": "<sup>2</sup> Ta binangonna iti rabaw dagiti tataaw, ket impasdecna iti rabaw dagiti carcarayan.",
			"3": "<sup>3</sup> Siasino ti umulinto iti turod ni Jehova? Ket siasino ti agtacderto iti nasantoan a yanna?",
			"4": "<sup>4</sup> Daydiay nga addaan nadalus nga im-ima ken natarnaw a puso; daydiay a saan a nangitan-oc iti cararwana iti kinaulbod, ken saan a nagsapata iti pangallilaw.",
			"5": "<sup>5</sup> Awatennanto ti parabur nga aggapu ken Jehova, ken ti kinalinteg nga aggapu iti Dios ti pannacaisalacanna.",
			"6": "<sup>6</sup> Daytoy ti caputotan dagiti agsapsapul kencuana, nga agsapul ita rupam, nga isu met laeng ni Jacob. (Selah)",
			"7": "<sup>7</sup> Ingatoyo dagiti uloyo, O dacayo a ruangan; maipangatocayo coma, dacayo agnanayon a rikep: ket ti Ari ti gloria sumrecto.",
			"8": "<sup>8</sup> Siasino ti Ari ti gloria? Ni Jehova a napigsa ken mannacabalin, ni Jehova a mannacabalin iti gubat.",
			"9": "<sup>9</sup> Ipangatoyo dagiti uloyo, O dacayo a ruangan; wen, ipangatoyo coma ida, dacayo agnanayon a rikep: ket ti Ari ti gloria sumrecto.",
			"10": "<sup>10</sup> Siasino daytoy nga Ari ti gloria? Ni Jehova dagiti buybuyot, isu ti Ari ti gloria. (Selah)"
		},
		"25": {
			"1": "<sup>1</sup> Kenca, O Jehova, itangadco toy cararwac.",
			"2": "<sup>2</sup> O Diosco, kenca nagtalecac, dinac baybay-an a maibabain; dica ipalubos a dagiti cabusorco agballigida caniac.",
			"3": "<sup>3</sup> Wen, awan ti agpannuray kenca a maibabainto: isudanto ti maibabain dagiti managliliput nga awan gapgapuna.",
			"4": "<sup>4</sup> Iparangmo caniac dagiti daldalanmo, O Jehova; isurom caniac dagiti dandanam.",
			"5": "<sup>5</sup> Iturongnac iti kinapudnom, ket isuronac; ta sica ti Dios ti pannacaisalacanco; ta kenca agururayac iti agmalmalem.",
			"6": "<sup>6</sup> Lagipem, O Jehova, dagiti nadungngo a caasim ken dagiti kinamanagayatmo; ta agnanayonda nanipud idi ugma.",
			"7": "<sup>7</sup> Dica lagipen dagiti basbasol ti kinaagtutuboc, ken kinalabsingco: cas mayannurot iti kinamanagayatmo sica lagipennac coma, gapu iti kinaimbagmo, O Jehova.",
			"8": "<sup>8</sup> Naimbag ket nalinteg ni Jehova: anansata isuronanto dagiti managbasol iti dalan.",
			"9": "<sup>9</sup> Iturongnanto ti naemma iti kinalinteg; ket isuronanto ti dalanna iti naemma.",
			"10": "<sup>10</sup> Amin dagiti dandana ni Jehova pulos a kinamanagayat ken kinapudno. Cadagiti mangsalimetmet iti tulagna ken cadagiti pammanecnecna.",
			"11": "<sup>11</sup> Gapu iti caicarian ti naganmo, O Jehova, pacawanem ti kinadakesco, ta dackel.",
			"12": "<sup>12</sup> Asino a tao ti agbuteng ken Jehova? Daydiay isuronanto iti dalan a pilienna.",
			"13": "<sup>13</sup> Ti cararwana agnaedto iti kinanam-ay; ket ti putotna tawidennanto ti daga.",
			"14": "<sup>14</sup> Ti kinapagayam ni Jehova addanto cadagiti agbuteng kencuana; ket iparangnanto cadacuada ti tulagna.",
			"15": "<sup>15</sup> Dagiti matac agnanayonda a situturong ken Jehova; ta alut-utennanto dagiti sacsacac iti bateng.",
			"16": "<sup>16</sup> Taliawennac ken caasiannac; ta matalimpungawac ken maducotanac.",
			"17": "<sup>17</sup> Dagiti dandanag toy pusoc dimmadackelda: ay alawennac cadi cadagiti pacarigatac.",
			"18": "<sup>18</sup> Imatangam ti ducotco ken ti bannogco; ket pacawanem amin dagiti basbasolco.",
			"19": "<sup>19</sup> Imatangam dagiti cabusorco, ta aduda; ket guraendac iti naranggas a gura.",
			"20": "<sup>20</sup> Ay igagam toy cararwac, ket ispalennac: dinac baybay-an a maibabain, ta agcamangac kenca.",
			"21": "<sup>21</sup> Ti kinaimbag ken kinalinteg salacnibandac coma, ta sica ti ururayec.",
			"22": "<sup>22</sup> Subbotem ti Israel, O Dios, cadagiti amin a pacaducotanna."
		},
		"26": {
			"1": "<sup>1</sup> Ocomennac, O Jehova, ta nagnaac iti kinasingpetco: nagtalecac met ken Jehova nga awan panagngatangata.",
			"2": "<sup>2</sup> Usigennac, O Jehova, ket padasennac; tingtingem toy pusoc ken isipco.",
			"3": "<sup>3</sup> Ta ti kinamanagayatmo adda iti sango dagiti matac; ken nagnaac iti kinapudnom.",
			"4": "<sup>4</sup> Saanac a nakicatugaw cadagiti tattao ti kinaulbod; ket diacto met sumrec a makicuyog cadagiti aginsisingpet.",
			"5": "<sup>5</sup> Cagurac ti gimong dagiti managdacdakes; ket diacto makicatugaw cadagiti nadangkes:",
			"6": "<sup>6</sup> Buggoacto dagiti im-imac babaen ti kinadalus: iti casta liclicmutecto ti altarmo, O Jehova;",
			"7": "<sup>7</sup> Tapno maipangegco ti timec ti panagyaman, ken maibagac amin dagiti nacascasdaaw nga ar-aramidmo.",
			"8": "<sup>8</sup> Jehova, ayatec ti pagnaedan a balaymo, ken ti yan a pagnaedan ti gloriam.",
			"9": "<sup>9</sup> Dica itipon toy cararwac cadagiti managbasol, ken toy biagco cadagiti tao ti dara;",
			"10": "<sup>10</sup> A cadagiti im-imada adda ti kinadangkes, ket ti canawan nga imada napno cadagiti pangsucsuc.",
			"11": "<sup>11</sup> Ngem no siac, magnaacto iti kinasingpetco: subbotennac, ket mangngaasica caniac.",
			"12": "<sup>12</sup> Ti sacac agtacder iti nasimpa a disso: cadagiti gimgimong idaydayawconto ni Jehova."
		},
		"27": {
			"1": "<sup>1</sup> Ni Jehova isu ti silaw ken salacanco; asino ti cabutengconto? ni Jehova isu ti bileg ti biagco; siasino ti pagbutengacto?",
			"2": "<sup>2</sup> Idi a dagiti managdacdakes dinarupdac tapno lamutenda ti lasagco, uray la nga dagiti casupadi ken cabusorco, naitibcol ket natuangda.",
			"3": "<sup>3</sup> Uray sangabuyotan ti agpacarso a bumusor caniac, ti pusoc dinto agbuteng: uray no gubat ti maisango caniac, nupay casta sitatalecacto laeng.",
			"4": "<sup>4</sup> Maysa a banag ti dinawatco ken Jehova, isu a birokecto; ti panagtaengco coma iti balay ni Jehova iti dagup dagiti al-aldaw ti biagco, tapno agbuybuyaac iti sayaat ni Jehova, ken imutectecac iti uneg ti templona.",
			"5": "<sup>5</sup> Ta iti aldaw ti panagrigat igaganacto a sililimed iti salinongna; iti abbong ti tabernaculona ilemmengnacto; isalpanacto iti tapaw iti maysa a bato.",
			"6": "<sup>6</sup> Ket ita ti uloc maital-onto iti ngatoen dagiti cabcabusorco a silalawlaw caniac; ket idatonconto iti tabernaculona dagiti datdaton ti ragsac; agcantaacto, wen, cantaacto ni Jehova cadagiti panangidaydayaw.",
			"7": "<sup>7</sup> Denggem, O Jehova, no umkisac iti timecco; caasiannac met, ket sungbatannac.",
			"8": "<sup>8</sup> Idi kinunam,  Sapulenyo ti rupac; toy pusoc kinunana kenca, ta rupam, O Jehova, sapulecto.",
			"9": "<sup>9</sup> Dica ilinged ta rupam caniac; dica pagtalawen a capungtot toy adipenmo: sican ti tulongco; dinac ibelleng, dinac met baybay-an, O Dios ti pannacaisalacanco.",
			"10": "<sup>10</sup> No da ama ken ina baybay-andac, ni ngad Jehova pidutennacto.",
			"11": "<sup>11</sup> Isurom caniac ti dalanmo, O Jehova; ket iturongnac iti nabatad a dana gapu cadagiti cabusorco.",
			"12": "<sup>12</sup> Dinac iyawat iti nakem dagiti casupadic: ta dagiti natiri a sacsacsi timmacderda a bumusor caniac, ket dagita isangawda ti kinadawel.",
			"13": "<sup>13</sup> Nagtalipungawac coma, no diac coma namati a makitac ti kinaimbag ni Jehova iti daga dagiti sibibiag.",
			"14": "<sup>14</sup> Paturaymo ni Jehova: bumilegca, ket tumured coma ta pusom; wen, paturaymo ni Jehova."
		},
		"28": {
			"1": "<sup>1</sup> Kenca, O Jehova, umawagacto: batoc dica agtuleng caniac; amangan la ket ta, no agulimecca caniac, agbalinac a cas cadagiti bumaba iti abut.",
			"2": "<sup>2</sup> Denggem ti timec dagiti ararawco, no umkisac kenca, no itag-ayco dagiti im-imac nga agturong iti nasantoan a pagipalawagam.",
			"3": "<sup>3</sup> Dinac paadayoen a maicuyog cadagiti nadangkes, ken cadagiti agar-aramid iti kinadakes; a saoenda ti cappia cadagiti caarrubada, ngem kinagulib ti adda cadagiti puspusoda.",
			"4": "<sup>4</sup> Itdem cadacuada ti catutopan ti gapuananda, ken catutopan ti kinadangkes dagiti panagaramidda: Itdem cadacuada cas iti panagaramid ti im-imada; ipaaymo cadacuada ti caicarianda.",
			"5": "<sup>5</sup> Ta dida icancano dagiti ar-aramid ni Jehova, wenno gapuanan dagiti im-imana, rebbaennanto ida ket dinanto bangonen ida.",
			"6": "<sup>6</sup> Madaydayaw coma ni Jehova, ta impangagna ti timec dagiti ar-ararawco.",
			"7": "<sup>7</sup> Ni Jehova isu ti bileg ken calasagco, ti pusoc nagtalec kencuana, ket naarayatac: anansata toy pusoc agragsac unay; ket iti cantac idaydayawconto.",
			"8": "<sup>8</sup> Ni Jehova isu ti bilegda, ket isu ti sarikedked ti panangisalacan iti pinulotanna.",
			"9": "<sup>9</sup> Isalacanmo ti ilim, ket bendicionam ti tawidmo: agpastorca met cadacuada, ket saranayem ida nga agnanayon."
		},
		"29": {
			"1": "<sup>1</sup> Ipaayyo ken Jehova, O dacayo nga annac ti mannacabalin, Ipaayyo ken Jehova ti kinadayag ken kinabileg.",
			"2": "<sup>2</sup> Ipaayyo ken Jehova ti kinadayag a mainugot iti naganna; daydayawenyo ni Jehova iti naimnas a kinasanto.",
			"3": "<sup>3</sup> Ti timec ni Jehova adda iti rabaw dagiti dandanum: ti Dios ti kinadayag aggurrood, ni Jehova met laeng adda iti rabaw dagiti adu a dandanum.",
			"4": "<sup>4</sup> Ti timec ni Jehova mannacabalin; ti timec ni Jehova napno iti kinadaeg.",
			"5": "<sup>5</sup> Ti timec ni Jehova sepakenna dagiti cayo a cedro; Wen, ni Jehova bungbungtolenna dagiti cedro diay Libano.",
			"6": "<sup>6</sup> Paglagtoenna met ida a cas urbon a vaca; Libano ken Sirion a cas bumaro a vaca nga atap.",
			"7": "<sup>7</sup> Ti timec ni Jehova gessatenna dagiti darang ti apuy.",
			"8": "<sup>8</sup> Ti timec ni Jehova pagarigengenenna ti let-ang; ni Jehova pagarigengenenna ti let-ang ti Cades.",
			"9": "<sup>9</sup> Ti timec ni Jehova aramidenna a dagiti ug-ugsa aganacda, ket labusanna nga aglamolamo dagiti bacbakir; ket iti templona tunggal kita ibagana Gloria.",
			"10": "<sup>10</sup> Ni Jehova nagtugaw a cas Ari idi layus; wen, ni Jehova agtugaw a cas Ari iti agnanayon.",
			"11": "<sup>11</sup> Ni Jehova itednanto ti pigsa cadagiti tattaona; ni Jehova paraburannanto iti cappia ti ilina."
		},
		"30": {
			"1": "<sup>1</sup> Itantan-occanto, O Jehova, ta binatacnac, ket dica impalubos a dagiti cabusorco pagraragsacandac.",
			"2": "<sup>2</sup> O Jehova a Diosco. Imkisac kenca, ket sica pinaimbagnac.",
			"3": "<sup>3</sup> O Jehova, sica inaonmo toy cararwac iti Tanem; sica tinaginayonnac a sibibiag, tapno diac agpababa iti abut.",
			"4": "<sup>4</sup> Icantayo ti panangidaydayaw ken Jehova, O dacay a sasantosna, ket agyamancayo a pacalaglagipan iti nasantoan a naganna.",
			"5": "<sup>5</sup> Ta ti ungetna apagcanito laeng; ti pammaraburna capaunpaut ti panagbiag: ti sangit mabalin nga agpatnag iti rabii, ngem ti ragsac umay iti bumigat.",
			"6": "<sup>6</sup> No siac, kinunac iti kinarang-ayco, diacto magarawen uray caanoman.",
			"7": "<sup>7</sup> Sica, O Jehova, gapu iti paraburmo pinatacdermo ti bantayco a natibker: sica inlingedmo dayta rupam; nagducotac.",
			"8": "<sup>8</sup> Imkisac kenca, O Jehova; ket ken Jehova nagpacpacaasiac:",
			"9": "<sup>9</sup> Ania ti pateg ti darac, inton umulogacon iti abut? Ti tapuc idaydayawnacanto ngata? Ipaduyacyacnanto ngata ti kinapudnom?",
			"10": "<sup>10</sup> Dumngegca, O Jehova, ket mangaasica caniac: Jehova, sica cadi ti manulong caniac.",
			"11": "<sup>11</sup> Sica pinagbalinmo caniac a panagsalsala ti panagladladingitco: sica winacnitam ti cumutco ket binaricsannac iti ragsac;",
			"12": "<sup>12</sup> Tapno ti kinadayagco icancantana coma ti panangidaydayaw kenca, ket saan nga agulimec. O Jehova a Diosco, agyamanacto kenca nga agnanayon."
		},
		"31": {
			"1": "<sup>1</sup> Kenca, O Jehova, agcamangac; diac cad maibabain uray caanoman: ispalennac ita kinalintegmo.",
			"2": "<sup>2</sup> Yallingagmo cad ta lapayagmo caniac; ispalennac daras: sica cadi ti natibker a bato caniac, balay a pagsalacniban a mangisalacan caniac.",
			"3": "<sup>3</sup> Ta sica ti batoc ken pagsalindegac; anansata gapu iti naganmo idalannac ket iturongnac cadi.",
			"4": "<sup>4</sup> Alututennac cadi iti bateng nga impacatda a sililimed caniac; ta sica ti napigsa a pagtaclinac.",
			"5": "<sup>5</sup> Ita imam italecco toy cararwac: sinubbotnac, O Jehova, sica a Dios ti pudno.",
			"6": "<sup>6</sup> Guraec dagiti managayat cadagiti pangallilaw a kinaubbaw; ngem agtalecac ken Jehova.",
			"7": "<sup>7</sup> Agragsacac ken agragrag-oacto ita kinamanagayatmo; ta nakitam ti leddaangco: naammoam toy cararwac cadagiti panagsicor;",
			"8": "<sup>8</sup> Ket saannac nga impapetpet iti ima ti cabusor; insimpam dagiti sacsacac iti nawaya a yan.",
			"9": "<sup>9</sup> Mangaasica caniac, O Jehova, ta addaac iti tarumpingay: ti matac marmay iti ladingit, wen, ti cararwac ken ti bagic.",
			"10": "<sup>10</sup> Ta ti biagco aggibusen iti liday, ket dagiti tawenco iti panagsasaibbec: ti pigsac umawan gapu iti kinadakesco, ket dagiti tultulangco marmaydan.",
			"11": "<sup>11</sup> Gapu cadagiti casupadic agbalinacon a pacaumsian, wen, cadagiti caarrubac iti nangnangrona, ken maysa a pagbutngan iti amammoc: dagiti nacakita caniac iti ruar intarayandac.",
			"12": "<sup>12</sup> Nalipatannacon a cas natay a tao a naiccat iti panunot: arigco ti maysa a naboong a lunglungan.",
			"13": "<sup>13</sup> Ta nangngegco ti panangibabain dagiti adu, ames nga agsusumbangir: idi a nagbibinnalacadda a bumusor caniac, insicatda nga iccaten toy biagco.",
			"14": "<sup>14</sup> Ngem nagcammatalecac kenca, O Jehova: kinunac, sica ti Diosco.",
			"15": "<sup>15</sup> Dagiti aldawco addada ita imam: ispalennac, cadi iti ima dagiti cabusorco, ken cadagiti mangidadanes caniac.",
			"16": "<sup>16</sup> Pagraniagem ta rupam itoy adipenmo: isalacannac ita kinamanagayatmo.",
			"17": "<sup>17</sup> Saanac cadi a maibabain, O Jehova; yantangay inawaganca: dagiti cadi managdacdakes ti maibabain, isuda cadi ti agulimec iti Tanem.",
			"18": "<sup>18</sup> Agumel cadi dagiti managulbod a bibig, nga agsaoda a sisasabrac cadagiti nalinteg, a sitatangsit ken siuuyaw.",
			"19": "<sup>19</sup> O nagdackelen ti kinaimbagmo, nga impenpenmo nga agpaay cadagiti agbuteng kenca, nga inaramidmo cadagiti agcamang kenca, iti sangoanan dagiti annac dagiti tattao!",
			"20": "<sup>20</sup> Iti salucob ta sangom lingdamto ida cadagiti nagulib a tinong ti tao: iti maysa a salinong a natalingenngen salacnibamto ida a sililimed iti susic dagiti dildila.",
			"21": "<sup>21</sup> Madaydayaw coma ni Jehova; ta imparangarangna caniac ti nacascasdaaw a kinamanagayatna iti maysa nga ili a natibker.",
			"22": "<sup>22</sup> No caniac, kinunac iti pannacaganatco, nagudasacon ita sangoanan dagiti matam: nupay casta sica nangngegmo ti timec dagiti panagpacpacaasic, idi imkisac kenca.",
			"23": "<sup>23</sup> O ayatenyo ni Jehova, dacayo amin a sasantosna: ni Jehova igagana dagiti sipapati, ket supapacanna a naananay ti agaramid a sitatangsit.",
			"24": "<sup>24</sup> Bumilegcayo coma, ket ta pusoyo tumured cadi, dacayo amin a mangnamnama ken Jehova."
		},
		"32": {
			"1": "<sup>1</sup> Nagasat ti mapacawan ti salungasingna, a ti basolna maabbongan.",
			"2": "<sup>2</sup> Nagasat ti tao a di pangipatayan ni Jehova iti kinakillo, ken iti espirituna awan ti sicap.",
			"3": "<sup>3</sup> Idi nagulimecac, dagiti tultulangco narmayda bayat ti panagungorco nga agpatnag ken agmalem.",
			"4": "<sup>4</sup> Ta aldaw ken rabii ta imam sibabantot a naiparabaw caniac: ti kinalapsatco namalbaliw a cas gapu iti kinaticag ti tiempo ti calgaw. (Selah)",
			"5": "<sup>5</sup> Binigbigco ti basolco kenca, ket ti kinadakesco diac inlinged: kinunac, ipudnocto dagiti salungasingco ken Jehova; ket sica pinacawanmo ti kinacas-ang ti basolco.",
			"6": "<sup>6</sup> Gapu itoy tunggal maysa a nadiosan pagcararagannaca coma iti tiempo a pannacasarac kenca: pudno nga intono aglippias dagiti dadackel a dandanum didanto dumanon kencuana.",
			"7": "<sup>7</sup> Sica ti paglemmengac; igaganacto iti danag; sica liclicmutennacto cadagiti cancanta ti pannacaispal. (Selah)",
			"8": "<sup>8</sup> Iwardascanto ket isurocanto iti dalan a pagnaemto: balacadancanto a sisisiput toy matac kenca.",
			"9": "<sup>9</sup> Saancayo cadi a cas iti cabayo, wenno cas iti mulo, nga awanan pannacaawat; a masapul dagiti arruaten a pacagat ken rienda a pangigawid cadacuada, ta no saan didacanto asitgan.",
			"10": "<sup>10</sup> Adu a ladladingit ti maaddanto cadagiti nadangkes; ngem ti agtalec ken Jehova, kinamanagayat ti manglawlawto kencuana.",
			"11": "<sup>11</sup> Siiyamancayo ken Jehova, ken agragsaccayo, dacayo a sililinteg; ket umsiagcay iti rag-o, dacayo a nasingpet iti puso."
		},
		"33": {
			"1": "<sup>1</sup> Agragragsaccayo ken Jehova, dacayo a sililinteg; naarnged ti panangidaydayaw a maipaay iti nalinteg.",
			"2": "<sup>2</sup> Agyamancayo ken Jehova a buyogen ti arpa: cantaanyo cadagiti panangidaydayaw a danggayan ti pagtocaran a sangapulo dagiti cuerdasna.",
			"3": "<sup>3</sup> Cantaanyo iti baro a canta; laingenyo ti agcutengteng a buyugen ti napigsa nga aweng.",
			"4": "<sup>4</sup> Ta ti sao ni Jehova nalinteg; ket amin nga aramidna naaramid iti kinamatalec.",
			"5": "<sup>5</sup> Ayatenna ti kinasingpet ken kinalinteg: ti daga sipupunno iti kinamanagayat ni Jehova.",
			"6": "<sup>6</sup> Gapu iti sao ni Jehova naaramid dagiti langlangit, ken dagup ti buyotda gapu iti sangaw ti ngiwatna.",
			"7": "<sup>7</sup> Isu pagtitiponenna dagiti dandanum ti baybay a cas gabsoon: ipenpenna dagiti mangliwengliweng cadagiti pagpenpenan.",
			"8": "<sup>8</sup> Agbuteng coma ti amin a daga ken Jehova: siaaripapa coma kencuana dagup dagiti agnaed toy lubong.",
			"9": "<sup>9</sup> Ta nagsao, ket natungpalen; nagbilin, ket napatibkeran.",
			"10": "<sup>10</sup> Ni Jehova paawanenna ti tinong dagiti nasnacion; ket paawasenna dagiti pampanunot dagiti il-ili.",
			"11": "<sup>11</sup> Ti balacad ni Jehova agtalinaed a natibker iti agnanayon, dagiti pampanunot ti pusona agpaut cadagiti amin a capcaputotan.",
			"12": "<sup>12</sup> Nagasat ti nacion a ti Diosna isu ni Jehova, ti ili a pinilina a pagtawidenna met laeng.",
			"13": "<sup>13</sup> Ni Jehova simamatmat manipud langit; buybuyaenna amin dagiti annac dagiti tattao;",
			"14": "<sup>14</sup> Manipud ayan ti taengna tannawaganna amin dagiti agnaed ditoy daga,",
			"15": "<sup>15</sup> Isu a mangsucog cadagiti puspusoda amin, a mangututob cadagiti amin nga ar-aramidda.",
			"16": "<sup>16</sup> Awan ti ari a maisalacan gapu iti kinaadu ti buyot: maysa a tao a napigsa saan a maispal gapu iti dackel a bileg.",
			"17": "<sup>17</sup> Ti cabayo maysa nga ubbaw a pacaisalacanan; saanna met a maispal iti siasinoman gapu iti naindaclan a bilegna.",
			"18": "<sup>18</sup> Kitaem, ti mata ni Jehova sisisiput cadagiti agbuteng kencuana, cadagiti manginanama iti kinamanagayatna;",
			"19": "<sup>19</sup> Tapno ispalenna ti cararwada ken patay, ken taginayonenna ida a sibibiag iti panagbisin.",
			"20": "<sup>20</sup> Ti cararwatayo nagururay ken Jehova: isu ti saranay ken calasagtayo.",
			"21": "<sup>21</sup> Ta ti pusotayo agragsacto kencuana, gapu ta nagtalectayo iti nasantoan a naganna.",
			"22": "<sup>22</sup> Agpaay cadi cadacami ta kinamanagayatmo, O Jehova, a cas iti pananginanamamin kenca."
		},
		"34": {
			"1": "<sup>1</sup> Idaydayawconto ni Jehova cadagiti amin a tiempo: ti pannacaidaydayawna agnanayonto nga adda iti ngiwatco.",
			"2": "<sup>2</sup> Ti cararwac pagpaspasindayagnanto ni Jehova: dagiti naemma mangngegdanto, ket agrag-oda.",
			"3": "<sup>3</sup> O bumuyogcayo caniac a mangipangrona ken Jehova, ket itan-octayo coma nga agtitimpuyog ti naganna.",
			"4": "<sup>4</sup> Binirbirocco ni Jehova, ket isu sinungbatannac, ket inispalnac cadagiti amin a panagbutbutengco.",
			"5": "<sup>5</sup> Kimmitada kencuana, ket nagraniagda; ket dagiti ruprupada uray caanoman didanto agmalmalanga.",
			"6": "<sup>6</sup> Toy nanumo a tao imkis, ket dinengngeg ni Jehova, ket insalacanna cadagiti amin a ducducotna.",
			"7": "<sup>7</sup> Ti angel ni Jehova alicubcubenna dagiti agbuteng kencuana, ket ispalenna ida.",
			"8": "<sup>8</sup> O nanamenyo ket kitaenyo ta ni Jehova naimbag: nagasat ti tao a cumamang kencuana.",
			"9": "<sup>9</sup> O agbutengcayo ken Jehova, dacayo a sasantosna; ta awan pagcurangan cadagiti agbuteng kencuana.",
			"10": "<sup>10</sup> Dagiti urbon a leon makiranganda, ket agsagabada iti bisin; ngem dagiti mangbiroc ken Jehova saandanto a macurangan iti aniaman a naimbag.",
			"11": "<sup>11</sup> Umaycayo, dacayo nga annac, tumimudcayo caniac: isurocto cadacayo ti panagbuteng ken Jehova.",
			"12": "<sup>12</sup> Siasino a tao ti agcalicagum iti biag, ken agayat iti adu nga al-aldaw, tapno macakita iti imbag?",
			"13": "<sup>13</sup> Aluadam ta dilam iti dakes, ken dagita bibigmo iti panagsaoda iti kinasicap.",
			"14": "<sup>14</sup> Pagpanawam ti dakes, ket aramidem ti imbag; birokem ti talna, ket isu ti surotem.",
			"15": "<sup>15</sup> Dagiti mata ni Jehova sisisirayda cadagiti sililinteg, ket dagiti lapayagna silulucatda iti ickisda.",
			"16": "<sup>16</sup> Ti rupa ni Jehova maibusor cadagiti agaramid iti dakes, tapno gupdenna ti pacalaglagipan cadacuada ditoy daga.",
			"17": "<sup>17</sup> Dagiti nalinteg nagickisda ket dinengngeg ni Jehova, ket inispalna ida cadagiti amin a ducducotda.",
			"18": "<sup>18</sup> Ni Jehova adda iti asideg cadagiti sitatarumpingay ti pusoda, ket isalacanna dagiti sibabawi ti espirituda.",
			"19": "<sup>19</sup> Adu dagiti sicsicor ti nasingpet; ngem ni Jehova ispalenna cadacuada amin.",
			"20": "<sup>20</sup> Aluadanna amin a tultulangna: awan uray maysa cadacuada ti mabongtol.",
			"21": "<sup>21</sup> Ti dakes patayennanto ti nadangkes; ket dagiti gumurgura iti nasingpet madusaandanto.",
			"22": "<sup>22</sup> Ni Jehova subbotenna ti cararwa dagiti ad-adipenna; ket cadagiti cumamang kencuana awanto ti madusaan."
		},
		"35": {
			"1": "<sup>1</sup> Makirupirca, O Jehova, cadagiti makirupir caniac: gubatem dagiti manggubat caniac.",
			"2": "<sup>2</sup> Petpetam ti calasag ken ti sarapa, ket agtacderca a badangco.",
			"3": "<sup>3</sup> Asutem met ti gayang, ket tubenem ti dalan a maibusor cadagiti mangamat caniac: cunaem itoy cararwac, siac ti salacanmo.",
			"4": "<sup>4</sup> Mabainan ken maababi cadi dagiti mamirbiroc itoy cararwac: mapagsubli ken mariribuc cadi dagiti mangisicsicat iti pacaranggasac.",
			"5": "<sup>5</sup> Arigda la coma taep a maisangbar iti angin, ket ti angel ni Jehova ipalpalaisna ida.",
			"6": "<sup>6</sup> Ti dalanda nasipnget ken nagalis coma ket ti angel ni Jehova cumamcamat cadacuada.",
			"7": "<sup>7</sup> Ta awan gapgapuna inlingedda caniac ti batengda iti palab-ug; awan gapgapuna incalianda iti abut toy cararwac.",
			"8": "<sup>8</sup> Ti pannacadadael dumteng coma kencuana a dina mapacadaan; ket ti bateng nga ilingedna mangsimbalud cadi kencuana met laeng; iti pannacadadael agtinnag cadi iti daydiay.",
			"9": "<sup>9</sup> Ket ti cararwac sirarag-onto ken Jehova: agragsacto iti panangisalacanna.",
			"10": "<sup>10</sup> Amin a tultulangco cunadanto, Jehova, siasino ti cas kenca, a mangispal iti napanglaw iti daydiay napigpigsa ngem isu, wen, iti napanglaw ken nacacaasi iti daydiay mangagaw kencuana?",
			"11": "<sup>11</sup> Dagiti natiri a sacsi tumacderda; pagintuodandac cadagiti banbanag a diac ammo.",
			"12": "<sup>12</sup> Supapacanda caniac iti dakes ti imbag, a pacatalimpungawan toy cararwac.",
			"13": "<sup>13</sup> Ngem no siac, idi a nagsakitda, nagpanesac: pinarigatco toy cararwac iti panagayunar; ket ti cararagco nagsubli itoy barucongco met laeng.",
			"14": "<sup>14</sup> Nagsaadac nga imbilangco cas isu gayemco wenno cabsatco: nagtamedac a sililiday, a cas maysa a mangdung-aw iti inana.",
			"15": "<sup>15</sup> Ngem iti pannacaparigatco nagragragsacda, ket nagtitiponda: dagiti nagulib naguornongda a sibubusor caniac, ket saanco a naammoan; pinisangpisangdac, ket dida sinardayan:",
			"16": "<sup>16</sup> Cas cadagiti managrabngis cadagiti pagrambacan, inngarngarrietda caniac dagiti ngipenda.",
			"17": "<sup>17</sup> Apo, casanonto ti capaut ti panagbuybuyam? Alututem toy cararwac cadagiti panangdadaelda, toy ayayatec cadagiti leon.",
			"18": "<sup>18</sup> Agyamanacto kenca iti dackel a tallaong: idaydayawcanto iti tengnga ti dackel nga ili.",
			"19": "<sup>19</sup> Dica ipalubos cadagiti cabusorco a pagragragsacandac a di umumno; ken dica ipalubos nga agkikinnidday dagiti gumurgura caniac nga awan gapgapuna.",
			"20": "<sup>20</sup> Ta dida saoen ti cappia; ngem sicatenda ketdi dagiti naulbod a sasao a maibusor cadagiti natalna iti daga.",
			"21": "<sup>21</sup> Wen, inngangada ti ngiwatda a sibebercacac caniac; kinunada, Aja, aja, isu nakitan dagiti matami.",
			"22": "<sup>22</sup> Sica nakitam, O Jehova; dica agulimec; O Apo, dica cadi adayo caniac.",
			"23": "<sup>23</sup> Matignayca cadi, ket agriingca iti kinalinteg a maitutop caniac; iti met laeng calintegac, Diosco ket Apoc.",
			"24": "<sup>24</sup> Ocomennac, O Jehova a Diosco, cas mayannurot ita kinalintegmo; ket dica ipalubos a pagraragsacandac.",
			"25": "<sup>25</sup> Dica palubos a cunaenda iti pusoda, Aja, casta ti tinarigagayanmi: dica ipalubos a cunada, Isu naalun-unmin.",
			"26": "<sup>26</sup> Mabainanda cadi ket mariribucda a padapada dagiti agragsac iti pannacaranggasco: macumutanda coma iti bain ken ab-abi dagiti agindadackel a bumusor caniac.",
			"27": "<sup>27</sup> Umsiagda coma iti rag-o, ket maragsacanda, dagiti makianamong itoy sililinteg a panggepco: wen, cunaenda cadi a cancanayon, ni Jehova maitanoc coma, isu a pagayatanna ti kinarang-ay ti adipenna.",
			"28": "<sup>28</sup> Ket ti dilac sarsaritaennanto ti kinalintegmo ken ti pannacaidayawmo iti bayat ti aldaw."
		},
		"36": {
			"1": "<sup>1</sup> Ti kinasalungasing ti nadangkes cunana iti uneg toy pusoc, awan panagbuteng iti Dios iti saclang dagiti matana.",
			"2": "<sup>2</sup> Ta alaliogenna ti bagina cadagiti matana met laeng, a iti kinadakesna dinto masucalan ken magura.",
			"3": "<sup>3</sup> Dagiti sasao ti ngiwatna kinakillo ken kinaulbod: binaybay-anna ti kinamanakem ken panagaramid iti imbag.",
			"4": "<sup>4</sup> Sigsigpenna ti kinakillo iti iddana; sumrec iti dalan a saan a nasayaat; saanna a casimron ti dakes.",
			"5": "<sup>5</sup> Ti kinamanagayatmo, O Jehova, adda cadagiti langlangit; ti kinamatalecmo dumanon cadagiti tangatang.",
			"6": "<sup>6</sup> Ti kinalintegmo cas cadagiti banbantay ti Dios; dagiti panagipatom dackel a mangliwengliweng; O Jehova, sica saluadam ti tao ken ti animal.",
			"7": "<sup>7</sup> Amangan a nagpateg ti kinamanagayatmo, O Dios! Ket dagiti annac dagiti tattao agcamangda iti salinong dagita payacmo,",
			"8": "<sup>8</sup> Mapnecdanto nga aglaplapusanan iti kinaananay ti balaymo; ket sica painumento ida iti carayan dagiti ragrag-om.",
			"9": "<sup>9</sup> Ta adda kenca ti ubbog ti biag: ita raniagmo makitaminto ti lawag.",
			"10": "<sup>10</sup> O tuloyem ti kinamanagayatmo cadagiti macaammo kenca, ken ti kinalintegmo cadagiti sililinteg iti pusoda.",
			"11": "<sup>11</sup> Ti saca ti kinatangsit dica ipalubos nga umay bumusor caniac, ket ti ima ti nadangkes dinac cadi pacsiaten.",
			"12": "<sup>12</sup> Dagidiayen natuangdan dagiti mangilkillo: naitublacdan, ket didanto macabangonen."
		},
		"37": {
			"1": "<sup>1</sup> Dica agalimuteng gapu cadagiti managdacdakes, dica met apalan dagiti agar-aramid iti kinakillo.",
			"2": "<sup>2</sup> Ta isuda mapatpatdanto iti mabiit a cas root, ket malaylaydanto a cas nalangto a mula.",
			"3": "<sup>3</sup> Agtalecca ken Jehova, ket agaramidca iti naimbag; agnaedca coma ditoy daga ket agtaraonca iti kinamatalecna.",
			"4": "<sup>4</sup> Pagayayatam met ni Jehova; ket isu itdennanto kenca dagiti tarigagay ta pusom.",
			"5": "<sup>5</sup> Icumitmo ti dalanmo ken Jehova; agtalecca met kencuana, ket isu ibanagnanto.",
			"6": "<sup>6</sup> Ket isu pagsacnapennanto ti kinalintegmo a cas iti lawag, ken ti calintegam a cas iti tengnga ti aldaw.",
			"7": "<sup>7</sup> Agtalnaca ken Jehova, ket paturaymo a siaanus: dica pagalimutengan ti agrang-ay iti dalanna, gapu iti tao a mapangabacna dagiti nadangkes a panggepna.",
			"8": "<sup>8</sup> Sardayam ti pungtot, ket lipatem ti gura: dica agalimuteng, daytoy agduyos laeng iti panagaramid iti dakes.",
			"9": "<sup>9</sup> Ta dagiti agaramid iti dakes magessatdanto; ngem dagidiay nga agpannuray ken Jehova, tawidendanto ti daga.",
			"10": "<sup>10</sup> Ta bassit pay a daricmat, ket ti nadangkes maawanton: wen, mingmingamto a sigaganetget ti ayanna, ket awanton.",
			"11": "<sup>11</sup> Ngem dagiti naemma tawidendanto ti daga, ket maayayatandanto iti kinaruay ti talna.",
			"12": "<sup>12</sup> Ti nadangkes sigsigpenna ti maibusor iti nalinteg, ket ingaretngetna dagiti ngipenna kencuana.",
			"13": "<sup>13</sup> Ti Apo catawaannanto; ta makitana a ti aldawna dumtengen.",
			"14": "<sup>14</sup> Dagiti nadangkes inasutda ti campilan ket imbisarda ti bai ti panada, tapno maipasagda ti napanglaw ken macasapul, tapno mapapatayda dagiti nalinteg iti dalan.",
			"15": "<sup>15</sup> Ti campilanda sumrecto cadagiti puspusoda met laeng, ket dagiti bai ti panada matuccolto.",
			"16": "<sup>16</sup> Nasaysayaat ti sangcabassit a cucua ti sililinteg ngem ti kinabacnang dagiti adu a nadangkes.",
			"17": "<sup>17</sup> Ta dagiti tackiag dagiti nadangkes matuccoldanto; ngem ni Jehova saranayenna dagiti sililinteg.",
			"18": "<sup>18</sup> Ni Jehova ammona dagiti aldaw dagiti napnoan-imbag; ket ti tawidda agnanayonto.",
			"19": "<sup>19</sup> Saandanto a mababainan intono tiempo ti riribuc; ket intono aldaw ti panagbisin mapnecdanto.",
			"20": "<sup>20</sup> Ngem dagiti nadangkes mapucawdanto, ket dagiti cabusor ni Jehova casdanto la taba dagiti carnero: marunawdanto; cas asuc maawandanto.",
			"21": "<sup>21</sup> Ti nadangkes umutang, ket saan nga agbayaden; ngem ti nalinteg managparabur, ket mangted.",
			"22": "<sup>22</sup> Ta dagidiay bendicionanna tawidendanto ti daga; ket dagiti ilunodna magessatdanto.",
			"23": "<sup>23</sup> Dagiti panagaddang ti naimbag a tao patalgedan ni Jehova; ket isu maayatanna ti dalanna.",
			"24": "<sup>24</sup> Uray matuang, saanto a madalupisac; ta ni Jehova saranayenna iti imana.",
			"25": "<sup>25</sup> Nagubingac, ket ita lacayacon; diac pay nacakita iti sililinteg a nabaybay-an, ken cadagiti putputotna man a makipalpalama iti canen.",
			"26": "<sup>26</sup> Amin nga aldaw sipaparabur, ket agpabulod; ket ti putotna mabendicionan.",
			"27": "<sup>27</sup> Pagtalawam ti dakes ket agaramidca iti naimbag; ket agtalinaedca nga agnanayon.",
			"28": "<sup>28</sup> Ta ni Jehova ayatenna ti kinalinteg, ket dina baybay-an dagiti sasantosna; maicanawada nga agnanayon: ngem ti putot dagiti nadangkes magessatdanto.",
			"29": "<sup>29</sup> Ti sililinteg tawidennanto ti daga, ket agtaengto kencuana nga agnanayon.",
			"30": "<sup>30</sup> Ti ngiwat ti sililinteg agsarita iti kinasirib, ket ti dilana agsao iti kinalinteg.",
			"31": "<sup>31</sup> Ti linteg ti Diosna adda iti pusona; cadagiti addangna awanto ti maicaglis.",
			"32": "<sup>32</sup> Ti nadangkes siimenna ti sililinteg, ket isapulna ti pammatayna kencuana.",
			"33": "<sup>33</sup> Ni Jehova dinanto baybay-an iti imana, dinanto met dusaen intono maocom.",
			"34": "<sup>34</sup> Paturaymo ni Jehova, ket salimetmetam ti dalanna, ket itan-ocnacanto nga agtawid iti daga; intono magessat ti nadangkes, makitamto.",
			"35": "<sup>35</sup> Nakitac ti nadangkes iti naidaclan a pannacabalin, ket agsalumpayac a cas nalasbang a cayo iti tinuboanna a daga.",
			"36": "<sup>36</sup> Ngem adda limmabas, ket, ni, awanen: wen, sinapulco, ngem saan a nasaracanen.",
			"37": "<sup>37</sup> Mingmingam ti napnoan-imbag a tao, ket matmatam ti nalinteg; ta addanto nanam-ay a tungpal a maipaay iti tao ti cappia.",
			"38": "<sup>38</sup> Ngem no maipapan cadagiti managlabsing, madadaeldanto a matalipupus: ti tungpal dagiti nadangkes magessatto.",
			"39": "<sup>39</sup> Ngem ti pannacaisalacan dagiti sililinteg biang ni Jehova: isu ti salindegda iti panawen ti ducot.",
			"40": "<sup>40</sup> Ket ni Jehova tulongan, ken ispalenna ida: isu ispalenna ida cadagiti nadangkes, ket isalacanna ida, gapu ta kimmamangda kencuana."
		},
		"38": {
			"1": "<sup>1</sup> O Jehova, dinac cadi babalawen ita pungtotmo; dinac met dusaen ita nabara a lucsawmo.",
			"2": "<sup>2</sup> Ta dagiti panam maipalayda a siiirut caniac, ket ta imam pandagannac a sidadagsen.",
			"3": "<sup>3</sup> Awan ti kinasalun-at iti lasagco gapu ita rurodmo; awan met ti pia a pulos cadagiti tultulangco gapu iti basolco.",
			"4": "<sup>4</sup> Ta dagiti kinakilloc lapunusenda ti uloc: cas nadagsen nga awit nalaus ti bantotda caniac.",
			"5": "<sup>5</sup> Dagiti sugsugatco nacaarariecda ket nagderderda, gapu iti kinamauyongco.",
			"6": "<sup>6</sup> Masnebanac ket maparucobac a napalalo; silaladingitac nga agmalmalem.",
			"7": "<sup>7</sup> Ta dagiti lomoc napnoda iti bara; ket awan ti kinasalun-at iti lasagco.",
			"8": "<sup>8</sup> Mapacapuyac ket nacaro ti pannacairidridco: nagungorac gapu iti di-pannacatalna toy pusoc.",
			"9": "<sup>9</sup> Apo, amin a calicagumco sisasaclang kenca; ket ti panagun-onnoyco saan met a nailinged kenca.",
			"10": "<sup>10</sup> Toy pusoc aggutocgutoc, ket ti pigsac baybay-annac: no maipapan iti lawag dagiti matac, casta met a nagpucaw caniac.",
			"11": "<sup>11</sup> Dagiti caingungot ken gagayyemco cumayacayda itoy didigrac; ket dagiti cacabagiac addada iti adayo.",
			"12": "<sup>12</sup> Dagiti met mangsibsibloc itoy biagco, agipacatda cadagiti sil-silo caniac;  ken dagiti agbirbiroc iti pacadangrarac agsaoda cadagiti agcacaranggas, ket agpanpanunotda nga agmalmalem cadagiti sinicicap.",
			"13": "<sup>13</sup> Ngem sica, cas tuleng a tao, diac denggen; ken arigac la umel a tao a dina ngangaen ti ngiwatna.",
			"14": "<sup>14</sup> Wen, siac arigac la tao a di macangngeg, ken iti ngiwatna awan ti isusuppiat.",
			"15": "<sup>15</sup> Ta sica, O Jehova, ti pagtalcac: sica sumungbatcanto, O Apo a Diosco.",
			"16": "<sup>16</sup> Ta kinunac, Di la ket maminano ta pagragsacandac: no agcaglis ti sacac, isuda pagindadackelandac.",
			"17": "<sup>17</sup> Ta ngannganiac matuang, ket ti ladingitco agnanayon itoy sangoanac.",
			"18": "<sup>18</sup> Ta ipatacconto ti kinakilloc; agladladingitacto gapu iti basolco.",
			"19": "<sup>19</sup> Ngem dagiti cabusorco napartacda, napigsada; ket dagiti gumurgura a di umumno caniac umaduda.",
			"20": "<sup>20</sup> Dagidiay met a subadanda iti dakes ti imbag sibubusorda caniac, gapu ta surotec ti banag a naimbag.",
			"21": "<sup>21</sup> Dinac baybay-an, O Jehova: O Diosco, dica umadayo caniac.",
			"22": "<sup>22</sup> Darasem ti mangarayat caniac, O Apo, a salacanco."
		},
		"39": {
			"1": "<sup>1</sup> Siac kinunac, Annadacto dagiti dalanco, tapno diac macabasol babaen itoy dilac: pacagatacto toy ngiwatco, bayat ti caadda ti nadangkes itoy sangoanac.",
			"2": "<sup>2</sup> Nagumelac a siulimec, nagteppelac, uray pay iti naimbag; ket ti ladingitco nagkibur.",
			"3": "<sup>3</sup> Ti pusoc nagbara ditoy unegco; idi nga agpanpanunotac ti apuy simged; idi a casta nagsaoac babaen itoy dilac:",
			"4": "<sup>4</sup> Jehova, ipacaammom caniac ti tungpalco, ken no ania ti rucod dagiti aldawco, ipacaammom cadi ti nalaus a kinarasic.",
			"5": "<sup>5</sup> Adtoy, inaramidmo dagiti aldawco a cas dinangan; ket ti capaut ti panagbiagco casla awan ita sangoanam: pudno a tunggal tao iti casayaatan a casasaadna biig nga ubbaw. (Selah)",
			"6": "<sup>6</sup> Pudno a tunggal tao magna iti ubbaw a panagpabuya; pudno nga cumalaisegda a barengbareng: aguccon iti kinabacnang, ket dina ammo no siasino ti mangacoyto cadacuada.",
			"7": "<sup>7</sup> Ket ita, Apo, ania ti urayec? Ti inanamac adda kenca.",
			"8": "<sup>8</sup> Ispalennac cadagiti amin a salungasingco: dinac pagbalinen nga umumsien ti maag.",
			"9": "<sup>9</sup> Nagumelac, diac nginanga ti ngiwatco; ta sica inaramidmo.",
			"10": "<sup>10</sup> Yadayom ti danogmo caniac: marunawac iti panagtupac ta imam.",
			"11": "<sup>11</sup> No bagbagaam ti tao gapu iti kinadangkesna, talipupusem ti kinasayaatna a cas iti sanga: pudno nga amin a tao kinaubbaw. (Selah)",
			"12": "<sup>12</sup> Denggem ti cararagco, O Jehova, ket ipangagmo toy ickisco; dica pagulimecan dagitoy luluac: ta siac maysaac a gangannaet kenca, maysa nga agcalcallautang, a cas cadagidi amin a dadackelco.",
			"13": "<sup>13</sup> O pawaywayannac, tapno mapulangac ti pigsac, ita ta diac pay pumusay, ken maawan."
		},
		"40": {
			"1": "<sup>1</sup> Pinaturayco a siaanus ni Jehova; ket inallingagnac, ket nangngegna ti ickisco.",
			"2": "<sup>2</sup> Inaonnac met iti nacaalalinggec nga abut, iti nacalutlutolut a pitac; ket imbatayna dagiti sacsacac iti maysa a bato, ket pinapigsana dagiti addangco.",
			"3": "<sup>3</sup> Ket impaayna ti baro a canta ditoy ngiwatco, wen, pangidaydayaw iti Diostayo: adu dagiti macaimatangto, ken agbuteng, ket agtalecdanto ken Jehova.",
			"4": "<sup>4</sup> Bendito ti tao a pagbalinenna a pagcammatalcanna ni Jehova, ket saanna a pagraeman ti natangsit, casta met dagiti agturong cadagiti ululbod.",
			"5": "<sup>5</sup> Aduda, O Jehova a Diosco, dagiti nacascasdaaw nga ar-aramid nga inaramidmon, ken dagiti panpanunotmo nga agturong cadacami: saan a mabalin nga intarenen iti sangoanam; no palawagec ket saoec coma ida, adaduda ngem ti mabalin a bilangen.",
			"6": "<sup>6</sup> Ti daton ken ti sagut dica pagayayatan; dagiti lapayagco pinaglucatmo: ti daton a puuran ken daton gapu iti basol saanmo a kiniddaw.",
			"7": "<sup>7</sup> Idi a casta kinunac, Adtoy, umayac; iti lucot ti libro adda a naisurat ti maipanggep caniac:",
			"8": "<sup>8</sup> Pagragsacac nga aramiden ti pagayatam, O Diosco; wen, ti lintegmo adda iti uneg ti pusoc.",
			"9": "<sup>9</sup> Imbunannagco dagiti naragsac a damdamag ti kinalinteg iti dackel a tallaong; adtoy, diacto medmedan dagiti bibigco, O Jehova, sica ammom.",
			"10": "<sup>10</sup> Diac inlimed ti kinalintegmo iti uneg toy pusoc; imparangarangco ti kinamatalecmo ken panangisalacanmo; saanco nga inlemmeng ti kinamanagayatmo ken kinapudnom iti dackel a tallaong.",
			"11": "<sup>11</sup> Dica gawidan caniac dagita nadungngo a caasim, O Jehova; salacnibandac cadi a cancanayon ta kinamanagayat ken kinapudnom.",
			"12": "<sup>12</sup> Ta dagiti di mabilang a kinadakes linicmutdac; dagiti kinakilloc inaddagandac, iti uray la a diac macatungangaw; adaduda ngem dagiti booc ti uloc; ket ti pusoc nagpucaw caniac.",
			"13": "<sup>13</sup> Maayayoca cadi, O Jehova, a mangispal caniac: darasennac a saranayen, O Jehova.",
			"14": "<sup>14</sup> Mababainanda ken mariruda cadi a padapada dagiti manurotsurot itoy cararwac tapno dadaelenda: mapagsanudda cadi ken maibabain dagiti agayat iti pacaranggasac.",
			"15": "<sup>15</sup> Agmalmalangada cadi gapu iti pannacabainda dagiti agcuna caniac, Aja, aja.",
			"16": "<sup>16</sup> Amin dagiti mangbiroc kenca agrag-o ken maragsacanda cadi kenca: dagiti agayat iti panangisalacanmo cunada cadi a cancanayon, ni Jehova maipangrona coma.",
			"17": "<sup>17</sup> Ngem siac nacacaasiac ket macurcuranganac; nupay casta  ti Apo sipapanunot caniac: sica ti saranayco ken mangispal caniac; dica agbayag, O Diosco."
		},
		"41": {
			"1": "<sup>1</sup> Bendito ti mangimatang iti napanglaw: ni Jehova ispalennanto intono aldaw ti dakes.",
			"2": "<sup>2</sup> Ni Jehova salacnibannanto ket taripatoennanto a sibibiag, ket benditonto ditoy rabaw ti daga; ket dicanto cadi iyawat iti pagayatan dagiti cabusorna.",
			"3": "<sup>3</sup> Ni Jehova sumaranayto kencuana iti idda a nacaidalitan: sica tarimaanem amin nga iddana iti panagsakitna.",
			"4": "<sup>4</sup> Kinunac, O Jehova, caasiannac: papiaem ti cararwac; ta nagbasolac kenca.",
			"5": "<sup>5</sup> Dagiti cabusorco, pagsasaoandac iti dakes, a cunada, caanonto ti ipapatayna, ken pannacapucaw ti naganna?",
			"6": "<sup>6</sup> Ket no umaynac kitaen, agsao iti ulbod; ti pusona aguccon iti kinakillo kencuana met laeng: no macaruaren, isaonan.",
			"7": "<sup>7</sup> Amin a gumurgura caniac agarasaasda iti maibusor caniac; panpanemnemenda ti pacadangranac.",
			"8": "<sup>8</sup> Dakes a sakit, cunada, ti sicacapet kencuana; ket ita ta immidda saanto a bumangonen.",
			"9": "<sup>9</sup> Wen, ti pay caingongotco unay a gayyem, a nagtalcac, isu a nakicaan iti canec, incugtarna ti mucodna caniac.",
			"10": "<sup>10</sup> Ngem sica, O Jehova, caasiannac, ket batakennac, tapno mabalesco ida.",
			"11": "<sup>11</sup> Gapu itoy ammoc a sica pagay-ayatannac, gapu ta ti cabusorco saan nga agballigi caniac.",
			"12": "<sup>12</sup> Ket no maipanggep caniac, sica bitibitennac iti kinaimbagco, ket icabilnac iti sangoanam iti agnanayon.",
			"13": "<sup>13</sup> Bendito coma ni Jehova, a Dios ti Israel, manipud kinaagnanayon inggana iti kinaagnanayon. Sapay coma, ket sapay coma ta casta."
		},
		"42": {
			"1": "<sup>1</sup> Cas panagal-al ti ugsa a mawaw cadagiti baresbes a dandanum, casta ti panagal-al toy cararwac a mawaw kenca, O Dios.",
			"2": "<sup>2</sup> Toy cararwac mawaw iti Dios, iti sibibiag a Dios: caano ti idadatengconto a dumatag iti saclang ti Dios?",
			"3": "<sup>3</sup> Dagiti luluac isuda dagiti taraonco iti aldaw ken rabii, idinto a cancanayon laeng a cuncunada caniac, Ayannan ti Diosmo?",
			"4": "<sup>4</sup> Dagitoy a banbanag malagipco, ket maibuyat toy cararwac itoy unegco, no casano daydi ipapanco agraman sangabunggoyan, ket intulodco ida iti balay ti Dios, agraman timec ti ragsac ken panangidaydayaw, umariwecwec a ramrambacanda ti aldaw a nasantoan.",
			"5": "<sup>5</sup> Apay a mapasagca man, O cararwac? Ken apay maringgoranca man iti unegco? Mangnamnamaca iti Dios; ta idaydayawco pay gapu iti tulong ti langana.",
			"6": "<sup>6</sup> O Diosco, ti cararwac sipapasag itoy unegco: anansata lagipenca manipud iti daga ti Jordan, ken cadagiti Hermonitas, manipud iti turod a Mizar.",
			"7": "<sup>7</sup> Ti yuyeng ayabanna ti sabali a yuyeng iti panagdaranudor dagiti dissourmo: amin dagiti daldalluyonmo ken dagiti palongmo naglasatda iti rabawco.",
			"8": "<sup>8</sup> Ngem ni Jehova baonennanto ti kinamanagayatna iti bayat ti aldaw; ket iti rabii ti cantana addanto caniac, ken cararag pay iti Dios ti biagco.",
			"9": "<sup>9</sup> Cunacto iti Dios a batoc, Apay a linipatannac? Apay a magmagnaac a silaladingit gapu iti panangidadanes ti cabusor?",
			"10": "<sup>10</sup> Cas la campilan cadagitoy tultulangco, dagiti cabusorco umumsiendac, sada pay cuncuna a canayon caniac, ayannan ti Diosmo?",
			"11": "<sup>11</sup> Apay a mapasagca man, O cararwac? Apay a maringgoranca man iti unegco? Manginanamaca iti Dios; ta idaydayawconto pay, isu a tulong ti langac, ken Diosco."
		},
		"43": {
			"1": "<sup>1</sup> Ocomennac, O Dios, ket irisirismo ti calintegac iti maysa a nacion a saan a mangicascaso iti Dios: O ispalennac iti manangirubo ken nakillo a tao.",
			"2": "<sup>2</sup> Ta sica ti Dios ti pigsac; apay nga inwagsacnac man? Apay a magmagnaac a silaladingit gapu iti panangidadanes ti cabusor?",
			"3": "<sup>3</sup> O ibaonmo ti silawmo ken kinapudnom; isuda cadi ti mangiturong caniac: iturongdac cadi ita nasantoan a turodmo, ken cadagiti tabernaculom.",
			"4": "<sup>4</sup> Iti casta innacto iti altar ti Dios, iti Dios a mangnibinibi a rag-oc; ket harpaecto ti panangidayawco kenca, O Dios, Diosco.",
			"5": "<sup>5</sup> Apay a mapasagca man, O cararwac? Ken apay a maringgoranca man iti unegco? Manginamnamaca iti Dios; ta idaydayawconto pay, isu a tulong ti langac, ken Diosco."
		},
		"44": {
			"1": "<sup>1</sup> Nangngegmi babaen cadagiti lapayagmi, O Dios, dagiti dadackelmi imbagada cadacami, no ania ti aramid nga inaramidmo cadagiti al-aldawda, cadagiti al-aldaw idi ununana.",
			"2": "<sup>2</sup> Sica pinacsiatmo babaen ita imam dagiti nasnacion; ngem isuda insaadmo ida: sica pinagladingitmo dagiti il-ili; ngem isuda pinagwarasmo ida.",
			"3": "<sup>3</sup> Ta saanda a naala a tagicuaen ti daga gapu ti campilanda met laeng, saan met nga ti tackiagda met laeng ti nangisalacan cadacuada; no di ket ta canawan nga iman, ken tackiagmo, ken ti lawag ta langam, gapu ta sipaparaburca idi cadacuada.",
			"4": "<sup>4</sup> Sica ti Aric, O Dios: ibilinmo ti pannacasalacnib ni Jacob.",
			"5": "<sup>5</sup> Gapu kenca maidaramudomminto dagiti cabusormi: gapu iti naganmo maibaddecminto dagiti umalsa a bumusor cadacami.",
			"6": "<sup>6</sup> Ta diacto agtalec iti baic, saan met a ti campilanco ti mangisalacanto caniac.",
			"7": "<sup>7</sup> Ngem sica ti nangisalacan cadacami cadagiti cabcabusormi, ket imbabainmo dagiti manggurgura cadacami.",
			"8": "<sup>8</sup> Babaen iti Dios nagpaspasindayawcami a nagmalmalem, ket itdenminto ti panagyaman ita naganmo iti agnanayon. (Selah)",
			"9": "<sup>9</sup> Ngem ita sica impuruacnacami ken impannacami iti pannacaibabain, ket saanca a cumuyogen cadagiti buybuyotmi.",
			"10": "<sup>10</sup> Sica pinagsanudnacami iti cabusor; ket dagiti manggurgura cadacami agsamsamda.",
			"11": "<sup>11</sup> Sica pinagbalinnacami a cas carnero a naisagana a masida, ket inwarasnacami cadagiti nasnacion.",
			"12": "<sup>12</sup> Ilacom ti ilim nga awan bayadna, ket saanmo a pinaadu ti sanicuam gapu iti pategda.",
			"13": "<sup>13</sup> Sica pagbalinennacami a pacaumsian dagiti caarrubami, malalais ken macatcatawaan cadagiti makidindinna cadacami.",
			"14": "<sup>14</sup> Sica pagbalinennacami a taltalanggutangen dagiti nasnacion, ngilngilangilan dagiti tattao.",
			"15": "<sup>15</sup> Agmalmalem a ti pannacaibabainco adda ditoy sangoanac, ket ti bain ti rupac binungonnac,",
			"16": "<sup>16</sup> Gapu iti timec ti mangab-abi ken agbasbassawang, gapu iti cabusor ken iti mangbales.",
			"17": "<sup>17</sup> Amin daytoy agdissoor cadacami, nupay casta dacami saandaca a linipatan, saancami met a naggulib iti tulagmo.",
			"18": "<sup>18</sup> Ti pusomi saan a limmicud, saanmi met nga inlagisi dagiti ad-addangmi iti dalanmo,",
			"19": "<sup>19</sup> Rinebbanacami a nasakit unay iti yan dagiti as-aso nga atap, ken inabongotannacami iti aniniwan ni patay.",
			"20": "<sup>20</sup> No linipatanmi coma ti nagan ti Diosmi, wenno inyunnatmi coma dagiti imami iti sabali a dios;",
			"21": "<sup>21</sup> Dinto met la salaysayen coma ti Dios daytoy? Ta isu ammona dagiti palimed ti puso.",
			"22": "<sup>22</sup> Wen, ta gapu kenca mapapataycami nga agmalmalem; maibilangcami a cas cadagiti carcarnero a maipaay iti pagpartian.",
			"23": "<sup>23</sup> Agriingca, apay a maturogca, O Apo? Bumangonca, dinacami ipuruac a cancanayon.",
			"24": "<sup>24</sup> Apay nga ilingedmo ta rupam, ket lipatem ti panagleddaang ken pannacairurumenmi?",
			"25": "<sup>25</sup> Ta ti cararwami naimameg inggana iti tapuc: ti bagimi cumebkeb iti daga.",
			"26": "<sup>26</sup> Bumangonca cadi a saranaymi, ket subbotennacami gapu iti kinamanagayatmo."
		},
		"45": {
			"1": "<sup>1</sup> Ti pusoc aglippias iti naimbag a banag; saoec dagiti banbanag a naaramidco maipanggep iti Ari: ti dilac isu ti pluma ti maysa a nalaing a mannurat.",
			"2": "<sup>2</sup> Nasaysayaatca ngem dagiti annac dagiti tattao; ti gracia naibuyat cadagiti bibigmo: Anansata ti Dios binendicionannaca nga agnanayon.",
			"3": "<sup>3</sup> Ibarikesmo ta campilanmo ita lupom, O mannacabalin, ti dayag ken ti tan-ocmo.",
			"4": "<sup>4</sup> Ket iti tan-ocmo agsacayca a sirarangay, gapu iti pudno ken kinaemma ken kinalinteg; ket ta macanawanmo isuronanto kenca dagiti nacaalalinggec a banbanag.",
			"5": "<sup>5</sup> Dagiti panpanam natiradda; dagiti nasnacion matuangda iti babaem; addada iti puso dagiti cabcabusor ti ari.",
			"6": "<sup>6</sup> Ti tronom, O Dios, agnanayon nga awan inggana: cetro ti kinalinteg ti cetro ti pagariam.",
			"7": "<sup>7</sup> Inayatmo ti kinalinteg, ket ginuram ti kinadangkes: gapuna ti Dios, ti Diosmo, sinapsapoannaca iti lana ti kinaragsac a nangnangrona ngem dagiti caduam.",
			"8": "<sup>8</sup> Amin dagiti cawesmo agammirra, ken agassandalo, ken agacacasia; manipud cadagiti palacio a marfil dagiti kinuerdasan a pagtocaran pinagragsacdaca.",
			"9": "<sup>9</sup> Dagiti annac a babbai dagiti ar-ari addada iti nagtengngaan dagiti natan-oc a bonggoymo a babbai: dita macanawanmo agtatacder ti reina a naarcosan iti balitoc iti Ofir.",
			"10": "<sup>10</sup> Denggem, O anac a babai, ket ututobem, ket yallingagmo ta lapayagmo; lipatem met ti ilim, ket ti balay ni amam:",
			"11": "<sup>11</sup> Iti casta ti ari esmannanto ta imnasmo; ta isu ti agturaymo, ket pagraemam.",
			"12": "<sup>12</sup> Ket ti anac a babai ti Tiro addanto idiay agraman sagut; dagiti nabacnang cadagiti umili agpacpacaasidanto ita paraburmo.",
			"13": "<sup>13</sup> Ti anac a babai ti ari idiay laem ti palacio sidadaeg nga awan pagcuranganna: ti pagan-anayna napattopattocan iti balitoc.",
			"14": "<sup>14</sup> Isu maitulodto agraman binordaan a cawesna iti Ari: dagiti babbalasang a caduana a sumursurot kencuana, mayegdanto kenca.",
			"15": "<sup>15</sup> Babaen iti rag-o ken panagragsac maituloddanto: sumrecdanto iti palacio ti Ari.",
			"16": "<sup>16</sup> Maisandi cadagiti dadackelmo dagitinto annacmo, isuda a pagbalinemto a piprincipe iti amin a daga.",
			"17": "<sup>17</sup> Pagbalinecto ti naganmo malaglagip cadagiti amin a capcaputotan: anansata dagiti tattao agyamandanto kenca nga agnanayon awan inggana."
		},
		"46": {
			"1": "<sup>1</sup> Ti Dios isu ti amang ken bilegtayo, sisisibay unay a saranay iti panagducot.",
			"2": "<sup>2</sup> Anansata ditayto agbuteng, agpapan pay agbaliw ti daga, ken agpapan pay dagiti banbantay aggagabsuonda iti tucoc dagiti baybay:",
			"3": "<sup>3</sup> Uray pay dagiti dandanumda agungor ken makiburda, uray pay dagiti banbantay agpigergerda gapu iti idadackelda. (Selah)",
			"4": "<sup>4</sup> Adda maysa a carayan a dagiti ayusna paragsakenda ti ili ti Dios, ti nasantoan a yan dagiti tabernaculo ti Cangatoan.",
			"5": "<sup>5</sup> Ti Dios adda iti tengnga ti ili; ti ili saanto a maalis: ti Dios tulongannanto, ket dayta mabiit unay.",
			"6": "<sup>6</sup> Dagiti nasnacion nagkiburda, dagiti pagpagarian nariribucda: inyesngawna ti timecna, ti daga nalunag.",
			"7": "<sup>7</sup> Ni Jehova dagiti buybuyot adda cadatayo; ti Dios ni Jacob isu ti amangtayo. (Selah)",
			"8": "<sup>8</sup> Umaycayo, imatanganyo dagiti ar-aramid ni Jehova, no ania dagiti panangdadael nga inaramidna ditoy daga.",
			"9": "<sup>9</sup> Pagsardengenna dagiti gubgubat inggana iti ungto ti daga; rungrungdoenna ti bai ti pana, ket gupdenna a maminpinsan ti gayang; puuranna dagiti luglugan iti apuy.",
			"10": "<sup>10</sup> Agtalnacayo, ket ammoenyo a siac ti Dios: maitan-ocacto cadagiti nasnacion, maitan-ocacto ditoy daga.",
			"11": "<sup>11</sup> Ni Jehova dagiti buybuyot adda cadatayo; ti Dios ni Jacob isu ti amangtayo. (Selah)"
		},
		"47": {
			"1": "<sup>1</sup> O agsipatcayo, dacayo amin nga umili; agpuccawcayo iti Dios iti timec ti panagballigi.",
			"2": "<sup>2</sup> Ta ni Jehova a Cangatoan nacakigkigtot; isu ti naidaclan nga Ari iti amin a daga.",
			"3": "<sup>3</sup> Isu parucmaenna dagiti il-ili iti babaentayo, ken dagiti nasnacion iti baba dagiti dapdapantayo.",
			"4": "<sup>4</sup> Isu ipiliannatayo iti tawidentayo, iti dayaw ni Jacob nga inayayatna. (Selah)",
			"5": "<sup>5</sup> Ti Dios ngimmato a naipucpuccaw, ni Jehova a napacuyogan iti aweng ti trompeta.",
			"6": "<sup>6</sup> Cantaenyo dagiti panangidaydayaw iti Dios, cantaenyo dagiti panangidaydayaw: cantaenyo dagiti panangidaydayaw iti Aritayo, cantaenyo dagiti panangidaydayaw.",
			"7": "<sup>7</sup> Ta ti Dios isu ti Ari ti amin a daga: cantaenyo dagiti panangidaydayaw a maawatanyo.",
			"8": "<sup>8</sup> Ti Dios iturayanna dagiti nasnacion: ti Dios agtugaw iti nasantoan a tronona.",
			"9": "<sup>9</sup> Dagiti piprincipe dagiti il-ili agtitiponda tapno isuda dagiti tattao ti Dios ni Abraham; ta dagiti calasag ti daga cucua ida ti Dios; isu maitanoc unay."
		},
		"48": {
			"1": "<sup>1</sup> Dackel ni Jehova, ket maicari a maidaydayaw unay, iti uneg ili ti Diostayo, iti nasantoan a bantayna.",
			"2": "<sup>2</sup> Naimnas ti kinatayagna, ragsac ti amin a daga, ti bantay a Sion, iti bangir ti amianan, ti ciudad ti dackel nga Ari.",
			"3": "<sup>3</sup> Ti Dios nagpacaammo cadagiti palaciona a maipaay a pagcamangan.",
			"4": "<sup>4</sup> Ta, ni, dagiti ar-ari naggigimongda, naglabasda a sangsangcatimpuyog.",
			"5": "<sup>5</sup> Nakitada, idi a casta nasdaawda; nagkigtotda nagpanawda a nagdagdagus.",
			"6": "<sup>6</sup> Ti tayegteg kinapetna ida sadiay ti ut-ut, a cas iti maysa a babai nga agpasical.",
			"7": "<sup>7</sup> Babaen ti casaor burakem dagiti sasacayan ti Tarsis.",
			"8": "<sup>8</sup> Cas nangngegmi, casta ti nakitami, Iti ili ni Jehova dagiti buybuyot, iti ili ti Diostayo: ti Dios pasingkedannanto nga agnanayon. (Selah)",
			"9": "<sup>9</sup> Pinanpanunotmi ti kinamanagayatmo, O Dios, iti tengnga ti templom.",
			"10": "<sup>10</sup> Cas iti naganmo, O Dios, casta ti pannacadaydayawmo agingga cadagiti pungto ti daga: ta canawan nga imam napno iti kinalinteg.",
			"11": "<sup>11</sup> Maragsacan cadi ti bantay Sion, agragsac cadi dagiti babbalasang ti Juda, gapu cadagiti pangngeddengmo.",
			"12": "<sup>12</sup> Sumibsibayca iti Sion, ket licmutem ti ararubayanna; bilangem dagiti baluartena:",
			"13": "<sup>13</sup> Bigbigem dagiti natibker a bacudna; utobem dagiti palaciona: tapno mabalinmo nga ibaga iti sumaruno a caputotan.",
			"14": "<sup>14</sup> Ta daytoy a Dios isu ti Diostayo iti agnanayon awan inggana: isu ti mangiturongto cadatayo uray inggana iti patay."
		},
		"49": {
			"1": "<sup>1</sup> Ipangagyo daytoy, dacayo amin nga il-ili; dumngegcayo, dacayo amin nga agnaed itoy lubong,",
			"2": "<sup>2</sup> Nababa man ken nangato, nabacnang ken napanglaw agpapadada amin.",
			"3": "<sup>3</sup> Ti ngiwatco agsaonto iti kinasirib, ket ti panpanunot toy pusoc addanto ti pannacaawat.",
			"4": "<sup>4</sup> Yallingagconto ti lapayagco iti maysa a pangarigan: ibatadconto ti nasipnget a saoc iti arpa.",
			"5": "<sup>5</sup> Ania ti pagbutngacto cadagiti alaldaw ti dakes, intono ti kinadangkes cadagitoy mucodco saligsaligennac?",
			"6": "<sup>6</sup> Dagiti agtalec iti kinabacnangda, ket pagpasindayagda ti caadu dagiti sanicuada;",
			"7": "<sup>7</sup> Awan cadacuada ti macabalin babaen iti ania man a pamuspusan a manubbot iti cabsatna, ken mangted man iti Dios iti supapacna.",
			"8": "<sup>8</sup> (Ta ti pannacasubbot ti biagda nangina, ket saan a magawidan),",
			"9": "<sup>9</sup> Tapno agbiag coma laeng nga agnanayon, a dina coma makita ti pannacarupsa.",
			"10": "<sup>10</sup> Ta isu makitananto. Dagiti masirib a tao matayda; ti maag ken ti nacuneng mapucawda a padapada, ket ibatida ti sanicuada cadagiti sabsabali.",
			"11": "<sup>11</sup> Panunutenda iti unegda a dagiti balbalayda agnanayonda ket dagiti yan a pagtataenganda inggana cadagiti amin a caputotan; impanaganda cadagiti dagdagada dagiti nagnaganda met laeng.",
			"12": "<sup>12</sup> Ngem ti tao saan nga agtaeng iti kinadayaw: capadana dagiti animal a mapucaw.",
			"13": "<sup>13</sup> Daytoy a dalanda isu ti kinamaagda: nupay casta iti calpasanda dagiti tattao anamonganda dagiti sasaoda. (Selah)",
			"14": "<sup>14</sup> Casda la arban a naipato ken Tanem; ni patay isunto ti mangipaarab cadacuada: ket ti nalinteg addanto panagturayna cadacuada no bumigat; ket ti sayaatda runrunotento ni Tanem, tapno awan ti pagyanan a maipaay kencuana.",
			"15": "<sup>15</sup> Ngem ti Dios subbotennanto ti cararwac iti pannacabalin ni Tanem; ta isu awatennacto. (Selah)",
			"16": "<sup>16</sup> Dica agbuteng no adda bumacnang, no ti dayag ti balayna dumackel:",
			"17": "<sup>17</sup> Ta intono matay awanto ti maipanawna; ti dayagna dinto bumaba a sumurot kencuana.",
			"18": "<sup>18</sup> Uray pay iti bayat ti panagbiagna binenditona ti cararwana, (ken dagiti tattao idaydayawdaca, no agaramidca iti naimbag kenca met laeng),",
			"19": "<sup>19</sup> Mapanto laeng iti caputotan dagiti dadackelna; didanto makita uray caano man ti lawag.",
			"20": "<sup>20</sup> Ti tao a madaydayaw, ket saan a macaawat, cas cadagiti an-animal a mapucaw."
		},
		"50": {
			"1": "<sup>1</sup> Ti Mannacabalin, ti Dios, ni Jehova, nagsaon, ket inawaganna ti daga manipud iti leleggacan ti init agingga iti lelennecanna.",
			"2": "<sup>2</sup> Manipud Sion, ti awan pagcuranganna iti kinaimnas, ti Dios nagraniagen.",
			"3": "<sup>3</sup> Ti Diostayo umay, ket saan nga agulimec: adda apuy a mangrunaw iti sangoananna, ket iti sibayna aglicmut ti casta unay a bagio.",
			"4": "<sup>4</sup> Awaganna dagiti langlangit sadi ngato, ken ti daga, tapno ocomenna coma ti ilina:",
			"5": "<sup>5</sup> Urnongenyo dagiti sasantosco a maitipon caniac, dagiti nakitulag caniac gapu iti panagdaton.",
			"6": "<sup>6</sup> Ket dagiti langlangit ipalawagdanto ti kinalintegna; ta ti Dios isu ti ocom met laeng. (Selah)",
			"7": "<sup>7</sup> Dumngegca, O ilic, ket agsaoacto; O Israel, ket agsacsiacto kenca: siac ti Dios, Diosmo met laeng.",
			"8": "<sup>8</sup> Saancanto a babalawen gapu cadagiti datonmo; ken dagiti datonmo a mapuuran addada a cancanayon ditoy sangoanac.",
			"9": "<sup>9</sup> Diacto awaten ti bumaro a vaca iti balaymo, uray met cadagiti calding a lallaki cadagiti corralmo.",
			"10": "<sup>10</sup> Ta tunggal animal ti cabakiran cucuac, ken dagiti arban iti tapaw dagiti rinibu a turturod.",
			"11": "<sup>11</sup> Ammoc amin dagiti tumatayab cadagiti banbantay; ken dagiti atap nga an-animal ti away cucuac.",
			"12": "<sup>12</sup> No comano mabisinac, saanco nga ibaga kenca; ta ti lubong cucuac, ken amin nga adda kencuana.",
			"13": "<sup>13</sup> Agsidaacto aya iti lasag ti vaca, wenno uminum iti dara dagiti calding?",
			"14": "<sup>14</sup> Isagutmo iti Dios ti daton ti panagyaman; ket bayadam dagiti incarim iti Cangatoan;",
			"15": "<sup>15</sup> Ket awagannac iti aldaw ti pacadanagan: ispalencanto, ket sica idaydayawnacto.",
			"16": "<sup>16</sup> Ngem cadagiti nadangkes ti Dios cunana, ania ti rebbengmo nga aramiden a pangiparangarangmo cadagiti pagal-alagadac, ken iti panangawatmo iti pannakitulagco ita ngiwatmo,",
			"17": "<sup>17</sup> Idinto a carurodmo ti pannursuroc, ken ipalladawmo ita licudam dagiti sasaoc?",
			"18": "<sup>18</sup> Idi nakitam ti maysa a mannanacaw, nakitimpuyogca kencuana, ken nakiramanca cadagiti nakiabig iti dida asawa.",
			"19": "<sup>19</sup> Sica ipaaymo ta ngiwatmo iti gulib.",
			"20": "<sup>20</sup> Agtugawca ket agsaoca a maibusor iti cabsatmo; padpadacsem ti anac ni inam met laeng.",
			"21": "<sup>21</sup> Inaramidmo dagitoy a banbanag, ket nagulimecac; ipatpatomon a siac maysaac a cas kenca met laeng; ngem  babalawencanto, ket icabilconto ida nga agiintar iti sango dagiti matam.",
			"22": "<sup>22</sup> Ita utobenyo daytoy, dacayo a manglipat iti Dios, di la ket ta pirgisencayo, ket awan ti mangispal:",
			"23": "<sup>23</sup> Siasino man a mangisagut iti daton ti panagyaman padayawannac; ket daydiay manarimaan iti dalanna iparangconto kencuana ti panangisalacan ti Dios."
		},
		"51": {
			"1": "<sup>1</sup> Caasiannac, O Dios, cas mayannurot iti kinamanagayatmo: cas mayannurot iti caruay dagiti nasnecan a caasim punasem dagiti kinasalungasingco.",
			"2": "<sup>2</sup> Buggoannac iti amin a kinadakesco, ket ugasannac iti basolco.",
			"3": "<sup>3</sup> Ta ammoc dagiti salungasingco; ket ti basolco canayon nga adda ditoy sangoanac.",
			"4": "<sup>4</sup> Sica, sica laeng, ti nacabasolac, ken nacaaramidac iti dackes iti sangoanam; ta maipakita ti kinalintegmo no agsaoca, ken agraniagca no agipatoca.",
			"5": "<sup>5</sup> Adtoy a nayanacac iti kinadakes; ket iti basol impasngaynac ni inac.",
			"6": "<sup>6</sup> Adtoy a tarigagayam ti kinapudno cadagiti caungan a paspaset; ket iti caunegan a paset ipacaammomto caniac ti kinasirib.",
			"7": "<sup>7</sup> Dalusannac babaen iti hisopo, ket dumalusacto, buggoannac, ket napudpudawacto ngem nieve.",
			"8": "<sup>8</sup> Ipangngegmo caniac ti rag-o ken panagayayat, tapno dagiti tultulang a binungbungtolmo maragsacanda.",
			"9": "<sup>9</sup> Ilingedmo ta rupam cadagiti basbasolco, ket punasem dagiti amin a kinadakesco.",
			"10": "<sup>10</sup> Parsuaem caniac ti nadalus a puso, O Dios; ket pabaroem ti maysa a nalinteg nga espiritu itoy unegco.",
			"11": "<sup>11</sup> Dinac pagtalawen dita saclangmo; ket dica iccaten caniac ti nasantoan nga espiritum.",
			"12": "<sup>12</sup> Isublim caniac ti ragsac ti panangisalacanmo; ken sarapaennac iti naayat nga espiritu.",
			"13": "<sup>13</sup> Iti casta isurocto cadagiti managlabsing dagiti daldalanmo; ket dagiti managbasol agsublidanto kenca.",
			"14": "<sup>14</sup> Ispalennac iti pannacabasol ti panangpapatay, O Dios, sica a Dios ti pannacaisalacanco; ket ti dilac icantananto a napigsa ti kinalintegmo.",
			"15": "<sup>15</sup> O Apo, luctam dagiti bibigco; ket ti ngiwatco iparangarangnanto ti pannacaidaydayawmo.",
			"16": "<sup>16</sup> Ta saanca a maayayo iti sacrificio; ta no saan a casta itdec coma: saanmo a pagayayatan ti pinuuran a sagut.",
			"17": "<sup>17</sup> Dagiti sacrificio a maipaay iti Dios isu ti espiritu a nadudog; ti nadudog ken sibabawi a puso, O Dios, saanmonto a laisen.",
			"18": "<sup>18</sup> Ipaayam iti imbag ita naimbag a nakemmo iti Sion: Bangonem dagiti bacbacud ti Jerusalem.",
			"19": "<sup>19</sup> Iti casta maayayocanto cadagiti sacrificio ti kinalinteg, iti pinuuran a sagut ken iti sagut a maipuur a sibubukel; iti casta agidatondanto cadagiti bumaro a vacvaca iti rabaw ti altarmo."
		},
		"52": {
			"1": "<sup>1</sup> Apay a pagpasindayagmo man ti kinaulpit, O mannacabalin a tao? Ti kinamanagayat ti Dios agnanayon.",
			"2": "<sup>2</sup> Ta dilam balinbalinenna ti napalalo a kinadakes, cas natadem a navajas, a manggulgulib.",
			"3": "<sup>3</sup> Adadda a pagayatam ti dakes ngem ti imbag, ken ti panagulbod ngem ti panagsaom iti kinalinteg. (Selah)",
			"4": "<sup>4</sup> Pagayatam amin dagiti mangalun-on a sao, O sica naulbud a dila.",
			"5": "<sup>5</sup> Ti Dios dadaelennacanto met nga agnanayon; pidutennacanto, ket gabutennacanto dita toldam, ket parotennacanto iti daga dagiti sibibiag. (Selah)",
			"6": "<sup>6</sup> Dagiti sililinteg makitadanto met, ken agamesdanto, ket catawaandanto, a cuncunada,",
			"7": "<sup>7</sup> Ni, daytoy isu ti tao a dina pinagbalin ti Dios a pigsana, ngem nagtalec ketdi iti caadu dagiti kinabacnangna, ken pinagbilbilegna ti bagina iti kinadangkesna.",
			"8": "<sup>8</sup> Ngem no siac, arigac la maysa a nalangto nga oliva iti balay ti Dios: agtalecac iti kinamanagayat ti Dios nga agnanayon.",
			"9": "<sup>9</sup> Itdecto kenca dagiti panagyaman iti agnanayon, ta sica ti nangaramid; ket manginanamaacto iti naganmo, ta isu ti naimbag, iti saclang dagiti sasantosmo."
		},
		"53": {
			"1": "<sup>1</sup> Ti maag kinunana iti pusona, Awan Dios. Nadadaelda, ken nagaramidda iti nacarurrurud a kinadakes; awan uray maysa nga agaramid iti naimbag.",
			"2": "<sup>2</sup> Ti Dios tinan-awanna manipud sadi langit dagiti annac dagiti tattao, tapno kitaenna no adda maysa a nacapanunot, a nangbiroc iti Dios.",
			"3": "<sup>3</sup> Tunggal maysa cadacuada timmallicud; padapadada a nagbalin a narugit; awan agaramid iti naimbag, awan, uray maysa.",
			"4": "<sup>4</sup> Dagiti managaramid iti dakes awan aya ti isipda, a lamutenda ti ilic a cas panaglamutda iti canen, ket dida awagan ti Dios?",
			"5": "<sup>5</sup> Addada a sibubuteng uray idiay awan cabuteng; ta ti Dios inwarsiwarsina dagiti tultulang ti sipapacarso a bumusor kenca: sica imbabainmo ida, gapu ta ti Dios pinaayna ida.",
			"6": "<sup>6</sup> O sapay ta ti pannacaisalacan ti Israel nagparang coma manipud iti Sion! No ti Dios subbotenna ti pannacacayaw ti ilina, Iti casta ni Jacob agragragsacto, ket ti Israel agrag-onto."
		},
		"54": {
			"1": "<sup>1</sup> Isalacannac, O Dios, gapu ita naganmo, ket ocomennac ita pannacabalinmo.",
			"2": "<sup>2</sup> Denggem ti cararagco, O Dios; allingagem dagiti balbalicas ti ngiwatco.",
			"3": "<sup>3</sup> Ta dagiti gangannaet bimmangonda a bumusor caniac, ket dagiti naranggas a tatao binirbirocda toy cararwac: saanda nga insaad ti Dios iti sangoananda. (Selah)",
			"4": "<sup>4</sup> Adtoy, ti Dios isu ti catulungac: ti Apo makicuyog cadagiti manaranay itoy cararwac.",
			"5": "<sup>5</sup> Pagcallatikennanto ti dakes cadagiti cabcabusorco: racrakem ida iti kinapudnom.",
			"6": "<sup>6</sup> Iti sibubulos a nakem a panangisagut agidatonacto iti sacrificio kenca: agyamanacto iti naganmo, O Jehova, ta naimbag.",
			"7": "<sup>7</sup> Ta inispalnac iti amin a pagducotan; ket ti matac nakitanan ti calicagumac a maipaay cadagiti cabusorco."
		},
		"55": {
			"1": "<sup>1</sup> Ipangagmo toy cararagco, O Dios; ket dica ilingedan toy ararawco.",
			"2": "<sup>2</sup> Imdengannac, ket sungbatannac: Diac macainana iti asasugco, ket agsasainnecac,",
			"3": "<sup>3</sup> Gapu iti timec ti cabusor, gapu iti panangilupit dagiti nadangkes; ta agipalladawda iti kinadakes caniac, ket iti pungtotda idadanesdac.",
			"4": "<sup>4</sup> Ti pusoc matuocan a siuut-ut itoy unegco: ket dagiti al-aliaw ni patay agpasagda caniac.",
			"5": "<sup>5</sup> Ti aligaget ken tayegteg nagdissuorda caniac, ket ti pannacaaliaw inaddagannac.",
			"6": "<sup>6</sup> Ket kinunac, O no adda coma payacco a cas maysa a calapati! Iti casta tumayabac coma nga umadayo, ket aginanaac.",
			"7": "<sup>7</sup> Ket iti casta agcalcalautangac coma iti adayo, agtaengac coma iti casamecan. (Selah)",
			"8": "<sup>8</sup> Agpartacac coma nga aglemmeng iti maysa a pagsalingdan iti umalipugpug nga angin ken bagio.",
			"9": "<sup>9</sup> Dadaelem, O Apo, pisiem ti dilada; ta nakitac ti kinadamsac ken ringgor iti ili.",
			"10": "<sup>10</sup> Aldaw ken rabii agibawibawda kencuana iti rabaw dagiti bacudna: ti met kinadakes ken ti ranggas addada iti tengngana.",
			"11": "<sup>11</sup> Ti kinadakes adda iti tengngana: panangilupit ken panangiculbo saanda a pumanaw cadagiti lanlansanganna.",
			"12": "<sup>12</sup> Ta saan a cabusor ti nangab-abi caniac; ta no saan a casta naibturac coma: saan met a ti nanggurgura caniac a nagindadackel a bumusor caniac; ta no saan a casta naglemmengac coma:",
			"13": "<sup>13</sup> Ngem sica, tao a capadpadac, Caduac ken capalpalaloac a gayyem.",
			"14": "<sup>14</sup> Nagbinnalacadta iti nasamit a patigmaan; nagnata iti balay ti Dios agraman ti caaduan.",
			"15": "<sup>15</sup> Ni patay abutenna coma ida a pettat, lumnedda coma a sibibiag iti Tanem; ta ti kinadangkes adda iti pagnaedanda, iti unegda.",
			"16": "<sup>16</sup> No maipapan caniac, siac umawagacto iti Dios; ket ni Jehova isalacannacto.",
			"17": "<sup>17</sup> Malem, ken bigat, ken iti tengnga ti aldaw, agasugacto, ken agsainnecac; ket denggennanto ti timecco.",
			"18": "<sup>18</sup> Sinubbotna a sitatalna toy cararwac iti gubat a maibusor caniac; ta aduda dagidiay nakisalisal caniac.",
			"19": "<sup>19</sup> Ti Dios mangegnanto, ket sungbatannanto ida, ti met laeng agtaeng manipud ugma, (Selah) Dagiti tattao a dida agbaliw, ken dida agbuteng iti Dios.",
			"20": "<sup>20</sup> Inlayatna dagiti im-imana a bumusor cadagiti sicacappia kencuana: rinabngisna ti tulagna.",
			"21": "<sup>21</sup> Ti ngiwatna naglamuyot a cas mantequilla, ngem ti pusona isu ti gubat. Dagiti sasaona naluclucnengda ngem lana, nupay casta isuda dagiti siaasut a campilan.",
			"22": "<sup>22</sup> Iyallatiwmo ta awitmo ken Jehova, ket saranayennacanto: dinanto ipalubos a magaraw ti nalinteg.",
			"23": "<sup>23</sup> Ngem sica, O Dios, ipisocmonto ida iti abut ti pannacadadael: dagiti mawaw iti dara ken mananggulib didanto agbiag iti cagudua dagiti al-aldawda; ngem siac agcammatalecacto kenca."
		},
		"56": {
			"1": "<sup>1</sup> Caasiannac cadi, O Dios; ta ti tao cayatnac nga alun-unen: agmalmalem isu makigubgubat a mangliput caniac.",
			"2": "<sup>2</sup> Dagiti cabusorco cayatdac nga alununen nga agmalmalem; ta aduda dagiti makibacal a sicucuspag caniac.",
			"3": "<sup>3</sup> Ania man nga horas a panagbutengco, isaadconto ti panagtalecco kenca.",
			"4": "<sup>4</sup> Iti Dios (idaydayawconto ti saona), iti Dios insaadcon ti panagtalecco, saanacto a mapabuteng; ania ti maaramid ti lasag caniac?",
			"5": "<sup>5</sup> Agmalmalem a ballicugenda dagiti sasaoc: amin dagiti pampanunotda maibusorda caniac a pacadacsac.",
			"6": "<sup>6</sup> Agbubonggoyda amin, ken aglingedda, itugtugotandac, wen sinegseggaanda toy cararwac.",
			"7": "<sup>7</sup> Macalasutdanto ngata babaen ti kinadakes? babaen ti pungtot ipuruacmo dagiti tattao, O Dios.",
			"8": "<sup>8</sup> Sica bilangem dagiti pannacaisiasic. Ibotellam dagiti luluac; saanda nga adda iti librom?",
			"9": "<sup>9</sup> Iti casta dagiti cabusorco agtuckiaddanto intono aldaw a panagawagco: daytoy ammoc, a ti Dios agpaay caniac.",
			"10": "<sup>10</sup> Iti Dios (idaydayawconto ti saona), ken Jehova (idaydayawconto ti saona),",
			"11": "<sup>11</sup> Iti Dios insaadco ti panagtalecco, diacto mapabuteng; ania ti maaramid ti tao caniac?",
			"12": "<sup>12</sup> Dagiti carcarim addada caniac, O Dios: ipaayconto kenca dagiti datdaton a pagyaman.",
			"13": "<sup>13</sup> Ta inispalmo toy cararwac iti patay: Saanmo aya nga inlisi dagiti sacsacac iti pannacatuang, tapno macapagnaac iti sangoanan ti Dios. Iti lawag ti sibibiag?"
		},
		"57": {
			"1": "<sup>1</sup> Caasiannac, O Dios, mangngaasica cadi caniac; ta ti cararwac agsalindeg kenca: wen, iti salinong dagiti payacmo agcamangacto, inggana iti mapalabas dagitoy a pacarigatan.",
			"2": "<sup>2</sup> Umkisacto iti Dios a Cangatoan, iti Dios a mangipapaay cadagiti amin a banag caniac.",
			"3": "<sup>3</sup> Agbaonto manipud langit, ket isalacannac, intono ti mangalun-un caniac mangababi; (Selah) ti Dios ibaonnanto ti kinamanagayatna ken kinapudnona.",
			"4": "<sup>4</sup> Ti cararwac adda iti tengnga dagiti leon; agiddaac iti baet dagiti napadarangan, wen cadagiti annac dagiti tattao, nga dagiti ngipenda picpica ken panpana, ket ti dilada natadem a campilan.",
			"5": "<sup>5</sup> Maitan-occa cadi, O Dios, iti rabaw dagiti langit; ti dayagmo rimbawanna coma amin a daga.",
			"6": "<sup>6</sup> Insaganaanda iti bateng dagiti addangco; ti cararwac naparucob: nangcalida iti palab-ug iti sangoanac; naipisocda met laeng iti tengngana. (Selah)",
			"7": "<sup>7</sup> Natalged ti pusoc, O Dios, ti pusoc natalged: agcantaacto, wen, agcantaacto cadagiti panangidaydayaw.",
			"8": "<sup>8</sup> Agriingca, kinadayagco; agriingcayo, salterio ken arpa: siac met laeng agriingacto a masapa.",
			"9": "<sup>9</sup> Agyamanacto kenca, O Apo, iti tengnga dagiti tattao: cantaecto dagiti panangidaydayaw kenca iti tengnga dagiti nasnacion.",
			"10": "<sup>10</sup> Ta ti kinamanagayatmo dackel agingga cadagiti langlangit, ket ti kinapudnom agingga cadagiti tangatang.",
			"11": "<sup>11</sup> Maitan-occa cadi, O Dios, iti rabaw dagiti langlangit; ti dayagmo rimbawanna coma amin ti daga."
		},
		"58": {
			"1": "<sup>1</sup> Pudno aya met laeng nga iti kinaulimec agsaocayo iti kinalinteg? Agipatocayo aya met laeng a sililinteg, O dacayo nga annac dagiti tattao?",
			"2": "<sup>2</sup> Saan, iti uneg ti puso agaramidcayo iti kinadakes; Timbengenyo ti ranggas dagiti im-imayo ditoy daga.",
			"3": "<sup>3</sup> Dagiti nadangkes naisupadidan manipud iti aanacan: sumiasidan apaman a mayanacda, nga agsaoda cadagiti ulbod.",
			"4": "<sup>4</sup> Ti gitada cas gita ti uleg: casda la carasaen a tuleng a rinepcanda ti lapayagda,",
			"5": "<sup>5</sup> A dina mangngeg ti timec dagiti manangayaw, uray pay dagiti calaingan a mangayaw.",
			"6": "<sup>6</sup> Pusiem dagiti ngipngipenda, cadagiti ngiwatda, O Dios; pusiem dagiti sangsangi dagiti cabanbannoaganna a leon, O Jehova.",
			"7": "<sup>7</sup> Aglunagda cadi a cas danum nga agayus a nataray: no isirigna dagiti panana, arig la coma maputed.",
			"8": "<sup>8</sup> Casda la coma bisucol a marunaw ken agpucaw, cas  iti alis ti maysa a babai, a saan a nacakita iti init.",
			"9": "<sup>9</sup> Sacbay ti pannacaricna dagiti bangam cadagiti apuy ti sisiit, isu pucawennanto ida iti alipugpug, ti nalangto ken ti macset agpada.",
			"10": "<sup>10</sup> Ti nalinteg agrag-onto no makitana ti pammales: ibuggonanto dagiti sacsacana iti dara ti nadangkes;",
			"11": "<sup>11</sup> Tapno iti casta dagiti tattao cunaendanto, pudno nga adda gunguna cadagiti nalinteg: pudno nga adda Dios a mangocom ditoy daga."
		},
		"59": {
			"1": "<sup>1</sup> Ispalennac cadagiti cabusorco, O Diosco: isimpanac iti ngatoen dagiti bumangon a maibusor caniac.",
			"2": "<sup>2</sup> Ispalennac cadagiti agar-aramid iti kinadakes, ken isalacannac cadagiti tattao a mawaw iti dara.",
			"3": "<sup>3</sup> Ta, ni, cumlebda a mangsaneb itoy cararwac; dagiti nabileg agtitiponda a sititimpuyog a bumusor caniac: saan a gapu iti panaglabsingco, di met gapu iti basolco, O Jehova.",
			"4": "<sup>4</sup> Agtarayda ken agsaganada met idinto nga awan basolco, Agriingca tapno tulongannac, ket matmatam.",
			"5": "<sup>5</sup> Wen, sica, O Jehova a Dios dagiti buybuyot, Dios ti Israel, bumangonca tapno sarungcaram amin dagiti nasnacion: saanca cadi a naasi cadagiti nadangkes a managlabsing. (Selah)",
			"6": "<sup>6</sup> Agsublida iti rumabii, agtaguubda a cas aso, ket agliclicmutda iti ili.",
			"7": "<sup>7</sup> Ni, agtig-abda cadagiti ngiwatda; Adda campilan cadagiti bibbibigda: ta cunada,  siasino ti macangngeg?",
			"8": "<sup>8</sup> Ngem sica, O Jehova, catawaamto ida; pagbalinemto ida a pagrarabacan amin dagiti nasnacion.",
			"9": "<sup>9</sup> Gapu iti bilegna agpannurayacto kenca; ta ti Dios isu ti nangato a baluartec.",
			"10": "<sup>10</sup> Ti Diosco iti kinamanagayatna sabtennacto; ti Dios ipaaynanto a makitac ti calicagumco nga agpaay cadagiti cabusorco.",
			"11": "<sup>11</sup> Dica papatayen ida, di-la-ket ta dagiti tattaoc manglipatda: Iwarasmo ida gapu iti pannacabalinmo, ket itulmengmo ida, O Apo a calasagmi.",
			"12": "<sup>12</sup> Gapu iti basol ti ngiwatda, ken sasao dagiti bibbibigda, matiliwda met la coma iti kinatangsitda, ken gapu iti panaglunlunodda ken panangyulbodda iti saoenda.",
			"13": "<sup>13</sup> Runotem ida iti pungtot, runotem ida, tapno maawandan: ket ipacaammom cadacuada a ti Dios agturay ken Jacob, inggana cadagiti pungto toy daga. (Selah)",
			"14": "<sup>14</sup> Ket iti rumabii pagsubliem ida, pagtaguubem ida a cas aso, ket liclicmutenda ti ili.",
			"15": "<sup>15</sup> Agallaalladanto nga agbiroc iti taraon, ken sumsumgadanto nga agpatpatnag no dida mapnec.",
			"16": "<sup>16</sup> Ngem icantacto ti kinabilegmo; wen, icantacto a natibong iti agsapa ti kinamanagayatmo: ta sican ti nangato a baluartec, ken camangco iti aldaw ti pannacariribucco.",
			"17": "<sup>17</sup> Kenca, O pagbilgac, icantacto dagiti pagdaydayaw: ta ti Dios isu ti nangato a baluartec, ti Diosco a manangngaasi."
		},
		"60": {
			"1": "<sup>1</sup> O Dios, sica impalladawnacami, sica intublacnacami; nacaungetca; O alangonennacami cadi manen.",
			"2": "<sup>2</sup> Pinagkintayegmo ti daga; pinagbirrim: agasam dagiti rengrengngat; ta agpigerger.",
			"3": "<sup>3</sup> Imparangam ti ilim cadagiti nabantot a banbanag: pinainumnacami iti arac ti pas-iraw.",
			"4": "<sup>4</sup> Intedmo ti bandera cadagiti agbuteng kenca, tapno maibistrad gapu iti kinapudnom. (Selah)",
			"5": "<sup>5</sup> Tapno ti ayayatem maispal coma, isalacanmo babaen iti canawan nga imam, ket sungbatannacami.",
			"6": "<sup>6</sup> Ti Dios nagsaon iti kinasantona: agrag-oacto; bingayecto ti Sikem, ket rucudecto ti lobong a Succot.",
			"7": "<sup>7</sup> Ti Galaad cucuac, ken cuac ti Manases; ti Efraim isu met ti cabal toy uloc; ti Juda isu ti cetroc.",
			"8": "<sup>8</sup> Ti Moab isu ti bacca a pagugasac; idiay Edom ipalladawconto ti sapatosco; umsiagca, Filistia, gapu caniac.",
			"9": "<sup>9</sup> Siasino ti mangipanto caniac iti ili a natibker? Siasino ti nangiturong caniac diay Edom?",
			"10": "<sup>10</sup> Saan a sica, O Dios, ti nangipalladaw cadacami? Ket sica, O Dios, saanca a makicuyog cadagiti buybuyotmi.",
			"11": "<sup>11</sup> Badangannacami a sumaranget iti cabusor; ta barengbareng ti tulong ti tao.",
			"12": "<sup>12</sup> Gapu iti Dios agaramidtayto a simamaingel; ta isu ti mangibaddecto cadagiti cabusortayo."
		},
		"61": {
			"1": "<sup>1</sup> Denggem cadi ti ickisco, O Dios; imdengam ti cararagco.",
			"2": "<sup>2</sup> Manipud iti pungto ti daga umawagacto kenca, intono maitulmeng toy pusoc: itulodnac iti bato a natay-tayag ngem siac.",
			"3": "<sup>3</sup> Ta sican ti kinamangac, natibker a baluarte iti cabusor.",
			"4": "<sup>4</sup> Agtaengacto nga agnanayon iti tabernaculom: agcamangacto iti salucob dagiti payacmo. (Selah)",
			"5": "<sup>5</sup> Ta sica, O Dios, dinengngegmo dagiti carcaric: intedmo caniac ti tawid dagiti agbuteng iti naganmo.",
			"6": "<sup>6</sup> Paatiddugemto ti biag ti ari; dagiti tawenna casladanto cadagiti adu a caputotan.",
			"7": "<sup>7</sup> Agtaengto iti sangoanan ti Dios iti agnanayon: O saganaem ti kinamanagayat ken kinapudno, tapno isuda ti mangsalimetmet kencuana.",
			"8": "<sup>8</sup> Iti casta icantacto ti panangidaydayaw iti naganmo iti agnanayon, tapno matungpalco nga inaldaw dagiti carcaric."
		},
		"62": {
			"1": "<sup>1</sup> Ti cararwac agpannuray a siuulimec iti Dios laeng: aggapu kencuana ti pannacaisalacanco:",
			"2": "<sup>2</sup> Isu laeng ti batoc ken salacanco: isu ti natayag a baluartec; saanacto a maanano unay.",
			"3": "<sup>3</sup> Casano capaut ti panangidadanesyonto iti maysa a tao, tapno mapapatayyo, dacayo amin, a cas nagirig a diding, cas agluggaluggad nga alad?",
			"4": "<sup>4</sup> Agbibinnalacadda laeng tapno mapadsoda ti tacnengna; pagayayatanda dagiti ul-ulbod; cadagiti ngiwatda mangparaburda ngem mangilunodda iti unegda. (Selah)",
			"5": "<sup>5</sup> Cararwac, agpannurayca a siuulimec iti Dios laeng; ta ti inanamac aggapu kencuana.",
			"6": "<sup>6</sup> Isu laeng ti batoc ken salacanco: isu ti nangato a baluartec, saanacto a maanano unay.",
			"7": "<sup>7</sup> Adda iti Dios ti pannacaisalacanco ken dayawco; ti bato ti kinabilegco, ken ti camangco adda iti Dios.",
			"8": "<sup>8</sup> Agtaleccayo kencuana iti amin a tiempo, dacayo nga umili; ibucbocyo ti pusoyo iti sangoananna: ti Dios isu ti camang a maipaay cadatayo. (Selah)",
			"9": "<sup>9</sup> Pudno a dagiti tattao a nababa ti casasaadda ubbawda, ket dagiti tattao a nangato ti casasaadda ulbodda. Iti gagantingan tumayocdanto; agtitiponda amin nalaglag-anda ngem anges.",
			"10": "<sup>10</sup> Dica pagtalcan ti panangilupit, ket dica mapaubbaw iti panagagaw: No ti sanicua umadu, dica italinaed ta pusom.",
			"11": "<sup>11</sup> Ti Dios nagsaon iti naminsan, namindua a nangngegco daytoy, a ti pannacabalin biang ti Dios.",
			"12": "<sup>12</sup> Casta met a biangmo, O Apo, ti kinamanagayat; ta sica itdem iti tunggal tao ti mayannatup iti aramidna."
		},
		"63": {
			"1": "<sup>1</sup> O Dios, sica ti Diosco, sigaganetgetacto a mangbiroc kenca: toy cararwac mawaw kenca, ti lasagco segseggaannaca, iti naticag ken nautuyan a daga, nga awanan danum.",
			"2": "<sup>2</sup> Iti casta minatmatanca iti nasantoan a yanmo, tapno kitaec ti pannacabalinmo ken dayagmo.",
			"3": "<sup>3</sup> Ta ti kinamanagayatmo nasaysayaat ngem ti biag, dagiti bibigco idaydayawdacanto.",
			"4": "<sup>4</sup> Iti casta agdaydayawacto kenca bayat ti panagbiagco: itag-ayconto dagiti im-imac gapu iti naganmo.",
			"5": "<sup>5</sup> Toy cararwac mapnecto cas cadagiti pata ken taba; ket ti ngiwatco idaydayawnacanto cadagiti siraragsac a bibig;",
			"6": "<sup>6</sup> No malagipca iti pagiddaac, ken panpanunotenca cadagiti panagpuyat iti rabii.",
			"7": "<sup>7</sup> Ta sican ti saranayco, ket iti salinong dagiti payacmo agragrag-oacto.",
			"8": "<sup>8</sup> Toy cararwac sumursurot a sigaganetget kenca: ti canawan nga imam saranayennac.",
			"9": "<sup>9</sup> Ngem dagiti mangbiroc itoy cararwac, tapno dadaelenda, mapandanto cadagiti naununeg a paset ti daga.",
			"10": "<sup>10</sup> Maiyawatdanto iti pannacabalin ti campilan: isudanto ti maysa a reddec cadagiti zorra.",
			"11": "<sup>11</sup> Ngem ti ari agrag-onto iti Dios: tunggal maysa nga agsapata gapu kencuana agragsacto; ta ti ngiwat dagiti agsao cadagiti ul-ulbod mapagtangepto."
		},
		"64": {
			"1": "<sup>1</sup> Denggem ti timecco, itoy panagasugco, O Dios, salacnibam toy biagco iti panagbuteng iti cabusor.",
			"2": "<sup>2</sup> Ilemmengnac iti nalimed a panangisicat dagiti managdacdakes, iti riribuc dagiti agar-aramid iti kinakillo;",
			"3": "<sup>3</sup> Dagidiay a pinatademda ti dilada a cas campilan, ken insirigda dagiti panpanada, nga isuda dagiti napait a sasao;",
			"4": "<sup>4</sup> Tapno cadagiti nalmeng a yan puntaanda ti napnoan-imbag: iti pettat ipuntadan kencuana, ket dida agbuteng.",
			"5": "<sup>5</sup> Paturdenda dagiti bagbagida iti dakes a gandat; pagtutulaganda ti agisaad iti silo a nalinged; cunada, Siasino ti macakitanto cadacuada?",
			"6": "<sup>6</sup> Isuda sapulenda dagiti kinadangkes; nalpasmin, cunada, ti nagaget a panangsapsapul: ket ti nalimed a panunot ken ti puso ti tunggal maysa nauneg.",
			"7": "<sup>7</sup> Ngem ti Dios puntaannanto ida; iti pettat masugatdanto iti maysa a pana.",
			"8": "<sup>8</sup> Iti casta maitublacdanto, a dagiti met la dilada ti maibusorto cadacuada: amin dagiti macakita cadacuada iwingiwingdanto dagiti ul-uloda.",
			"9": "<sup>9</sup> Ket amin a tao agbutengdanto; ket ibunannagdanto ti aramid ti Dios, ket ututobendanto a simamanakem ti panangaramidna.",
			"10": "<sup>10</sup> Dagiti nalinteg maayayatandanto ken Jehova, ket agcamangdanto kencuana; ket amin dagiti sililinteg iti pusoda agragsacdanto."
		},
		"65": {
			"1": "<sup>1</sup> Ti panangidaydayaw idiay Sion segsegaannaca, O Dios, ket kenca maitungpalto ti cari.",
			"2": "<sup>2</sup> O sica a dumngeg iti cararag, kenca ti umayandanto dagiti amin a lasag.",
			"3": "<sup>3</sup> Dagiti kinadangkes mangabacda caniac: no maipapan cadagiti panaglablabsingmi sica pacawanemto ida.",
			"4": "<sup>4</sup> Nagasat ti tao a piliem, ket paasitgem kenca, tapno macapagtaeng cadagiti paraanganmo: mapneccamto iti kinaimbag ti balaymo, ti nasantoan a templom.",
			"5": "<sup>5</sup> Babaen cadagiti nacakigkigtot a banbanag sica sungbatannacaminto iti kinalinteg, O Dios ti pannacaisalacanmi; sica a pagtalcan dagiti amin a pungto ti daga, ken dagiti adda iti tengnga ti taaw nga adayo:",
			"6": "<sup>6</sup> Daydiay iti bilegna patibkerenna dagiti banbantay, idinto ta nagbarikes iti pannacabalin;",
			"7": "<sup>7</sup> Daydiay pagtalnaenna ti daranudor dagiti baybay, ti daranudor dagiti dalluyon, ken ti gulogulo dagiti tattao.",
			"8": "<sup>8</sup> Dagiti met agnaed cadagiti caadayoan a yan mabutengda cadagiti pacalaglagipan ti pannacabalinmo: sica paragsakem dagiti iruruar ti bigat ken ti rabii.",
			"9": "<sup>9</sup> Sica sarungcaram ti daga, ket bisibisam, pabacnangem unay; ti carayan ti Dios napno iti danum: ipaayam ida iti bukel, intono nasaganamon a casta ti daga.",
			"10": "<sup>10</sup> Danumam a sibubuslon dagiti gulgulisna; pababaem dagiti timtimburogna: palucnengem cadagiti arbis; bendicionam ti panagrusingna.",
			"11": "<sup>11</sup> Balangatam ti tawen ita kinaimbagmo; ket dagiti daldalanmo agitedtedda iti kinalucmeg.",
			"12": "<sup>12</sup> Tedtedanda dagiti pagaraban cadagiti let-ang; ket dagiti turturod nabaricsanda iti ragsac.",
			"13": "<sup>13</sup> Dagiti pagaraban nacawesanda cadagiti ar-arban; dagiti tanap nacumutanda met iti anien; agdirdir-ida iti ragsac, agcancantada met."
		},
		"66": {
			"1": "<sup>1</sup> Aramidem ti macaparagsac nga aweng iti Dios, dagup ti sangadagaan:",
			"2": "<sup>2</sup> Icantam ti dayag ti naganna: padayagem ti pannacaidaydayawna.",
			"3": "<sup>3</sup> Cunaem iti Dios, Amangan a nacaamames dagiti ar-aramidmo! Gapu iti cadackel ti pannacabalinmo dagiti cabcabusormo maparucmadanto kenca.",
			"4": "<sup>4</sup> Ti amin a daga agdaydayawto kenca, ket cancantaannacanto; cantaandanto ti naganmo. (Selah)",
			"5": "<sup>5</sup> Umaycayo, ket kitaenyo dagiti ar-aramid ti Dios; nacaamames cadagiti aramidna a maipaay cadagiti annac dagiti tao.",
			"6": "<sup>6</sup> Pinagbalinna ti taaw a namaga a daga; linasatda a pinagna ti carayan sadiay nagragrag-ocami kencuana.",
			"7": "<sup>7</sup> Isu agturay babaen ti pannacabalinna iti agnanayon; dagiti matana ti nasungit saanda coma a macapagpasindayaw. (Selah)",
			"8": "<sup>8</sup> O benditoenyo ti Diostayo, dacayo a tattao, ket ipangngegyo ti timec ti pannacaidaydayawna;",
			"9": "<sup>9</sup> Daydiay mangigaga ti cararwatayo iti panagbiag, ket dina ituloc a dagiti sacsacatayo maiwasda.",
			"10": "<sup>10</sup> Ta sica, O Dios, pinadasnacami: sinusuutnacami, a cas iti pirac a maguguran.",
			"11": "<sup>11</sup> Impastrecnacami iti bateng; insaadmo ti nacaro nga awit iti rabaw dagiti lomlomomi.",
			"12": "<sup>12</sup> Pinagtalaytaymo dagiti tattao cadagiti rabaw dagiti ul-ulomi; naglasatcami iti apuy ken iti danum; ngem sica inlasutnacami nga impan iti nabacnang a disso.",
			"13": "<sup>13</sup> Umayacto iti balaymo agraman cadagiti sagsagut a mapuuran; bayadacto kenca dagiti carcaric,",
			"14": "<sup>14</sup> Nga insawang dagiti bibbibigco, ken insao ti ngiwatco, idi addaac iti pagducotan.",
			"15": "<sup>15</sup> Idatonconto kenca dagiti sagsagut a nalucmeg a mapuuran, agraman sayamusum dagiti carcarnero a calantangan; agidatonacto cadagiti vacvaca a lallaki agraman calcalding. (Selah)",
			"16": "<sup>16</sup> Umaycayo, ket dumngegcayo, dacayo amin nga agbuteng iti Dios, ket ipalawagconto ti impaayna itoy cararwac.",
			"17": "<sup>17</sup> Imkisac kencuana babaen iti ngiwatco, ket naidaydayaw itoy dilac.",
			"18": "<sup>18</sup> No ipategco ti kinadakes itoy pusoc, ti Apo saanto a dumngeg:",
			"19": "<sup>19</sup> Ngem pudno a ti Dios dimngeg; inimdenganna ti timec ti cararagco.",
			"20": "<sup>20</sup> Madaydayaw coma ti Dios, isu a saan a nangiwagsac iti cararagco, ken dina met inyadayo caniac ti kinamanagayatna."
		},
		"67": {
			"1": "<sup>1</sup> Ti Dios mangngaasi coma cadatayo, ket bendicionannatayo coma, pagraniagenna coma ti rupana cadatayo; (Selah)",
			"2": "<sup>2</sup> Tapno ti dalanmo maammoan coma ditoy rabaw ti daga, ti panangisalacanmo iti tengnga dagiti amin a nasnacion.",
			"3": "<sup>3</sup> Dagiti tattao idaydayawdaca coma, O Dios; amin dagiti tattao idaydayawdaca coma.",
			"4": "<sup>4</sup> O dagiti nasnacion agragsacda ken agcantada coma a pagrag-o; ta ocomemto a sililinteg dagiti tattao, ken iturayam dagiti nasnacion ditoy rabaw ti daga. (Selah)",
			"5": "<sup>5</sup> Dagiti tattao idaydayawdaca coma, O Dios; amin nga tattao idaydayawdaca coma.",
			"6": "<sup>6</sup> Ti daga pinaaduna ti apit: ti Dios, ti met laeng Diostayo, bendicionannatayto.",
			"7": "<sup>7</sup> Ti Dios bendicionannatayto; ket amin dagiti pungto ti daga agbutengdanto kencuana."
		},
		"68": {
			"1": "<sup>1</sup> Tumacder coma ti Dios, dagiti cabusorna mawarawarada coma; agtalawda met coma iti sangoananna dagiti gumurgura kencuana.",
			"2": "<sup>2</sup> Cas pannacaipanaw ti asuc, casta ti pannacaipanawda: cas pannacalunag ti allid a maisarang iti apuy, casta coma ti pannacapucaw dagiti nadangkes iti sangoanan ti Dios.",
			"3": "<sup>3</sup> Ngem dagiti sililinteg maayayatanda coma; agrag-oda coma iti saclang ti Dios: wen, agragragsacda coma a siaayat.",
			"4": "<sup>4</sup> Cantaanyo ti Dios, icantayo ti panangidaydayaw iti naganna: iyaramidanyo iti calzada a maipaay kencuana nga agsacay a lumasat cadagiti let-ang; ti naganna Jehova; ket agragrag-ocayo iti sangona.",
			"5": "<sup>5</sup> Ama dagiti ululila, ken ocom dagiti babbalo, ti Dios iti nasantoan a pagnaedanna.",
			"6": "<sup>6</sup> Ti Dios pakipagnaedenna ti taltalimpungawen iti sangacabbalayan: iruarna dagiti nacayawan nga ipan iti kinarang-ay; ngem dagiti nasungit agnaedda iti naticag a daga.",
			"7": "<sup>7</sup> O Dios, idi impangoloam ti ilim, idi naglasatca iti let-ang; (Selah)",
			"8": "<sup>8</sup> Ti daga nagkintayeg, dagiti met langlangit nagitinnagda iti tudo iti sangoanan ti Dios: diay Sinai nagpigerger iti saclang ti Dios, Dios ti Israel.",
			"9": "<sup>9</sup> Sica, O Dios, nangibaonca iti naruay a tudo, pinatalgedam ti pinatawidam idi a nabannogan.",
			"10": "<sup>10</sup> Ti buyotmo nagnaed sadiay: sica, O Dios, insaganaam ita kinaimbagmo a maipaay iti napanglaw.",
			"11": "<sup>11</sup> Ti Apo itdenna ti sao: dagiti babbai a mangiwarnac cadagiti damdamag dackelda a buyot.",
			"12": "<sup>12</sup> Dagiti ar-ari cadagiti buybuyot agtalawda, isuda agtalawda; ket ti babai nga agbati iti balay bingayenna ti masamsam.",
			"13": "<sup>13</sup> No agiddaca iti tengnga dagiti pagaponan dagiti carnero,   arig la cadagiti payac ti calapati a nacalupcupan iti pirac, ken dagiti pawisno iti amarillo a balitoc.",
			"14": "<sup>14</sup> Idi a ti Mannacabalin amin nagiwarsi cadagiti ar-ari sadiay, arig la agnieve idiay Salmon.",
			"15": "<sup>15</sup> Bantay ti Dios ti bantay Basan; bantay a natayag ti bantay Basan.",
			"16": "<sup>16</sup> Apay a kitaenyo a sipapaludip, dacayo a naalimpatoc a banbantay, daydiay bantay nga inesman ti Dios a pagtaenganna? Wen, ni Jehova pagtaengannanto nga agnanayon.",
			"17": "<sup>17</sup> Dagiti luglugan ti Dios duapulo ribuda, wen, rinibribu a ribuda: ti Apo adda iti tengngada, cas idiay Sinai, idiay Santuario.",
			"18": "<sup>18</sup> Immulica iti nangato, impanawmo dagiti nacayawan; inawatmo dagiti sagsagut iti tengnga dagiti tattao, wen, castamet cadagiti nasungit, ta ni Jehova a Dios agnaed coma idiay,",
			"19": "<sup>19</sup> Bendito ti Apo, nga inaldaw-aldaw a mangawit iti awittayo, wen, ti Dios isu ti salacantayo. (Selah)",
			"20": "<sup>20</sup> Ti Dios adda cadatayo ti Dios dagiti pannacaisalacan; ket biang ni Jehova nga Apo ti pannacalasut iti patay.",
			"21": "<sup>21</sup> Ngem ti Dios burakennanto ti ulo cadagiti cabusorna, ti nabooc a tuctoc ti magmagna pay laeng iti kinamanagbasolna.",
			"22": "<sup>22</sup> Ti Apo kinunana, Alaecto manen manipud Basan, aonecto manen ida cadagiti yuyeng ti baybay.",
			"23": "<sup>23</sup> Tapno maibaddecmo ti sacam iti darada, tapno ti dila dagiti asom adda mabagida cadagiti cabusormo.",
			"24": "<sup>24</sup> Nakitada dagiti ipapanmo, O Dios, wen, dagiti ipapan ti Diosco, Aric, iti santuario.",
			"25": "<sup>25</sup> Dagiti cumacanta immunada, dagiti tumotocar simmarunoda, iti tengnga dagiti babbalasang a nagtagipandareta.",
			"26": "<sup>26</sup> Dayawenyo ti Dios cadagiti gimgimong, wen, ti Apo, dacayo a taga-ubbog ti Israel.",
			"27": "<sup>27</sup> Sadiay adda ni ubing a Benjamin nga agturayda, dagiti piprincipe ti Juda ken ti gimongda, dagiti piprincipe ti Zabulon, dagiti piprincipe ti Neftali.",
			"28": "<sup>28</sup> Ti Diosmo binilinna ti pigsam: Pabilgem, O Dios, ti inaramidmo cadacami.",
			"29": "<sup>29</sup> Gapu iti templom idiay Jerusalem dagiti ar-ari agyegdanto cadagiti sagsagut kenca.",
			"30": "<sup>30</sup> Tubngarem ti atap nga animal cadagiti calidliddaan, ti kinaruay dagiti vacvaca a toro, agraman cadagiti ururbon a vaca dagiti tattao; nga ibadbaddec ta sacam dagiti paspaset ti pirac: winarawarana dagiti tattao nga agayat iti gubat.",
			"31": "<sup>31</sup> Dagiti piprincipe rumuardanto sadi Egipto; ti Etiopia darasennanto a yunnat dagiti imana iti Dios.",
			"32": "<sup>32</sup> Cantaanyo ti Dios, dacayo a pagpagarian ditoy daga; O agcantacayo iti panangidaydayaw iti Apo; (Selah)",
			"33": "<sup>33</sup> Iti Daydiay nga agsacay iti langit dagiti langlangit, nga addada idi ugma; adtoy, inyesngawna ti timecna, timec a nabileg.",
			"34": "<sup>34</sup> Ibunannagyo ti kinapigsa iti Dios: ti kinatan-ocna adda iti ngatoen ti Israel, ket ti bilegna adda cadagiti tangatang.",
			"35": "<sup>35</sup> O Dios, nacabutbutengca manipud cadagiti nasantoan a pagnaedam: ti Dios ti Israel, isu a mangted iti bileg ken pannacabalin ti ilina. Bendito ti Dios."
		},
		"69": {
			"1": "<sup>1</sup> Isalacannac, O Dios; ta dagiti danum sumrecda itoy cararwac.",
			"2": "<sup>2</sup> Lumlumnedac iti nauneg nga aloyooy, nga awan pagbatayan: maitapugac cadagiti nauneg a danum, a dagiti layus lapunosendac.",
			"3": "<sup>3</sup> Napacsoyanacon iti panagicickis; ti carabucobco nagmagan: dagiti matac umlayda bayat ti panagururayco iti Diosco.",
			"4": "<sup>4</sup> Dagidiay a gumurgura caniac nga awan gapgapuna adaduda ngem dagiti booc toy uloc: dagidiay a mangracrac coma caniac, a cabcabusorco a di-umumno, nabilegda: ti saanco nga innala capilitan nga ipulangco.",
			"5": "<sup>5</sup> O Dios, sica ammom ti kinamauyongco; ket dagiti basbasolco saanda a mailinged kenca.",
			"6": "<sup>6</sup> Saanda cadi a mababainan gapu caniac dagiti agururay kenca, O Apo Jehova dagiti buybuyot: saanda cadi a maibabain gapu caniac dagiti mangbiroc kenca, O Dios ti Israel;",
			"7": "<sup>7</sup> Yantangay gapu kenca nagsagabaac iti pannacaumumsi; ni bain inabbungotanna toy rupac.",
			"8": "<sup>8</sup> Nagbalinac a sangsangaili cadagiti cacabsatco, ken gangannaet cadagiti annac ni inac.",
			"9": "<sup>9</sup> Ta ti anep iti balaymo ibusennacon; ket dagiti panangumsi dagiti mangumumsi kenca nagdissuorda caniac.",
			"10": "<sup>10</sup> Idi nagsangitac, ken ginugurac toy cararwac iti panagayuno, isu ti nacaumumsiac.",
			"11": "<sup>11</sup> Idi pinagcawesco ti nakersang a lupot, nagbalinac cadacuada a taltalangutangenda.",
			"12": "<sup>12</sup> Dagiti agtutugaw iti ruangan tantanawtawendac; ket siac ti idaldallot dagiti nabartec.",
			"13": "<sup>13</sup> Ngem no caniac, ti cararagco maipaay kenca, O Jehova, iti tiempo a maiparbeng: O Dios, iti caruay ti kinamanagayatmo, sungbatannac iti kinapudno ti panangisalacanmo.",
			"14": "<sup>14</sup> Alut-utennac iti lab-og, ket dinac baybay-an a lumned: maisalacanac cadi cadagiti gumurgura caniac, ken cadagiti nauneg a dandanum.",
			"15": "<sup>15</sup> Ti dinackel saannac cadi nga iremrem, dinac met coma alun-unen ti yuyeng; ket ti abut dina cadi iyemem ti ngiwatna caniac.",
			"16": "<sup>16</sup> Sungbatannac, O Jehova; yantangay ti kinamanagayatmo naimbag: cas mayannurot ita caadu dagiti kinamanangngaasim taliawennac.",
			"17": "<sup>17</sup> Ket dica ilinged ta rupam itoy adipenmo; ta maducotanac: sungbatannac cadi a sidadaras.",
			"18": "<sup>18</sup> Umasidegca itoy cararwac, ket subbotem: sacaennac gapu cadagiti cabusorco.",
			"19": "<sup>19</sup> Ammom ti pannacaumumsic, ken pannacabainco, ken pannacaibabainco: dagiti casupadic addada amin iti sangoanam.",
			"20": "<sup>20</sup> Ti umsi binuracna toy pusoc; ket ita sipupunnoac cadagiti dadagsen: ket nagmatamataac iti siasinoman a mangngaasi caniac, ngem awan; ken cadagiti mangliwliwa, ngem awan nasaracac.",
			"21": "<sup>21</sup> Iniccandac met ti apro a maipaay a taraonco; ket iti pannacawawco pinainumdac iti suca.",
			"22": "<sup>22</sup> Ti pangananda iti sangoananda agbalin coma a silo; ket no addada iti talna, agbalin coma a palab-ug.",
			"23": "<sup>23</sup> Cumudrep cadi dagiti matmatada, tapno iti casta dida macakita; ket dagiti lomlomoda pagpigergerem cadi a cancanayon.",
			"24": "<sup>24</sup> Ibuyatmo ti pungtotmo cadacuada, ket ti rungsot ta ungetmo magam-udna cadi ida.",
			"25": "<sup>25</sup> Ti pagtaenganda aglangalang coma; awan cadi ti macapagtaeng cadagiti calcalapawda.",
			"26": "<sup>26</sup> Ta idadanesda ti dinanarmon; ket isarsaritada ti tuoc dagiti sinugatmo.",
			"27": "<sup>27</sup> Nayonam iti kinadakes dagiti kinadangkesda; ket saanmo ida a pasreken ita kinalintegmo.",
			"28": "<sup>28</sup> Mapunasda coma iti libro ti biag, ket saanda a mailista cadagiti nalinteg.",
			"29": "<sup>29</sup> Ngem nacacaasiac ken situtuocac: ti panangisalacanmo, O Dios, ipangatonac cadi.",
			"30": "<sup>30</sup> Idaydayawconto ti nagan ti Dios iti canta, ken padayagecto iti panagyaman.",
			"31": "<sup>31</sup> Ket adaddanto a pacaayayoan ni Jehova ngem ti maysa a vaca, wenno toro a saraan ken cacuccucu.",
			"32": "<sup>32</sup> Dagiti naemma nakitada, ket maragsacanda: dacayo a mangbiroc iti Dios, agrag-o coma ta pusoyo.",
			"33": "<sup>33</sup> Ta ni Jehova denggenna ti macasapul, ket saanna a laisen dagiti nacayawan a taona.",
			"34": "<sup>34</sup> Ti langit ken daga idaydayawda coma, dagiti baybay ken amin nga aggargaraw cadacuada.",
			"35": "<sup>35</sup> Ta ti Dios isalacannanto ti Sion, ket bangonennanto dagiti il-ili ti Juda; ket agtaengdanto sadiay, ket tagicuaendanto.",
			"36": "<sup>36</sup> Castamet ti caputotan dagiti ad-adipenna tawidendanto; ket dagiti agayat iti naganna agnaeddanto sadiay."
		},
		"70": {
			"1": "<sup>1</sup> Darasem, O Dios, ti mangispal caniac; darasem ti umarayat caniac, O Jehova.",
			"2": "<sup>2</sup> Mababainan ken mariribucda cadi dagiti mangbirbiruc itoy cararwac: mapagsublida cadi ken maibabainda dagiti maayatan iti pacaranggasac.",
			"3": "<sup>3</sup> Mapatallicudda cadi gapu iti pannacabainda dagiti agcuna, Aja, aja.",
			"4": "<sup>4</sup> Dagiti agbiroc kenca agragrag-o ken maragsacanda coma kenca; ket dagiti agayat iti panangisalacanmo cunada coma a cancanayon, mapadayag coma ti Dios.",
			"5": "<sup>5</sup> Ngem napanglawac ken nanumo; Agalallegca cadi nga umay caniac, O Dios; sica ti badangco ken mangispal caniac; O Jehova, dica cadi agtantan."
		},
		"71": {
			"1": "<sup>1</sup> Kenca, O Jehova, agcamangac: diac cadi maibabain uray caanoman.",
			"2": "<sup>2</sup> Ispalennac ita kinalintegmo, ket alawennac: yallingagco cadi ta lapayagmo caniac, ket isalacannac.",
			"3": "<sup>3</sup> Sica cadi ti bato a pagnaedan a maipaay caniac, a mabalinco a caraptan a cancanayon: imbilinmon a maisalacanac, ta sica ti batoc ken salindegco.",
			"4": "<sup>4</sup> Alawennac, O Diosco, iti ima dagiti managdacdakes, iti ima ti nadangkes ken nadawel a tao.",
			"5": "<sup>5</sup> Ta sica ti inanamac, O Apo Jehova: pagtalcac nanipud kinaubingco.",
			"6": "<sup>6</sup> Sica ti nanarsaranay caniac nanipud iti aanacan; sica ti nangiruar caniac iti tian ni inac: kenca cancanayon ti panangidaydayawco.",
			"7": "<sup>7</sup> Arigac la datdatlag cadagiti adu; ngem sica ti nabileg a camangco.",
			"8": "<sup>8</sup> Ti ngiwatco mapnonto iti pannacaidaydayawmo, ken iti tan-ocmo bayat ti aldaw.",
			"9": "<sup>9</sup> Dinac cadi pagtalawen iti tiempo ti kinalacay; dinac cadi baybay-an intono umawanen ti pigsac.",
			"10": "<sup>10</sup> Ta dagiti cabusorco agsasaoda maipanggep caniac; ken dagiti mangsisiim itoy cararwac agbibinnalacadda.",
			"11": "<sup>11</sup> A cuncunada, ti Dios binaybay-annan, camatenyo ket tiliwenyo; ta awanen ti mangispal kencuana.",
			"12": "<sup>12</sup> O Dios, dinac cadi adayoan; O Diosco, agdarasca nga umarayat caniac.",
			"13": "<sup>13</sup> Mabainan ken maibusda cadi dagiti sibubusor itoy cararwac; mabungonda coma iti pannacalais ken pannacaibabain dagiti mangisapsapul iti pacaranggasac.",
			"14": "<sup>14</sup> Ngem manginanamaacto a cancanayon, ken idaydayawcanto laeng a dumegdeg a dumegdeg.",
			"15": "<sup>15</sup> Ti ngiwatco sarsaritaennanto ti kinalintegmo, ken ti panangisalacanmo iti amin nga aldaw; ta diac ammo dagiti bilangda.",
			"16": "<sup>16</sup> Umayacto agraman cadagiti nabileg nga ar-aramid ni Apo Jehova: saritaecto ti kinalintegmo, wen ti kinalintegmo laeng.",
			"17": "<sup>17</sup> O Dios, sica insuronac nanipud kinaagtutuboc; ket agpapan ita impalpalawagco dagiti nacascasdaaw nga ar-aramidmo.",
			"18": "<sup>18</sup> Wen, uray laclacayanacon nga ub-ubanan, dinac cadi baybay-an, O Dios, inggana iti maipalawagco ti kinapigsam iti umay a caputotan, ti pannacabalinmo iti aniaman a dumteng.",
			"19": "<sup>19</sup> Ti met kinalintegmo, O Dios, nangato unay; sica a nangaramid cadagiti dadackel a banbanag, O Dios, siasino ti cas kenca?",
			"20": "<sup>20</sup> Sica a nangiparang cadagiti adu ken naut-ut a pacadanagan, pagbiagennacamto manen, ken aonennacamto manen cadagiti caunegan ti daga.",
			"21": "<sup>21</sup> Degdegam cadi ti kinadackelco, ket agsublica manen a mangliwliwa caniac.",
			"22": "<sup>22</sup> Idaydayawcanto met iti salterio, ti kinapudnom met laeng, O Dios: Kenca agcantaacto cadagiti pangidaydayaw a buyogen ti arpa, O sica a Santo ti Israel.",
			"23": "<sup>23</sup> Dagiti bibigco umsiagdanto iti ragsac intono agcantaac cadagiti pangidaydayaw kenca; ken toy cararwac a sinubbotmo.",
			"24": "<sup>24</sup> Casta met a toy dilac sarsaritaennanto ti kinalintegmo iti agmalmalem; ta naibabainda ken nariribucda, dagiti mangsapsapul iti pacaranggasac."
		},
		"72": {
			"1": "<sup>1</sup> Itedmo iti ari dagiti pangngeddengmo, O Dios, ken ti kinalintegmo iti anac ti ari.",
			"2": "<sup>2</sup> Isu mangocomto a sililinteg iti ilim, ken simamanakem cadagiti napanglawmo.",
			"3": "<sup>3</sup> Dagiti banbantay mangyegdanto iti cappia cadagiti umili, ken dagiti turturod, iti kinalinteg.",
			"4": "<sup>4</sup> Isu mangocomto cadagiti napanglaw iti umili, isalacannanto dagiti annac ti nanumo; ket pispisangennanto ti mangidadanes.",
			"5": "<sup>5</sup> Agbutengdanto kenca bayat ti panagpaut ti init, ken cas iti capaut ti bulan, cadagiti amin a caputotan.",
			"6": "<sup>6</sup> Bumabanto a cas tudo iti napatpat a root, cas arbis a mangbisibis iti daga.",
			"7": "<sup>7</sup> Cadagiti al-aldawna agrangpayanto ti kinalinteg, ken kinaruay ti talna, agingga iti maawanen ni bulan.",
			"8": "<sup>8</sup> Addanto met panagturayna manipud baybay agingga iti baybay, ken manipud idiay carayan inggana cadagiti pungpungto ti daga.",
			"9": "<sup>9</sup> Dagiti agnaed iti let-ang agrucnoydanto iti saclangna; ket dagiti cabusorna maidumudomdanto iti tapuc.",
			"10": "<sup>10</sup> Dagiti ar-ari idiay Tarsis ken dagiti purpuro agbuisdanto: dagiti ar-ari ti Sheba ken Seba agipaaydanto cadagiti sagsagut.",
			"11": "<sup>11</sup> Wen, amin nga ar-ari agrucbabdanto iti saclangna; amin a nasnacion agservidanto kencuana.",
			"12": "<sup>12</sup> Ta ispalennanto ti macasapul intono umkis, ken ti napanglaw nga awan mangarayat kencuana.",
			"13": "<sup>13</sup> Mangngaasinto cadagiti napanglaw ken macasapul, ket dagiti cararwa dagiti macasapul isalacannanto.",
			"14": "<sup>14</sup> Subbotennanto dagiti cararwada iti panangirurumen ken iti panangrabsut: ket napategto ti darada iti saclangna:",
			"15": "<sup>15</sup> Ken agbiagdanto; ket isu maiccanto iti balitoc ti Sheba: ket dagiti tattao icararagdanto a cancanayon; pagasatendanto nga agmalmalem.",
			"16": "<sup>16</sup> Addanto kinaruay ti bukel iti daga iti tapaw dagiti banbantay; ti bungada margaayandanto a cas ti Libano: ket dagiti taga-ili agrangpayadanto a cas iti root iti daga.",
			"17": "<sup>17</sup> Ti naganna agpautto nga agnanayon; ti naganna mataginayonto a cas iti capaut ti init: ket dagiti tattao mabendicionandanto kencuana; amin a nasnacion naganendanto ti nagasat.",
			"18": "<sup>18</sup> Bendito ni Jehova a Dios, Dios ti Israel, nga isu laeng ti agaramid cadagiti nacascasdaaw a banbanag:",
			"19": "<sup>19</sup> Ket bendito ti nadayag a naganna iti agnanayon; ket dagup ti daga mapno coma iti dayagna. Amen, ket amen.",
			"20": "<sup>20</sup> (Dagiti cararag ni David nga anac ni Jesse agtungpaldan.)"
		},
		"73": {
			"1": "<sup>1</sup> Pudno a ti Dios naimbag iti Israel, wen cadagiti nadalus ti pusoda.",
			"2": "<sup>2</sup> Ngem no siac, dagiti sacsacac nagistayda napanen; dagiti addangco ngannganida la unay naigalis.",
			"3": "<sup>3</sup> Ta immapalac cadagiti napalangguad, idi a nakitac ti kinarang-ay dagiti managdacdakes.",
			"4": "<sup>4</sup> Ta awan ti panagrigat iti ipapatayda; ngem natibker ketdi ti pigsada.",
			"5": "<sup>5</sup> Awananda iti pacapulcocan a cas cadagiti sabali a tattao; saanda met a maparparigatan a cas cadagiti sabali a tattao.",
			"6": "<sup>6</sup> Gapuna a ti kinatangsit isu ti cas cawar a naipulipul iti tengngedda; ti panagrabsut mangbungon cadacuada a cas cawes.",
			"7": "<sup>7</sup> Dagiti matmatada agbucbukirad iti kinalucmeg: adda cadacuada ti ad-adu ngem ti mabalin a calicaguman ti puso.",
			"8": "<sup>8</sup> Mangrabrabngisda, ket iti kinadakes agiyebcasda iti panangidadanes: agsaoda a sipapalangguad.",
			"9": "<sup>9</sup> Intan-ocda ti ngiwatda cadagiti langlangit, ket ti dilada agdakiwas ditoy daga.",
			"10": "<sup>10</sup> Anansata dagiti tattaona agsublida ditoy: ket dandanum ti napno a tagayan maareb-eb gapu cadacuada,",
			"11": "<sup>11</sup> Ket cunada, Casano ti pannacaammo ti Dios? Ket adda aya pannacaammo idiay Cangatoan?",
			"12": "<sup>12</sup> Matmatanyo, dagitoy dagiti nadangkes; ket idinto a sinanam-ayda laeng, dumegdeg ti kinabacnangda.",
			"13": "<sup>13</sup> Pudno nga ubbaw ti panangugasco itoy pusoc, ken panagbuggoc cadagiti im-imac iti kinadalus;",
			"14": "<sup>14</sup> Ta agmalmalem a nadidigraac, ket ti pannacadusac binigambigat.",
			"15": "<sup>15</sup> No kinunac coma, Casta ti sawecto; Ney, nagaramidac coman iti liniliput iti caputotan dagiti annacmo.",
			"16": "<sup>16</sup> Idi pinanunotco no casano ti pannacaammoc coma iti daytoy, napalalo ti rigatco;",
			"17": "<sup>17</sup> Inggana iti napanac iti nasantoan a disso ti Dios, ken inututobco ti maudi a tungpalda.",
			"18": "<sup>18</sup> Pudno nga icabilmo ida cadagiti nagalis a yan: itublacmo ida iti pannacadadael.",
			"19": "<sup>19</sup> Anian ti panagbalinda a nalangalang iti apagdaricmat; marunotda a maibus cadagiti amames.",
			"20": "<sup>20</sup> Cas maysa a dardarepdep no agriing datao, casta, O Apo, no agriingca, umsiemto ti langada.",
			"21": "<sup>21</sup> Ta ti cararwac napataramnay, ken naduyocac itoy pusoc:",
			"22": "<sup>22</sup> Iti casta napaduegac, ken nanengnengac; maysaac a cas atap nga animal iti sangoanam.",
			"23": "<sup>23</sup> Nupay casta siaaddaac a cancanayon kenca: tinengngelmo ti canawan nga imac.",
			"24": "<sup>24</sup> Sica iturongnacto iti pammatigmaanmo, ket calpasanna awatennacto iti kinadayag.",
			"25": "<sup>25</sup> Siasino ti tagicuaec sadi langit no saan a sica? Ket awan ditoy rabaw ti daga ti aniaman a tarigagayac no saan a sica.",
			"26": "<sup>26</sup> Ti lasagco ken ti pusoc marsaac-da; ngem ti Dios isu ti kired toy pusoc ken biangco nga agnanayon.",
			"27": "<sup>27</sup> Ta, ni, dagiti adayo kenca mapucawdanto: rinacracmo amin dagiti agbalangcantis, nga aglicud kenca.",
			"28": "<sup>28</sup> Ngem nasayaat nga umasasidegac iti Dios: pinagbalinco ni Apo Jehova a camangco, tapno maisaritac amin dagiti ar-aramidmo."
		},
		"74": {
			"1": "<sup>1</sup> O Dios, apay a pagtalawennacami nga agnanayon? Apay a dayta pungtotmo umasoc a bumosor cadagiti carcarnero iti pagpaarabam?",
			"2": "<sup>2</sup> Lagipem ti gimongmo a pinaaddam nanipud idi ugma, isu a sinubbotmo tapno isu ti capuonan a patawidam; ken ti bantay Sion, a nagtaengam.",
			"3": "<sup>3</sup> Iturongmo dagita sacsacam cadagiti agnanayon a nawalangwalang, iti amin a dakes nga inaramid ti cabusor iti nasantoan a disso.",
			"4": "<sup>4</sup> Dagiti cabcabusormo nagugada iti tengnga ti gimongmo; imbayogda dagiti wagaywayda a castanda.",
			"5": "<sup>5</sup> Arigda la cadagiti tattao a nangitag-ay cadagiti wasay nga agdisso iti recrec dagiti caycayo.",
			"6": "<sup>6</sup> Ket ita amin a kinitikitan nga aramidna tumekenda iti wasay ken cadagiti marmartillo.",
			"7": "<sup>7</sup> Inuramda ti balaymo a nasantoan; tinabbaawanda a rinebba ti pagnaedan ti naganmo inggana iti daga.",
			"8": "<sup>8</sup> Kinunada iti pusoda, Dadaelentayo amin ida a maminpinsan: pinuuranda amin dagiti paggigimongan a maipaay ti Dios iti daga.",
			"9": "<sup>9</sup> Saantayo a makitan dagiti tandatayo: awanen ti siasinoman a mammadto; cadatayo awan ti siasinoman a macaammo no casano ti cabayagna.",
			"10": "<sup>10</sup> Casano ti capaut, O Dios, ti panangumumsi ti cabusor? Cancanayonto aya a pagtabtabbaawan ti cabusor ta naganmo?",
			"11": "<sup>11</sup> Apay a medmedam ta imam, dayta met laeng canawanmo? Ucsutemon ita barucongmo, ket runutem ida.",
			"12": "<sup>12</sup> Nupay casta ti Dios isu ti Ari nanipud ugma, a mangaramid iti pannacaisalacan ditoy daga.",
			"13": "<sup>13</sup> Sica binisacmo ti baybay ita kinapigsam: sica binuracmo dagiti ul-ulo dagiti nacaalaligagaw iti taaw.",
			"14": "<sup>14</sup> Sica binuracmo dagiti ul-ulo ti leviatan; isu intedmo a taraon dagiti tattao nga agnaed iti let-ang.",
			"15": "<sup>15</sup> Linuctam dagiti ubbog ken carcarayan: pinagmagam dagiti napegges nga ay-ayus.",
			"16": "<sup>16</sup> Ti aldaw cucuam, ket ti rabii cucuam met: sica ti nangsagana iti silaw ken iti init.",
			"17": "<sup>17</sup> Incabilmo dagiti pagpatinggaan ti daga: inaramidmo dagiti tiempo ti pudot ken lamec.",
			"18": "<sup>18</sup> Lagipem daytoy, a ti cabusor nangumumsin, O Jehova, ken ti maysa a simamauyong nga umili nagtabbaawanda ta naganmo.",
			"19": "<sup>19</sup> O dica iyawat ti cararwa ti pagawmo iti atap nga animal: dica lipaten nga agnanayon ti biag ti nacacaasim.",
			"20": "<sup>20</sup> Icancanom coma ti tulag; ta dagiti nasipnget a disso toy daga napnoda cadagiti pagyanan ti kinadawel:",
			"21": "<sup>21</sup> O saan coma nga agsubli a mabainan ti mairurumen: ti napanglaw ken macasapul idaydayawda coma ta naganmo.",
			"22": "<sup>22</sup> Bumangonca, O Dios, icalintegam ti bucudmo met laeng a panggep: lagipem a ti ong-ong a tao umumsiennaca nga agmalmalem.",
			"23": "<sup>23</sup> Dica lipaten ti timec dagiti cabcabusormo. Ti gulogulo dagiti umalsa kenca pumigsa a cancanayon."
		},
		"75": {
			"1": "<sup>1</sup> Agyamancami kenca, O Dios; agyamancami, ta ti naganmo asideg: dagiti tattao saritaenda dagiti nacascasdaaw nga ar-aramidmo.",
			"2": "<sup>2</sup> Intono dumteng ti naikeddeng a tiempo, mangipatoacto a sililinteg.",
			"3": "<sup>3</sup> Ti daga ken dagiti agnaed marunawda: salimetmetac dagiti adigina. (Selah)",
			"4": "<sup>4</sup> Kinunac cadagiti napalangguad, Saancayo nga agpalpalangguad; ket cadagiti nadangkes, dicayo itingra dagiti sarayo:",
			"5": "<sup>5</sup> Dicayo patingraen a nangato dagiti sarayo; dicayo agsao a sisisickil ti tengngedyo.",
			"6": "<sup>6</sup> Ta saan nga iti daya, saan nga iti laud, di met iti abagatan, ti paggapuan ti pannacaipangato.",
			"7": "<sup>7</sup> Ta ti Dios isu ti ocom: ipababana ti maysa, ipangatona ti sabali.",
			"8": "<sup>8</sup> Ta iti ima ni Jehova adda maysa a tagayan, ket ti arac rumasoc; napno iti ninawnaw ken sana met la ibuyat: agpayso a dagiti ared-edna arebebento amin dagiti nadangkes iti daga, ket inumendanto.",
			"9": "<sup>9</sup> Ngem ipalawagconto nga agnanayon, icantacto ti panangidaydayaw iti Dios ni Jacob.",
			"10": "<sup>10</sup> Amin met dagiti sarsara dagiti nadangkes putdecto; ngem dagiti sarsara dagiti nalinteg maipangatonto."
		},
		"76": {
			"1": "<sup>1</sup> Idiay Juda naamammoda ti Dios: ti naganna naindaclan sadi Israel.",
			"2": "<sup>2</sup> Idiay met Salem adda ti tabernaculona, ken ti pagtaenganna idiay Sion.",
			"3": "<sup>3</sup> Sadiay binungtonda dagiti panpana ti bai; ti calasag, ken ti campilan, ken ti gubat. (Selah)",
			"4": "<sup>4</sup> Nagloriaanca, ket natan-occa, uray pay cadagiti banbantay a pagtucmaan.",
			"5": "<sup>5</sup> Dagiti nabileg ti pusoda agbalinda a sinamsam, inturogdan ti turogda; ket awan cadagiti tattao a napigsa ti nacaaramat cadagiti im-imada.",
			"6": "<sup>6</sup> Iti panagungetmo, O Dios ni Jacob, ti lugan ken ti cabayo agpadpadda a maitebbang iti nargaan a turog.",
			"7": "<sup>7</sup> Sica, pudno a sica, pagbutbutngandaca; ket siasino ti macapagtacder iti sangoanam no agpungtotcan?",
			"8": "<sup>8</sup> Impangngegmo ti keddeng manipud sadi langit; ti daga nagbuteng, ket nagmayeng,",
			"9": "<sup>9</sup> Idi bimmangon ti Dios a mangocom, tapno isalacanna amin a naemma itoy daga. (Selah)",
			"10": "<sup>10</sup> Pudno a ti pungtot ti tao pacaidayawamto: ti tidda ti pungtot pagbarikesmonto.",
			"11": "<sup>11</sup> Agcaricayo, ket agbayadcayo ken Jehova a Diosyo: amin dagiti adda iti arpadna agyegda coma cadagiti sagsagut kencuana isu a rebbeng a pagbutngan.",
			"12": "<sup>12</sup> Gudasennanto ti espiritu dagiti piprincipe: Isu macaamames cadagiti ar-ari ditoy daga."
		},
		"77": {
			"1": "<sup>1</sup> Iyickisconto iti Dios, ti timecco, wen iti Dios, ti timecco; ket isu imdengannacto.",
			"2": "<sup>2</sup> Idi aldaw ti panagdanagco binirocco ti Apo: ti imac naiyunnat a nagpatpatnag ket saan a limmucay; toy cararwac dina cayat ti maliwliwaan.",
			"3": "<sup>3</sup> Lagipec ti Dios, ket maculcolanac: agasugac, ket ti espirituc maimameg, (Selah)",
			"4": "<sup>4</sup> Tenglem dagiti matac nga agsiput: nalaus ti pannacariribucco a diac macasao,",
			"5": "<sup>5</sup> Inututobco dagiti al-aldaw idi ugma, dagiti tawtawen dagidi cadaanan a tiempo.",
			"6": "<sup>6</sup> Abbucayeg itoy lagipco ti cantac iti rabii: casasaoc toy pusoc met laeng; ket ti cararwac aramidenna ti naregta a panagsukisuc.",
			"7": "<sup>7</sup> Agnanayon aya a mangbaybay-anto ti Apo? Ket saanto aya a mangngaasin?",
			"8": "<sup>8</sup> Ti kinamanagayatna nagawanen aya iti agnanayon? Ti carina agpucawen ngata a cancanayon?",
			"9": "<sup>9</sup> Nalipatanen ti Dios ti kinamanangparaburna? Iti pungtotna pinagrikepnan aya dagiti nadungngo nga asina? (Selah)",
			"10": "<sup>10</sup> Ket kinunac, Daytoy ti dadagsenco; ngem lagipecto dagiti tawtawen ti macanawan nga ima ti Cangatoan.",
			"11": "<sup>11</sup> Saritaecto dagiti ar-aramid ni Jehova, ta lagipecto dagiti nacascasdaaw a gapuanam idi ugma:",
			"12": "<sup>12</sup> Pampanunutecto met amin nga aramidmo, ken ututubecto dagiti gapuanam.",
			"13": "<sup>13</sup> Ti dalanmo, O Dios, adda iti kinasanto: siasino ti naindaclan a dios a cas iti Dios?",
			"14": "<sup>14</sup> Sica ti Dios nga agaramid cadagiti nacascasdaaw: impacaammom ti pigsam iti nagtengngaan dagiti tattao.",
			"15": "<sup>15</sup> Sinubbotmo ita tackiagmo ti ilim, dagiti annac da Jacob ken Jose. (Selah)",
			"16": "<sup>16</sup> Dagiti dandanum nakitadaca, O Dios; dagiti dandanum nakitadaca, nagbutengda: dagiti caadalman nagpigergerda met.",
			"17": "<sup>17</sup> Dagiti ul-ulep nagibuyatda iti danum; dagiti langlangit nagyesngawda iti aweng: dagiti pampanam met nagsawarda.",
			"18": "<sup>18</sup> Ti uni ti gurroodmo nagallicubeng iti alipugpug; dagiti kimkimat sinilnaganda toy lubong: ti daga nagarigengen ket naggingined.",
			"19": "<sup>19</sup> Ti dalanmo adda idi iti taaw, ket dagiti danam cadagiti dadackel a dandanum, ken dagiti tugtugotmo saan ida a nailasin.",
			"20": "<sup>20</sup> Impangoloam ti ilim a cas maysa a pangen, babaen ti panangibin da Moises ken Aaron."
		},
		"78": {
			"1": "<sup>1</sup> Ipangagmo, O ilic, ti lintegco: Yallingagmo dagita lapayagyo cadagiti sao ti ngiwatco.",
			"2": "<sup>2</sup> Yebcasto toy ngiwatco iti maysa a pangngarig; yesngawconto dagiti nasipnget a sasao idi ugma,",
			"3": "<sup>3</sup> Isuda a nangngeg ken naammoantayo ken imbaga cadatayo dagidi amammatayo.",
			"4": "<sup>4</sup> Dicamto ilimed ida dadagiti putputotda, babaen ti panangibagami iti caputotan a sumaruno cadagiti pacaidaydayawan ni Jehova, ken ti kinapigsana, ken dagiti nacascasdaaw nga ar-aramid nga inaramidna.",
			"5": "<sup>5</sup> Ta nangted iti pammanecnec ken Jacob, ket nangikeddeng iti linteg iti Israel, isu nga imbilinna cadagiti amammatayo, nga ipacaammoda ida cadagiti putputotda;",
			"6": "<sup>6</sup> Tapno ti caputotan a sumaganad maammoanna ida, agpapan dagiti ubbing a mayanacto; dagidiay bumangondanto ket ibagadanto ida cadagiti putputotda,",
			"7": "<sup>7</sup> Tapno maisaadda coma ti inanamada iti Dios, ken dida malipatan dagiti aramid ti Dios, ngem salimetmetanda ketdi dagiti bilbilinna,",
			"8": "<sup>8</sup> Ken saanda coma a cas cadagidi amammada, a caputotan a patupec ket nasungit, caputotan a dida mapaglinteg ti pusoda, ken ti espirituda saan a natalingenngen iti Dios.",
			"9": "<sup>9</sup> Dagiti anac ni Efraim, idinto a nagtagiarmas ken nagtagipanada, naglicudda idi aldaw ti bacal.",
			"10": "<sup>10</sup> Dida sinalimetmetan ti tulag ti Dios, ket indianda ti nagna iti lintegna;",
			"11": "<sup>11</sup> Ket linipatanda dagiti ar-aramidna, ken dagiti nacascasdaaw a gapuanan nga imparangarangna cadacuada.",
			"12": "<sup>12</sup> Nacascasdaaw a banbanag dagiti inaramidna iti saclang dagiti amammada, idiay daga nga Egipto, idiay away ti Zoan.",
			"13": "<sup>13</sup> Binisngayna ti baybay, ket pinaglasatna ida iti tengngana; ket pinagtacderna dagiti dandanum a cas la napenpen.",
			"14": "<sup>14</sup> Iti aldaw inturturongna met ida babaen ti maysa nga ulep, ket bayat ti agpatnag iti lawag ti apuy.",
			"15": "<sup>15</sup> Pinagrengngatna dagiti batbato iti let-ang, ken iniccanna ida iti inumen a sibubuslon a cas aggapu cadagiti caungan.",
			"16": "<sup>16</sup> Pinagpusuacna met dagiti baresbes cadagiti batbato, ket pinagayusna dagiti dandanum a cas carcarayan.",
			"17": "<sup>17</sup> Nupay casta nagbasolda laeng iti maicaniwas kencuana, a bimmusor iti Cangatoan idiay let-ang.",
			"18": "<sup>18</sup> Ken sinuutda ti Dios iti pusoda gapu iti panagkiddawda iti taraon a cas maitutop iti tarigagayda.",
			"19": "<sup>19</sup> Wen, nagsaoda iti maibusor iti Dios; kinunada, Mabalin ngata ti Dios nga isagana ti canen ditoy let-ang?",
			"20": "<sup>20</sup> Adtoy, dinugsolna ti bato, ket iti casta pimsuac dagiti dandanum, ket dagiti carayan naglippiasda; macaited met ngata iti tinapay? mangipaayto ngata iti carne iti ilina?",
			"21": "<sup>21</sup> Ngarud ni Jehova nangngegna, ket nacapungtot; ket simged ti apuy a maibusor ken Jacob, ken castamet ti pungtot nagpalalo a mangbusor iti Israel;",
			"22": "<sup>22</sup> Gapu ta saanda a namati iti Dios, ket saanda a nagtalec iti panangisalacanna.",
			"23": "<sup>23</sup> Nupay casta binilinna dagiti tangatang iti ngato, ket linuctanna dagiti ruangan ti langit;",
			"24": "<sup>24</sup> Ket intudona cadacuada ti mana a canenda, ket intedna cadacuada ti taraon manipud langit.",
			"25": "<sup>25</sup> Ti tao nangan iti tinapay ti mannacabalin: imbaonanna ida iti taraon a naananay.",
			"26": "<sup>26</sup> Pinagpul-oyna ti casaor cadagiti tangatang; ket iti bilegna inturongna ti angin nga abagat.",
			"27": "<sup>27</sup> Nagtudo met iti carne cadacuada cas tapoc, ken payacan a tumtumatayab a cas iti darat dagiti baybay:",
			"28": "<sup>28</sup> Ket pinagtinnagna iti tengnga ti nagpacarsoanda, iti aglicmut cadagiti nagnaedanda.",
			"29": "<sup>29</sup> Iti casta nanganda, ket nagpennecda a nalaing; ket itedna cadacuada ti calicagumda met laeng.",
			"30": "<sup>30</sup> Dida pay naisina iti daydi a tinarigagayanda, adda pay laeng cadagiti ngiwngiwatda daydi canenda,",
			"31": "<sup>31</sup> Idi a rimmangen ti pungtot ti Dios cadacuada, ket nangpapatay cadagiti cabanegan cadacuada, ken impasagna dagiti napili a taga-Israel.",
			"32": "<sup>32</sup> No man pay castoy isuda nagbasbasolda laeng, ken dida namati cadagiti nacascasdaaw nga ar-aramidna.",
			"33": "<sup>33</sup> Gapuna a dagiti al-aldawda inibusna iti barengbareng, ket dagiti tawtawenda iti ames.",
			"34": "<sup>34</sup> Idi a papatayenna ida, isu metten ti panangbirucda kencuana; ket nagsublida ken sinapulda a sipapasnec ti Dios.",
			"35": "<sup>35</sup> Ket nalagipda a ti Dios isu ti batoda, ket ti Cangatoan a Dios ti manubbot cadacuada.",
			"36": "<sup>36</sup> Ngem isu inalaliugda babaen ti ngiwatda, nagulbodda kencuana, babaen ti dilada.",
			"37": "<sup>37</sup> Ta ti pusoda saan a nalinteg kencuana, dida met sitatalimudoc iti tulagna.",
			"38": "<sup>38</sup> Ngem isu, idinto a manangngaasi, pinacawanna ti kinadakesda, ket saanna a pinucaw ida: wen, naminadu nga incalilisna ti pungtotna, ket saanna nga impapas amin a pungtotna.",
			"39": "<sup>39</sup> Ket linaglagipna nga isuda lasagda laeng, angin a lumabas, ket saan nga agsublin.",
			"40": "<sup>40</sup> Anian a nagadu ti ibubusorda kencuana idiay tantanap, ken panamagladingitda kencuana idiay let-ang!",
			"41": "<sup>41</sup> Ket sinublianda manen ti mangsu-ut iti Dios, ken pinaungetda ti Santo ti Israel.",
			"42": "<sup>42</sup> Saanda a linaglagip ti imana, ken daydi aldaw a pinangsubbotna cadacuada iti cabusor;",
			"43": "<sup>43</sup> Casano ti panangicabilna cadagiti pagilasinanna idiay Egipto, ken cadagiti gapuananna a nacascasdaaw idiay tay-ac ti Zoan,",
			"44": "<sup>44</sup> Ket pinagbalinna a dara dagiti carcarayanda, ken dagiti baresbesda, tapno iti casta dida macainum.",
			"45": "<sup>45</sup> Nangibaon cadacuada cadagiti umatibelbel a ngilaw, a nangsepsep cadacuada; ken tuctucac, a nangdadael cadacuada.",
			"46": "<sup>46</sup> Inyawatna met ti kinarangpayada iti arabas, ken impadudonna ti nagbannoganda.",
			"47": "<sup>47</sup> Dinadaelna dagiti inuvasanda iti uraro, ket dagiti sicomoroda iti linnaaw a nagbalay.",
			"48": "<sup>48</sup> Impaayna met cadagiti an-animalda ti uraro, ket dagiti pangenda iti nabara a sal-it.",
			"49": "<sup>49</sup> Impalladawna met cadacuada ti kinarungsot ti pungtotna, rurod, ken gura, ken riribuc, bunggoy ti espiritu a dakes.",
			"50": "<sup>50</sup> Inyaramidanna iti dana ti pungtotna; saanna nga incaluya ti cararwada iti patay, intedna ketdi ti biagda iti angol,",
			"51": "<sup>51</sup> Ket dinanarna amin dagiti inauna nga annac sadi Egipto, ti pangolo ti pigsada cadagiti calapaw ni Cam.",
			"52": "<sup>52</sup> Ngem intulodna ti ilina met laeng a casda la carcarnero, ket inturongna ida iti let-ang a cas maysa a pangen.",
			"53": "<sup>53</sup> Ket intulodna ida a sitatalged, iti casta dida nagbuteng; ngem ti baybay linemmesna dagiti cabcabusorda.",
			"54": "<sup>54</sup> Ket inyegna ida iti pungto ti nasantoan a yan, iti daytoy a bantay, a pinaadda ti canawan nga imana.",
			"55": "<sup>55</sup> Pinacsiatna met dagiti nasnacion iti sangoananda, ken pinaglalasinna ida iti tawid ti pinuonpuon, ket pinagnaedna dagiti caputotan ni Israel cadagiti calcalapawda.",
			"56": "<sup>56</sup> Nupay casta sinu-ut ken bimmusorda iti Cangatoan a Dios, ket dida sinalimetmetan dagiti pamanecnecna;",
			"57": "<sup>57</sup> Timmallicudda ketdi, ken nangliliputda cas cadagiti ammada: naicabsiwda a cas mangallilaw a bai ti pana.",
			"58": "<sup>58</sup> Ta ginargarida a nacapungtot gapu cadagiti nangato a dissoda, ket ginutugotda nga agimon gapu cadagiti nakitikitan a ladawanda.",
			"59": "<sup>59</sup> Idi a ti Dios nangngegna daytoy, nagrurod, ket kinarimonna a napalalo ti Israel.",
			"60": "<sup>60</sup> Iti casta pinanawanna ti tabernaculo idiay Silo, ti tolda a binangonna iti nagtengngaan dagiti tattao:",
			"61": "<sup>61</sup> Ket inyawatna ti pigsana iti pannacacayaw, ken ti dayagna iti ima ti sumuppiat.",
			"62": "<sup>62</sup> Inyawatna met ti ilina iti campilan, ket nacapungtot iti patawidanna.",
			"63": "<sup>63</sup> Ti apuy linamutna dagiti cabanbannoagan a lallakida; ket dagiti virgenda awan cantada iti panagpaboda.",
			"64": "<sup>64</sup> Dagiti papadida naidalitda iti campilan; ket dagiti balbaloda dida nacapagunoy.",
			"65": "<sup>65</sup> Idi a casta ti Apo nagriing a cas maysa a nacaturog, cas mannacabalin a lalaki nga agisissiag gapu iti arac.",
			"66": "<sup>66</sup> Ket kinabilna a pinatallicudan dagiti simmuppiat kencuana: insaadna ida iti agnanayon a pannacaababi.",
			"67": "<sup>67</sup> Maysa pay binaybay-anna ti calapaw ni Jose, ken dina met nagayatan ti caputotan ni Efraim.",
			"68": "<sup>68</sup> Ngem pinilina ti caputotan ni Juda, ti bantay Sion nga inayatna.",
			"69": "<sup>69</sup> Ket binangonna ti santuariona a cas cadagiti alimpatoc, cas iti daga nga impasdecna tapno agnanayon.",
			"70": "<sup>70</sup> Pinilina met ni David nga adipenna, ken impanawna cadagiti pagaponan ti carnero.",
			"71": "<sup>71</sup> Nanipud iti panangsursurotna cadagiti cabayan nga addaan annac isu innalana, tapno isu ti pastor ni Jacob nga ilina, ken iti Israel a pinatawidanna.",
			"72": "<sup>72</sup> Iti casta isu idi ti pastorda cas mayannurot iti kinalinteg ti pusona, ket impangoloanna ida babaen ti kinalaing ti imana."
		},
		"79": {
			"1": "<sup>1</sup> O Dios, dagiti nasnacion umaydan iti uneg ti impatawidmo; ti nasantoan a templom minulitanda; impadsoda a ginabsoon ti Jerusalem.",
			"2": "<sup>2</sup> Dagiti bangcay dagiti adipenmo impalamutda cadagiti tumatayab dagiti tangatang, ti lasag dagiti sasantom cadagiti an-animal nga atap ditoy daga.",
			"3": "<sup>3</sup> Ti darada imbuyatda a cas danum iti aglawlaw ti Jerusalem; ket awan ti agitabon cadacuada.",
			"4": "<sup>4</sup> Nagbalincami a maumumsi cadagiti carcarrubami, ababien ken catcatawaan dagiti aglawlaw cadacami.",
			"5": "<sup>5</sup> Casano ti capautna, O Jehova? sipupungtotcanto aya nga agnanayon? Ti panagimonmo manguramto aya a cas apuy?",
			"6": "<sup>6</sup> Iparucpucmo ta pungtotmo cadagiti nasnacion a di-mangbigbig kenca, ken cadagiti pagpagarian nga di-umawag ita naganmo.",
			"7": "<sup>7</sup> Ta inibusda ni Jacob, ket rinagragda ti pagnaedanna.",
			"8": "<sup>8</sup> Dica cadi isingir cadacami dagiti kinadakes dagiti dadackelmi: sabtennacami cadi a sipapardas dagita nadungngo a caasim; ta naipababacami unayen.",
			"9": "<sup>9</sup> Saranayennacami, O Dios ti pannacaisalacanmi, tapno pacaidaydayawan ti naganmo; ket ispalennacami, ken pacawanem dagiti basbasolmi, gapu met laeng ita naganmo.",
			"10": "<sup>10</sup> Ania ti gapuna a dagiti nasnacion macunadanto, Sadino ti ayan ti Diosda? ti pannacaibales ti dara dagiti ad-adipenmo a naibuyat mabigbig cadi dagiti nasnacion iti saclangmi.",
			"11": "<sup>11</sup> Ti sennaay ti nacayawan dumanon coma ita saclangmo: cas mainugot iti kinadackel ti pannacabalinmo salacnibam cadi dagiti naipato ken patay;",
			"12": "<sup>12</sup> Ket isublim cadagiti carrubami ti maminpito idiay barucongda ti panagumsi, isu a pinangumumsida kenca, O Apo.",
			"13": "<sup>13</sup> Iti casta dacami nga ilim ken carcarnero iti pagpaarabam agyamancamto kenca nga agnanayon: iparangarangminto ti pacaidaydayawam cadagiti amin a capcaputotan."
		},
		"80": {
			"1": "<sup>1</sup> Timudem, O Pastor ti Israel, sica a mangiturong ken Jose a cas maysa a pangen; sica nga agtugaw iti rimbaw dagiti querubin, agraniagca cadi.",
			"2": "<sup>2</sup> Iti sango da Efraim, Benjamin ken Manases, paggunayem ti pigsam, ket, umaynacami isalacan.",
			"3": "<sup>3</sup> Ipasublinacam cadi, O Dios; ken pagraniagem ta rupam, ket maisalacancamto.",
			"4": "<sup>4</sup> O Jehova Dios dagiti buybuyot, casano ti capaut a sipupungtotca iti cararag ti ilim?",
			"5": "<sup>5</sup> Sica tinaraonam ida iti tinapay a lulua, ken impainummo cadacuada ti lulua a nalaus ti caaduna.",
			"6": "<sup>6</sup> Sica pakirupirennacami cadagiti caarsubami; ket dagiti cabusormi agkikinnatawada.",
			"7": "<sup>7</sup> Ipasublinacam cadi, O Dios dagiti buybuyot; ken pagraniagem ta rupam, ket maisalacancamto.",
			"8": "<sup>8</sup> Nangalaca iti maysa nga uvas manipud Egipto: pinacsiatmo dagiti nasnacion, ket immulam.",
			"9": "<sup>9</sup> Insaganaam iti lugar, ket rimmamut a nauneg, ket sinacnapanna ti daga.",
			"10": "<sup>10</sup> Dagiti banbantay naabbonganda iti linongna, ket dagiti sarsaringitna arigda la cadagiti cedro ti Dios.",
			"11": "<sup>11</sup> Insalumpayacna dagiti sangsangana inggana iti taaw, ket dagiti rusrusingna agingga idiay Carayan.",
			"12": "<sup>12</sup> Apay a rinebbam dagiti bacbacudna, ket iti casta amin dagiti lumabas iti dalan rabsutenda?",
			"13": "<sup>13</sup> Ti alingo ti cabakiran ragragenna, ket dagiti atap nga an-animal nagcaanda kencuana.",
			"14": "<sup>14</sup> Dawatenmi kenca, sumublica cadi, O Dios dagiti buybuyot: tannawagam manipud langit, ket matmatam, ken sucnalam daytoy nga uvas,",
			"15": "<sup>15</sup> Ken ti uvas nga immula ta canawan nga imam, ken ti sanga a pinatibkermo tapno agservi kenca met laeng.",
			"16": "<sup>16</sup> Napuuran iti apuy, napucan; mapucawda gapu iti panangunget ta langam.",
			"17": "<sup>17</sup> Ta imam maipatay coma iti tao dita macanawanmo, iti anac ti tao a pinapigsam tapno agservi kenca.",
			"18": "<sup>18</sup> Iti casta dicamto tumallicud kenca: papartakennacami, ket awaganminto ta naganmo.",
			"19": "<sup>19</sup> Ipasublinacam cadi, O Jehova a Dios dagiti buybuyot; pagraniagem ta rupam, ket maisalacancamto."
		},
		"81": {
			"1": "<sup>1</sup> Catinggawenyo ti mangcanta ti agpaay iti Dios a pigsatayo: ipaayanyo iti naragsac nga aweng ti Dios ni Jacob.",
			"2": "<sup>2</sup> Mangrugicayo iti maysa a canta, ket yegyo ditoy ti Pandareta, ti nacaayayo nga arpa agraman salterio.",
			"3": "<sup>3</sup> Puyotenyo ti tororot no aglutuad, no cumabus, iti aldaw ti fiestatayo.",
			"4": "<sup>4</sup> Ta isu ti linteg ken Israel, maysa a bilin ti Dios ni Jacob.",
			"5": "<sup>5</sup> Isu ti inkeddengna ken Jose a maipaay a pamanecnec, idi a rimmuar idiay daga nga Egipto   isu a nacangngegac ti pagsasao a diac ammo.",
			"6": "<sup>6</sup> Inlisic ti abagana iti awiten: dagiti im-imana nailisida iti curibut.",
			"7": "<sup>7</sup> Sica immawagca iti pannacariribuc ket siac inispalca; sinungbatanca iti nalmeng a yan ti gurruood; sinuutca idiay danum ti Meriba. (Selah)",
			"8": "<sup>8</sup> Denggem, O ilic, ket mamanecnecacto kenca: O Israel, no comano ipangagnac!",
			"9": "<sup>9</sup> Awanto ti gangannaet a Dios kenca; dicanto met agdaydayaw iti aniaman a dios a gangannaet.",
			"10": "<sup>10</sup> Siac ni Jehova a Diosmo, a nangaon kenca idiay daga nga Egipto: ingangam a nalaing ta ngiwatmo, ket siac punnoecto.",
			"11": "<sup>11</sup> Ngem ti ilic dina impangag ti timecco; ken ti Israel dinac kinayat.",
			"12": "<sup>12</sup> Ita casta binaybay-ac ida a sumurot iti kinasungit ti pusoda, tapno magnada cadagiti bucbucodda a balbalacad.",
			"13": "<sup>13</sup> O no ti ilic, denggennac coma, no ti Israel magna coma cadagiti daldalanco!",
			"14": "<sup>14</sup> Pagtamedec coma daras dagiti cabcabusorda, ken iwadagco coma toy imac cadagiti casupadida.",
			"15": "<sup>15</sup> Dagiti gumurgura ken Jehova agpacumbabada coma kencuana: ket ti tiempoda agpaut coma iti agnanayon.",
			"16": "<sup>16</sup> Taraonanna met coma ida iti casayaatan ti trigo; ken iti diro nga aggapu iti bato siac pennekenca coma."
		},
		"82": {
			"1": "<sup>1</sup> Ti Dios agtatacder iti gimong a maipaay iti Dios; isu mangocom iti nagtengngaan dagiti didios.",
			"2": "<sup>2</sup> Casano ti cabayag ti panangocomyonto a sikikillo, ken pammadayawyo cadagiti tattao a managdacdakes? (Selah)",
			"3": "<sup>3</sup> Ocomenyo dagiti napanglaw ken ul-ulila: aramidenyo ti kinalinteg cadagiti naladingit ken nacurapay.",
			"4": "<sup>4</sup> Subbotenyo dagiti napanglaw ken macasapul: ispalenyo ida iti ima dagiti managdacdakes.",
			"5": "<sup>5</sup> Awan ammoda, dida met macaawat; agatatingawda iti kinasipnget: amin dagiti pamuon ti daga agarigengenda.",
			"6": "<sup>6</sup> Kinunac, Dacayo dioscayo, ket dacayo amin annacnacayo ti Cangatoan.",
			"7": "<sup>7</sup> Nupay casta mataycayto a cas cadagiti tattao, ken matuang a cas maysa cadagiti piprincipe.",
			"8": "<sup>8</sup> Bumangonca, O Dios, ocomem ti daga; ta tawidemto amin dagiti nasnacion."
		},
		"83": {
			"1": "<sup>1</sup> O Dios, dica taginayonen ta ulimecmo: dica agtalna, ket dica agmayeng, O Dios.",
			"2": "<sup>2</sup> Ta, ni, dagiti cabusormo agririawda; ket dagiti gumurgura kenca intangadda ti uloda.",
			"3": "<sup>3</sup> Adda nasicap a gandat a pangbusorda iti ilim, ket agbibinnalacadda iti maibusor cadagiti salsalacnibam.",
			"4": "<sup>4</sup> Kinunada, Umaycayo, ket gupdentayo ti kinanacionda; tapno ti nagan ti Israel saanen a malaglagip.",
			"5": "<sup>5</sup> Ta nagtitimpuyogda amin; mangaramidda iti maysa a tulag a maibusor kenca:",
			"6": "<sup>6</sup> Dagiti calcalapaw ti Edom ken dagiti Ismaelitas; ti Moab, ken dagiti Agarenos;",
			"7": "<sup>7</sup> Gebal, ken Ammon, ken Amalec; Ti Filistia agraman dagiti umili iti Tiro;",
			"8": "<sup>8</sup> Ti met Asiria kimmanunong cadacuada; isuda dagiti catulungan dagiti annac ni Lot. (Selah)",
			"9": "<sup>9</sup> Aramidem cadacuada ti cas ken Madian, ti cas ken Sisara, ti cas ken Jabin, idiay carayan Cison;",
			"10": "<sup>10</sup> Isuda a natay idiay Endor, dagidi nagbalin a cas rugit a maipaay itoy daga.",
			"11": "<sup>11</sup> Pagbalinem dagiti natan-oc cadacuada a cas cada Oreb ken Zeeb; wen, amin dagiti piprincipeda cas cada Zeba ken Zalmunna;",
			"12": "<sup>12</sup> Isuda a nagcuna, Alaentayo ketdi a tagicuaen dagiti pagnaedan ti Dios.",
			"13": "<sup>13</sup> O Diosco, pagbalinem ida a cas agalalipugpug a tapuc; cas mayang-angin a nagpatpatan.",
			"14": "<sup>14</sup> Cas apuy a mangpuur iti bakir, cas gil-ayab a manguram cadagiti bantay;",
			"15": "<sup>15</sup> Casta coma ti panangcamat cadacuada ti bagiom, ken panangkigtot cadacuada ti alipugpugmo.",
			"16": "<sup>16</sup> Punnoem dagiti ruprupada iti bain, bareng sapulenda coma ti naganmo, O Jehova.",
			"17": "<sup>17</sup> Mabainanda ken mariribucda coma nga agnanayon; wen, maariwengda cadi ket mapucawda;",
			"18": "<sup>18</sup> Bareng maammoanda coma a sicsica laeng, nga agnagan Jehova, ti Cangatoan a ringbawam iti amin a daga."
		},
		"84": {
			"1": "<sup>1</sup> Nagimnasdan dagiti tabernaculom, O Jehova dagiti buybuyot!",
			"2": "<sup>2</sup> Toy cararwac siiiliw, wen, sisesegga cadagiti paraangan ni Jehova; ti pusoc ken lasagco umumkisda iti Dios a sibibiag.",
			"3": "<sup>3</sup> Uray, ti pay billit nacasapul iti balayna, ket ti sallapingaw, maysa a pagumocan a maipaay kencuana met laeng a pangicabilanna cadagiti annacna, isu met dagiti altarmo, O Jehova dagiti buybuyot, Aric ket Diosco.",
			"4": "<sup>4</sup> Nagasat dagiti agtaeng iti balaymo: sidadayawdanto laeng kenca. (Selah)",
			"5": "<sup>5</sup> Nagasat ti tao a ti bilegna agtaud kenca; nga iti pusona adda dagiti dalan nga agpa-Sion.",
			"6": "<sup>6</sup> Idinto nga aglasatda idiay lobong ti Sangsangit pagbalinenda a yan dagiti burayoc; wen, ti nasapa a tudo lapunosenna ida cadagiti parabur.",
			"7": "<sup>7</sup> Pumigsada laeng a pumigsa; tunggal maysa cadacuada agparang iti saclang ti Dios idiay Sion.",
			"8": "<sup>8</sup> O Jehova Dios dagiti buybuyot, denggem ti cararagco; tumimudca, O Dios ni Jacob. (Selah)",
			"9": "<sup>9</sup> Imatangam, O Dios a calasagmi, ket siputam ti rupa ti pinulutam.",
			"10": "<sup>10</sup> Ta ti maysa nga aldaw cadagiti paraanganmo nasaysayaat ngem sangaribu. Caycayatco laengen ti agbantay iti ruangan ti balay ti Diosco, ngem ti panagnaed cadagiti calapaw ti kinadangkes.",
			"11": "<sup>11</sup> Ta ni Jehova a Dios isu ti init ken calasag: ni Jehova mangtedto iti parabur ken gloria; awanto ti imbag a maikedked cadagiti magna a sililinteg.",
			"12": "<sup>12</sup> O Jehova dagiti buybuyot, nagasat ti tao nga agcammatalec kenca."
		},
		"85": {
			"1": "<sup>1</sup> Jehova, sica pinaraburam ti dagam; pinagawidmon iti pannacacayaw ni Jacob.",
			"2": "<sup>2</sup> Pinacawanmo ti kinadakes ti ilim; inabbongam amin a basolda. (Selah)",
			"3": "<sup>3</sup> Iniccatmo amin a pungtotmo; nagpanawam ti kinarungsot ti pungtotmo.",
			"4": "<sup>4</sup> Agsublica cadacami, O Dios ti pannacaisalacanmi, ket pagsardayem ti lucsawmo cadacami.",
			"5": "<sup>5</sup> Capungtotnacamto aya nga agnanayon? Padanonemto aya ti pungtotmo cadagiti amin a capcaputotan?",
			"6": "<sup>6</sup> Dinacamto aya pagbiagenen, tapno ti ilim macapagragsac kenca?",
			"7": "<sup>7</sup> Iparangarangmo cadacami ti kinamanagayatmo, O Jehova, ket itdem cadacami ti panangisalacanmo.",
			"8": "<sup>8</sup> Denggecto ti saoen ni Jehova a Dios; ta agsaonto iti cappia iti ilina, ken cadagiti sasantosna: ngem saanda cadi a sumublin iti kinamaag.",
			"9": "<sup>9</sup> Pudno a ti panangisalacanna asideg cadagiti agbuteng kencuana, tapno ti dayag agtaeng iti dagatayo.",
			"10": "<sup>10</sup> Ti panangngaasi ken kinapudno nagaracupda; ti kinalinteg ken cappia naginnagepda.",
			"11": "<sup>11</sup> Ti pudno tumaud ditoy daga ket ti kinalinteg timmannawag manipud langit.",
			"12": "<sup>12</sup> Wen, ni Jehova itdennanto ti naimbag; ket ti dagatayo pataudennanto ti bungana.",
			"13": "<sup>13</sup> Ti kinalinteg magnanto iti sangoananna, ket pagbalinennanto a dana dagiti tugtugotna."
		},
		"86": {
			"1": "<sup>1</sup> Itimudmo cadi ta lapayagmo, O Jehova, ket sungbatannac; ta napanglawac ket nacurapayac.",
			"2": "<sup>2</sup> Salacnibam toy cararwac; yantangay sitataengac iti Dios: sica O Diosco, isalacanmo cadi ti adipenmo nga agtalec kenca.",
			"3": "<sup>3</sup> Mangngaasica caniac, O Apo; ta sica ti umumkisac nga agmalmalem.",
			"4": "<sup>4</sup> Paragsakem ti puso ti adipenmo; ta kenca, O Apo, itangadco toy cararwac.",
			"5": "<sup>5</sup> Ta sica, Apo, naimbagca, ken sisasaganaca a mamacawan, ken aglaplapusananca iti kinamagayat cadagiti amin nga umawag kenca.",
			"6": "<sup>6</sup> Imdengam cadi, O Jehova, ti cararagco; ket timudem ti timec dagiti ar-ararawco.",
			"7": "<sup>7</sup> Iti aldaw a panagducotco umawagacto kenca; ta sica sungbatannacto.",
			"8": "<sup>8</sup> Awan ti cas kenca cadagiti didiosen, O Apo; awan met ti cas cadagiti ar-aramidmo.",
			"9": "<sup>9</sup> Amin dagiti nasnacion nga inaramidmo umaydanto nga agrucbab iti saclangmo, O Apo; ket ipaduyacyacdanto ti tan-oc ti naganmo.",
			"10": "<sup>10</sup> Ta sica naidaclanca, ket agaramidca cadagiti nacascasdaaw: sicsica laeng ti Dios.",
			"11": "<sup>11</sup> Isurom caniac ti dalanmo, O Jehova; cayatco ti magna iti kinapudnom: pagcaycaysaem toy pusoc tapno agbuteng ita naganmo.",
			"12": "<sup>12</sup> Idaydayawcanto, O Apo a Diosco, iti amin a pusoc; ket idaydayawconto ti naganmo iti agnanayon.",
			"13": "<sup>13</sup> Ta dackel ti kinamanagayatmo caniac; ken inaonmo toy cararwac iti caungan a Tanem.",
			"14": "<sup>14</sup> O Dios, dagiti nacuspag bimmangonda a bumusor caniac, ket sangcabunggoy a tattao a managrabsut binirocda toy cararwac, ket saandaca nga insaad iti saclangda.",
			"15": "<sup>15</sup> Ngem sica, O Apo, Diosca a naasi ken managparabur, naanatca nga agpungtot, ken aglaplapusananca iti kinamanagayat ken kinapudno.",
			"16": "<sup>16</sup> O tumaliawca caniac, ket caasiannac; itdem ta bilegmo itoy adipenmo, ket isalacanmo toy anac ti adipenmo a babai.",
			"17": "<sup>17</sup> Iparangannac iti tanda a pagimbagan, tapno dagiti gumurgura caniac makitada, coma ket mabainanda, ta sica, Jehova, binadangannac, ket liniwliwanac."
		},
		"87": {
			"1": "<sup>1</sup> Ti pamuonna adda cadagiti nasantoan a bantay.",
			"2": "<sup>2</sup> Ni Jehova ayayatenna dagiti ruangan ti Sion a nangnangrona ngem amin dagiti pagtaengan ni Jacob.",
			"3": "<sup>3</sup> Nadayag a banbanag dagiti panangsarsaritada kenca, O ili ti Dios. (Selah)",
			"4": "<sup>4</sup> Inaganacto ni Rahab ken Babilonia a casda maibilang cadagiti macaamammo caniac: adtoy, da Filistia, ken Tiro, agraman Etiopia: daytoy nayanac idiay.",
			"5": "<sup>5</sup> Wen, masasaonto ti Sion, Daytoy ken daydiay a naipasngay kencuana; ket ti met laeng Cangatoan ti mamatacderto kencuana.",
			"6": "<sup>6</sup> Ni Jehova ibilangnanto, intono ilanadna dagiti tattao, daytoy naipasngay idiay. (Selah)",
			"7": "<sup>7</sup> Dagiti agcancanta a cas met cadagiti agsalsala cunaendanto, amin dagiti ububbogco addada kenca."
		},
		"88": {
			"1": "<sup>1</sup> O Jehova, ti Dios ti pannacaisalacanco, nagickisac iti aldaw ken rabii iti saclangmo.",
			"2": "<sup>2</sup> Toy cararagco macastrec cadi dita sangoanam; Yallingagmo cadi ta lapayagmo itoy cararagco:",
			"3": "<sup>3</sup> Ta ti cararwac sipupunno cadagiti ducducot, ket ti biagco umadani ken Tanem.",
			"4": "<sup>4</sup> Maibilangac cadagiti bumaba iti abut; arigac la tao nga awan pagpaarayatanna,",
			"5": "<sup>5</sup> A maipalladaw a cacanunong dagiti natay, cas iti napapatay a naidalit iti tanem, a dica lagipenen, ket nagudasdan dita imam.",
			"6": "<sup>6</sup> Sica insaadnac iti caunegan nga abut, cadagiti nasipnget a yan, cadagiti yuyeng.",
			"7": "<sup>7</sup> Ta pungtotmo agdisso a sibabantot caniac, ken pinagladingitnac cadagiti amin a dalluyonmo. (Selah)",
			"8": "<sup>8</sup> Inyadayom caniac dagiti caammoammoc; pinagbalinnac a carimonda: sipupupocac, ket diac macaaliwacsay.",
			"9": "<sup>9</sup> Ti matac marunaw a gapu iti ladingit: inawaganca nga inaldaw, O Jehova; intag-ayco dagitoy im-imac kenca.",
			"10": "<sup>10</sup> Iparangmonto aya dagiti datdatlag cadagiti natay? Dagiti natay bumangondanto aya a mangidaydayaw kenca? (Selah)",
			"11": "<sup>11</sup> Ti kinamanagayatmo maipalgacto aya idiay tanem? Wenno ti kinamatalecmo, idiay pacadadaelan?",
			"12": "<sup>12</sup> Dagiti datdatlagmo maammoanto aya iti casipngetan? Ken ti kinalintegmo idiay daga ni lipat?",
			"13": "<sup>13</sup> Ngem kenca, O Jehova, imkisac; ket iti bigat umayto ti cararagco ita saclangmo.",
			"14": "<sup>14</sup> Jehova, apay nga iwagsacmo toy cararwac? Apay nga ilingedmo ta rupam caniac?",
			"15": "<sup>15</sup> Silaladingitac, ket sisasaganaac a matay nanipud kinaubingco: idinto nga agsagabaac cadagiti pangigtotmo, maculcolanac.",
			"16": "<sup>16</sup> Ti rungsotmo naglasat caniac; dagiti pangigtotmo ginessatdac.",
			"17": "<sup>17</sup> Nagcuscusicusda iti aglawlaw caniac a cas danum iti agmalmalem; linacubdac a sangsangcapinsan.",
			"18": "<sup>18</sup> Mangayayat ken pagayam inyadayom caniac, ken iti, casipngetan dagiti caammoammoc."
		},
		"89": {
			"1": "<sup>1</sup> Icantacto ti kinamanagayat ni Jehova iti agnanayon: iti ngiwatco ipacaammocto ti kinamatalecmo cadagiti amin a capcaputotan.",
			"2": "<sup>2</sup> Ta kinunac, Ti caasi mabangonto iti agnanayon; ti kinamatalecmo ipasdecmonto cadagiti langlangit.",
			"3": "<sup>3</sup> Nangaramidac iti tulag cadagiti pinilic, insapatac ken David nga adipenco:",
			"4": "<sup>4</sup> Ti caputotam ipasdecconto nga agnanayon, ken patacderecto ti tronom agingga cadagiti amin a capcaputotan. (Selah)",
			"5": "<sup>5</sup> Ket dagiti langlangit idaydayawdanto dagiti datdatlagmo, O Jehova; ti kinamatalecmo iti panaggigimong dagiti sasanto.",
			"6": "<sup>6</sup> Ta siasino cadagiti tangatang ti mayasping ken Jehova? Siasino cadagiti annac ti mannacabalin ti pumada ken Jehova,",
			"7": "<sup>7</sup> A Dios a nacaamamac unay iti panagiinnoman dagiti sasanto, ken pagbutbutngan a nangrona ngem amin dagiti nanglawlaw iti arpadna?",
			"8": "<sup>8</sup> O Jehova a Dios dagiti buybuyot, Siasino ti nabileg, a cas kenca, O Jehova? Ket ti kinamatalecmo aglicmut kenca.",
			"9": "<sup>9</sup> Sica iturayam ti panagindadackel ti baybay: no dagiti dalluyonna bumangonda, sica pagtalnaem ida.",
			"10": "<sup>10</sup> Rinebbam ni Rahab a cas maysa a napapatay; winarawaram dagiti cabcabusormo iti tackiag ta pigsam.",
			"11": "<sup>11</sup> Dagiti langlangit cucuam, ti daga cucuam met: ti lubong ken dagup ti adda kencuana, pinataudmo ida.",
			"12": "<sup>12</sup> Ti amianan ken abagatan, sica ti namarsua cadacuada: da Tabor ken Hermon pagragsacanda ta naganmo.",
			"13": "<sup>13</sup> Adda tackiagmo a nabileg; napigsa ta imam, ket natayag ta canawanmo.",
			"14": "<sup>14</sup> Ti kinalinteg ken kinajusticia isuda ti pamuun ta tronom: ti kinamanagayat ken kinapudno akinparupada ita sangoanam.",
			"15": "<sup>15</sup> Bendito ti umili a macaammo iti nacaayayo nga canta: magnada, O Jehova, iti silnag ta langam.",
			"16": "<sup>16</sup> Ita naganmo agragsacda nga agmalmalem: ket iti kinalintegmo maitan-ocda.",
			"17": "<sup>17</sup> Ta sica ti dayag ti bilegda; ket iti pammaraburmo ti sarami maitan-octo.",
			"18": "<sup>18</sup> Ta ti calasagmi biang ni Jehova: ken ti arimi biang ti Santo ti Israel.",
			"19": "<sup>19</sup> Idin nagsaoca iti parparmata cadagiti sasantom, ket kinunam, Siac incumitco ti badang iti maysa a nabileg; intan-occo ti maysa a napili iti umili.",
			"20": "<sup>20</sup> Nasaracac ni David nga adipenco; ti nasantoan a lanac ti pinangpulutco kencuana.",
			"21": "<sup>21</sup> Kencuana mataginayonto ti imac; ti tackiagco mangpapigsanto met kencuana,",
			"22": "<sup>22</sup> Ti cabusor dinto macadaeg kencuana, ket ti anac ti kinadangkes dinto met mamagliday kencuana.",
			"23": "<sup>23</sup> Ket itublacconto iti sangoananna, dagiti casupadina ken danarecto dagiti gumura kencuana.",
			"24": "<sup>24</sup> Ngem ti kinamatalecco ken kinamanagayatco maicappondanto kencuana; ket gapu iti naganco maitan-octo ti sarana.",
			"25": "<sup>25</sup> Icabilconto met ti imana iti rabaw ti baybay, ket ti canawan nga imana iti rabaw dagiti carcarayan.",
			"26": "<sup>26</sup> Isu umkisto caniac, Sica ti Amac, Diosco, ken bato ti pannacaisalacanco.",
			"27": "<sup>27</sup> Isu pagbalinecto met nga inauna nga anacco, catan-ocan cadagiti ar-ari ditoy daga.",
			"28": "<sup>28</sup> Ti kinamanagayatco taginayonecto kencuana; ket ti tulagco sitatalinaedto kencuana.",
			"29": "<sup>29</sup> Ti bin-ina pagpautecto met nga agnanayon, ket ti tronona cas cadagiti al-aldaw ti langit.",
			"30": "<sup>30</sup> No dagiti annacna bay-anda ti lintegco, ket dida magna cadagiti pagbilinac;",
			"31": "<sup>31</sup> No barengbarengenda dagiti linlintegco, ket dida salimetmetan dagiti bilbilinco;",
			"32": "<sup>32</sup> Iti casta sumarungcaracto nga agtagipang-or, iti salungasingda ken agtagibaot iti kinadakesda.",
			"33": "<sup>33</sup> Ngem ti kinamanagayatco diacto talipupusen nga iccaten kencuana, diacto met bayan iti kinamatalecco nga agcurang.",
			"34": "<sup>34</sup> Ti tulagco diacto barengbarengen, diac met baliwan ti banag a nagwayaway cadagiti bibigco.",
			"35": "<sup>35</sup> Idinto nga insapatac babaen ti kinasantoc: saanacto nga agulbod ken David:",
			"36": "<sup>36</sup> Ti capuonanna agpautto nga agnanayon, ken ti tronona cas ti init iti sangoanac.",
			"37": "<sup>37</sup> Sipapasdecto nga agnanayon a cas iti bulan, ken cas, iti matalec a sacsi idiay langit. (Selah)",
			"38": "<sup>38</sup> Ngem sica inwagsacmo ken binaybay-am, kinapungtotmo dagiti pinulutam.",
			"39": "<sup>39</sup> Ginuram ti tulag ti adipenmo: inlupitmo ti coronana gapu iti panangipalladawmo iti daga.",
			"40": "<sup>40</sup> Rinaracmo amin dagiti alaladna; impanmo iti pannacargaay dagiti pagsalindeganna.",
			"41": "<sup>41</sup> Amin nga aglasat iti dalan tumacawda kencuana: nagbalin nga ababien dagiti caarrubana.",
			"42": "<sup>42</sup> Intag-aymo ti macanawan nga ima dagiti casupadina; pinagragsacmo amin dagiti cabusorna,",
			"43": "<sup>43</sup> Wen, kinulpim ti tadem ti campilanna, ket saanmo a pinagtacder iti gubat.",
			"44": "<sup>44</sup> Pinagsardengmo ti kinaraniagna, ket impalladawmo ti tronona iti daga.",
			"45": "<sup>45</sup> Dagiti al-aldaw ti cabanbannoaganna pinaababam: isu kinumutam iti bain. (Selah)",
			"46": "<sup>46</sup> Casano ti cabayag, O Jehova? Aglingedcanto aya nga agnanayon? Casano ti capaut a sumsumgedto ta pungtotmo a cas apuy?",
			"47": "<sup>47</sup> O lagipem ti caababa ti tiempoc: anian a kinaubbaw ti namarsuaam cadagiti amin nga annac ti tao!",
			"48": "<sup>48</sup> Ania a tao ti agbiagto ket saannanto a makita ni patay, a maispalnanto ti cararwana iti pannacabalin ni Tanem? (Selah)",
			"49": "<sup>49</sup> Apo, sadino ti yandan dagiti casisigud a kinamanagayatmo, nga insapatam ken David babaen ti kinamatalecmo?",
			"50": "<sup>50</sup> Lagipem, Apo, ti pannacaibabain dagiti ad-adipenmo; anian ti panagsagabac itoy barucongco iti pammabain dagiti amin a nabileg a tattao,",
			"51": "<sup>51</sup> Isu a pananguyuyaw dagiti cabcabusormo, O Jehova, isu a pananguyuyawda cadagiti tugtugot ti pinulutam.",
			"52": "<sup>52</sup> Bendito coma ni Jehova nga agnanayon laeng. Amen, ket Amen."
		},
		"90": {
			"1": "<sup>1</sup> Apo, sica ti nagtataenganmi cadagiti amin a capcaputotan.",
			"2": "<sup>2</sup> Idi casacbayan ti pannacapataud dagiti banbantay, wenno idi pay la pinaltuadmo ti daga ken ti lubong, ken manipud pay ketdi idi kinaagnanayon agingga iti kinaagnanayon, sica ti Dios.",
			"3": "<sup>3</sup> Sica pagbawingem ti tao iti pannacadadael, ket cunam, Sumublicayo, dacayo nga annac dagiti tattao.",
			"4": "<sup>4</sup> Ta dagiti sangaribu a tawen iti sangoanam cas laeng iti maysa a calman no nacalabasen, ken cas maysa a panagpuyat iti rabii.",
			"5": "<sup>5</sup> Sica yanudmo ida a cas mailayus; isuda arigda tay ridep: iti agsapa arigda la root a tumubo.",
			"6": "<sup>6</sup> Iti bigat agbaludbud, ken dumackel; iti malem mapucan, ket malaylay.",
			"7": "<sup>7</sup> Ta marunotcami ita pungtotmo, ket ita lucsawmo madanagancami.",
			"8": "<sup>8</sup> Incabilmo dagiti kinadangkesmi dita sangoanam, dagiti nalmeng a basbasolmi dita masilnagan ta rupam.",
			"9": "<sup>9</sup> Ta amin dagiti aldawmi naglabasda iti ungetmo: pagcanibusanenmi dagiti tawenmi a cas maysa a sasainnec:",
			"10": "<sup>10</sup> Dagiti al-aldaw dagiti tawenmi pitopuloda a tawen, wenno agpapan pay gapu iti kinabileg walopulo a tawen; nupay casta ti laeng sagudayda bannog ken ladingit; ta lumabas nga apagbiit, ket tumayabcamin.",
			"11": "<sup>11</sup> Siasino ti macaammo iti bileg ti ungetmo, ken ta pungtotmo a mayannurot iti buteng a rebbengen kenca?",
			"12": "<sup>12</sup> Iti casta isuronacami a mangbilang cadagiti al-aldawmi, tapno magun-odmi coma ti puso a manakem.",
			"13": "<sup>13</sup> Agsublica cadi, O Jehova; caanonto? Ket pagbabawiam cadi ti maipaay cadagiti ad-adipenmo.",
			"14": "<sup>14</sup> O pennekennacami cadi iti bigat ita kinamanagayatmo, tapno siraragsac ken maayayatancami cadagiti amin nga al-aldawmi.",
			"15": "<sup>15</sup> Paragsakennacami cadi cas mayannurot cadagiti al-aldaw a panamagladingitmo cadacami, ken cadagiti tawtawen a pannacaimatangmin iti dakes.",
			"16": "<sup>16</sup> Agparang cadi ti aramidmo cadagiti ad-adipenmo, ken ta dayagmo cadagiti annacda.",
			"17": "<sup>17</sup> Ket ti parabur ti Apo a Diostayo adda coma cadatayo; ket patalgedam cadi ti aramid dagiti imami cadacami; wen, ti aramid dagiti im-imami patalgedam coma."
		},
		"91": {
			"1": "<sup>1</sup> Ti agtaeng iti nalmeng a yan ti Cangatoan agtalinaedto iti masalinongan ti Mannacabalin.",
			"2": "<sup>2</sup> Cuncunacto maipanggep ken Jehova, isu ti camang ken salindegco; Diosco, a pagcamatalcac.",
			"3": "<sup>3</sup> Ta ispalennacanto iti silo ti agpangpangngati, ken iti macapatay nga angol.",
			"4": "<sup>4</sup> Salucobannacanto cadagiti pawisna, ket iti salinong dagiti payacna agcamangcanto: ti calasag ken sangga isu ti kinapudnona.",
			"5": "<sup>5</sup> Sica saancanto nga agbuteng iti pangigtot iti rabii, uray pay iti pana a sumiag iti aldaw.",
			"6": "<sup>6</sup> Gapu iti angol a magna iti casipngetan, uray pay iti pannacadadael a mangrupsa iti tengnga ti aldaw.",
			"7": "<sup>7</sup> Sangaribu ti matuangto ita sikigam, ket sangapulo-ribo dita macanawanmo; ngem saanto nga umasideg kenca.",
			"8": "<sup>8</sup> Cadagita laeng matam makitamto, ket maimatangamto iti supapac ti nadangkes.",
			"9": "<sup>9</sup> Ta sica, O Jehova, ti camangco! pinagbalinmo ti Cangatoan a pagnaedam;",
			"10": "<sup>10</sup> Awanto ti aniaman a dakes a dumteng kenca, awan met ti aniaman a didigra a macaasidegto dita calapawmo.",
			"11": "<sup>11</sup> Ta itdennanto dagiti angelesna nga agaywan kenca, tapno aluadandaca cadagiti amin a daldalanmo.",
			"12": "<sup>12</sup> Tapayaendacanto cadagiti im-imada, tapno dayta sacam saan a maitibcol iti bato.",
			"13": "<sup>13</sup> Ibaddecmonto ti leon ken carasaen: ti urbon a leon ken ti uleg ipayatmonto ita dapanmo.",
			"14": "<sup>14</sup> Gapu ta insaadna ti ayatna caniac, ngarud isu ilasatconto: icabilconto iti nangato, gapu ta inammona ti naganco.",
			"15": "<sup>15</sup> Isu awagannacto, ket siac sungbatacto; addaacto kencuana iti pagducotan: isu ispalecto ken idaydayawconto.",
			"16": "<sup>16</sup> Isu pennekecto iti napaut a panagbiag, ken pangiparangarangac iti panangisalacanco."
		},
		"92": {
			"1": "<sup>1</sup> Nasayaat ti panangipaay ti panagyaman ken Jehova, ket ti panagcanta cadagiti panangidaydayaw iti naganmo, O Cangatoan;",
			"2": "<sup>2</sup> Panangiparangarang iti kinamanagayatmo iti bigat, ket ti kinamanagtalimudocmo tunggal rabii,",
			"3": "<sup>3</sup> A danggayan ti pagtocaran a sangapulo ti cuerdasna ken ti salterio; agraman nadaeg nga aweng ti arpa.",
			"4": "<sup>4</sup> Ta sica, Jehova, pinaragsacnac gapu cadagiti ar-aramidmo: agballigiacto cadagiti aramid dagiti im-imam.",
			"5": "<sup>5</sup> Anian a nagdadackel dagiti ar-aramidmo, O Jehova! Dagiti panpanunotmo naunegda unay.",
			"6": "<sup>6</sup> Ti nadueg a tao dina ammo; ti met maag dina maawatan daytoy:",
			"7": "<sup>7</sup> Inton tumarubo dagiti nadangkes a cas iti root, ken no lumapsac dagiti amin nga agar-aramid iti kinadakes; isu daytan ti pannacadadaeldanto nga agnanayon.",
			"8": "<sup>8</sup> Ngem sica, O Jehova, natan-occa iti agnanayon.",
			"9": "<sup>9</sup> Ta, ni, dagiti cabusormo, O Jehova, ta, ni, dagiti cabusormo mapucawdanto; amin dagiti agar-aramid iti kinadangkes mawarawaradanto.",
			"10": "<sup>10</sup> Ngem ti sarac intan-ocmo a cas ti sara ti  atap a vaca: napulotanac iti lana a cassinglag.",
			"11": "<sup>11</sup> Ti matac nakitana ti calicagumac a maipaay cadagiti cabcabusorco, dagiti lapayagco nangngegda ti calicagumac a maipaay cadagiti managdacdakes a mangbusor caniac.",
			"12": "<sup>12</sup> Ti nalinteg agrangpayanto a cas iti cayo a palma: bumaludbodto a cas iti cedro ti Libano.",
			"13": "<sup>13</sup> Addada a naimula idiay balay ni Jehova; agrangpayadanto cadagiti paraangan ti Diostayo.",
			"14": "<sup>14</sup> Agbungadanto pay laeng iti kinalacayda; situtubbogdanto ken silalangtodanto:",
			"15": "<sup>15</sup> Tapno iparangarangda a ni Jehova sililinteg; isu ti batoc, ket awan kinakillo kencuana."
		},
		"93": {
			"1": "<sup>1</sup> Ni Jehova agari; nacawesan iti kinadayag; ni Jehova nacawesan iti kinapigsa; isu ti imbarikesna: ti lubong naisimpa met, a saan a magaraw.",
			"2": "<sup>2</sup> Ti tronom naisimpa nanipud idi ugma: sica addaca nanipud kinaagnanayon.",
			"3": "<sup>3</sup> Dagiti layus nagpangatoda, O Jehova, dagiti layus nagpangato ti timecda; dagiti layus ngumato dagiti allonda.",
			"4": "<sup>4</sup> Iti ringbaw dagiti timtimec dagiti adu a danum, dagiti napigsa a daranudur ti baybay, ni Jehova sadi ngato adda a sibibileg.",
			"5": "<sup>5</sup> Dagiti pammanecnecmo pudnoda unay: ti kinasanto mainugot iti balaymo, O Jehova, iti kinaagnanayon."
		},
		"94": {
			"1": "<sup>1</sup> O Jehova, sica Dios a makinbiang iti pammales, sica Dios a makinbiang iti pammales, agraniagca.",
			"2": "<sup>2</sup> Tumacderca, sica nga ocom ti daga: ipaaymo iti natangsit ti caicarianna.",
			"3": "<sup>3</sup> Jehova, casano capaut dagiti nadangkes, casano capaut ti panagballigi dagiti nadangkes?",
			"4": "<sup>4</sup> Agsalsalawasawda, agsaoda a sipapalangguad: amin dagiti agar-aramid iti kinadangkes agpaspasindayawda.",
			"5": "<sup>5</sup> Tumekenda ti ilim, O Jehova, ken parigatenda ti patawidam.",
			"6": "<sup>6</sup> Patayenda ti balo ken ti gangannaet, ken iccatenda ti biag dagiti ululila.",
			"7": "<sup>7</sup> Ket cunada, Dinto makita ni Jehova, dinto met imutectecan ti Dios ni Jacob.",
			"8": "<sup>8</sup> Utobenyo, dacayo a nadueg iti pagilian; ket dacayo a maag caanonto ti panagnakemyo?",
			"9": "<sup>9</sup> Daydiay nangimula iti pagdengngeg, isu saanto aya a macangngeg? Daydiay namataud iti mata, isu saanto aya a macakita?",
			"10": "<sup>10</sup> Daydiay mamagbaga cadagiti nasnacion, saan ngata a mangtarimaan, nga isu a mangisuro iti tao iti kinasirib?",
			"11": "<sup>11</sup> Ni Jehova ammona dagiti pampanunot ti tao, nga isuda dagiti kinaubbaw.",
			"12": "<sup>12</sup> Bendito ti tao a bagbagaam, O Jehova, ken sursuroam ita lintegmo;",
			"13": "<sup>13</sup> Tapno maiccam iti inana manipud cadagiti al-aldaw ti pagpaglan, agingga iti macalian ti abut a maipaay iti nadangkes.",
			"14": "<sup>14</sup> Ta ni Jehova dinanto ipalladaw ti ilina, dinanto met baybay-an ti patawidanna.",
			"15": "<sup>15</sup> Ta ti panangocom agsublinto iti kinalinteg; ket amin dagiti sililinteg iti puso sumurotdanto kencuana.",
			"16": "<sup>16</sup> Siasino ti tumacderto a maipuon caniac a bumusor cadagiti managdacdakes? Siasino ti agtacderto a pannacabagic a bumusor cadagiti agar-aramid iti kinadangkes?",
			"17": "<sup>17</sup> No saan coma a ni Jehova idi ti tulongco, toy cararwac nabayag coman a nagnaed iti kinaulimec.",
			"18": "<sup>18</sup> Idi kinunac, Toy sacac maicaglis; ti kinamanagayatmo, O Jehova, tinengngelnac.",
			"19": "<sup>19</sup> Iti caadu dagiti panpanunotco itoy unegco dagiti pangliwliwam patalgedenda toy cararwac.",
			"20": "<sup>20</sup> Ti trono ti kinadakes addanto aya pannakicanaponna kenca, isu a mangbuangay iti ranggas gapu iti pagbilinan?",
			"21": "<sup>21</sup> Agtitimpuyogda a mangbusor iti cararwa ti nalinteg, ken mangpabasol iti nadalus a dara.",
			"22": "<sup>22</sup> Ngem ni Jehova isun ti natayag a baluartec, ket ti Diosco isu ti bato a camangco.",
			"23": "<sup>23</sup> Ken isu ti nangidissuor cadacuada iti kinadakesda met laeng, ken mangpessatto cadacuada iti kinadangkesda met laeng; ni Jehova a Diostayo pucawennanto ida."
		},
		"95": {
			"1": "<sup>1</sup> O umaycayo, cantaantayo ni Jehova; ipaaytayo ti narag-o a dir-i iti bato ti pannacaisalacantayo.",
			"2": "<sup>2</sup> Mapantayo a siiyaman iti saclangna; ipaayantayo iti narag-o a dir-i agraman salmos.",
			"3": "<sup>3</sup> Ta ni Jehova isu ti naidaclan a Dios, ken naidadaclan nga ari iti ngatoen dagiti amin a didiosen.",
			"4": "<sup>4</sup> Adda cadagiti im-imana dagiti mangliwengliweng ditoy daga: dagiti catayag dagiti banbantay cucuana met.",
			"5": "<sup>5</sup> Ti baybay cucuana, ket inaramidna; ken dagiti im-imana pinataudda ti namaga a daga.",
			"6": "<sup>6</sup> O umaycayo, agdaydayawtayo ken agrucnoytayo; agparintumengtayo iti saclang ni Jehova a nangaramid cadatayo:",
			"7": "<sup>7</sup> Ta isu ti Diostayo, ken datayo ti umili ti pagpaarabanna, ken carcarnero ti imana. Ita nga aldaw, no mangegyo coma ti timecna!",
			"8": "<sup>8</sup> Dicayo patangkenen ta pusoyo, a cas idiay Meriba, a cas iti aldaw ti Masa iti let-ang,",
			"9": "<sup>9</sup> Idi a dagiti amammayo sinulisogdac, pinadasdac, ket nakitada ti aramidco.",
			"10": "<sup>10</sup> Uppat a pulo a tawen a nagladladingitac iti dayta a caputotan, ket kinunac, isu ti maysa nga umili a mayawawan iti pusoda, ket saanda a naammoan dagiti daldalanco:",
			"11": "<sup>11</sup> Gapuna insapatac iti panaglucsawco a didanto sumrec iti inanac."
		},
		"96": {
			"1": "<sup>1</sup> O cantaanyo ni Jehova iti baro a canta: cantaanyo ni Jehova, dagup ti daga.",
			"2": "<sup>2</sup> Cantaanyo ni Jehova, benditoenyo ti naganna; iparangarangyo ti panangisalacanna nga inaldawaldaw.",
			"3": "<sup>3</sup> Ipalawagyo ti dayagna cadagiti nasnacion. Dagiti nacascasdaaw nga ar-aramidna cadagiti amin a tattao.",
			"4": "<sup>4</sup> Ta naidaclan ni Jehova, ket rebbengna unay ti maidaydayaw: rebbeng a pagbutngan a nangnangrona ngem amin a didiosen.",
			"5": "<sup>5</sup> Ta amin dagiti didiosen dagiti tattao isuda dagiti sinan-didios; ngem ni Jehova inaramidna dagiti langlangit.",
			"6": "<sup>6</sup> Dayaw ken dayag addada iti sangoananna: pigsa ken kinasayaat addada iti nasantoan a yanna.",
			"7": "<sup>7</sup> Ipadayawyo ni Jehova, dacayo a sangsangcacabagian dagiti il-ili, ipadayawyo ni Jehova ti dayag ken kinapigsa.",
			"8": "<sup>8</sup> Ipadayawyo ni Jehova ti dayag a mainugot iti naganna: mangyegcayo iti daton, ket umaycayo cadagiti paraanganna.",
			"9": "<sup>9</sup> O agdaydayawcayo ken Jehova iti imnas ti kinasanto: agkintayegcayo iti sangona, amin a daga.",
			"10": "<sup>10</sup> Cunaenyo cadagiti nasnacion, ni Jehova agari: ti met lubong naipasdec a di-mabalin nga isinen: ocomennanto a sicacanatad dagiti tattao.",
			"11": "<sup>11</sup> Agrag-o coma dagiti langlangit, ket agragsac coma ti daga; agdaranudur coma ti baybay, ken dagup ti linaonna;",
			"12": "<sup>12</sup> Ti tay-ac agrag-o coma, ken amin nga adda kencuana; iti casta amin dagiti caycayo ti bakir agcantadanto gapu iti rag-o.",
			"13": "<sup>13</sup> Iti sangoanan ni Jehova; ta isu umay, ta isu umay a mangocom iti daga: ocomenanto a sililinteg toy lubong, ken dagiti tattao babaen ti kinapudnona."
		},
		"97": {
			"1": "<sup>1</sup> Ni Jehova agari; ti daga agragsac coma; agrag-o coma dagiti adu a purpuro.",
			"2": "<sup>2</sup> Dagiti ul-ulep ken sipnget agliclicmutda iti arpadna; kinalinteg ken kinajusticia ti nagbatayan ti tronona.",
			"3": "<sup>3</sup> Adda apuy a magna iti sangoananna, ket manguram cadagiti cabcabusorna nga aglawlaw.",
			"4": "<sup>4</sup> Dagiti kimkimatna sinilnaganda toy lubong: ti daga nakitana, ket nagkintayeg.",
			"5": "<sup>5</sup> Dagiti banbantay naglunagda a cas allid iti sangoanan ni Jehova, iti sangoanan ti Apo ti sangalubongan.",
			"6": "<sup>6</sup> Dagiti langlangit ibunannagda ti kinalintegna, ket amin dagiti inilin-ili nakitada ti dayagna.",
			"7": "<sup>7</sup> Mabainanda coma amin dagiti agservi cadagiti ladladawan a kinitikitan, a pagpasindayagda dagiti didiosen a pagcaragan; agdaydayawcayo kencuana, dacayo amin a didios.",
			"8": "<sup>8</sup> Ti Sion nacangneg ket naragsacan, ket dagiti annac a babbai ti Juda nagrag-oda, gapu cadagiti panangocommo, O Jehova.",
			"9": "<sup>9</sup> Ta sica, Jehova, ti cangatoan iti ngatoen ti amin a daga: sica ti naitan-oc a naringringbaw unay ngem amin a didiosen.",
			"10": "<sup>10</sup> O dacayo nga agayayat ken Jehova, guraenyo ti dakes; isu salacnibanna dagiti cararwa dagiti sasantona; isalacanna ida iti ima dagiti nadangkes.",
			"11": "<sup>11</sup> Ti silaw naimula a maipaay cadagiti sililinteg, ket ti kinaragsac cadagiti nalinteg iti puso.",
			"12": "<sup>12</sup> Agrag-ocayo ken Jehova, dacayo a sililinteg; ket agyamancayo a pacalaglagipan iti nasantoan a naganna."
		},
		"98": {
			"1": "<sup>1</sup> O cantaanyo ni Jehova iti baro a canta; ta nagaramid cadagiti nacascasdaaw a banbanag: ti canawan nga imana, ken ti nasantoan a tackiagna, nagun-odnan ti balligi a maipaay kencuana.",
			"2": "<sup>2</sup> Ni Jehova impacaammona ti panangisalacanna: ti kinalintegna imparangna a simamayaya iti imatang dagiti nasnacion.",
			"3": "<sup>3</sup> Linagipna ti kinamanagayat ken kinamatalecna iti balay ni Israel: amin dagiti pungto ti daga nakitada ti panangisalacan ti Diostayo.",
			"4": "<sup>4</sup> Ipaayanyo ni Jehova iti naragsac a dir-i, dagup ti daga: ipecsayo ket agcantacayo gapu ti rag-o, wen, agcantacayo iti panangidaydayaw.",
			"5": "<sup>5</sup> Cantaanyo ni Jehova iti panangidaydayaw a bagayan ti arpa; bagayan ti arpa ken timec a macaayayo.",
			"6": "<sup>6</sup> Cadagiti tororot ken aweng ti corneta aramidenyo ti naragsac a dir-i iti sangoanan ti Ari, ni Jehova.",
			"7": "<sup>7</sup> Agdaranudur coma ti baybay ken amin a linaonna; ti lubong ken amin nga agnaed kencuana.",
			"8": "<sup>8</sup> Dagiti laylayus pagsipatenda coma dagiti imimada; dagiti turturod agcantada coma nga agtitimpuyog gapu ti rag-o.",
			"9": "<sup>9</sup> Iti sangoanan ni Jehova; ta unay a mangocom itoy daga: ocomennanto a sililinteg toy lubong, ken sicacanatad dagiti inilin-ili."
		},
		"99": {
			"1": "<sup>1</sup> Ni Jehova agari; dagiti tattao agkintayegda coma: agtutugaw iti ngatoen dagiti Kerubin, ti daga aggarao coma.",
			"2": "<sup>2</sup> Ni Jehova naindaclan sadi Sion; ket isu nangato iti ngatoen dagiti amin a tattao.",
			"3": "<sup>3</sup> Idaydayawda coma ta naindaclan ken nacakigkigtot a naganmo: isu santo.",
			"4": "<sup>4</sup> Ti bileg ti ari pagayatanna met ti kinajusticia; sica ipasdecmo ti kinacanatad; sica salimetmetam ti kinajusticia ken kinalinteg iti sacup ni Jacob.",
			"5": "<sup>5</sup> Itan-ocyo ni Jehova a Diostayo, ket agdaydayawcayo iti sacaananna: isu Santo.",
			"6": "<sup>6</sup> Da Moises ken Aaron iti gimong dagiti papadina, ken ni Samuel iti nagtengngaan dagiti umawawag iti naganna; immawagda ken Jehova, ket isu sinungbatanna ida.",
			"7": "<sup>7</sup> Nagsao cadacuada iti monmon nga ulep: sinalimetmetanda dagiti pammanecnecna, ken ti nagbilinan nga intedna cadacuada.",
			"8": "<sup>8</sup> Sica sinungbatam ida, O Jehova a Diosmi: sica ti Dios a namacawan cadacuada, nupay inaramatmo ti pammales cadagiti ar-aramidda.",
			"9": "<sup>9</sup> Itan-ocyo ni Jehova a Diostayo, ket agdaydayawcayo idiay nasantoan a turodna; ta ni Jehova a Diostayo santo."
		},
		"100": {
			"1": "<sup>1</sup> Ipaayanyo iti naragsac a dir-i ni Jehova, dacayo amin a dagdaga.",
			"2": "<sup>2</sup> Agservicayo a sirarag-o ken Jehova: umaycayo iti sangoananna agraman panagcanta.",
			"3": "<sup>3</sup> Ammoyo a ni Jehova, isu ti Dios: isu ti nangaramid cadatayo, ket datayo cucuanatayo; datayo ti ilina, ken carcarnero ti pagpaarabanna.",
			"4": "<sup>4</sup> Sumreccayo a siyayaman, cadagiti ruanganna ken cadagiti paraanganna agraman panangidaydayawyo; agyamancayo kencuana, ket benditoenyo ti naganna.",
			"5": "<sup>5</sup> Ta ni Jehova naimbag; ti kinamanagayatna agnanayon, ket ti kinamatalecna agpaay cadagiti amin a caputotan."
		},
		"101": {
			"1": "<sup>1</sup> Icantacto ti kinamanagayat ken kinalinteg: kenca, O Jehova, agcantaacto iti panangidaydayaw.",
			"2": "<sup>2</sup> Simamanakemacto nga agtalinaed iti nalimbong a dalan: O caano ti iyaaymonto caniac? Magnaacto iti uneg ti balayco babaen ti natarnaw a pusoc.",
			"3": "<sup>3</sup> Diacto mangicabil iti naalas a banag iti saclang dagiti matac: guraec ti aramid dagiti sumiasi; saanto a cumpet caniac.",
			"4": "<sup>4</sup> Ti nadangkes a puso umadayonto caniac: awanto ti ammoec a dakes a banag.",
			"5": "<sup>5</sup> Siasinoman a mamadpadakes a nalimed iti caarrubana isu ti dadaelecto; ti adda nangato a panagkitkitana ken natangsit a panagpuspusona diacto panoynoyan.",
			"6": "<sup>6</sup> Dagiti matac siimatangdanto cadagiti matalec ditoy daga, tapno makipagnaedda caniac: ti magna iti nalinteg a dalan, isu ti agservinto caniac.",
			"7": "<sup>7</sup> Ti agaramid iti panangallilaw dinto makipagnaed iti uneg ti balayco: ti agsao iti ulbod dinto mapatalgedan iti saclang dagiti matac.",
			"8": "<sup>8</sup> Binigambigat a dadaelecto dagiti amin a nadangkes ditoy daga: tapno dagiti agaramid iti kinadangkes pucawec ditoy ili ni Jehova."
		},
		"102": {
			"1": "<sup>1</sup> Denggem ti cararagco, O Jehova, ket dumanon cadi kenca ti ickisco.",
			"2": "<sup>2</sup> Dica cadi ilinged ta rupam caniac iti aldaw ti panagducotco: yallingagmo ta lapayagmo caniac; iti aldaw nga iyaawagco sungbatannac cadi a dardarasen.",
			"3": "<sup>3</sup> Ta dagiti al-aldawco marmarsaacda a cas la asuc, ket dagiti tultulangco mapuuranda a cas aluten.",
			"4": "<sup>4</sup> Ti pusoc makeltay a casla root, ket malaylay; ta malipatac ti mangan iti tinapayco.",
			"5": "<sup>5</sup> Maipuon iti timec ti panagungorco dagiti tultulangco dimketdan iti cudilco.",
			"6": "<sup>6</sup> Arigac la itay puec ti cabakiran; agbalinac a cas maysa a calaw cadagiti ayan a langalang.",
			"7": "<sup>7</sup> Agpuyatac, ket agbalinac a cas itay mammendita nga agwaywayas iti tuctoc ti balay.",
			"8": "<sup>8</sup> Dagiti cabusorco umumsiendac nga agmalmalem; dagiti gumurgura caniac ilunlunoddac.",
			"9": "<sup>9</sup> Ta nanganacon iti dapu a cas pannacatinapay, ket tinibnocac ti inumec iti panagsangit,",
			"10": "<sup>10</sup> Gapu iti rurodmo ken guram: ta binatacnac, ket sa impuruacnac.",
			"11": "<sup>11</sup> Dagiti al-aldawco arigda la aniniwan nga agpucaw; ket arigac la root a malaylay.",
			"12": "<sup>12</sup> Ngem sica, O Jehova, agtalinaedca nga agnanayon; ket ti malaglagip a naganmo agpaay cadagiti amin a capcaputotan.",
			"13": "<sup>13</sup> Bumangoncanto, ket caasiamto ti Sion; ta batangnan ti panangaasi kencuana, wen, ti natudingan a tiempo dimtengen.",
			"14": "<sup>14</sup> Ta dagiti ad-adipenmo pagayayatanda dagiti batbatona, ket caasianda ti tapucna.",
			"15": "<sup>15</sup> Iti casta dagiti nasnacion pagbutngandanto ti nagan ni Jehova, ket amin dagiti ar-ari ditoy daga pagbutngandanto dayta dayagmo:",
			"16": "<sup>16</sup> Ta ni Jehova ti nangbangon iti Sion; nagparang a sidadayag.",
			"17": "<sup>17</sup> Inimatanganna ti cararag dagiti taltalipungawen, ket saanna a pinaid ti cararagda.",
			"18": "<sup>18</sup> Daytoy maisuratto nga agpaay iti caputotan a masacbayan; ket ti umili a maparsuanto idaydayawdanto ni Jehova.",
			"19": "<sup>19</sup> Ta kimmita iti baba manipud tapaw ti santuariona; manipud sadi langit ni Jehova minatmatanna toy daga.",
			"20": "<sup>20</sup> Tapno denggenna ti sasainnec ti sibabalud; tapno ruc-atanna dagiti naipato iti patay;",
			"21": "<sup>21</sup> Tapno dagiti tattao maibunannagda idiay Sion, ti nagan ni Jehova ken ti pacaidaydayawanna idiay Jerusalem;",
			"22": "<sup>22</sup> Intono agtitipon amin dagiti tattao, ken dagiti pagpagarian, tapno agservida ken Jehova.",
			"23": "<sup>23</sup> Isu pinacapuyna ti pigsac iti dalan; pinaababana dagiti al-aldawco.",
			"24": "<sup>24</sup> Kinunac, O Diosco, dinac cadi pucawen iti ngalay dagiti aldawco: dagiti tawenmo agtarusda cadagiti amin a caputotan.",
			"25": "<sup>25</sup> Idi ugma insimpamon ti pamuon toy daga; ket dagiti langit aramid dagiti im-imam.",
			"26": "<sup>26</sup> Mapucawdanto, ngem sica agnanayoncanto; wen, isuda amin dumaandanto a cas iti pagan-anay; cas pamlesan sucatamto ida, ket masucatandanto:",
			"27": "<sup>27</sup> Ngem sica castam met laeng, ket dagiti tawenmo awan gibusda.",
			"28": "<sup>28</sup> Dagiti annac dagiti ad-adipenmo agtuloydanto, ket ti bin-ida maipasdecto iti sangoanam."
		},
		"103": {
			"1": "<sup>1</sup> Benditoem ni Jehova, O cararwac, ken amin nga adda iti unegco, benditoenyo coma ti nasantoan a naganna.",
			"2": "<sup>2</sup> Benditoem ni Jehova, O cararwac, ket dica lipaten dagiti amin a paraburna:",
			"3": "<sup>3</sup> Isu a mamacawan cadagiti amin a kinadangkesmo; isu a mamapia cadagiti amin a nasacsakitmo;",
			"4": "<sup>4</sup> Isu a manubbot ita biagmo iti pannacadadael; isu a mangbalangat kenca iti kinamanagayat ken cadagiti nadungngo nga asasi;",
			"5": "<sup>5</sup> Isu a mangpennec iti tarigagaymo cadagiti naimbag a banbanag, iti casta ti kinaagtutubom mapabaro a cas ti aguila.",
			"6": "<sup>6</sup> Ni Jehova ibanagna dagiti nalinteg nga ar-aramid, ken ocomenna dagiti amin a mailuplupit.",
			"7": "<sup>7</sup> Impacaammona dagiti dalanna ken Moises, dagiti ar-aramidna cadagiti annac ti Israel.",
			"8": "<sup>8</sup> Ni Jehova sicacaasi ken siaayat, namayamay nga agpungtot, ket aglaplapusanan iti kinamanagayat.",
			"9": "<sup>9</sup> Saanto a cancanayon a mangbabalaw; ket dinanto met ingingpen a canayon ti pungtotna.",
			"10": "<sup>10</sup> Isu saanna nga impaay cadatayo ti cas mayannatup cadagiti basbasoltayo, dinatayo met sinupapacan iti catutopan dagiti kinadangkestayo.",
			"11": "<sup>11</sup> Ta cas cangato dagiti langlangit iti ngatoen toy daga, casta ti cadackel ti kinamanagayatna cadagiti agbuteng kencuana.",
			"12": "<sup>12</sup> Cas panagaddayo ti daya ken ti laud, casta ti nangyadayoanna cadagiti salsalungasingtayo cadatayo.",
			"13": "<sup>13</sup> Cas panangngaasi ti maysa nga ama cadagiti annacna, casta ti panangngaasi ni Jehova cadagiti agbuteng kencuana.",
			"14": "<sup>14</sup> Ta ammona ti pannacasucogtayo; isu malagipna a datayo tapuctayo.",
			"15": "<sup>15</sup> No maipanggep iti tao, dagiti aldawna casda la root; cas maysa a sabong iti tay-ac, casta ti panaglangtona.",
			"16": "<sup>16</sup> Ta ti angin lumabas caniana, ket manasanasen; ket ti nagsaadanna saanto pay a maammoanen.",
			"17": "<sup>17</sup> Ngem ti kinamanagayat ni Jehova cadagiti agbuteng kencuana manipud iti kinaagnanayon agpapan iti kinaagnanayon, ket ti kinalintegna agpaay cadagiti annac dagiti anannac;",
			"18": "<sup>18</sup> Cadagidiay mangsalimetmet iti tulagna, ken cadagiti manglaglagip cadagiti alalagadenna nga aramidenda ida.",
			"19": "<sup>19</sup> Ni Jehova impasdecna ti tronona cadagiti langlangit; ket ti pagarianna pagturayanna amin.",
			"20": "<sup>20</sup> Benditoenyo ni Jehova, dacayo nga angelesna, a mannacabalin iti bileg, a manungtungpal iti saona, a nangtimtimud iti timec ti saona.",
			"21": "<sup>21</sup> Benditoenyo ni Jehova, dacayo amin a buybuyotna, dacayo amin a ministrona nga agaramid iti pagayatanna.",
			"22": "<sup>22</sup> Benditoenyo ni Jehova, dacayo amin nga aramidna, cadagiti amin a yan ti pagturayanna: benditoem ni Jehova, O cararwac."
		},
		"104": {
			"1": "<sup>1</sup> Benditoem ni Jehova, O cararwac, O Jehova a Diosco, sica naindaclanca unay; nacawesanca iti dayaw ken kinadayag:",
			"2": "<sup>2</sup> Sica a mangbungon kenca met laeng iti lawag a cas la pannacapagananaymo; a mangbistrad cadagiti langlangit a cas maysa a cortina;",
			"3": "<sup>3</sup> A mangicabil cadagiti busuran dagiti silsiledna iti uneg dagiti dandanum; a pagbalinenna a luganna dagiti ul-ulep; a magna iti rabaw dagiti paypayac ti angin;",
			"4": "<sup>4</sup> A mamagbalin cadagiti an-angin a babaonenna; cadagiti gilgil-ayab ti apuy a ministrona;",
			"5": "<sup>5</sup> Isu a nangicabil cadagiti pamuon toy daga, a dinto maisina uray caanoman.",
			"6": "<sup>6</sup> Isu inabbongam iti caadalman ti baybay a cas la pannacapagananayna; dagiti dandanum nagtacderda a nangatngato ngem dagiti banbantay.",
			"7": "<sup>7</sup> Iti panangtubngarmo nagtalawda; iti timec ti gurroodmo nagdardarasda.",
			"8": "<sup>8</sup> (Bimmangon dagiti banbantay, limnec dagiti tantanap) a napan cadagiti yan a pinarnuaymo a naisangrat cadacuada.",
			"9": "<sup>9</sup> Sica nangicabilca iti beddeng tapno dida ballasiwen; tapno dida sunotanen a lapunusen toy daga.",
			"10": "<sup>10</sup> Isu ibaonna dagiti ub-ubbog cadagiti tantanap; agtarayda cadagiti babaet dagiti banbantay;",
			"11": "<sup>11</sup> Itdenda ti inumen iti tunggal animal iti tay-ac; dagiti atap nga asno pedpedenda ti wawda.",
			"12": "<sup>12</sup> Iti sibayda dagiti tumatayab cadagiti langlangit adda pagnaedanda; iyesngawda ti timecda iti babaet dagiti sangsanga.",
			"13": "<sup>13</sup> Isu siboganna dagiti banbantay manipud cadagiti silsiledna: ti daga mapno iti bunga dagiti gapuanam.",
			"14": "<sup>14</sup> Pagtuboenna ti root a maipaay cadagiti vacvaca, ken ti mula nga agservi iti tao; tapno isu maparnuayna ti taraonna iti daga,",
			"15": "<sup>15</sup> Ken ti arac a mamaragsac iti puso ti tao, ken lana a mamagsilnag iti rupana, ken tinapay a mamakired iti puso ti tao.",
			"16": "<sup>16</sup> Dagiti caycayo ni Jehova mapnoda iti tubbog; dagiti cedro ti Libano, nga immulana;",
			"17": "<sup>17</sup> Isu a pagaramidan dagiti bilbillit cadagiti um-umocda: no maipanggep iti cannaway, dagiti saleng isuda ti balayna.",
			"18": "<sup>18</sup> Dagiti natayag a banbantay ti pagyanan dagiti calding nga atap; dagiti batbato isuda ti apon dagiti conejo.",
			"19": "<sup>19</sup> Dinutocna ti bulan a pagbaliwan ti tiempo: ti init ammona ti ilelennecna.",
			"20": "<sup>20</sup> Aramidem ti sipnget, ket isu ti rabii, kencuana dagiti amin nga an-animal ti cabakiran agsawarda.",
			"21": "<sup>21</sup> Dagiti urbon a leon ugaanda ti tucmaanda, ket birokenda ti taraonda nga aggapu iti Dios.",
			"22": "<sup>22</sup> Ti init sumingising, agpapanawda, ket agculmegda iti uneg dagiti rukibda.",
			"23": "<sup>23</sup> Ti tao mapan iti aramidna ken iti trabajona agingga iti rumabii.",
			"24": "<sup>24</sup> O Jehova, anian a nagadu dagiti ar-aramidmo! Nainsiriban ti panangaramidmo cadacuada amin: ti daga napno iti pagsanicuaam.",
			"25": "<sup>25</sup> Addayta ti baybay, dackel ket nalawa, isu a yan dagiti agcucunolcunol a banbanag a di-mabilang, babassit man ken dadackel nga an-animal.",
			"26": "<sup>26</sup> Adda idiay a magna dagiti sasacayan; adda ballena, nga inaramidmo a makiayayam sadiay.",
			"27": "<sup>27</sup> Dagitoy agurayda amin kenca, tapno iccam ida iti taraon iti maiparbeng a tiempo.",
			"28": "<sup>28</sup> Iccam ida, isuda acuyenda; ucradem ta imam, isuda mapnecda iti imbag.",
			"29": "<sup>29</sup> Ilingedmo ta rupam isuda agducotda; iccatem ti angesda, matayda, ket agpulangda iti catatapucda.",
			"30": "<sup>30</sup> Sica ibaonmo ti Espiritum, maparsuadan; ket pabaroem ti langa ti daga.",
			"31": "<sup>31</sup> Ti dayag ni Jehova agpaut coma nga agnanayon; pagrag-oan coma ni Jehova dagiti ar-aramidna:",
			"32": "<sup>32</sup> Isu a taldiapanna toy daga, ket agpigerger; calbitenna dagiti banbantay, ket agasucda.",
			"33": "<sup>33</sup> Cancantaacto ni Jehova cas capaut ti panagbiagco: cancantaacto ti panangidaydayaw iti Diosco bayat ti caaddac.",
			"34": "<sup>34</sup> Toy panagpanunotco nasam-it coma kencuana: pagrag-oacto ni Jehova.",
			"35": "<sup>35</sup> Dagiti managbasol maibusda coma ditoy daga, ket maawanda coma dagiti nadangkes. Benditoem ni Jehova, O cararwac. Idaydayawyo ni Jehova."
		},
		"105": {
			"1": "<sup>1</sup> Agyamancayo ken Jehova, umawagcayo iti naganna; ipacaammoyo cadagiti inilin-ili dagiti ar-aramidna.",
			"2": "<sup>2</sup> Cantaanyo, cantaanyo cadagiti panangidaydayaw; isaoyo amin dagiti nacascasdaaw nga ar-aramidna.",
			"3": "<sup>3</sup> Pagpasindayawyo ti nasantoan a naganna: agragrag-o coma ti puso dagiti mangbiroc ken Jehova.",
			"4": "<sup>4</sup> Birokenyo ni Jehova ken ti pigsana; sapulenyo coma laeng ti rupana.",
			"5": "<sup>5</sup> Lagipenyo dagiti nacascasdaaw nga ar-aramid nga inaramidna, dagiti datdatlagna, ken dagiti panangikeddeng ti ngiwatna,",
			"6": "<sup>6</sup> O dacayo a caputotan ni Abraham nga adipenna, dacayo nga anannac ni Jacob, dacayo a pinilina.",
			"7": "<sup>7</sup> Isu ni Jehova ti Diostayo: dagiti panangocomna addada iti dagup ti daga.",
			"8": "<sup>8</sup> Silalagip nga agnanayon iti tulagna, ti sao nga imbilinna cadagiti rinibu a caputotan,",
			"9": "<sup>9</sup> Ti intulagna ken Abraham, ken ti sapatana ken Isaac,",
			"10": "<sup>10</sup> Ket pinasingkedanna dayta met laeng ken Jacob iti maysa a pagbilinan, iti Israel iti maysa a tulag nga agnanayon,",
			"11": "<sup>11</sup> A kinunana, itdecto kenca ti daga a Canaan, a gasatmo a tawiden;",
			"12": "<sup>12</sup> Idi a bassit pay laeng ti bilangda, a tattao, wen, bassitda pay unay, ket gangannaetda sadiay.",
			"13": "<sup>13</sup> Ket nagallaallada iti nacion ken nacion, manipud maysa a pagarian agingga iti sabali nga umili.",
			"14": "<sup>14</sup> Dina intuloc iti siasinoman a tao nga agaramid iti dakes cadacuada; wen, binabalawna dagiti ar-ari gapu cadacuada,",
			"15": "<sup>15</sup> A cunana,  Dicayo sagiden dagiti pinulutac, ken dicayo ranggasan dagiti mammadtoc.",
			"16": "<sup>16</sup> Ket immayab ti panagbisin ditoy daga; dinadaelna ti amin a taraon.",
			"17": "<sup>17</sup> Nangibaon iti maysa a tao a paraunada; ni Jose nailaco a cas adipen:",
			"18": "<sup>18</sup> Dagiti sacana pinarigatda cadagiti ramal: isu naicabil cadagiti cawar a landoc,",
			"19": "<sup>19</sup> Agingga iti tiempo a natungpal ti saona, ti sao ni Jehova ti nangsuut kencuana.",
			"20": "<sup>20</sup> Ti ari nagbaon ket rinuc-atanna; wen, ti agturay cadagiti inilin-ili, ket pinalubosanna nga agwayawaya.",
			"21": "<sup>21</sup> Pinagbalinna nga apo ti balayna, ken agimaton iti dagup ti sanicuana;",
			"22": "<sup>22</sup> Tapno manengngel cadagiti piprincipena cas pagayatanna, ken mangisuro cadagiti panglacayenna iti kinasirib.",
			"23": "<sup>23</sup> Ni Israel immay met sadi Egipto; ket ni Jacob nakipagili idiay daga ni Cam.",
			"24": "<sup>24</sup> Ket pinaaduna unay ti ilina ken pinagbalinna ida a napigpigsa ngem dagiti nangsuppiat cadacuada.",
			"25": "<sup>25</sup> Imbawingna ti pusoda a guraenda ti ilina, tapno agaramid a sisisicap cadagiti ad-adipenna.",
			"26": "<sup>26</sup> Imbaonna ni Moises nga adipenna, castamet ni Aaron a pinilina.",
			"27": "<sup>27</sup> Incabilna iti tengngada dagiti pagilasinanna, ken datdatlag iti daga ni Cam.",
			"28": "<sup>28</sup> Binaonna ti sipnget, ket pinagsipngetna; ket saanda a binusor dagiti sasaona.",
			"29": "<sup>29</sup> Pinagbalinna a dara dagiti dandanumda, ket pinatayna dagiti icicanda.",
			"30": "<sup>30</sup> Ti dagada naatibelbelan idi cadagiti tuctucac cadagiti silsiled dagiti ar-arida.",
			"31": "<sup>31</sup> Nagsao, ket dimteng dagiti atibelbel dagiti ngilngilaw, ken cutcuto cadagiti amin a lawlawda.",
			"32": "<sup>32</sup> Intedna cadacuada ti uraro a pannacatudoda, ken gumilgil-ayab nga apuy iti dagada.",
			"33": "<sup>33</sup> Dinanarna dagiti cauvuvasanda ken highigosda, ken sinip-acna dagiti caycayo cadagiti beddengda.",
			"34": "<sup>34</sup> Nagsao, ket ti lucton dimteng, ken ti dudon, ket saan a mabilang,",
			"35": "<sup>35</sup> Ket kinnanda amin a mula idiay dagada, ket kinnanda ti apit ti dagada.",
			"36": "<sup>36</sup> Sinugatna met dagiti inauna nga annac idiay dagada, a cangronaan ti amin a pigsada.",
			"37": "<sup>37</sup> Ket inlapsutna ida a napacuyugan iti pirac ken balitoc; ket awan uray maysa nga agcacapuy a tao cadagiti capcapuonanda.",
			"38": "<sup>38</sup> Ti Egipto naragsacan idi nagluasda; ta ti panagbutengda caniada immapay cadacuada.",
			"39": "<sup>39</sup> Nangibistrad iti ulep a pannacaabbongda, ken apuy a mangraniag iti rabii.",
			"40": "<sup>40</sup> Nagdawatda, ket nangyeg cadagiti tuctucling, ket pinennecna ida iti tinapay ti langit.",
			"41": "<sup>41</sup> Binettacna ti bato, ket dagiti danum nagparucpocda; nagayusda cadagiti namaga a yan a cas carayan.",
			"42": "<sup>42</sup> Ta linagipna ti nasantoan a saona,   ken Abraham nga adipenna.",
			"43": "<sup>43</sup> Ket inlapsutna ti ilina a siraragsac, ken dagiti pinilina a sicacantada.",
			"44": "<sup>44</sup> Ket intedna cadacuada dagiti dagdaga dagiti pagpagarian; ket tinagicuada ti nagbannogan dagiti inilin-ili:",
			"45": "<sup>45</sup> Tapno masalimetmetanda coma dagiti alalagadenna, ken matungpalda dagiti linlintegna. Idaydayawyo ni Jehova."
		},
		"106": {
			"1": "<sup>1</sup> Idaydayawyo ni Jehova. O pagyamananyo ni Jehova; ta isu naimbag; ta ti kinamanagayatna agnanayon.",
			"2": "<sup>2</sup> Siasino ti macaisao cadagiti nabileg a gapuanan ni Jehova, wenno, macaiparangarang amin a pacaidaydayawanna?",
			"3": "<sup>3</sup> Bendito dagiti mangsalimetmet iti kinalinteg, ken ti agaramid iti kinalinteg cadagiti amin a tiempo.",
			"4": "<sup>4</sup> Laglagipennac, O Jehova, nga iraman iti parabur nga ipaaymo iti ilim; O sucnalannac ita panangisalacanmo,",
			"5": "<sup>5</sup> Tapno makitac coma ti kinanam-ay dagiti pinilim, tapno macapagrag-oac iti kinaragsac ti nacionmo, tapno mabalinco coma ti makipagragsac iti patawidam.",
			"6": "<sup>6</sup> Nakipagbasolcami cadagiti ammami, nagapuananmi ti kinadangkes, nagaramidcami a sidadakes.",
			"7": "<sup>7</sup> Dagiti ammami dida naawatan dagiti datdatlagmo idiay Egipto; dida linagip ti caadu dagiti kinamanagayatmo, ngem simmukirda ketdi idiay baybay, wen idiay Baybay Nalabaga.",
			"8": "<sup>8</sup> Nupay casta isu insalacanna ida a maigapu iti naganna, tapno maipacaammona ti napigsa a pannacabalinna.",
			"9": "<sup>9</sup> Tinubngarna met ti Baybay Nalabaga, ket nagmaga: iti casta inlasatna ida iti uneg, nga arig la iti let-ang.",
			"10": "<sup>10</sup> Ket insalacanna ida iti ima ti nanggura cadacuada, ket sinubbotna ida iti ima ti cabusor.",
			"11": "<sup>11</sup> Ket dagiti dandanum linapunosda dagiti casupadida; awan natda uray maysa cadacuada.",
			"12": "<sup>12</sup> Idi a casta pinatidan dagiti saona; incantada ti pannacaidaydayawna.",
			"13": "<sup>13</sup> Nalipatanda iti apagbiit dagiti aramidna; saanda a nagpannuray iti pammatigmaanna.",
			"14": "<sup>14</sup> Ngem naggartemda iti napalalo iti let-ang; ken sinuutda ti Dios idiay tanap.",
			"15": "<sup>15</sup> Ket intedna cadacuada ti dawatda, ngem impaw-itna ti pannacauma iti cararwada.",
			"16": "<sup>16</sup> Nagimonda met ken Moises iti pacarso, ken ni Aaron a santo ni Jehova.",
			"17": "<sup>17</sup> Ti daga nagnganga ket inalunonna ni Datan, ket ginaboranna ti buyot ni Abiram.",
			"18": "<sup>18</sup> Ket ti apuy dimmarang iti bunggoyda; ti darang pinuuranna dagiti nadamca.",
			"19": "<sup>19</sup> Nangaramidda iti urbon a vaca idiay Horeb, ket nagdaydayawda iti sinucog a ladawan.",
			"20": "<sup>20</sup> Iti casta insucatda ti tan-ocda iti maysa a caasping ti vaca a mangan iti root.",
			"21": "<sup>21</sup> Linipatda ti Dios a Mangisalacan cadacuada, a nagaramid cadagiti dadackel a banbanag idiay Egipto,",
			"22": "<sup>22</sup> Nacascasdaaw nga ar-aramid idiay daga a Cam, ken nacakigkigtot a banag idiay Baybay Nalabaga.",
			"23": "<sup>23</sup> Gapuna isu kinunana a pucawenna coma ida, no ni Moises a pinilina saan coma a nagtacder iti saclangna idiay pagbettacanna, tapno icalilisna ti pungtotna, di la ket ta pucawenna ida.",
			"24": "<sup>24</sup> Wen, inumsida ti nacaayayo a daga, saanda a pinati ti saona,",
			"25": "<sup>25</sup> No di ket nagtantanabutobda cadagiti toltoldada, ket dida intaltalec ti timec ni Jehova.",
			"26": "<sup>26</sup> Gapuna insapatana cadacuada, nga idalitnanto ida idiay let-ang.",
			"27": "<sup>27</sup> Ken padsoennanto ti capututanda cadagiti nasnacion, ken iwaraswarasnanto ida cadagiti dagdaga.",
			"28": "<sup>28</sup> Ket nakitiponda met ken Baalpeor, ket kinnanda dagiti datdaton cadagiti natnatay.",
			"29": "<sup>29</sup> Cadagidiay nga ar-aramidda ginargarida a nagpungtot; ket ti angol napasamac cadacuada.",
			"30": "<sup>30</sup> Idin nagtacder ni Finees, ket imbanagna ti panangocom; ket iti casta ti angol naatipa.",
			"31": "<sup>31</sup> Ket dayta naibilang kencuana a kinalinteg, agpapan cadagiti amin a capcaputotan iti agnanayon.",
			"32": "<sup>32</sup> Ket isu pinagpungtotda met idiay dandanum ti Meriba, iti casta isu ti nacapadakes ken ni Moises maipuon cadacuada;",
			"33": "<sup>33</sup> Ta bimmusorda iti espirituna, ket isu cadagiti bibigna nagsao a dina napuutan.",
			"34": "<sup>34</sup> Saanda a pinucaw dagiti inilin-ili cas imbilin ni Jehova cadacuada,",
			"35": "<sup>35</sup> Ngem nakilaocda cadagiti nasnacion, ket sinursuroda dagiti ar-aramidda,",
			"36": "<sup>36</sup> Ken nagservida cadagiti didiosen, isu a nagbalin a pangsilo cadacuada.",
			"37": "<sup>37</sup> Wen, indatonda dagiti annacda a lallaki ken babbai cadagiti demonio.",
			"38": "<sup>38</sup> Ken imbuyatda ti dara a nadalus, uray pay ti dara dagiti annacda a lallaki ken babbai, isuda nga indatonda cadagiti didiosen ti Canaan; ket ti daga namulitan iti dara.",
			"39": "<sup>39</sup> Iti casta narugitanda cadagiti ar-aramidda, ket nagbalangcantisda cadagiti gapuananda.",
			"40": "<sup>40</sup> Gapuna a ti pungtot ni Jehova simged a sibubusor iti ilina, ket kinarurodna ti nagpatawidanna.",
			"41": "<sup>41</sup> Ket intedna ida iti ima dagiti nasnacion; ket dagidi gumurgura cadacuada inturayanda ida.",
			"42": "<sup>42</sup> Dagiti cabusorda pinarparigatda met ida, ket nagyanda a naparucma iti babaen ti imada.",
			"43": "<sup>43</sup> Naminadu nga inispalna ida; ngem simmukirda iti panagbibinnalacadda, ket naimegmegda iti kinadangkesda.",
			"44": "<sup>44</sup> Nupay casta inimatanganna ti ladingitda, idi a nangngegna ti ickisda:",
			"45": "<sup>45</sup> Ket linagipna a maipaay cadacuada ti tulagna, ket nagbabawi cas mayalubog iti caadu dagiti kinamanangngaasina.",
			"46": "<sup>46</sup> Ket inaramidna met a macaasianda cadagiti amin a nangaycayaw cadacuada.",
			"47": "<sup>47</sup> Isalacannacami, O Jehova a Diosmi, ket acoyennacami nga alaen cadagiti nasnacion, tapno agyamancami ita nasantoan a naganmo, ket agballigicami iti pannacaidaydayawmo.",
			"48": "<sup>48</sup> Bendito ni Jehova, a Dios ti Israel, manipud kinaagnanayon aginggana met laeng iti kinaagnanayon. Ket amin ti umili cunana coma, Amen. Idaydayawmo ni Jehova."
		},
		"107": {
			"1": "<sup>1</sup> O agyamancayo ken Jehova, ta isu naimbag; ta ti kinamanangngaasina agnanayon.",
			"2": "<sup>2</sup> Dagiti sinubbot ni Jehova cunaenda coma a casta, dagidiay a sinubbotna iti ima ti cabusor,",
			"3": "<sup>3</sup> Ken tiniptiponna a naggapu cadagiti dagdaga, manipud iti daya manipud iti laud, manipud amianan ket manipud abagatan.",
			"4": "<sup>4</sup> Nagcalcallautangda iti let-ang iti langlangalang a dalan; awan nasaracanda nga ili a pagnaedan.",
			"5": "<sup>5</sup> Sibibisin ken siwawaw, ti cararwada nagpasag cadacuada.",
			"6": "<sup>6</sup> Idi a casta imkisda ken Jehova iti panagducotda, ket isu inispalna ida cadagiti sensennaayda.",
			"7": "<sup>7</sup> Inturongna met ida iti nalinteg a dalan, tapno macagtengda iti ili a pagtaengan.",
			"8": "<sup>8</sup> O dagiti tattao idaydayawda coma ni Jehova gapu iti kinamanagayatna, ken gapu cadagiti nacascasdaaw nga ar-aramidna cadagiti annac dagiti tattao!",
			"9": "<sup>9</sup> Ta pennekenna ti gumawgawawa a cararwa, ket ti sibibisin a cararwa punnoenna iti imbag.",
			"10": "<sup>10</sup> Cas cadagidiay a nagtugaw iti kinasipnget ken iti linong ni patay, a sibabaludda iti leddaang ken landoc,",
			"11": "<sup>11</sup> Gapu ta binusorda dagiti sasao ti Dios, ken inumsida ti patigmaan ti Cangatoan:",
			"12": "<sup>12</sup> Gapuna a pinadagsenanna ti pusoda iti panagrigat; natuangda, ket awan siasinoman a simmaranay.",
			"13": "<sup>13</sup> Idi a casta imkisda ken Jehova iti panagducotda, ket isu insalacanna ida cadagiti sensennaayda.",
			"14": "<sup>14</sup> Inaonna ida iti kinasipnget ken iti linong ni patay, pinugsatna dagiti parautda.",
			"15": "<sup>15</sup> O dagiti tattao idaydayawda coma ni Jehova gapu iti kinamanagayatna, ken gapu cadagiti nacascasdaaw nga ar-aramidna cadagiti annac dagiti tattao.",
			"16": "<sup>16</sup> Ta dinupracna dagiti ruangan a gambang, ket pinutedna dagiti balunet a landoc.",
			"17": "<sup>17</sup> Dagiti maag gapu iti salungasingda, ken gapu iti kinadangkesda, maparigatanda.",
			"18": "<sup>18</sup> Ti cararwada carurodda ti aniaman a kita ti taraon; ket umadanida cadagiti ruangan ni patay.",
			"19": "<sup>19</sup> Iti casta umkisda ken Jehova iti panagducotda, ket isu isalacanna ida cadagiti sensennaayda.",
			"20": "<sup>20</sup> Ibaonna ti saona, ket agasanna ida, ket ispalenna ida cadagiti pacadadaelanda.",
			"21": "<sup>21</sup> O dagiti tattao idaydayawda coma ni Jehova gapu iti kinamanagayatna, ken gapu iti nacascasdaaw nga ar-aramidna cadagiti annac dagiti tattao!",
			"22": "<sup>22</sup> Ket idatonda coma kencuana dagiti sacrificio ti panagyaman, ket ipalawagda nga icancanta dagiti ar-aramidna.",
			"23": "<sup>23</sup> Dagiti tumapug idiay baybay cadagiti sasacayan, dagiti agcomcomercio cadagiti dadackel a dandanum;",
			"24": "<sup>24</sup> Dagitoy makitada dagiti ar-aramid ni Jehova, ken dagiti datdatlagna iti taaw.",
			"25": "<sup>25</sup> Ta bilinenna, ket pabangonenna ti angin ti bagio, isu a mangicudduag cadagiti dalluyonna.",
			"26": "<sup>26</sup> Umalimpatocda nga agpalangit, sada manen agpababa cadagiti yuyeng: ti cararwada malunag gapu iti ducot.",
			"27": "<sup>27</sup> Maipaspas-irawda, ket agpigpigergerda a cas ti nabartec a tao, amin nga ammoda mapucawen.",
			"28": "<sup>28</sup> Iti casta umkisda ken Jehova iti panagducotda, ket ilapsutna ida cadagiti sensennaayda.",
			"29": "<sup>29</sup> Pagbalinenna ti bagio a linac, iti casta dagiti dalluyonna agtalnada.",
			"30": "<sup>30</sup> Iti casta maragsacandan gapu ta natalnadan; ket sana iturong ida iti tartarigagayanda a pagsangladan.",
			"31": "<sup>31</sup> O dagiti tattao idaydayawda coma ni Jehova gapu ti kinamanagayatna, ken gapu iti nacascasdaaw nga ar-aramidna cadagiti annac dagiti tattao!",
			"32": "<sup>32</sup> Itan-ocda met coma iti tallaong ti umili, ken idaydayawda coma iti pagtutugawan dagiti panglacayen.",
			"33": "<sup>33</sup> Pagbalinenna dagiti carcarayan a let-ang, ken dagiti burburayoc a naticag a daga,",
			"34": "<sup>34</sup> Daga a pagapapitan, a naapaya a daga, gapu iti kinadakes dagiti agnaed cadacuada.",
			"35": "<sup>35</sup> Pagbalinenna ti let-ang a danaw, ken ti naticag a daga a burayoc.",
			"36": "<sup>36</sup> Ket sadiay pagnaedenna dagiti mabisin, tapno macaisaganada ti ili a pagnaedan,",
			"37": "<sup>37</sup> Ken mabunubonanda dagiti taytay-ac, ket mamulaanda dagiti panguvasan, ket lac-amenda dagiti bungbunga nga immadu.",
			"38": "<sup>38</sup> Isu bendicionanna met ida, tapno umaduda unay; ket saanna nga ituloc a macraayan dagiti an-animalda.",
			"39": "<sup>39</sup> Sa manen, macsayanda ken maparucmada gapu iti pannacailuplupit, ducot, ken ladingit.",
			"40": "<sup>40</sup> Iparucpocna ti umsi cadagiti piprincipe, ket pagcalcallautangenna ida iti langalang, nga awan ti pagdalanan.",
			"41": "<sup>41</sup> Nupay casta itandudona ti napanglaw manipud iti ladingitna, ket ipaayanna iti putputot a cas pangen.",
			"42": "<sup>42</sup> Dagiti nalinteg makitadanto, ket agragsacdanto; ket ti amin a kinadangkes pagtangepennanto ti ngiwatna.",
			"43": "<sup>43</sup> Siasinoman a masirib imutectecannanto dagitoy a banbanag; ket panpanunutendanto ti kinamanagayat ni Jehova."
		},
		"108": {
			"1": "<sup>1</sup> Ti pusoc sitatalingengen, O Dios; agcantaacto, wen, cantaecto dagiti panangidaydayaw, agraman pay ti pannacaitan-occo.",
			"2": "<sup>2</sup> Agriingcayo, salterio ken arpa: siac met laeng agriingacto met a masapa unay.",
			"3": "<sup>3</sup> Agyamanacto kenca, O Jehova, iti tengnga dagiti inilin-ili; ket icantacto dagiti panangidaydayaw kenca, iti tengnga dagiti nasnacion.",
			"4": "<sup>4</sup> Ta ti kinamanagayatmo naindaclan iti ringbaw dagiti langlangit; ken ti kinapudnom dumanon cadagiti tangatang.",
			"5": "<sup>5</sup> Maitan-occa coma, O Dios, iti ringbaw dagiti langlangit, ket ti dayagmo ringbawanna amin toy daga.",
			"6": "<sup>6</sup> Tapno ti ayayatem maispal, isalacannacami ita canawan nga imam, ket sungbatannacami.",
			"7": "<sup>7</sup> Ti Dios nagsaon babaen iti kinasantona: Agragrag-oacto; bingayecto ti Sikem, ket rucodecto ti lobong ti Succot.",
			"8": "<sup>8</sup> Cucuac ti Galaad; cucuac ti Manases; ti Efraim isu met ti salacnib ti uloc; ti Juda isu ti cetroc.",
			"9": "<sup>9</sup> Ti Moab isu ti bacca a pagbuggoac; sadi Edom ipalladawconto ti sapatosco; sadi Filistia ti pagdir-iacto.",
			"10": "<sup>10</sup> Siasino ti mangiserrecto caniac idiay ili a nabacudan? Siasino ti nangiturong caniac idiay Edom?",
			"11": "<sup>11</sup> Saannacami aya nga inwagsac, O Dios? Ket saanca a cumuyog, O Dios, cadagiti buybuyotmi.",
			"12": "<sup>12</sup> Badangannacami a bumusor cadagiti casupadimi; ta ubbaw ti saranay ti tao.",
			"13": "<sup>13</sup> Gapu iti Dios simamaingelcamto: ta isu ti mangilupitto cadagiti casupadimi."
		},
		"109": {
			"1": "<sup>1</sup> Dica agtalna, O Dios a pagdaydayawac.",
			"2": "<sup>2</sup> Ta ti ngiwat ti nadangkes ken ti ngiwat ti kinaulbod inngangada caniac: nagsaoda caniac a siuulbod ti dilada.",
			"3": "<sup>3</sup> Inalicubcubdac met cadagiti sasao ti gura, ket nakibacalda caniac nga awan gapgapuna.",
			"4": "<sup>4</sup> Gapu iti ayatco isu ti pakicabusoranda caniac: ngem cumararagac.",
			"5": "<sup>5</sup> Ket insupapacda caniac ti dakes gapu iti imbag, ken gura gapu iti ayatco.",
			"6": "<sup>6</sup> Mangicabilca iti dakes a tao nga agimaton kencuana; ken tumacder coma iti maysa a mangrupir idiay macanawan nga imana.",
			"7": "<sup>7</sup> Intono maocom, rumsua coma a nacabasol; ket ti cararagna agbalin coma a basol.",
			"8": "<sup>8</sup> Bumassit coma dagiti al-aldawna; ket alaen coma ti sabali ti saadna.",
			"9": "<sup>9</sup> Maulila coma dagiti annacna, ken mabalo ti asawana.",
			"10": "<sup>10</sup> Agallaalla coma dagiti annacna, ken makilimlimosda; ket agsapsapulda coma iti taraonda cadagiti langlangalang a yanda.",
			"11": "<sup>11</sup> Ti managagum cuycuyenna coma amin nga adda kencuana; ket dagiti gangannaet samsamenda coma ti pagbannoganna.",
			"12": "<sup>12</sup> Awan cadi uray maysa a mangigay-at iti ayat kencuana; awan met coma ti siasino man a mangngaasi cadagiti ulila nga annacna.",
			"13": "<sup>13</sup> Magudas coma ti inaudina; iti sumaganad a caputotan mapunas coma ti naganda.",
			"14": "<sup>14</sup> Ti kinadakes dagiti dadackelna maipalpalagip coma ken Jehova; ket ti basol ti inana di coma mapunas.",
			"15": "<sup>15</sup> Addada coma a cancanayon iti saclan ni Jehova, tapno gudasenna ti pacalaglagipan cadacuada ditoy daga;",
			"16": "<sup>16</sup> Gapu ta dina linagip nga imparangarang ti ayat, intuggudna ketdi ti napanglaw ken nanumo a tao, ken ti nadanar ti pusona, tapno patayenna ida.",
			"17": "<sup>17</sup> Wen, nagayatanna ti panagilunod, ket isu ti dimteng kencuana; ket dina nagrayoan ti pammarabur, ket isu ti nayadayo kencuana.",
			"18": "<sup>18</sup> Incawesna met iti bagina met laeng ti panagilunod a cas pannacapagan-anayna, ket simrec a cas danum cadagiti caungan a bagina, ken cas lana cadagiti tultulangna.",
			"19": "<sup>19</sup> Isu coma kencuana ti cas cagay nga icapetna, ken pannacabarikes a pagbarikesna a cancanayon.",
			"20": "<sup>20</sup> Daytoy ti gunguna dagiti casupadic gapu ken Jehova, ken cadagidiay nga agsao iti dakes a maicaniwas itoy cararwac.",
			"21": "<sup>21</sup> Ngem bumiangca cadi caniac, O Jehova, nga Apo, a maigapu ita naganmo: yantangay naimbag ti kinamanagayatmo, ispalennac cadi;",
			"22": "<sup>22</sup> Ta napanglawac ken nanumoac, ket toy pusoc nadanar itoy unegco.",
			"23": "<sup>23</sup> Maawanacon a cas ti aniniwan no agpucaw; maisaysayagac a casla dudon.",
			"24": "<sup>24</sup> Dagiti tumtumengco aglucaylucaydan gapu iti panagayayuno; ket ti lasagco awananen iti taba.",
			"25": "<sup>25</sup> Agbalinac met a nacababain cadacuada: no makitadac, iwingiwingda ti uloda.",
			"26": "<sup>26</sup> Tulongannac, O Jehova a Diosco; O isalacannac cas mayalubog ita kinamanagayatmo:",
			"27": "<sup>27</sup> Tapno maammoanda a daytoy ti imam; a sica, Jehova, ti nangaramid.",
			"28": "<sup>28</sup> Ala agilunodda laeng, ngem sica mangbendicionca: no bumangonda, maibabaindanto, ngem toy adipenmo agragrag-onto.",
			"29": "<sup>29</sup> Macawesan coma dagiti casupadic iti pannacaibabain, ket macumotanda coma iti panagbainda met laeng a casla cagayda.",
			"30": "<sup>30</sup> Agyamanacto iti dackel ken Jehova babaen itoy ngiwatco; wen, idaydayawconto iti tengnga ti dackel a gimong:",
			"31": "<sup>31</sup> Ta isu agtacderto iti macanawam nga ima ti nanumo, tapno isalacanna cadagiti mangocom iti cararwana."
		},
		"110": {
			"1": "<sup>1</sup> Ni Jehova cunana iti Apoc, Agtugawca iti macanawanco agingga iti mapagbanagco dagiti cabcabusormo a pagbatayam.",
			"2": "<sup>2</sup> Ni Jehova ibaonnanto ti sarucod ti bilegmo manipud Sion: agturayca iti tengnga dagiti cabcabusormo.",
			"3": "<sup>3</sup> Ti ilim itulnogna ti bagina a siaayat iti aldaw ti pannacabalinmo, iti nasantoan a pannakidangadang: nagtaud iti aanacan ti bigat addaanca iti linnaaw ti kinaagtutubom.",
			"4": "<sup>4</sup> Ni Jehova insapatana, ket dinto agbabawi: sica ti padi nga agnanayon cas galad ni Melkisedec.",
			"5": "<sup>5</sup> Ti Apo dita macanawanmo danarennanto dagiti ar-ari iti aldaw ti pungtotna.",
			"6": "<sup>6</sup> Mangocomto cadagiti nasnacion, punnoennanto ida cadagiti bagbagi a natay; danarennanto ti pangoloen cadagiti adu a dagdaga.",
			"7": "<sup>7</sup> Inumannanto ti agayayus iti dalan: iti casta isu ital-onanto ti ulo."
		},
		"111": {
			"1": "<sup>1</sup> Idaydayawyo ni Jehova, agyamanacto ken Jehova iti amin a pusoc, iti pagbibinnalacadan dagiti nalinteg, ken iti gimong.",
			"2": "<sup>2</sup> Dagiti ar-aramid ni Jehova naindaclanda, a biroken dagiti amin nga agrayo cadacuada.",
			"3": "<sup>3</sup> Ti aramidna kinadayaw ken kinadaeg; ket ti kinalintegna agpaut nga agnanayon.",
			"4": "<sup>4</sup> Inaramidna dagiti nacascasdaaw nga aramidna tapno laglagipen ida: ni Jehova managparabur ken manangngaasi.",
			"5": "<sup>5</sup> Nangted iti taraon cadagiti agbuteng kencuana; silalagipto laeng iti tulagna.",
			"6": "<sup>6</sup> Impamatmatna iti ilina ti pannacabalin dagiti aramidna, iti panangtedna cadacuada iti tawid dagiti nasnacion.",
			"7": "<sup>7</sup> Dagiti aramid dagiti imana kinapudno ken kinajusticia; amin nga alalagadenna napaypaysoda.",
			"8": "<sup>8</sup> Naituyangda nga agnanayon awan inggana; naaramidda iti kinapudno ken kinalinteg.",
			"9": "<sup>9</sup> Imbaonna ti pannacasubbot iti ilina; imbilinna nga agnanayon ti intulagna: santo ket madaydayaw ti naganna.",
			"10": "<sup>10</sup> Ti panagbuteng ken Jehova isu ti pangrugian ti kinasirib; addaanda iti nasayaat a panagawawat dagiti agtungpal cadagiti bilbilinna; ti pannacaidaydayawna agpaut nga agnanayon."
		},
		"112": {
			"1": "<sup>1</sup> Idaydayawyo ni Jehova. Nagasat ti tao nga agbuteng ken Jehova, a maragsacan unay cadagiti bilbilinna.",
			"2": "<sup>2</sup> Ti caputotanna mannacabalinto ditoy rabaw ti daga: ti caputotan ti nalinteg mabendicionanto.",
			"3": "<sup>3</sup> Pagsanicuaan ken kinabacnang addadanto iti balayna; ket ti kinalintegna agpaut nga agnanayon.",
			"4": "<sup>4</sup> Iti nalinteg adda bumangon a silaw iti sipnget: managayat, ken manangngaasi, ket sililinteg.",
			"5": "<sup>5</sup> Pagimbagan ti tao a managayat ken agpautang; taripatoennanto ti panggepna iti pannacaocom.",
			"6": "<sup>6</sup> Ta saanto a magaraw uray caanoman; ti nalinteg addanto laeng iti agnanayon a pannacalaglagip.",
			"7": "<sup>7</sup> Dinanto pagbutngan dagiti dakes a damdamag: ti pusona sitatalingenngen, a manginanama ken Jehova.",
			"8": "<sup>8</sup> Ti pusona natalged, dinto agbuteng, agingga iti makitana ti tarigagayanna nga agpaay cadagiti casupadina.",
			"9": "<sup>9</sup> Isu nagiwaras, nangted iti macasapul; ti kinalintegna agpaut nga agnanayon: ti sarana maitan-octo a sidadayaw.",
			"10": "<sup>10</sup> Ti nadangkes makitananto, ket agpulcocto; pagngaretngetennanto dagiti ngipenna, ket marunawto: ti tarigagay ti nadangkes mapucawto."
		},
		"113": {
			"1": "<sup>1</sup> Idaydayawyo ni Jehova. Idaydayawyo, O dacayo nga ad-adipen ni Jehova, idaydayawyo ti nagan ni Jehova.",
			"2": "<sup>2</sup> Bendito coma ti nagan ni Jehova manipud ita nga agnanayon.",
			"3": "<sup>3</sup> Manipud sumingising ti init agingga iti ilelennecna met laeng ti nagan ni Jehova maidaydayaw coma.",
			"4": "<sup>4</sup> Ni Jehova natan-oc iti ringbaw dagiti amin a nasnacion, ket ti dayagna naringringbaw ngem dagiti langlangit.",
			"5": "<sup>5</sup> Siasino ti cas ken Jehova a Diostayo, nga adda ti tugawna iti nangato,",
			"6": "<sup>6</sup> Nga agpacumbaba tapno matmatanna dagiti adda sadi langit ken iti daga?",
			"7": "<sup>7</sup> Bangonenna ti napanglaw manipud iti tapuc, ket aonenna ti nacurapay iti pagibellengan ti rugit;",
			"8": "<sup>8</sup> Tapno isu ti isaadna cadagiti principe, cadagiti met laeng principe ti ilina.",
			"9": "<sup>9</sup> Pagtagibalayenna ti babai a lupes, ket pagbalinenna a naragsac nga ina dagiti annac. Idaydayawyo ni Jehova."
		},
		"114": {
			"1": "<sup>1</sup> Idi a pimmanaw ti Israel idiay Egipto, ti balay ni Jacob nanipud iti umili a gangannaet ti pagsasaona;",
			"2": "<sup>2</sup> Ti Juda nagbalin a santuariona, ti Israel pagturayanna.",
			"3": "<sup>3</sup> Ti baybay nakitana, ket nagtalaw; ti Jordan napasanud.",
			"4": "<sup>4</sup> Dagiti banbantay naglalagtoda a cas carcarnero a calantangan, dagiti turturod a babassit cas carcarnero nga urbon.",
			"5": "<sup>5</sup> Ania ti napasamacmo, Sica O bay-bay, a nagtalawca pay? Sica Jordan, apay a nagsanudca?",
			"6": "<sup>6</sup> Dacayo a banbantay, a naglalagtocayo pay a cas carcarnero a calantangan; dacayo turod a babassit, a cas carcarnero nga urbon?",
			"7": "<sup>7</sup> Agkintayegca, sica daga, iti sangoanan ti Apo, iti sangoanan ti Dios ni Jacob,",
			"8": "<sup>8</sup> Isu a namagbalin ti bato a libtong ti danum: ti pamulinawen, pagbalinenna nga ubbog ti dandanum."
		},
		"115": {
			"1": "<sup>1</sup> Saan a cadacami, O Jehova, saan a cadacami, no di ket ita naganmo ti pangtedam iti dayag, gapu iti kinamanagayatmo, ken gapu iti pateg ti kinapudnom.",
			"2": "<sup>2</sup> Apay a sawento dagiti nacion, ayanna ita ti Diosda?",
			"3": "<sup>3</sup> Ngem ti Diosmi adda cadagiti langlangit: inaramidna ti aniaman a kinayatna.",
			"4": "<sup>4</sup> Dagiti didiosen pirac ken balitoc, ti aramid dagiti im-ima dagiti tattao.",
			"5": "<sup>5</sup> Adda ngiwngiwatda, ngem dida agsao; adda matmatada, ngem dida macakita;",
			"6": "<sup>6</sup> Adda laplapayagda, ngem dida macangngeg; adda agagongda, ngem dida macaangot;",
			"7": "<sup>7</sup> Adda im-imada, ngem dida macaaricap; adda sacsacada, ngem dida macapagna; dida met macapagsao iti carabucobda.",
			"8": "<sup>8</sup> Dagiti mangaramid cadacuada umaspingdanto cadacuada; wen, ken siasinoman nga agcammatalec cadacuada.",
			"9": "<sup>9</sup> O Israel, agcammatalecca ken Jehova: isu ti tulongda ken calasagda.",
			"10": "<sup>10</sup> O balay ni Aaron, agcammataleccayo ken Jehova: isu ti tulongda ken calasagda.",
			"11": "<sup>11</sup> Dacayo nga agbuteng ken Jehova, agtaleccayo ken Jehova: isu ti tulongda ken calasagda.",
			"12": "<sup>12</sup> Ni Jehova silalagip cadatayo; bendicionannatayto: bendicionannanto ti balay ni Israel; bendicionannanto ti balay ni Aaron.",
			"13": "<sup>13</sup> Bendicionannanto dagiti agbuteng ken Jehova, babassit man ken dadackel.",
			"14": "<sup>14</sup> Ni Jehova parang-ayennacayo coma a parang-ayen, dacayo ken dagiti anannacyo.",
			"15": "<sup>15</sup> Benditonacayo ni Jehova, isu a nangaramid iti langit ken daga.",
			"16": "<sup>16</sup> Dagiti langlangit isuda dagiti langlangit ni Jehova; ngem ti daga intedna cadagiti annac dagiti tattao.",
			"17": "<sup>17</sup> Dagiti natay dida idaydayaw ni Jehova, ken siasinoman a bumaba iti ulimec;",
			"18": "<sup>18</sup> Ngem benditoentayo ni Jehova manipud ita nga agnanayon. Idaydayawyo ni Jehova."
		},
		"116": {
			"1": "<sup>1</sup> Ayatec ni Jehova, agsipud ta denggenna ti timecco ken dawdawatco.",
			"2": "<sup>2</sup> Gapu ta inyallingagna ti lapayagna caniac, gapuna umawagacto kencuana bayat ti panagbiagco.",
			"3": "<sup>3</sup> Dagiti galgalut ni patay pinarautandac, ket dagiti tutuoc ni Tanem kinapetdac: nasaracac ti ducot ken ladingit.",
			"4": "<sup>4</sup> Idin immawagac iti nagan ni Jehova; O Jehova, agdawatac kenca, luc-atam toy cararwac.",
			"5": "<sup>5</sup> Managayat ni Jehova, ket sililinteg; wen, ti Diostayo sicacaasi.",
			"6": "<sup>6</sup> Ni Jehova salacnibanna dagiti nanengneng: naipababaac, ket isu insalacannac.",
			"7": "<sup>7</sup> Agpulangca iti kinatalnam, O cararwac; ta ni Jehova bimmiang a sipaparabur kenca.",
			"8": "<sup>8</sup> Ta inispalmo toy cararwac nanipud ken patay; dagiti matac nanipud cadagiti lulua, ken dagiti sacac nanipud iti pannacapadso,",
			"9": "<sup>9</sup> Magnaacto iti saclang ni Jehova iti daga dagiti nabiag.",
			"10": "<sup>10</sup> Patiec gapuna agsaoac: nagleddaangac a nalaus:",
			"11": "<sup>11</sup> Kinunac iti pannacaganatco, amin a tattao naulbod.",
			"12": "<sup>12</sup> Ania ti itdecto ken Jehova a subad dagiti paraburna caniac?",
			"13": "<sup>13</sup> Alaecto ti copa ti pannacaisalacan, ken awagacto ti nagan ni Jehova.",
			"14": "<sup>14</sup> Bayadacto dagiti carcaric ken Jehova, wen, iti sangoanan ti amin nga ilina.",
			"15": "<sup>15</sup> Napateg iti imatang ni Jehova ti ipapatay dagiti sasantona.",
			"16": "<sup>16</sup> O Jehova, pudno a siac adipennac: siac adipennac, anac ti babai nga adipenmo; sica winarwarmo dagiti repreppetco.",
			"17": "<sup>17</sup> Isagutconto kenca ti daton a pagyaman, ket umawagacto iti nagan ni Jehova.",
			"18": "<sup>18</sup> Bayadacto dagiti carcaric ken Jehova, wen, iti sangoanan ti amin nga ilina,",
			"19": "<sup>19</sup> Cadagiti paraangan ti balay ni Jehova, iti tengngam, O Jerusalem. Idaydayawyo ni Jehova."
		},
		"117": {
			"1": "<sup>1</sup> O idaydayawyo ni Jehova, dacayo amin a nasnacion; ipadpadayawyo, dacayo amin nga inilin-ili.",
			"2": "<sup>2</sup> Ta naindaclan ti kinamanagayatna cadatayo; ket ti kinapudno ni Jehova agnanayon. Idaydayawyo ni Jehova."
		},
		"118": {
			"1": "<sup>1</sup> O agyamancayo ken Jehova; ta isu naimbag; ta ti kinamanagayatna agnanayon.",
			"2": "<sup>2</sup> Cunaen coma ita ti Israel, a ti kinamanagayatna agnanayon.",
			"3": "<sup>3</sup> Cuna coma ti balay ni Aaron ita, a ti kinamanagayatna agnanayon.",
			"4": "<sup>4</sup> Dagiti agbuteng ken Jehova cunada coma ita, a ti kinamanagayatna agnanayon.",
			"5": "<sup>5</sup> Nanipud itoy sennaayco immawagac ken Jehova: ni Jehova sinungbatannac ket incabilnac  iti nalawa a disso.",
			"6": "<sup>6</sup> Ni Jehova adda ditoy sikigac; diacto agbuteng: ania ti mabalin nga aramiden ti tao caniac?",
			"7": "<sup>7</sup> Ni Jehova adda ditoy sikigac iti nagtengngaan dagiti mangarayat caniac: iti casta makitacto ti calicagumco nga agpaay cadagiti gumurgura caniac.",
			"8": "<sup>8</sup> Nasaysayaat ti panagcamang ken Jehova ngem ti panagtaltalec iti tao.",
			"9": "<sup>9</sup> Nasaysayaat ti icacamang ken Jehova ngem ti panagtaltalec cadagiti principe.",
			"10": "<sup>10</sup> Amin dagiti nasnacion linacubdac: iti nagan ni Jehova gupdecto ida.",
			"11": "<sup>11</sup> Linacubdac; wen, linacubdac: iti nagan ni Jehova gupdecto ida.",
			"12": "<sup>12</sup> Linacubdac nga arigda la uyocan; naiddepda a cas apuy dagiti sisiit: iti nagan ni Jehova gupdecto ida.",
			"13": "<sup>13</sup> Sica dinuclosnac a nacaro tapno matuangac; ngem ni Jehova inarayatnac.",
			"14": "<sup>14</sup> Ni Jehova isu ti bilegco ken cantac; ken isu ti mangisalacan caniac.",
			"15": "<sup>15</sup> Ti timec ti panagragragsac ken pannacaisalacan adda cadagiti toltolda dagiti sililinteg: ti canawan nga ima ni Jehova agmamaingel.",
			"16": "<sup>16</sup> Ti canawan nga ima ni Jehova naitan-oc: ti canawan nga ima ni Jehova agmamaingel.",
			"17": "<sup>17</sup> Saanacto a matay, ngem agbiagacto, ken ipalawagconto dagiti ar-aramid ni Jehova.",
			"18": "<sup>18</sup> Ni Jehova dinusanac iti nacaro; ngem dinac ket inyawat ken patay.",
			"19": "<sup>19</sup> Aglucatda coma caniac dagiti ruruangan ti kinalinteg: sumrecacto cadacuada, agyamanacto ken Jehova.",
			"20": "<sup>20</sup> Daytoy ti ruangan ni Jehova; ti sililinteg sumrecto kencuana.",
			"21": "<sup>21</sup> Agyamanacto kenca; ta sinungbatannac, ket nagbalinca a salacanco.",
			"22": "<sup>22</sup> Ti bato a di-kinayat dagiti agbangbangon nagbalin a pasuli.",
			"23": "<sup>23</sup> Daytoy ti panagaramid ni Jehova; nacascasdaaw cadagiti matmatatayo.",
			"24": "<sup>24</sup> Daytoy ti aldaw nga inaramid ni Jehova; pagragsacanmi ken pagragoanminto.",
			"25": "<sup>25</sup> Mangisalacanca ita, dawatenmi kenca, O Jehova: O Jehova, dawatenmi kenca, ibaonmo ita ti kinanamay.",
			"26": "<sup>26</sup> Bendito ti umay iti nagan ni Jehova: binenditodaca manipud iti balay ni Jehova.",
			"27": "<sup>27</sup> Ni Jehova isu ti Dios, ket iniccannatayo iti silaw: galutanyo ti daton cadagiti taltali, wen agingga cadagiti sara ti altar.",
			"28": "<sup>28</sup> Sica ti Diosco, ket agyamanacto kenca: sica ti Diosco, idaydayawcanto.",
			"29": "<sup>29</sup> O agyamancayo ken Jehova; ta isu naimbag; ta ti kinamanagayatna agnanayon."
		},
		"119": {
			"1": "<sup>1</sup> Nagasat dagiti awan pagcurcuranganda iti dalan, a magnada iti linteg ni Jehova.",
			"2": "<sup>2</sup> Bendito dagiti mangsalimetmet cadagiti pammanecnecna, nga agbiroc kencuana iti amin a pusoda.",
			"3": "<sup>3</sup> Wen, saanda nga agaramid iti kinakillo; magnada cadagiti daldalanna.",
			"4": "<sup>4</sup> Sica imbilinmo cadacami dagiti al-alagadem, tapno annurotenmi ida a sireregta.",
			"5": "<sup>5</sup> Sapay coma ta dagiti desdesco maisimpada nga umannurot cadagiti pangngeddengmo!",
			"6": "<sup>6</sup> Iti casta saanacto a maibabain, no adda panagraemco cadagiti amin a bilbilinmo.",
			"7": "<sup>7</sup> Agyamanacto kenca agraman kinalinteg ti puso, inton masursuroc dagiti sililinteg a panagipatom.",
			"8": "<sup>8</sup> Annurotecto dagiti pangngeddengmo: O dinac cadi baybay-an a pulos. BETH",
			"9": "<sup>9</sup> Ania ti pangdalusto ti agtutubo iti dalanna? Ti panangitaltalecna iti mayannurot iti saom.",
			"10": "<sup>10</sup> Iti amin a pusoc binirbirocca: O dinac baybay-an a maisiasi cadagiti bilbilinmo.",
			"11": "<sup>11</sup> Ti saom indulinco itoy pusoc, tapno diac agbasol kenca.",
			"12": "<sup>12</sup> Benditoca, O Jehova: isurom caniac dagiti al-alagadem.",
			"13": "<sup>13</sup> Cadagiti bibigco impalawagco amin dagiti nagbilinan ta ngiwatmo.",
			"14": "<sup>14</sup> Nagrag-oac ti dalan dagiti pamanecnecmo, a cas iti caadu dagiti amin a sansanicua.",
			"15": "<sup>15</sup> Imutectecacto dagiti alagadem, ket pagraemacto dagiti dalanmo.",
			"16": "<sup>16</sup> Maragragsacanacto cadagiti al-alagadem: diacto lipaten ti saom. GIMEL",
			"17": "<sup>17</sup> Ipaayam cadi a sipaparabur toy adipenmo, tapno agbiagac; iti casta annurotecto ti saom.",
			"18": "<sup>18</sup> Luctam dagitoy matac, tapno mabuyac dagiti nacascasdaaw a banbanag nga aggapu ita lintegmo.",
			"19": "<sup>19</sup> Gangannaetac ditoy daga: dica ilinged caniac dagiti bilbilinmo.",
			"20": "<sup>20</sup> Toy cararwac mariribuc gapu iti cancanayon nga iliwna cadagiti linlintegmo.",
			"21": "<sup>21</sup> Tinubngarmo dagiti natangsit nga addada a nailunod, a sumiasida cadagiti bilbilinmo.",
			"22": "<sup>22</sup> Iyadayom cadi caniac ti ab-abi ken uyaw; gapu ta sinalimetmetac dagiti impanecnecmo.",
			"23": "<sup>23</sup> Dagiti principe nagtugawda met ket nagsarsaritada iti maibusor caniac; ngem toy adipenmo nagpanunot cadagiti al-alagadem.",
			"24": "<sup>24</sup> Dagiti pamanecnecmo isuda met ti pagray-oac ken cabalanbalacadco. DALETH",
			"25": "<sup>25</sup> Toy cararwac kimleb iti tapuc: papartakennac cadi cas mayannurot iti saom.",
			"26": "<sup>26</sup> Impalawagco dagiti daldalanco, ket sica sinungbatannac: isurom caniac dagiti al-alagadem.",
			"27": "<sup>27</sup> Ipaawatmo caniac ti dalan dagiti alagadem: iti casta panpanunotecto dagiti nacascasdaaw nga ar-aramidmo.",
			"28": "<sup>28</sup> Toy cararwac marunaw gapu iti bantot: papigsaennac cas mayannurot iti saom.",
			"29": "<sup>29</sup> Ilisim caniac ti dalan ti kinaulbod; ket itdem a siaayat caniac ti lintegmo.",
			"30": "<sup>30</sup> Pinilic ti dalan ti kinamanagtalinaed: dagiti pagbilbilinam incabilco ditoy sangoc.",
			"31": "<sup>31</sup> Salikepkepac dagiti pangpanecnecmo: O Jehova, dinac cadi pabainan.",
			"32": "<sup>32</sup> Tarayecto ti dalan dagiti bilbilinmo, intono palawaem toy pusoc. HE",
			"33": "<sup>33</sup> Isurom caniac, O Jehova, ti dalan dagiti al-alagadem; ket salimetmetacto agpapan pagtungpalan.",
			"34": "<sup>34</sup> Iccannac ti pannacaawat, ket salimetmetacto ti lintegmo; wen, annurotecto iti amin a pusoc.",
			"35": "<sup>35</sup> Ipannac iti dana dagiti bilbilinmo; ta cadacuada maragsacanac.",
			"36": "<sup>36</sup> Pagturungem toy pusoc cadagiti pammanecnecmo, a saan ket nga iti kinaagum.",
			"37": "<sup>37</sup> Ilisim dagitoy matac iti panangmatmat iti kinaubbaw, ket papartakennac cadagiti daldalanmo.",
			"38": "<sup>38</sup> Panecnecam ti saom itoy adipenmo, a maipaay iti panagbuteng kenca.",
			"39": "<sup>39</sup> Iliclicmo caniac ti pannacaab-abi a cabutengco; ta dagiti pagbilbilinam naimbagda.",
			"40": "<sup>40</sup> Adtoy, inililiwco dagiti al-alagadem: papartakennac iti kinalintegmo. VAV",
			"41": "<sup>41</sup> Umay coma met caniac ta kinamanagayatmo, O Jehova. Dayta pay panangisalacanmo, cas mayannurot iti saom.",
			"42": "<sup>42</sup> Iti casta addanto isungbatco iti mangab-abi caniac; ta agtalecac iti saom.",
			"43": "<sup>43</sup> Ket dica cadi iccaten a pulos ti sao ti pudno itoy ngiwatco; ta nanginanamaac cadagiti pangngeddengmo.",
			"44": "<sup>44</sup> Iti casta annurotecto nga agnanayon ti lintegmo nga awan ingana.",
			"45": "<sup>45</sup> Ket magnaacto a siwayawaya; ta binirocco dagiti alagadem.",
			"46": "<sup>46</sup> Saoecto met dagiti pammanecnecmo iti saclang dagiti ar-ari, ket saanacto a maibabain.",
			"47": "<sup>47</sup> Ket pagrayrayoacto dagiti bilbilinmo, nga inayayatco.",
			"48": "<sup>48</sup> Itag-ayconto met dagiti im-imac cadagiti bilbilinmo, nga inayayatco; ket imutectecacto dagiti alagadem. ZAYIN",
			"49": "<sup>49</sup> Laglagipem ti saom itoy adipenmo, gapu ta pinangnamnamanac.",
			"50": "<sup>50</sup> Daytoy ti liwliwac iti ladingitco; ta ti saom pinagbiagnac.",
			"51": "<sup>51</sup> Dagiti natangsit inuyuyawdac a napalalo, ngem, saanac a simmiasi iti lintegmo.",
			"52": "<sup>52</sup> Linagipco dagiti pangngeddengmo idi ugma, O Jehova, ket naliwliwaac.",
			"53": "<sup>53</sup> Nabara nga unget ti kimpet caniac, gapu cadagiti nadangkes a nangbaybay-an iti lintegmo.",
			"54": "<sup>54</sup> Dagiti alagadem isuda ti incancantac iti balay ti panagallaallac.",
			"55": "<sup>55</sup> Linagipco ti naganmo, O Jehova, iti rabii, ket inannurotco ti lintegmo.",
			"56": "<sup>56</sup> Daytoy ti addan caniac, Gapu ta sinalimetmetac dagiti pannursurom. CHETH",
			"57": "<sup>57</sup> Ni Jehova ti apagco: sinaocon nga annurotec coma dagiti sasaom.",
			"58": "<sup>58</sup> Dinawdawatco ti paraburmo iti amin a pusoc: sicacaasica cadi caniac cas mayannurot iti saom.",
			"59": "<sup>59</sup> Pinanunotco dagiti daldalanco, ket inturongco dagiti sacsacac cadagiti pammanecnecmo.",
			"60": "<sup>60</sup> Nagalallegac, ket diac nagtantan, a mangannurot cadagiti bilbilinmo.",
			"61": "<sup>61</sup> Dagiti taltali dagiti nadangkes binaracusandac; ngem diac linipatan ti lintegmo.",
			"62": "<sup>62</sup> Iti tengnga ti rabii bumangonacto nga agyaman kenca gapu cadagiti sililinteg a pangngeddengmo.",
			"63": "<sup>63</sup> Maysaac a cadua dagiti agbuteng kenca, ken dagiti mangannurot cadagiti al-alagadem.",
			"64": "<sup>64</sup> Ti daga, O Jehova, napno iti kinamanagayatmo: isurom caniac dagiti al-alagadem. TETH",
			"65": "<sup>65</sup> Impaayam a nasayaat toy adipenmo, O Jehova, cas mayannurot iti saom.",
			"66": "<sup>66</sup> Isuronac iti naimbag a panagipato ken pannacaammo; ta namatiac cadagiti bilbilinmo.",
			"67": "<sup>67</sup> Idi diac pay nagleddaang nayawawanac; ngem itan annurotec ti saom.",
			"68": "<sup>68</sup> Sica naimbagca, ken naimbag ti aramidmo; isurom caniac dagiti alagadem.",
			"69": "<sup>69</sup> Dagiti natangsit nagparboda iti ulbod a maibusor caniac: iti amin a pusoc salimetmetacto dagiti al-alagadem.",
			"70": "<sup>70</sup> Ti pusoda nataba a cas sebo; ngem agrayoac iti lintegmo.",
			"71": "<sup>71</sup> Nasayaat caniac daydi panagleddaangco; tapno maammoac dagiti al-alagadem.",
			"72": "<sup>72</sup> Ti linteg ta ngiwatmo nasaysayaat caniac ngem rinibu a balitoc ken pirac. YODH",
			"73": "<sup>73</sup> Dagiti im-imam inaramiddac ken sinucogdac: iccannac cadi iti pannacaawat, tapno maammoac dagiti bilbilinmo.",
			"74": "<sup>74</sup> Dagiti agbuteng kenca makitadacto ket maragsacandanto, ta nanginanamaac iti saom.",
			"75": "<sup>75</sup> Ammoc, O Jehova, a dagiti panangipatom sililintegda, ken iti kinamatalecmo pinagladingitnac.",
			"76": "<sup>76</sup> Dawatec kenca, ti kinamanagayatmo, isu cadi ti pacabang-arac, cas mayannurot iti saom itoy adipenmo.",
			"77": "<sup>77</sup> Dagiti nasnec a caasim umayda cadi caniac, tapno macapagbiagac; ta ti lintegmo isu ti linglingayco.",
			"78": "<sup>78</sup> Dagiti natangsit maibabainda cadi; ta intublacdac a di-umumno: ngem  imutectecacto dagiti al-alagadem.",
			"79": "<sup>79</sup> Dagiti agbuteng kenca agturongda coma caniac; ket ammodanto dagiti pammanecnecmo.",
			"80": "<sup>80</sup> Toy pusoc maananay cadi cadagiti al-alagadem, tapno saanac a maibabain. KAPH",
			"81": "<sup>81</sup> Toy cararwac matalimudaw gapu ita panangisalacanmo; ngem manginanamaac iti saom.",
			"82": "<sup>82</sup> Dagiti matac maadayda gapu ita saom, bayat ti panagcunac, Caano ti panangliwliwamto caniac?",
			"83": "<sup>83</sup> Ta nagbalinac a cas supot ti arac a maicasuuran; nupay casta diac malipatan dagiti al-alagadem.",
			"84": "<sup>84</sup> Mano dagiti al-aldaw toy adipenmo? Caano ti panangaramidmonto ti panangocom cadagiti mangirurumen caniac?",
			"85": "<sup>85</sup> Dagiti nacuspag incaliandac iti abut, dagidiay dida mayannurot iti lintegmo.",
			"86": "<sup>86</sup> Amin dagiti bilbilinmo sitatalinaedda: kinamatcamatdac a di umumno, saranayennac cadi.",
			"87": "<sup>87</sup> Ngannganidac rinunot ditoy rabaw ti daga; ngem diac indian dagiti al-alagadem.",
			"88": "<sup>88</sup> Pagbiagennac cas mayalubog iti kinamanagayatmo; iti casta annurotecto ti pamanecnec ta ngiwatmo. LAMEDH",
			"89": "<sup>89</sup> Agnanayon, O Jehova, a ti saom sitatalinaed sadi langit.",
			"90": "<sup>90</sup> Ti kinamatalecmo agpaut cadagiti amin a caputotan: insimpam ti daga, ket agtaeng.",
			"91": "<sup>91</sup> Agtaengda itoy nga aldaw cas mayalubog cadagiti pagbilinam; ta dagiti amin nga adda isuda dagiti ad-adipenmo.",
			"92": "<sup>92</sup> No saan coma a ti lintegmo ti linglingayco, natayacon coma idi iti sennaayco.",
			"93": "<sup>93</sup> Uray caanoman diacto malipatan dagiti pannursurom; ta isuda ti pinangpabiagmo caniac.",
			"94": "<sup>94</sup> Siac cucuanac, isalacannac; ta binirocco dagiti al-alagadem.",
			"95": "<sup>95</sup> Dagiti nadangkes dinadaanandac, tapno dadaelendac; ngem ututobecto dagiti pammanecnecmo.",
			"96": "<sup>96</sup> Nakitac ti pagpatinggaan ti amin a kinasayaat; ngem ti bilinmo awan patinggana. MEM",
			"97": "<sup>97</sup> O anian a panangayatco iti lintegmo! Isu ti imutectecac nga agmalmalem.",
			"98": "<sup>98</sup> Dagiti bilbilinmo pagbalinendac a nanacnakem ngem dagiti cabusorco; ta agnanayonda caniac.",
			"99": "<sup>99</sup> Adadda ti pannacaawatco ngem amin dagiti manursuro caniac; ta dagiti pangpanecnecmo isuda ti ototobec.",
			"100": "<sup>100</sup> Ad-adda ti maawatco ngem cadagiti lallacay, gapu ta sinalimetmetac dagiti al-alagadem.",
			"101": "<sup>101</sup> Tinengngelco dagiti sacsacac iti aniaman a dakes a dalan, tapno maannurotco coma ti saom.",
			"102": "<sup>102</sup> Saanac a limmiclic cadagiti pagbilbilinam; ta insuronac.",
			"103": "<sup>103</sup> Anian a nagsam-it dagiti sasaom itoy panagnanamco! Wen, nasamsam-it ngem diro itoy ngiwatco!",
			"104": "<sup>104</sup> Gapu cadagiti bilbilinmo maragpatco ti pannacaawat: gapuna guraec ti amin a dalan nga inaallilaw. NUN",
			"105": "<sup>105</sup> Ti saom pagsilawan cadagiti sacsacac, ket silaw iti danac.",
			"106": "<sup>106</sup> Insapatac, ket pinasingkedac, nga annurotecto dagiti sililinteg a pagbilinam.",
			"107": "<sup>107</sup> Siduducotac la unay: pagbiagennac cadi, O Jehova, cas mayalubog iti saom.",
			"108": "<sup>108</sup> Dawatec kenca, awatem cadi, dagiti sibubulos a sagsagut toy ngiwatco, O Jehova. Ken isuronac cadagiti pagbilinam.",
			"109": "<sup>109</sup> Ti cararwac adda a cancanayon itoy imac; nupay casta diac malipatan ti lintegmo.",
			"110": "<sup>110</sup> Dagiti nadangkes nangipacatda iti pangsilo caniac; nupay casta diac simmiasi cadagiti alagadem.",
			"111": "<sup>111</sup> Dagiti pamanecnecmo inawatco ida a cas tawid nga agnanayon; ta isuda ti ragrag-o toy pusoc.",
			"112": "<sup>112</sup> Inrucnoyco toy pusoc a mangtungpal cadagiti al-alagadem nga agnanayon, wen agpapan iti canibusanan. SAMEKH",
			"113": "<sup>113</sup> Guraec dagiti nagcadua ti pakinakemda; ngem ti lintegmo ayatec.",
			"114": "<sup>114</sup> Sica ti pagsalingedac ken calasagco: manginanamaac iti saom.",
			"115": "<sup>115</sup> Umadayocayo caniac, dacayo a managdacdakes, tapno masalimetmetac dagiti bilbilin ti Diosco.",
			"116": "<sup>116</sup> Saranayennac cas mayalubog iti saom, tapno macapagbiagac; ket saanac a maibabain itoy pananginanamac.",
			"117": "<sup>117</sup> Bitibitennac, ket maisalacanacto, ket pagraemacto a cancanayon dagiti al-alagadem.",
			"118": "<sup>118</sup> Sica pinaawanmo dagiti aglibtaw cadagiti al-alagadem; ta ti pangallilawda isu ti kinaulbod.",
			"119": "<sup>119</sup> Sica icay-om a cas lued dagiti nadangkes ditoy daga: gapuna ayatec dagiti pammanecnecmo.",
			"120": "<sup>120</sup> Ti lasagco agpigerger iti panagbuteng kenca; ket siaamesac cadagiti pangngeddengmo. AYIN",
			"121": "<sup>121</sup> Inaramidco ti kinajusticia ken kinalinteg: dinac cadi baybay-an cadagiti mangilupit caniac.",
			"122": "<sup>122</sup> Sica cadi ti pammatalged a pagimbagan toy adipenmo: dinac coma mailupit ti natangsit.",
			"123": "<sup>123</sup> Umlay dagitoy matac gapu iti panangisalacanmo, ken gapu iti sililinteg a saom.",
			"124": "<sup>124</sup> Ipaayam toy adipenmo cas mayalubog iti kinamanagayatmo, ken isurom caniac dagiti al-alagadem.",
			"125": "<sup>125</sup> Siac ti adipenmo; iccannac cadi iti pannacaawat, tapno maammoac dagiti pamanecnecmo.",
			"126": "<sup>126</sup> Tiemponan ti panagtrabajo ni Jehova; ta binarengbarengda ti lintegmo.",
			"127": "<sup>127</sup> Gapuna ayatec dagiti bilbilinmo a nangnangrona ngem balitoc, wen, nangnangrona ngem balitoc a pulos.",
			"128": "<sup>128</sup> Gapuna ilalaec amin dagiti al-alagadem maipapan cadagiti amin a banag a nalinteg; ken guraec amin a dalan nga inaallilaw. PE",
			"129": "<sup>129</sup> Dagiti pamanecnecmo nacascasdaawda: gapuna a toy cararwac salimetmetanna ida.",
			"130": "<sup>130</sup> Ti pannacalucat dagiti saom mangted lawag; mangted iti pannacaawat cadagiti nacuneng.",
			"131": "<sup>131</sup> Inngangac iti dackel toy ngiwatco, ket nagunnoyac; ta siseseggaac idi cadagiti bilbilinmo.",
			"132": "<sup>132</sup> Agsublica cadi caniac, ket caasiannac, cas cadawyam nga aramiden cadagiti agayat ita naganmo.",
			"133": "<sup>133</sup> Ipasdecmo dagiti addangco iti saom; ket awan coma ti aniaman a kinadakes a macapagturay caniac.",
			"134": "<sup>134</sup> Subbotennac iti panangilupit ti tao: iti casta annurotecto dagiti al-alagadem.",
			"135": "<sup>135</sup> Pagraniagem coma ta rupam itoy adipenmo; ket isurom caniac dagiti al-alagadem.",
			"136": "<sup>136</sup> Burayoc ti danum agayusda cadagitoy matac, gapu ta dida annuroten ti lintegmo. TSADHE",
			"137": "<sup>137</sup> Sililintegca, O Jehova, ken nalinteg dagiti panangipatom.",
			"138": "<sup>138</sup> Imbilinmo dagiti pamanecnecmo babaen ti kinalinteg ken ti kinamatalec unay.",
			"139": "<sup>139</sup> Ti ganetgetco rinunotnacon, gapu ta dagiti casupadic linipatanda dagiti sasaom.",
			"140": "<sup>140</sup> Ti saom pulos a nadalus; gapuna a toy adipenmo ayatenna.",
			"141": "<sup>141</sup> Bassitac ket maicuscuspilac; nupay casta diac lipaten dagiti al-alagadem.",
			"142": "<sup>142</sup> Ti kinalintegmo kinalinteg nga agnanayon, ket ti lintegmo isu ti pudno.",
			"143": "<sup>143</sup> Da ducot ken sennaay kimpetda caniac; nupay casta dagiti bilbilinmo isuda dagiti linglingayco.",
			"144": "<sup>144</sup> Dagiti pamanecnecmo sililintegda nga agnanayon: iccannac iti pannacaawat, ket agbiagacto. QOPH",
			"145": "<sup>145</sup> Immawagac iti amin a pusoc; sungbatannac cadi; O Jehova: salimetmetacto dagiti al-alagadem.",
			"146": "<sup>146</sup> Immawagac kenca; isalacannac, ket annurotecto dagiti pamanecnecmo.",
			"147": "<sup>147</sup> Inunaac ti bannawag ti agsapa, ket inyickisco: nanginanamaac cadagiti sasaom.",
			"148": "<sup>148</sup> Sinacbayan dagitoy matac dagiti agbantay nga agpuyat, tapno imutectecac ti Saom.",
			"149": "<sup>149</sup> Denggem toy timecco cas mayalubog iti kinamanagayatmo: pagbiagennac, O Jehova, cas mayalubog cadagiti pagbilinam.",
			"150": "<sup>150</sup> Umadanida dagiti sumursurot iti kinadakes; adayoda iti lintegmo.",
			"151": "<sup>151</sup> Sica asidegca, O Jehova; ket amin dagiti bilbilinmo kinapudno.",
			"152": "<sup>152</sup> Nabayagen a naammoac cadagiti pamanecnecmo a binuangaymo ida tapno agnanayonda. RESH",
			"153": "<sup>153</sup> Imutectecam toy leddaangco, ket ispalennac; yantangay diac lipatan ti lintegmo.",
			"154": "<sup>154</sup> Salacnibam cadi ti panggepco, ket subbotennac: pagbiagennac cas mayalubog iti saom.",
			"155": "<sup>155</sup> Ti pannacaisalacan adayo cadagiti nadangkes; ta dida biroken dagiti al-alagadem.",
			"156": "<sup>156</sup> Dadackel dagiti kinamanangngaasim, O Jehova: pagbiagennac cas mayalubog cadagiti pagbilinam.",
			"157": "<sup>157</sup> Aduda dagiti mangidadanes caniac ken casupadic; nupay casta diac simmiasi cadagiti pammanecnecmo.",
			"158": "<sup>158</sup> Minatmatac dagiti nagulib, ket nasicoranac. Gapu ta dida annuroten ti saom.",
			"159": "<sup>159</sup> Utobem no casano ti panagayatco cadagiti bilbilinmo: pagbiagennac, O Jehova, cas mayalubog iti kinamanagayatmo.",
			"160": "<sup>160</sup> Ti pacadagupan ti saom isu ti pudno; ket tunggal maysa cadagiti sililinteg a pagbilinam agnanayon. SHIN",
			"161": "<sup>161</sup> Dagiti principe indadanesdac nga awan gapgapuna; ngem toy cararwac agtaeng a siraraem cadagiti saom.",
			"162": "<sup>162</sup> Pagragrag-oac ti saom, a cas maysa a macasarac iti dackel a samsamen.",
			"163": "<sup>163</sup> Guraec ket caaliawco ti kinaulbod; ngem ti lintegmo ayatec.",
			"164": "<sup>164</sup> Maminpito iti inaldaw nga idaydayawca, gapu cadagiti sililinteg a pagbilinam.",
			"165": "<sup>165</sup> Dackel a talna ti maadda cadagiti agayat iti lintegmo; ket awan cadacuada ti pacaitibcolanda,",
			"166": "<sup>166</sup> Ninamnamac ti panangisalacanmo, O Jehova, ket tinungpalco dagiti bilinmo.",
			"167": "<sup>167</sup> Toy cararwac inannurotna dagiti pamanecnecmo; ket ayatec ida a napalalo.",
			"168": "<sup>168</sup> Inannurotco dagiti bilinmo ken pamanecnecmo; ta amin dagiti dalanco addada iti saclangmo. TAV",
			"169": "<sup>169</sup> Ti ickisco macaasideg cadi dita saclangmo, O Jehova: iccannac iti pannacaawat cas mayalubog iti saom.",
			"170": "<sup>170</sup> Ti dawatco macagteng cadi dita sangoanam: ispalennac cas mayalubog iti saom.",
			"171": "<sup>171</sup> Dagiti bibigco mayebcasda coma ti panangidaydayaw; ta isurom caniac dagiti al-alagadem.",
			"172": "<sup>172</sup> Icancanta coma toy dilac ti saom; ta amin dagiti bilbilinmo kinalinteg.",
			"173": "<sup>173</sup> Ta imam sisasagana cadi a mangarayat caniac; ta pinilic dagiti al-alagadem.",
			"174": "<sup>174</sup> Sinegseggaac ti panangisalacanmo, O Jehova; ket ti lintegmo isu ti linglingayco.",
			"175": "<sup>175</sup> Agbiag coma toy cararwac, ket mangidaydayawto kenca; ken dagiti pagbilinam saranayendac coma.",
			"176": "<sup>176</sup> Naiwawaac a cas carnero a nayawawan; birokem cadi toy adipenmo; ta diac malipatan dagiti bilbilinmo."
		},
		"120": {
			"1": "<sup>1</sup> Iti panagsennaayco imkisac ken Jehova, ket sinungbatannac.",
			"2": "<sup>2</sup> Ispalem toy cararwac, O Jehova, cadagiti naulbod a bibig, ken iti manangiculbo a dila.",
			"3": "<sup>3</sup> Ania ti maitedto kenca, ken ania ti mainayonto pay kenca, sica manangiculbo a dila?",
			"4": "<sup>4</sup> Natarumamis a pana ti mannacabalin, agraman beggang ti enebro.",
			"5": "<sup>5</sup> Asiac pay, ta sangsangailiac ditoy Mesech, ta agnaedac iti tengnga dagiti toltolda ti Kedar!",
			"6": "<sup>6</sup> Toy cararwac nabayag a nakipagnaed iti manggura iti talna.",
			"7": "<sup>7</sup> Siac cayatco ti talna; ngem no agsaoac, makigubatda."
		},
		"121": {
			"1": "<sup>1</sup> Itangadconto dagiti matac cadagiti banbantay: sadino ti paggapuanto ti tulongco?",
			"2": "<sup>2</sup> Ti tulongco aggapu ken Jehova, a nangaramid iti langit ken daga.",
			"3": "<sup>3</sup> Dinanto ituloc a maicaglis ta sacam: Daydiay agaywan kenca dinto agridep.",
			"4": "<sup>4</sup> Adtoy, ti agaywan iti Israel saanto nga agridep dinto met agturog.",
			"5": "<sup>5</sup> Ni Jehova isu ti agaywan kenca: ni Jehova isu ti linongmo nga adda iti macanawanmo ita imam a canawan.",
			"6": "<sup>6</sup> Ti init dinacanto danaren iti aldaw, uray ti bulan iti rabii.",
			"7": "<sup>7</sup> Ni Jehova saluadannacanto iti amin a dakes; igagananto ta cararwam.",
			"8": "<sup>8</sup> Ni Jehova saluadannanto ti iruruarmo ken ti iseserrecmo manipud ita agpapan agnanayon."
		},
		"122": {
			"1": "<sup>1</sup> Naragsacanac idi kinunada caniac, intayon idiay balay ni Jehova.",
			"2": "<sup>2</sup> Dagiti sacsacami agtatacderda iti uneg dagiti ruanganmo, O Jerusalem,",
			"3": "<sup>3</sup> Jerusalem, a nabuangayca a cas sangsangcanayon nga ili a natibker a sangsangcamaysa:",
			"4": "<sup>4</sup> Isu a pagsang-atan dagiti tribu, dagiti met la tribu ni Jehova, iti maysa a pagbilinan ken Israel, tapno agyamanda iti nagan ni Jehova.",
			"5": "<sup>5</sup> Ta sadiay naisaad dagiti trono a pangocoman, dagiti trono ti balay ni David.",
			"6": "<sup>6</sup> Agcararagcayo a maipaay iti cappia ti Jerusalem: agnam-aydanto dagiti agayat kenca.",
			"7": "<sup>7</sup> Maadda coma ti cappia iti las-ud dagiti murallam, ken kinanam-ay iti uneg dagiti palaciom.",
			"8": "<sup>8</sup> Maigapu cadagiti cacabsatco ken cacaduac, cunaec ita, silalas-ud coma kenca ti cappia.",
			"9": "<sup>9</sup> Maipuon iti balay ni Jehova a Diosmi gun-odecto ti imbagmo."
		},
		"123": {
			"1": "<sup>1</sup> Kenca itangadco dagitoy matac, O sica nga agtutugaw cadagiti langlangit.",
			"2": "<sup>2</sup> Adtoy, cas panangsipsiput dagiti mata dagiti adipen iti ima ti apoda a lalaki, cas panangsipsiput dagiti mata ti adipen a babai iti ima ni apona a babai; casta ti panangsipsiput dagiti matami ken Jehova a Diosmi, agingga iti panangngaasina cadacami.",
			"3": "<sup>3</sup> Caasiannacami, O Jehova, caasiannacami cadi; ta napalalo unay ti pannacapnomi iti pannacaab-abi.",
			"4": "<sup>4</sup> Ti cararwami napnon a napalalo iti panangrabrabac dagiti sinanam-ay, ken iti panangab-abi dagiti natangsit."
		},
		"124": {
			"1": "<sup>1</sup> No saan coma a ni Jehova ti nakicanapon cadatayo, cunaen coma ti Israel ita,",
			"2": "<sup>2</sup> No saan coma a ni Jehova ti nakicanapon cadatayo, idi a dagiti tattao timmacderda a bumusor cadatayo;",
			"3": "<sup>3</sup> Inalun-ondatayo coman idi a sibibiag, idi a ti gurada simged a maibusor cadatayo:",
			"4": "<sup>4</sup> Dagiti dandanum linapunusdatayon coma idi, ti carayan naglasaten coman iti rabaw ti cararwatayo;",
			"5": "<sup>5</sup> Idin naglasatanda coma ti rabaw ti cararwatayo dagiti nacuspag a dandanum.",
			"6": "<sup>6</sup> Bendito coma ni Jehova, isu a di-nangted a cas tinucmaan cadatayo cadagiti ngipngipenda.",
			"7": "<sup>7</sup> Ti cararwatayo nacalapsut a cas billit cadagiti silo dagiti mannilo: ti silo nagsat, ket nacatalawtayo.",
			"8": "<sup>8</sup> Ti saranaytayo adda iti nagan ni Jehova, isu a nangaramid iti langit ken daga."
		},
		"125": {
			"1": "<sup>1</sup> Dagiti agcammatalec ken Jehova arigda la iti bantay Zion, a saan a maisina, ngem agtalinaed nga agnanayon.",
			"2": "<sup>2</sup> Cas pananglicmut dagiti banbantay iti Jerusalem, casta ni Jehova a manglawlawlaw iti ilina manipud ita agpapan agnanayonen.",
			"3": "<sup>3</sup> Ta ti cetro ti kinadangkes dinto agdisso iti nagasatan dagiti sililinteg; tapno dagiti sililinteg dida itanggaya dagiti im-imada iti kinadangkes.",
			"4": "<sup>4</sup> Ipaaymo ti imbag, O Jehova, cadagiti naimbag, ken cadagiti sililinteg cadagiti pusoda.",
			"5": "<sup>5</sup> Ngem no cadagiti agbawing a mapan cadagiti killo a dalanda, ni Jehova iturongnanto ida a maicuyog cadagiti agaramid iti kinadakes. Maadda coma ti cappia iti Israel."
		},
		"126": {
			"1": "<sup>1</sup> Idi impulang ni Jehova dagidiay nagsubli idiay Sion, arigtayo la idi cadagiti agtagainep.",
			"2": "<sup>2</sup> Idin ti ngiwatayo napunno iti catawa, ket ti dilatayo iti panagcancanta: idi a casta nasaoda cadagiti nasnacion, ni Jehova inaramidna dagiti dadackel a banbanag cadacuada.",
			"3": "<sup>3</sup> Ni Jehova inaramidna dagiti dadackel a banbanag a maipaay cadatayo? Gapuna agragsactayo.",
			"4": "<sup>4</sup> Ipanawmo coma manen ti pannacacayawmi, O Jehova, a cas cadagiti carcarayan iti Abagatan.",
			"5": "<sup>5</sup> Dagiti agmula cadagiti lulua agapitdanto iti ragsac.",
			"6": "<sup>6</sup> Ti mapan ket agsangsangit, nga agawit iti bin-i nga imulana, awan duadua nga agawidto a siraragsac, nga icuyogna dagiti binettecna."
		},
		"127": {
			"1": "<sup>1</sup> No saan a ni Jehova ti mangbangon iti balay, agbannogda a bareng-bareng dagiti mangbangon: no saan a ni Jehova ti mangaywan iti ili, ti agbantay agpuyat ngem banbannogna laeng.",
			"2": "<sup>2</sup> Banbannogmo ti agriing a masapa, ti uminana a maladaw, ti pannanganmo iti tinapay a pagbannogan; idinto nga isu itedna ti turog cadagiti ayayatenna.",
			"3": "<sup>3</sup> Kitaenyo, dagiti annac isuda ti pagpatawid ni Jehova: ket ti bunga ti tian isu ti panggungunana.",
			"4": "<sup>4</sup> Cas cadagiti pana iti ima ti nabileg a lalaki, casta dagiti annac ti agcabanuagan.",
			"5": "<sup>5</sup> Nagasat ti tao a ti tagubanna napno cadacuada: saandanto a maibabain, intono makisaoda cadagiti cabusorda iti pagsercan."
		},
		"128": {
			"1": "<sup>1</sup> Bendito ti tunggal maysa nga agbuteng ken Jehova, a magna cadagiti daldalanna.",
			"2": "<sup>2</sup> Ta sica canemto ti pagbannogan dagiti im-imam: nagasatcanto, ket naimbagto la kenca.",
			"3": "<sup>3</sup> Ti asawam arigto la narnooyan nga uvas, cadagiti caungan a siled ti balaymo; dagiti annacmo casda la mulmula nga olivas, a mailicmut iti lamisaanmo.",
			"4": "<sup>4</sup> Adtoy, castanto ti pannacabendito ti tao nga agbuteng ken Jehova.",
			"5": "<sup>5</sup> Ni Jehova bendicionannaca coma manipud Sion: ket makitam coma ti imbag ti Jerusalem iti amin nga al-aldaw ti biagmo.",
			"6": "<sup>6</sup> Wen, makitam coma dagiti annac dagiti annacmo. Maadda coma cappia iti Israel."
		},
		"129": {
			"1": "<sup>1</sup> Naminadu a pinarparigatdac nanipud kinaubingco, cunaen coma ti Israel ita.",
			"2": "<sup>2</sup> Naminadu a pinarparigatdac nanipud kinaubingco: nupay casta didac nagballigian.",
			"3": "<sup>3</sup> Dagiti agararado inaradoda toy bucotco; inyatiddugda dagiti gulgulisda.",
			"4": "<sup>4</sup> Ni Jehova sililinteg: ginupedna dagiti pangreppet dagiti nadangkes.",
			"5": "<sup>5</sup> Mabainanda cadi ket mapasanudda, amin dagiti gumura iti Sion.",
			"6": "<sup>6</sup> Arigda la coma root cadagiti tuctoc ti balay, a malaylay a dipay macadackel;",
			"7": "<sup>7</sup> Isu a ti agani dina mapunno ti imana, ken di-met agreppet iti binettec iti saclotna;",
			"8": "<sup>8</sup> Di-met cunaen dagiti lumabas, ti bendicion ni Jehova maadda coma kenca; dacami bendicionandaca iti nagan ni Jehova."
		},
		"130": {
			"1": "<sup>1</sup> Nanipud cadagiti yuyeng imkisac kenca, O Jehova.",
			"2": "<sup>2</sup> Apo, denggem toy timecco: siimdeng coma dagita lapayagmo itoy timec dagitoy panagdawdawatco.",
			"3": "<sup>3</sup> No sica, O Jehova, mingmingam coma dagiti kinadangkes, O Apo, siasino coma ti macapagtacder?",
			"4": "<sup>4</sup> Ngem adda kenca ti pammacawan, tapno mapagbutnganca coma.",
			"5": "<sup>5</sup> Paturayco ni Jehova, toy cararwac agpannuray, ket iti saona manginanamaac.",
			"6": "<sup>6</sup> Toy cararwac segseggaanna ti Apo a nacarcaro ngem dagiti agbanbantay nga agururay iti bigat; wen, nacarcaro ngem dagiti agururay iti bigat.",
			"7": "<sup>7</sup> O Israel, manginanamaca ken Jehova; ta ken Jehova adda kinamanagayat, ket adda kencuana nabuslon a pannubbot.",
			"8": "<sup>8</sup> Ket isu subbotennanto ti Israel cadagiti amin a kinadangkesna."
		},
		"131": {
			"1": "<sup>1</sup> Jehova, ti pusoc saan a natangsit, dagiti matac dida met nacuspag; diac met agasac cadagiti dadackel a banbanag, wenno cadagiti nacascasdaaw a napalalo caniac.",
			"2": "<sup>2</sup> Pudno a nagulimecac ket pinagtalnac toy cararwac; cas mapusot nga ubing ken inana, cas napusot nga ubing toy cararwac iti unegco.",
			"3": "<sup>3</sup> O Israel, manginanamaca ken Jehova manipud ita agpapan agnanayonen."
		},
		"132": {
			"1": "<sup>1</sup> Jehova, lagipem ni David ti amin a leddaangna;",
			"2": "<sup>2</sup> Anian a panagsapatana ken Jehova, ken panagcarina iti Mannacabalin a Dios ni Jacob:",
			"3": "<sup>3</sup> Pudno a diacto sumrec iti las-ud ti balayco, ken diacto met mapan iti iddac;",
			"4": "<sup>4</sup> Diacto paturogen dagiti matac, wenno pagridepen dagiti calub ti matac;",
			"5": "<sup>5</sup> Agingga iti macasaracac ti maysa a yan a maipaay ken Jehova, maysa a tabernaculo a maipaay ken Mannacabalin a Dios ni Jacob.",
			"6": "<sup>6</sup> Adtoy, nangngeganmi idiay Efrata: nasaracanmi idiay tay-ac ti bakir.",
			"7": "<sup>7</sup> Mapancamto cadagiti tabernaculona; agdaydayawcamto iti sacaananna.",
			"8": "<sup>8</sup> Tumacderca, O Jehova, dita ayan a pagininanaam; sica ken ti arca ti kinabilegmo.",
			"9": "<sup>9</sup> Dagiti papadim macawesanda coma iti kinalinteg; ket dagiti sasantom agdir-ida coma iti ragsac.",
			"10": "<sup>10</sup> Maipuon ken ni adipenmo a David. Dica cadi paglisien ti rupa ti linanaam.",
			"11": "<sup>11</sup> Ni Jehova nagsapata ken David iti pudno; dinanto paglisian: iti bunga ti tianmo isaadconto iti tronom.",
			"12": "<sup>12</sup> No dagiti annacmo salimetmetandanto ti tulagco ken ti pamanecnecco nga isurocto cadacuada, dagiti annacmo agtugawdanto met ita tronom iti agnanayon.",
			"13": "<sup>13</sup> Ta ni Jehova pinilina ti Sion; kinalicagumanna a pagyananna.",
			"14": "<sup>14</sup> Daytoy ti disso a paginanaac nga agnanayon: ditoy ti pagtaengacto; ta isu ti kinalicagumac.",
			"15": "<sup>15</sup> Bendicionacto a sibubuslon ti taraonna: pennekecto iti tinapay dagiti napanglawna.",
			"16": "<sup>16</sup> Cawesacto met dagiti papadina iti pannacaisalacan; ket dagiti sasantona agdir-idanto a napigsa iti ragsac.",
			"17": "<sup>17</sup> Sadiay pagsaringitecto ti sara ni David: insaganaac ti maysa a pagsilawan ti linanaac.",
			"18": "<sup>18</sup> Dagiti cabusorna cawesacto iti pannacaibabain; ngem kencuana ti balangatna agrangpayanto."
		},
		"133": {
			"1": "<sup>1</sup> Kitaenyo, nagimbagen ken anian a nacaayayo ti panagtitimpuyog dagiti agcacabsat iti kinamaymaysa!",
			"2": "<sup>2</sup> Arig la napateg a lana iti ulo, nga nagayus iti iming, wen iti iming ni Aaron; a nagpababa agingga iti baraybay dagiti cawesna:",
			"3": "<sup>3</sup> Cas linnaaw sadi Hermon a bumaba cadagiti bantay ti Sion: ta sadiay incumit ni Jehova ti bendicion, ken biag iti agnanayon."
		},
		"134": {
			"1": "<sup>1</sup> Matmatanyo, benditoenyo ni Jehova, dacayo amin nga ad-adipen ni Jehova, nga iti rabii agtaengcayo iti balay ni Jehova.",
			"2": "<sup>2</sup> Itag-ayyo dagiti im-imayo iti santuario, ket benditoenyo ni Jehova.",
			"3": "<sup>3</sup> Bendicionannaca coma ni Jehova manipud Sion; wen isu a nangaramid iti langit ken daga."
		},
		"135": {
			"1": "<sup>1</sup> Idaydayawyo ni Jehova. Idaydayawyo ti nagan ni Jehova; idaydayawyo, O dacayo nga ad-adipen ni Jehova,",
			"2": "<sup>2</sup> Dacayo nga agyan iti balay ni Jehova, cadagiti paraangan ti balay ti Diostayo.",
			"3": "<sup>3</sup> Idaydayawyo ni Jehova; ta ni Jehova naimbag: cantaenyo dagiti panangidaydayaw iti naganna, ta nacaayayo.",
			"4": "<sup>4</sup> Ta ni Jehova pinilina ni Jacob a maipaay kencuana, ket ti Israel tapno cucuana a bucod.",
			"5": "<sup>5</sup> Ta ammoc a ni Jehova dackel, ket ti Apotayo dacdackel pay ngem amin a didiosen.",
			"6": "<sup>6</sup> Aniaman a nagayatan ni Jehova, dayta ti inaramidna, sadi langit ken ditoy daga, cadagiti baybay ken cadagiti amin a yuyeng;",
			"7": "<sup>7</sup> Isu a mamagpangato cadagiti alingasaw manipud cadagiti pungto toy daga; isu a mamagkimat a maipaay agtudo; isu a mangparuar iti angin cadagiti pagidulinanna;",
			"8": "<sup>8</sup> Isu a nangdanar iti inauna nga anac sadi Egipto, anac ti tao man ken ti animal;",
			"9": "<sup>9</sup> Isu a nangibaon cadagiti pagilaslasinan ken datdatlag iti tengngam, O Egipto, ken Faraon, ken cadagiti amin nga ad-adipenna;",
			"10": "<sup>10</sup> Isu a nagcabil cadagiti adu a nasnacion, ken namapatay cadagiti nabileg nga ar-ari,",
			"11": "<sup>11</sup> Ni Sehon nga ari dagiti Amorreo, ken ni Og nga ari ti Basan, ken amin a pagpagarian sadi Canaan,",
			"12": "<sup>12</sup> Ket intedna ti dagada nga impatawid, tawiden ti Israel nga ilina.",
			"13": "<sup>13</sup> Ti naganmo, O Jehova, agnanayon; ti malaglagip a naganmo, O Jehova, agpapan cadagiti amin a caputotan.",
			"14": "<sup>14</sup> Ta ni Jehova ocomennanto ti ilina, ket pagbabawiannanto maipuon cadagiti ad-adipenna.",
			"15": "<sup>15</sup> Dagiti didiosen dagiti nasnacion pirac ken balitoc, ti aramid dagiti im-ima dagiti tattao.",
			"16": "<sup>16</sup> Adda ngiwngiwatda, ngem dida agsao; adda matmatada, ngem dida macakita;",
			"17": "<sup>17</sup> Adda laplapayagda, ngem dida macangngeg; awan met a pulos ti panaganges cadagiti ngiwatda.",
			"18": "<sup>18</sup> Dagiti mangaramid cadacuada umaspingdanto met cadacuada; wen, tunggal maysa nga agcammatalec cadacuana.",
			"19": "<sup>19</sup> O balay ni Israel, benditoenyo ni Jehova: O balay ni Aaron, benditoenyo ni Jehova:",
			"20": "<sup>20</sup> O balay ni Levi, benditoenyo ni Jehova: dacayo nga agbuteng ken Jehova, benditoenyo ni Jehova.",
			"21": "<sup>21</sup> Bendito coma ni Jehova manipud Sion, isu nga agnaed sadi Jerusalem. Idaydayawyo ni Jehova."
		},
		"136": {
			"1": "<sup>1</sup> O pagyamananyo ni Jehova; ta isu naimbag; ta ti kinamanagayatna agnanayon.",
			"2": "<sup>2</sup> O pagyamananyo ti Dios dagiti didios; ta ti kinamanagayatna agnanayon.",
			"3": "<sup>3</sup> O pagyamananyo ti Apo dagiti apappo; ta ti kinamanagayatna agnanayon:",
			"4": "<sup>4</sup> Isu a cacaisuna nga agaramid cadagiti dadackel a datdatlag; ta ti kinamanagayatna agnanayon:",
			"5": "<sup>5</sup> Isu a nangaramid cadagiti langlangit iti panangisipna laeng; ta ti kinamanagayatna agnanayon:",
			"6": "<sup>6</sup> Isu a nangibistrad iti daga iti ngato dagiti dandanum; ta ti kinamanagayatna agnanayon:",
			"7": "<sup>7</sup> Isu a nangaramid cadagiti dadackel a silsilaw; ta ti kinamanagayatna agnanayon:",
			"8": "<sup>8</sup> Ti init nga agturay iti aldaw; ta ti kinamanagayatna agnanayon:",
			"9": "<sup>9</sup> Ti bulan ken bitbituen nga agturay iti rabii; ta ti kinamanagayatna agnanayon:",
			"10": "<sup>10</sup> Isu a nangdidigra iti Egipto cadagiti annacda nga inauna; ta ti kinamanagayatna agnanayon:",
			"11": "<sup>11</sup> Ken nangilapsut iti Israel cadacuada; ta ti kinamanagayatna agnanayon:",
			"12": "<sup>12</sup> A sibibileg ti imana, ken sidedeppa dagiti tackiagna; ta ti kinamanagayatna agnanayon:",
			"13": "<sup>13</sup> Isu a namagsina iti Baybay Nalabaga; ta ti kinamanagayatna agnanayon:",
			"14": "<sup>14</sup> Ken namaglasat iti Israel iti tengngana; ta ti kinamanagayatna agnanayon;",
			"15": "<sup>15</sup> Ngem impadsona ni Faraon ken ti buyotna idiay Baybay Nalabaga; ta ti kinamanagayatna agnanayon:",
			"16": "<sup>16</sup> Isu a nangilasat iti ilina iti let-ang; ta ti kinamanagayatna agnanayon:",
			"17": "<sup>17</sup> Isu a nangdidigra cadagiti dadackel nga ar-ari; ta ti kinamanagayatna agnanayon;",
			"18": "<sup>18</sup> Ken namapatay cadagiti agdindinamag nga ar-ari; ta ti kinamanagayatna agnanayon:",
			"19": "<sup>19</sup> Ni Sihon nga ari dagiti Amorreos: ta ti kinamanagayatna agnanayon;",
			"20": "<sup>20</sup> Ken ni Og nga ari ti Basan; ta ti kinamanagayatna agnanayon;",
			"21": "<sup>21</sup> Ket intedna nga impatawid ti dagada; ta ti kinamanagayatna agnanayon;",
			"22": "<sup>22</sup> Wen, maysa a tawiden ni Israel nga adipenna; ta ti kinamanagayatna agnanayon:",
			"23": "<sup>23</sup> Daydiay nanglagip cadatayo iti daydi casasaadtayo a nababa; ta ti kinamanagayatna agnanayon:",
			"24": "<sup>24</sup> Ken nangispal cadatayo cadagiti casupaditayo; ta ti kinamanagayatna agnanayon:",
			"25": "<sup>25</sup> Daydiay mangted iti taraon iti amin a lasag; ta ti kinamanagayatna agnanayon.",
			"26": "<sup>26</sup> O pagyamananyo ti Dios ti langit; ta ti kinamanagayatna agnanayon."
		},
		"137": {
			"1": "<sup>1</sup> Iti denna dagiti carcarayan sadi Babilonia, Sadiay nagtugtugawcami, wen, nagsangsangitcami, no malagipmi idi ti Sion.",
			"2": "<sup>2</sup> Cadagiti caycayo a carawawi iti tengngana insab-itmi dagiti ararpami.",
			"3": "<sup>3</sup> Ta idiay dagiti nangayaw cadacami nagdawatda cadacami iti cancanta, ket dagiti namarigat cadacami nagdawatandacami iti panagragragsac, a cunada, icantaandacami man iti maysa cadagiti cancanta ti Sion.",
			"4": "<sup>4</sup> Casano ti panangcantaminto iti canta ni Jehova iti maysa a gangannaet a daga?",
			"5": "<sup>5</sup> No lipatenca coma, O Jerusalem, malipatan coma toy imac a canawan ti kinasigona.",
			"6": "<sup>6</sup> Toy dilac cumpet coma iti ngangaw toy ngiwatco, no saanca coma malagip; no diac coma ipatpateg ti Jerusalem ngem iti cangronaan a ragsacco.",
			"7": "<sup>7</sup> Lagipem, O Jehova, ti maibusor cadagiti annac ti Edom ti aldaw ti Jerusalem; isuda a nagcuna, Duprakenyo duprakenyo, wen inggana iti pamuonna.",
			"8": "<sup>8</sup> O anac a babai ti Babilonia, a maracraccanto naragsacto ti mangsupapac kenca, a cas iti impaaymo cadacami.",
			"9": "<sup>9</sup> Naragsacto ti mangala ken mangibarsac cadagiti maladagam iti bato."
		},
		"138": {
			"1": "<sup>1</sup> Agyamanacto kenca iti amin a pusoc: iti saclang dagiti didiosen icantacto dagiti panangidaydayaw kenca.",
			"2": "<sup>2</sup> Agdaydayawacto nga agturong iti nasantoan a templom, ken agyamanacto ita naganmo gapu iti kinamanagayatmo ken kinapudnom: ta sica pinadaegmo ti saom iti ringbaw ti amin ta naganmo.",
			"3": "<sup>3</sup> Iti daydi aldaw a panangawagco, sica sinungbatannac, pinaturednac iti pigsa itoy cararruac.",
			"4": "<sup>4</sup> Amin dagiti ar-ari ditoy daga agyamandanto kenca, O Jehova, ta nangngegda dagiti sasao ta ngiwatmo.",
			"5": "<sup>5</sup> Wen, icantadanto dagiti daldalan ni Jehova; ta dackel ti dayag ni Jehova.",
			"6": "<sup>6</sup> Ta nupay natan-oc ni Jehova, adda pay la panangpadayawna iti napacumbaba; ngem ti napalangguad mabigbigna manipud adayu.",
			"7": "<sup>7</sup> Nupay magnaac iti tengnga ti riribuc, sica pagbiagennacto; sica iyunnatmonto dayta imam a mangsallin iti gura dagiti cabusorco, ket ta canawan nga imam isalacannacto.",
			"8": "<sup>8</sup> Ni Jehova an-anayennanto daydiay maipapan caniac: ti kinamanagayatmo, O Jehova agnanayon; dica baybay-an dagiti aramid dagiti im-imam met laeng."
		},
		"139": {
			"1": "<sup>1</sup> O Jehova, sica, inusignac, ket nabigbignac.",
			"2": "<sup>2</sup> Ammom ti itutugawco ken itatacderco; maawatam ti panunotco nga adayo pay laeng.",
			"3": "<sup>3</sup> Mabigbigmo ti danac ken panagiddac, ket pagaammom unay dagiti amin a dalanco.",
			"4": "<sup>4</sup> Ta awan pay ti sao ditoy dilac, ngem adtoy, O Jehova, ammomon amin.",
			"5": "<sup>5</sup> Sica linawlawnac licudan man ken sangoanan, ket imparabawmo ta imam caniac.",
			"6": "<sup>6</sup> Ti casta a pannacaammo nacascasdaaw unay caniac; nangato, diac magaw-at.",
			"7": "<sup>7</sup> Sadino ngata ti papanac a maipanaw ita Espiritum? Wenno sadino ti pagtalawac a mayadayu dita sangoanam?",
			"8": "<sup>8</sup> No umuliac sadi langit, addaca sadiay: no aramidec ti pagiddaac ken Tanem, addaca sadiay.",
			"9": "<sup>9</sup> No alaec dagiti payac ni bannawag, ket agnaedac cadagiti capupungtaon ti baybay;",
			"10": "<sup>10</sup> Uray idiay ta imam iturongnacto, ket ta canawan nga imam tenglennacto.",
			"11": "<sup>11</sup> No cunac, awan duadua ni sipnget alicubcubennacto, ket ti lawag a nangalicubcub caniac agbalinto a rabii;",
			"12": "<sup>12</sup> Uray ni sipnget saan a macasalinged kenca, ti rabii agraniag ketdi a cas aldaw; da sipnget ken lawag agpadpadada kenca.",
			"13": "<sup>13</sup> Ta sica ti nangbukel cadagiti lalaemco: sica ti nangbungon caniac idiay aanacan ni inac.",
			"14": "<sup>14</sup> Agyamanacto kenca; ta nacaamamac ken nacascasdaaw ti pannacaaramidco; nacascasdaaw dagiti ar-aramidmo; ket daydayta ammoen unay toy cararwac.",
			"15": "<sup>15</sup> Ti langac saan a nailinged kenca, idi nabukelac a sililimed, ket naaramidac a naisangayan cadagiti caungan toy daga.",
			"16": "<sup>16</sup> Dagiti matam nakitada daydi bagic a dipay nabukel; ket ita librom naisuratda amin, dagiti pay al-aldaw naikeddeng idin caniac, idinto a cas la awan pay uray maysa cadacuada idi.",
			"17": "<sup>17</sup> Anian a nagpategda met caniac dagiti panunotmo, O Dios! Amangan a nagdackel ti pacadagupanda!",
			"18": "<sup>18</sup> No bilangec coma ida, adadu ti bilangda ngem ti darat: no agriingac, addaac pay la kenca.",
			"19": "<sup>19</sup> Pudno a papatayemto dagiti nadangkes, O Dios: pumanawcayo ngarud caniac, dacayo tattao a mawaw iti dara.",
			"20": "<sup>20</sup> Ta agsaoda a sidadangkes iti maibusor kenca, ket dagiti cabcabusormo aramatenda a barengbareng ti naganmo.",
			"21": "<sup>21</sup> Saanco aya a guraen, O Jehova, dagiti gumura kenca? Ken saanco aya a paglidayan dagiti tumacder a sibubusor kenca?",
			"22": "<sup>22</sup> Guraec ida iti naananay a gura: agbalinda a cabcabusorco.",
			"23": "<sup>23</sup> Usigennac, O Dios, ket ammoem toy pusoc: padasennac, ket ammoem dagiti pampanunotco;",
			"24": "<sup>24</sup> Ket kitaem no adda dinadangkes a dalan caniac, ket iturongnac iti dalan nga agnanayon."
		},
		"140": {
			"1": "<sup>1</sup> Ispalennac, O Jehova, iti dakes a tao; saluadannac iti nauyong a tao:",
			"2": "<sup>2</sup> Dagiti agpanagem cadagiti ranggas iti pusoda; cancanayon nga agtitiponda a makigubat.",
			"3": "<sup>3</sup> Pinatiradda ti dilada a cas iti uleg; ti gita ti carasaen adda iti las-ud dagiti bibigda. (Selah)",
			"4": "<sup>4</sup> Aluadannac, O Jehova, cadagiti im-ima dagiti nadangkes; saluadannac iti nauyong a tao: isuda a nangisicat a mangiligasi cadagiti ad-addangco.",
			"5": "<sup>5</sup> Dagiti natangsit nangipacatda iti pangsilo caniac, ken banbanteng; nangibistrada iti bateng iti igid ti dalan; incabilandac cadagiti paratignay. (Selah)",
			"6": "<sup>6</sup> Kinunac ken Jehova, Sica ti Diosco: allingagem ti timec dagiti ar-ararawco, O Jehova.",
			"7": "<sup>7</sup> O Jehova nga Apo, ti bileg ti pannacaisalacanco, sica inabbongam toy uloc idi aldaw ti bacal.",
			"8": "<sup>8</sup> Dica cadi itden, O Jehova, dagiti tarigagay ti nadangkes: nangnangrona pay a saan iti dakes ti panagemna, di la ket ta  agpalangguadda. (Selah)",
			"9": "<sup>9</sup> No maipanggep iti ulo dagiti manglacub caniac, ti ranggas dagiti bibbigda met laeng isu cadi ti mangtaccab cadacuada.",
			"10": "<sup>10</sup> Agdisso coma cadacuada dagiti bumarbara a begbeggang: maitappuacda cadi iti apuy, cadagiti nauneg nga ab-abut, a didanto lung-awanen.",
			"11": "<sup>11</sup> Ti mannanao ti dakes dinto agtalinaed ditoy daga: ti dakes anupennanto ti nauyong a tao tapno daddaelenna.",
			"12": "<sup>12</sup> Ammoc a ni Jehova igagananto ti calintegan dagiti maparparigatan, ken ti kinajusticia cadagiti macasapul.",
			"13": "<sup>13</sup> Kinapudnona a ti sililinteg agyamanto ita naganmo: ti nalinteg agnaedto dita saclangmo."
		},
		"141": {
			"1": "<sup>1</sup> Jehova, immawagac kenca; darasem cadi ti umay caniac: allingagem cadi ti timecco, no umawagac kenca.",
			"2": "<sup>2</sup> Ti cararagco agtarus cadi a cas incienso dita sangoanam; ti panangitanggayac coma cadagitoy im-imac cas daton ti malem.",
			"3": "<sup>3</sup> Mangicabilca iti agbantay iti sangonan toy ngiwatco, O Jehova: saluadam ti ruangan dagiti bibigco.",
			"4": "<sup>4</sup> Dica pagallingagen toy pusoc iti dakes a banag, a makiaramid cadagiti ar-aramid ti kinadangkes cadagiti tattao nga agaramid iti kinadakes; ket diac coma makipangan cadagiti cancanenda.",
			"5": "<sup>5</sup> Ti sililinteg danarennac coma laeng isunto ti maysa a panagayat; ala babalawennac laeng, isunto ti cas sapsapo itoy uloc; ti uloc dina coma pagkedkedan: ta uray pay cadagiti kinadangkesda ti cararagco agcancanayonto laeng.",
			"6": "<sup>6</sup> Dagiti ococomda maibarsacda cadagiti iking ti bato; ket mangngegdanto dagiti sasaoc; ta nasam-itda.",
			"7": "<sup>7</sup> Casla no ti maysa agarado ket burburenna ti daga, dagiti tultulangtayo mawarawarada iti ngiwat ni Tanem.",
			"8": "<sup>8</sup> Ta dagiti matac agturongda kenca, O Jehova nga Apo: kenca cumamangac, dica baybay-an toy cararwac nga agmaymaysa.",
			"9": "<sup>9</sup> Saluadannac iti silo nga impacatda caniac, ken cadagiti parparatignay dagiti agar-aramid iti kinadakes.",
			"10": "<sup>10</sup> Mailab-og cadi dagiti nadangkes cadagiti batbatengda met laeng, nupay casta siac mailasatac met."
		},
		"142": {
			"1": "<sup>1</sup> Iyickisco toy timecco ken Jehova; itoy timecco aramidec ti panagararawco ken Jehova.",
			"2": "<sup>2</sup> Ibucbucco ti asugco iti saclangna; iparangco iti saclangna ti pagsicorac.",
			"3": "<sup>3</sup> Idi a toy cararwac naidalit itoy unegco, sica ammom idi ti danac. Iti dalan a pagpagnaac nangipacatda iti pangsilo caniac.",
			"4": "<sup>4</sup> Mingmingam toy imac a canawan, ket makitam; ta awan tao a macabigbig caniac: naawananac iti pagcamangan; awan tao a mangitaltalec itoy cararwac.",
			"5": "<sup>5</sup> Imkisac kenca, O Jehova; kinunac, Sica ti camangco, eppegco ditoy daga dagiti sibibiag.",
			"6": "<sup>6</sup> Imdengan toy ickisco; ta naimegmegac unay: ispalennac cadi cadagiti mangidadanes caniac; ta napipigsada ngem siac.",
			"7": "<sup>7</sup> Aonem toy cararwac iti pagbaludan, tapno macapagyamanac ita naganmo: dagiti sililinteg lawlawendacto; ta sipaparaburcanto caniac."
		},
		"143": {
			"1": "<sup>1</sup> Denggem ti cararagco; O Jehova, allingagem dagiti arararawco; sungbatannac, ita kinamatalecmo ken ita kinalintegmo.",
			"2": "<sup>2</sup> Ket dica cadi ocomen toy adipenmo; ta ita sangoanam awan tao nga agbiag a sililinteg.",
			"3": "<sup>3</sup> Ta ti cabusor indadanesna toy cararwac; dinanarna toy biagco nga impadaga; pinagnaednac cadagiti yan a nasipnget, cas cadagiti nabayag a natayen.",
			"4": "<sup>4</sup> Gapuna a toy cararwac naidalit itoy unegco; ti pusoc itoy unegco sidadasay.",
			"5": "<sup>5</sup> Malagipco dagiti aldaw idi ugma; pampanunotec amin dagiti ar-aramidmo; isisipec ti aramid dagiti im-imam.",
			"6": "<sup>6</sup> Itay-ac dagiti daculapco kenca: toy cararwac mawaw kenca, a cas naticag a daga. (Selah)",
			"7": "<sup>7</sup> Darasem cadi ti sumungbat caniac, O Jehova; toy cararwac agcapsut: dica ilinged ta rupam caniac, di la ket ta agbalinac a cas cadagiti agpababa iti abut.",
			"8": "<sup>8</sup> Ipangngegmo caniac ti kinamanagayatmo iti bigat; ta sica ti pagtalcac: ipacaammom caniac ti dalan a rebbengco coma a pagnaan; ta itanggayac toy cararwac kenca.",
			"9": "<sup>9</sup> Ispalennac, O Jehova, cadagiti cabcabusorco: tumarayac nga umay kenca tapno aglemmengac.",
			"10": "<sup>10</sup> Isuronac a mangtungpal ita nakemmo, ta sica ti Diosco: ti Espiritum naimbag; idalannac iti daga ti kinalinteg.",
			"11": "<sup>11</sup> Pagbiagennac, O Jehova, maipuon ita naganmo: ita kinalintegmo aonem toy cararwac iti pagsicoran.",
			"12": "<sup>12</sup> Ket ita kinamanagayatmo pucawem dagiti cabusorco, ket racrakem amin dagiti mamarigat itoy cararwac; ta siac ti adipenmo."
		},
		"144": {
			"1": "<sup>1</sup> Bendito ni Jehova a batoc, isu a mangisuro cadagitoy imac a makigubat, ken cadagiti ramramayco a makibacal:",
			"2": "<sup>2</sup> Kinamanagayatco, ken pagsalindegac, natayag a baluartec, ken mangispal caniac; calasagco, ken isu a pagcamangac; isu a mamagpacumbaba iti ilic iti babaec.",
			"3": "<sup>3</sup> Jehova, ania ti tao, nga isu bigbigem? Wenno ti anac ti tao, nga isu icabilangam?",
			"4": "<sup>4</sup> Ti tao maipadpad iti kinaubbaw: dagiti al-aldawna arigda la maysa nga aniniwan nga agpucaw.",
			"5": "<sup>5</sup> Pagluyokem dagiti langitmo, O Jehova, ket agpababaca: calbitem dagiti banbantay, ket agasucdanto.",
			"6": "<sup>6</sup> Iwagsacmo dagiti kimkimat, ket warawaraem ida; ibiatmo dagiti panpanam, ket kiwarkiwarem ida.",
			"7": "<sup>7</sup> Iyunnatmo ta imam manipud ngato; ilapsutnac, ket ispalennac cadagiti dadackel a danum, iti ima dagiti gangannaet;",
			"8": "<sup>8</sup> A ti ngiwatda agsao iti allilaw, ket ti canawan nga imada ima a canawan ti kinaulbod.",
			"9": "<sup>9</sup> Mangcantaacto iti baro a canta kenca, O Jehova: madanggayan ti salterio a sangapulo dagiti cuerdasna agcantaacto cadagiti panangidaydayaw kenca.",
			"10": "<sup>10</sup> Sica daydiay mangmangted iti pannacaisalacan cadagiti ar-ari; daydiay mangilaplapsut ken David iti naranggas a campilan.",
			"11": "<sup>11</sup> Ilapsutnac, ket ispalennac iti ima dagiti gangannaet, a ti ngiwatda agsao iti allilaw, ken ti canawan nga imada ima a canawan ti kinaulbod.",
			"12": "<sup>12</sup> Intono dagiti annacmi a lallaki arigda la mulmula a nacadackelen iti kinabumaroda, ket dagiti annacmi a babbai arigda la bato a pasuli a naticticanen a cas pangpintas iti palacio;",
			"13": "<sup>13</sup> No dagiti camaligmi napnodan, a maipaaydan ti aniaman a kita ti penpen, ket dagiti carneromi pasngayendan ti rinibu ken pinullo a ribu cadagiti awawaymi;",
			"14": "<sup>14</sup> No dagiti vacvacami namusecsecdan; no awanen ti isasari ken itatacyas, ken awanen ti riaw cadagiti calcalsadatayo:",
			"15": "<sup>15</sup> Nagasat ti umili a castoy ti casasaadna; wen, nagasat ti umili a ti Diosna ni Jehova."
		},
		"145": {
			"1": "<sup>1</sup> Itan-occanto, Diosco, O Aric; ket benditoecto ti naganmo iti agnanayon.",
			"2": "<sup>2</sup> Tunggal aldaw benditoencanto; ket idaydayawconto ti naganmo iti agnanayon.",
			"3": "<sup>3</sup> Dackel ni Jehova, naindaclan unay ti pannacaidaydayaw; ket ti kinadackelna saan a matucod.",
			"4": "<sup>4</sup> Ti maysa a caputotan ipadpadayawnanto dagiti aramidmo iti sabali, ket sarsaritaennanto dagiti mannacabalin nga ar-aramidmo.",
			"5": "<sup>5</sup> Ti nagloriaan a daeg ti dayawmo, ken dagiti nacascasdaaw nga aramidmo, imutectecacto.",
			"6": "<sup>6</sup> Ket dagiti tattao sasaoendanto ti bileg dagiti nacaamamac nga ar-aramidmo; ket sarsaritaecto ti kinadackelmo.",
			"7": "<sup>7</sup> Iyesngawdanto ti pannacalagipda iti dackel a kinaimbagmo, ken icantadanto ti kinalintegmo.",
			"8": "<sup>8</sup> Ni Jehova managparabur, ken nacaasi; naanat nga agpungtot, ken dackel ti kinamanagayatna.",
			"9": "<sup>9</sup> Ni Jehova naimbag cadagiti isu-amin; ket dagiti nadungngo a caasina adda cadagiti amin nga ar-aramidna.",
			"10": "<sup>10</sup> Amin dagiti ar-aramidmo agyamandanto kenca, O Jehova; Ket dagiti sasantom benditoendacanto.",
			"11": "<sup>11</sup> Sasaoendanto ti dayag ti pagariam, ken sarsaritaendanto ti pannacabalinmo;",
			"12": "<sup>12</sup> Tapno ipacaammoda cadagiti annac dagiti tattao dagiti nabileg nga ar-aramidna, ken ti dayag ti nadaeg a pagarianna.",
			"13": "<sup>13</sup> Ti pagariam agnanayon a pagarian, ti panagturaymo mataginayon cadagiti amin a caputotan.",
			"14": "<sup>14</sup> Ni Jehova saranayenna amin a matuang. Ken batakenna amin dagiti maparucob.",
			"15": "<sup>15</sup> Dagiti matmata dagiti isu-amin agururayda kenca; ket sica itdem cadacuada ti taraonda iti maitutop a tiempona.",
			"16": "<sup>16</sup> Uccradem ta imam, ket pennekem ti tarigagay ti isu-amin a nabiag.",
			"17": "<sup>17</sup> Ni Jehova sililinteg cadagiti amin a dalanna, ken sipaparabur cadagiti amin nga aramidna.",
			"18": "<sup>18</sup> Ni Jehova siaarpad cadagiti amin nga umawag kencuana, cadagiti amin nga umawag kencuana iti kinapudno.",
			"19": "<sup>19</sup> Tungpalennanto ti tarigagay dagiti agbuteng kencuana; denggennanto met ti ickisda, ket isalacannanto ida.",
			"20": "<sup>20</sup> Ni Jehova salacnibanna amin dagiti agayat kencuana; ngem amin dagiti nadangkes dadaelennanto ida.",
			"21": "<sup>21</sup> Ti ngiwatco agsaonto iti panangidaydayaw ken Jehova; ket amin a lasag benditoenna coma ti nasantoan a naganna iti agnanayon awan inggana."
		},
		"146": {
			"1": "<sup>1</sup> Idaydayawyo ni Jehova. Idaydayawmo ni Jehova, O cararwac.",
			"2": "<sup>2</sup> Bayat ti panagbiagco idaydayawconto ni Jehova: cantaacto cadagiti panangidaydayaw ti Diosco bayat ti kinaaddac.",
			"3": "<sup>3</sup> Dica agcammatalec cadagiti principe, ken iti anac ti tao, a kencuana awan ti tulong.",
			"4": "<sup>4</sup> Ti angesna agpucaw, isu agpulang iti dagana; iti dayta met la nga aldaw dagiti panpanunotna mapucawda.",
			"5": "<sup>5</sup> Nagasat daydiay adda kencuana ti Dios ni Jacob a badangna, a ti inanamana adda ken Jehova a Diosna:",
			"6": "<sup>6</sup> Isu a nangaramid iti langit ken daga, ti baybay, ken amin nga adda cadacuada, isu a mangsalimetmet iti pudno nga agnanayon;",
			"7": "<sup>7</sup> Isu a mangaramid iti kinajusticia cadagiti mailupitlupit; isu a mangted iti taraon cadagiti mabisin: ni Jehova luc-atanna dagiti balbalud;",
			"8": "<sup>8</sup> Ni Jehova luc-atanna dagiti mata dagiti bulsec; ni Jehova batakenna dagiti maparucob; ni Jehova ayatenna dagiti sililinteg;",
			"9": "<sup>9</sup> Ni Jehova salacnibanna dagiti sangsangaili; saranayenna dagiti ululila ken balo; ngem ti dalan dagiti nadangkes balictadenna.",
			"10": "<sup>10</sup> Ni Jehova agarinto iti agnanayon, ti Diosmo, O Sion, agpapan cadagiti amin a caputotan. Idaydayawyo ni Jehova."
		},
		"147": {
			"1": "<sup>1</sup> Idaydayawyo ni Jehova; ta nasayaat ti panagcanta cadagiti panangidaydayaw iti Diostayo; ta nacaayayo, ket naimnas ti panangidaydayaw.",
			"2": "<sup>2</sup> Ni Jehova bangonenna ti Jerusalem; pagtitiponenna dagiti naipanaw iti Israel.",
			"3": "<sup>3</sup> Agasanna dagiti nadanar iti pusoda, ket bedbedanna dagiti sugsugatda.",
			"4": "<sup>4</sup> Bilangenna ti dagup dagiti bitbituen; awaganna ida cadagiti naganda.",
			"5": "<sup>5</sup> Dackel ti Diostayo, ket napigsa iti pannacabalin; ti panagisisipna awan inggana.",
			"6": "<sup>6</sup> Ni Jehova saranayenna dagiti naemma: ipasagna dagiti nadangkes iti daga.",
			"7": "<sup>7</sup> Cantaanyo ni Jehova iti panagyaman; cantaanyo ti Diostayo cadagiti panangidaydayaw a maarpaan:",
			"8": "<sup>8</sup> Isu a mangcumot cadagiti langlangit cadagiti ululep, isu a mangisagana iti tudo a maipaay toy daga, isu a mamagtubo iti root cadagiti banbantay.",
			"9": "<sup>9</sup> Itedna ti taraon cadagiti an-animal, ken cadagiti urbon a wac nga umarakiac.",
			"10": "<sup>10</sup> Saanna a pagrayoan ti pigsa ti cabayo: saanna a pacaayayoan dagiti gurong ti tao.",
			"11": "<sup>11</sup> Ni Jehova maayayo cadagiti agbuteng kencuana, cadagiti mangnamnama iti kinamanagayatna.",
			"12": "<sup>12</sup> Idaydayawmo ni Jehova, O Jerusalem; idaydayawmo ti Diosmo, O Sion.",
			"13": "<sup>13</sup> Ta pinalagdana dagiti balunet dagiti ruanganmo; binendicionannan dagiti annacmo dita unegmo.",
			"14": "<sup>14</sup> Patalnaenna iti uneg dagiti beddengmo: pusekennaca iti cababagasan a trigo.",
			"15": "<sup>15</sup> Iwayangna ti panagbilinna ditoy rabaw ti daga; ti saona agtaray a sipapardas.",
			"16": "<sup>16</sup> Mangted iti nieve a cas la napudaw a delana; mangiwarakiwac iti nagbalay a linaaw a cas dapu.",
			"17": "<sup>17</sup> Mangipalladaw iti hielo a cas la cadagiti murcat: siasino ti macaibtor iti lam-ecna?",
			"18": "<sup>18</sup> Iyesngawna ti saona, ket runawenna ida: pagpul-oyenna ti anginna, ket dagiti dandanum agayusda.",
			"19": "<sup>19</sup> Iparangarangna ti saona ken Jacob, dagiti al-alagadenna ken pagbilbilinanna iti Israel.",
			"20": "<sup>20</sup> Saan a nagaramid iti casta iti siaasinoman a sabali a nacion: ket no maipanggep cadagiti al-alagadenna, dida naammoan ida. Idaydayawyo ni Jehova."
		},
		"148": {
			"1": "<sup>1</sup> Idaydayawyo ni Jehova. Idaydayawyo ni Jehova manipud cadagiti langlangit: idaydayawyo cadagiti alimpatoc.",
			"2": "<sup>2</sup> Idaydayawyo, dacayo amin nga angelna: idaydayawyo, dacayo amin a buybuyotna.",
			"3": "<sup>3</sup> Idaydayawyo, init ken bulan: idaydayawyo, dacayo amin a bituen nga agsilnag.",
			"4": "<sup>4</sup> Idaydayawyo, dacayo langlangit, dagiti langlangit, ken dacayo a dandanum nga adda iti labes dagiti langlangit.",
			"5": "<sup>5</sup> Idaydayawda coma ti nagan ni Jehova; Ta isu nagbilin, ket naparsuada.",
			"6": "<sup>6</sup> Impasdecna met ida nga agnanayon nga awan inggana: nangaramid iti linteg a saanto a mapucaw.",
			"7": "<sup>7</sup> Idaydayawyo ni Jehova manipud iti daga, dacayo a leviatan, ken amin a yuyeng;",
			"8": "<sup>8</sup> Apuy ken uraro, nieve ken alingasaw, bagio nga angin, a tungpalenyo iti saona:",
			"9": "<sup>9</sup> Banbantay ken amin a turturod; nabunga a caycayo ken amin a cedro;",
			"10": "<sup>10</sup> An-animal nga atap ken amin nga amo; agay-ayam a parsua ken agtaytayab a bilbillit;",
			"11": "<sup>11</sup> Ar-ari ditoy daga ken amin nga inilin-ili; piprincipe ken amin nga oc-ocom ditoy daga;",
			"12": "<sup>12</sup> Babbaro man ken babbalasang; lallacay ken ububbing.",
			"13": "<sup>13</sup> Idaydayawda coma ti nagan ni Jehova; Ta ti naganna laeng ti maitanoc; ti dayagna naringringbaw ngem ti daga ken dagiti langlangit.",
			"14": "<sup>14</sup> Ket intag-ayna ti sara ti ilina, ti panangidaydayaw dagiti amin a sasantona; ken dagiti pay annac ti Israel, umili nga asideg kencuana. Idaydayawyo ni Jehova."
		},
		"149": {
			"1": "<sup>1</sup> Idaydayawyo ni Jehova. Cantaanyo ni Jehova iti baro a canta, ken iti pannacaidaydayawna iti tallaong dagiti sasanto.",
			"2": "<sup>2</sup> Pagrag-oan coma ti Israel ti nangaramid kencuana: siraragsac coma dagiti annac ti Sion iti Arida.",
			"3": "<sup>3</sup> Idaydayawda coma ti naganna iti panagsalsala: cantaenda coma kencuana dagiti panangidaydayaw a mapandaretaan ken maarpaan.",
			"4": "<sup>4</sup> Ta ni Jehova pagayayatanna ti ilina: pangayedennanto ti naemma iti pannacaisalacan.",
			"5": "<sup>5</sup> Dagiti sasanto agrag-odanto iti dayag: agcantada coma iti ragsac cadagiti pagiddaanda.",
			"6": "<sup>6</sup> Dagiti natan-oc a panangidayaw iti Dios adda coma cadagiti ngiwngiwatda, ken dua ti tademna a campilan iti imada;",
			"7": "<sup>7</sup> Tapno aramidenda ti pammales cadagiti nasnacion, ken pannusa cadagiti inilin-ili;",
			"8": "<sup>8</sup> Tapno etetanda dagiti ar-arida cadagiti cawcawar, ken dagiti natan-ocda cadagiti tol-ong a landoc;",
			"9": "<sup>9</sup> Tapno tungpalenda cadacuada ti panangocom a naisurat: daytoy a dayaw adda cadagiti amin a sasantona. Idaydayawyo ni Jehova."
		},
		"150": {
			"1": "<sup>1</sup> Idaydayawyo ni Jehova. Idaydayawyo ti Dios iti santuariona: idaydayawyo iti tangatang ti pannacabalinna.",
			"2": "<sup>2</sup> Idaydayawyo gapu cadagiti mannacabalin a gapuananna: idaydayawyo cas mayalubog iti mangnibinibi a kinadackelna.",
			"3": "<sup>3</sup> Idaydayawyo iti aweng ti tangguyob; idaydayawyo a madanggayan iti salterio ken arpa.",
			"4": "<sup>4</sup> Idaydayawyo iti pandereta ken sala: idaydayawyo cadagiti pagtocaran a kinuerdasan ken pito.",
			"5": "<sup>5</sup> Idaydayawyo cadagiti piang-piang a naaweng: idaydayawyo cadagiti piang-piang a nacalangiking.",
			"6": "<sup>6</sup> Amin nga adda angesna idaydayawda coma ni Jehova. Idaydayawyo ni Jehova."
		}
	}
};
module.exports = book;